 design, manufacture and deploy new and better products. The architecture gets you there more rapidly, securely and with connection reliability unsurpassed in the industry.\r\n\r\nTransportation\r\nEnfora pioneered resilient, high-speed, reliable end-point connectivity solutions for the transportation marketplace. Whether you\'re traveling the open road, meeting an on-time delivery or watching your child drive off to school, Enfora\'s innovation empowers you over the highway, on the rail and most anywhere, anytime in the supply chain.\r\n\r\n \r\nIndustrial Automation\r\nEnfora pioneered resilient, high-speed, reliable end-point connectivity solutions for the transportation marketplace. Whether you\'re traveling the open road, meeting an on-time delivery or watching your child drive off to school, Enfora\'s innovation empowers you over the highway, on the rail and most anywhere, anytime in the supply chain.\r\n\r\n    Security\r\nEnfora delivers exceptional connectivity with the industry\'s leading high performance communications platforms. Enabling real-time data for security applications including alarm panels, intelligent locks, asset monitoring devices and the latest in high-speed video capture and transmission.\r\n\r\nTelehealth / Medical\r\nConnecting the latest in remote healthcare products and services: from the simple glucose meter with an embedded communications module to a blood pressure monitor and much more. Today’s healthcare delivery network demands reliable communications services; no matter the modality, no matter the location.  \r\n\r\nConnected Home\r\nFrom the oil pipeline to the soft drink dispenser, today’s visionary companies rely on remote data communications to collect data from their remote assets, enhancing their bottom line by allowing their business to operate more efficiently through the management and utilization of critical, decision-based data.\r\n\r\nTelemetry\r\nFrom the oil pipeline to the soft drink dispenser, today’s visionary companies rely on remote data communications to collect data from their remote assets, enhancing their bottom line by allowing their business to operate more efficiently through the management and utilization of critical, decision-based data.\r\n\r\n  ','Solutions','','/our-partners','2012-08-30 14:48:00','2012-11-10 00:12:08',NULL,0),(166,'Novatel Wireless, Inc. is a leader in the design and development of intelligent wireless solutions based on 2G, 3G and 4G technologies providing wireless connectivity. The Company delivers specialized wireless solutions to carriers, distributors, retailers, OEMs and vertical markets worldwide. Novatel Wireless\' intelligent mobile hotspot products, software, USB modems, embedded modules and smart M2M modules provide innovative anywhere, anytime communications solutions for consumers and enterprises. \r\nHeadquartered in San Diego, California, Novatel Wireless, Inc. has been issued over 30 technology patents and has established partnerships with leading telecom operators, infrastructure providers and device manufacturers around the world. Novatel Wireless, Inc. is listed on NASDAQ: NVTL. \r\nTarget \r\nNovatel Wireless, Inc. partners with wireless network operators, distributors, original equipment manufacturers (OEMs), and vertical markets worldwide to offer wireless connectivity solutions that meet the unique needs of the following markets: \r\n\r\n\r\n\r\nMobile Workforce\r\nBusiness Professionals, Consumers, Sales Force, Field Service\r\n\r\n\r\nPublic Safety\r\nHomeland Security, Police, Fire, Traffic, Highway, Bridge\r\n\r\n\r\nTelematics\r\nAutomated Vehicle Location, Theft Recovery, Vehicle Monitoring\r\n\r\n\r\nTelemetry\r\nPoint Of Sale, ATM, Machine to Machine, Plant, Video, Theft Recovery, Vending, Meter Reading, Location Based Services\r\n\r\n\r\nTransportation\r\nTrucking, Courier, Fleet Management\r\n\r\n\r\nUtilities\r\nGas, Electric, Cable, Telephone\r\n\r\n\r\n\r\nDirection for the Future Novatel Wireless, Inc. is uniquely poised to take advantage of the burgeoning wireless market. The company has built a reputation for quality, reliable, innovative products that serve a broad audience. On the road ahead, Novatel Wireless, Inc. intends to stay ahead of the curve by continuing to form alliances with industry-leading partners, diversifying its product offerings and supporting the latest wireless technologies.   Enfora Aquisition\r\n Enfora will operate as a Novatel Wireless business unit, and the combined company will leverage synergies in product development, sales channels and complimentary resources. \r\n  Download Press Release  ','About','','/about','2012-08-30 14:48:00','2012-11-05 18:45:47',NULL,0),(167,'Enfora Tech Support\r\n M2M Support \r\n M2M Documentation  ProductsManualsUpdate \r\nProduct Name\r\n\r\n\r\nDevice Manual PDF | 3.1MB\r\n\r\n\r\nFirmware Download | 3.1MB\r\n  Mobile Broadband Products   M2M Products  ProductsManualsUpdate \r\nSample Mobile Broadband Product\r\n\r\n\r\nDevice Manual PDF | 3.1MB\r\n\r\n\r\nFirmware Download | 3.1MB\r\n \r\nSample M2M Product\r\n\r\n\r\nDevice Manual PDF | 3.1MB\r\n\r\n\r\nFirmware Download | 3.1MB\r\n Thank you for visiting Novatel Wireless support pages. \r\nMobile Broadband \r\nOur Mobile Broadband products are sold through carriers, OEMs and distributors and they will provide first level support to you. \r\nPlease contact the service provider or distributor from whom you purchased your device, before contacting Novatel Wireless support. \r\nHowever, if your service provider or distributor is unable to assist, please call 877-259-2761 or email for assistance. \r\nM2M \r\nNovatel Wireless M2M is committed to providing exceptional support to each and every customer. \r\nOur experienced support team works closely with the development teams to ensure you receive answers to even the most challenging technical support issues. \r\nAccess the Novatel M2M’s Product Support Website 24* hours a day for: \r\n·         Technical Support \r\n·         Product Documents \r\n·         Firmware Updates \r\n·         Software Tools \r\n·         FAQs  \r\nTechnical Support personnel are available during standard office hours, 8 to 5 central time zone.   \r\nExceeding expectations through continuous improvement. \r\n*Every effort is made to keep the Product Support website up and running, however, Novatel Wireless cannot be liable for website unavailability due to technical issues.  ','Support','','/support','2012-08-30 14:48:00','2012-11-05 17:50:17',NULL,0),(168,'Support Main Page Enfora Tech Support\r\n M2M Support \r\n M2M Documentation   Mobile Broadband Products   M2M Products   Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.  ','Main','','/support/main','2012-08-30 14:48:00','2012-11-12 23:28:29',NULL,0),(169,'Certification ','Certification','','/support/certification','2012-08-30 14:48:00','2012-11-10 00:05:21',NULL,0),(170,' Novatel Wireless, Inc. is a leader in the design and development of intelligent wireless solutions based on 2G, 3G and 4G technologies providing wireless connectivity. The Company delivers specialized wireless solutions to carriers, distributors, retailers, OEMs and vertical markets worldwide. Novatel Wireless\' intelligent mobile hotspot products, software, USB modems, embedded modules and smart M2M modules provide innovative anywhere, anytime communications solutions for consumers and enterprises. \r\n Headquartered in San Diego, California, Novatel Wireless, Inc. has been issued over 30 technology patents and has established partnerships with leading telecom operators, infrastructure providers and device manufacturers around the world. Novatel Wireless, Inc. is listed on NASDAQ: NVTL. \r\n Target \r\n Novatel Wireless, Inc. partners with wireless network operators, distributors, original equipment manufacturers (OEMs), and vertical markets worldwide to offer wireless connectivity solutions that meet the unique needs of the following markets: \r\n\r\n\r\n\r\nMobile Workforce\r\nBusiness Professionals, Consumers, Sales Force, Field Service\r\n\r\n\r\nPublic Safety\r\nHomeland Security, Police, Fire, Traffic, Highway, Bridge\r\n\r\n\r\nTelematics\r\nAutomated Vehicle Location, Theft Recovery, Vehicle Monitoring\r\n\r\n\r\nTelemetry\r\nPoint Of Sale, ATM, Machine to Machine, Plant, Video, Theft Recovery, Vending, Meter Reading, Location Based Services\r\n\r\n\r\nTransportation\r\nTrucking, Courier, Fleet Management\r\n\r\n\r\nUtilities\r\nGas, Electric, Cable, Telephone\r\n\r\n\r\n\r\n   \r\n Direction for the Future \r\n Novatel Wireless, Inc. is uniquely poised to take advantage of the burgeoning wireless market. The company has built a reputation for quality, reliable, innovative products that serve a broad audience. On the road ahead, Novatel Wireless, Inc. intends to stay ahead of the curve by continuing to form alliances with industry-leading partners, diversifying its product offerings and supporting the latest wireless technologies.   ','About Us','','/about/about-us','2012-08-30 14:49:00','2012-11-02 20:02:30',NULL,0),(171,'\r\n\r\n\r\n\r\n\r\n\r\n\r\nPeter V. Leparulo, Chairman and Chief Executive Officer\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n Peter V. Leparulo has served as a director since May 2003, as our Chairman since November 2006 and as our Chief Executive Officer since April 2008. He also served as our Chief Executive Officer from January 2003 to November 2007. From May 2001 to January 2003, he served as our Senior Vice President, General Manager, CDMA Operations. From September 2000 to May 2001, he served as our Senior Vice President, Corporate and Strategic Development and General Counsel. From June 1998 until September 2000, Mr. Leparulo was a Senior Partner at the law firm of Orrick, Herrington &amp; Sutcliffe LLP, where he specialized in corporate finance, mergers and acquisitions, securities, intellectual property and general corporate matters. Prior to joining Orrick, Mr. Leparulo was a Partner at the law firm of Pillsbury Madison &amp; Sutro LLP, from January 1992 until June 1998, and an Associate at that firm from October 1989 until January 1992. He holds a Bachelor of Science from Colgate University and a Juris Doctor from Case Western Reserve University. \r\n \r\n\r\n\r\n\r\n\r\n \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nKenneth Leddon, Senior Vice President and Chief Financial Officer\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nKenneth G. Leddon has served as our Senior Vice President and Chief Financial Officer since January 2008. From November 2007 to January 2008, he served as our interim Chief Financial Officer. Before joining us, Mr. Leddon was a principal in the management consulting firm of Leddon &amp; Associates from September 2006 until November 2007. Prior to that, he was a principal in the management consulting firm of Pathway Strategic Partners from November 2002 to September 2006. Mr. Leddon also served as an interim executive or financial advisor for several companies while employed with two nationally recognized management consulting firms, XRoads Solutions Group, LLC and Buccino &amp; Associates, Inc. He also served as Chief Financial Officer and Vice President for several portfolio companies of Milhous Group, a private equity firm that was based in California. Mr. Leddon started his career at U.S. Steel Corporation, where he held several financial management positions during his 10 year tenure. Mr. Leddon holds a Bachelor of Science in Business Administration from California State University-Northridge and a Master of Science in Business Administration from Robert Morris University. \r\n\r\n\r\n\r\n\r\n \r\n\r\n\r\n\r\nSlim S. Souissi, Senior Vice President and Chief Technology Officer\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n \r\nSlim S. Souissi has served as our Senior Vice President and Chief Technology Officer since 2004 and served as our Vice President and Chief Technology Officer from October 2002 to 2004. He previously served as our Vice President of Emerging Technologies from December 2001 to October 2002 and as our Principal Research Scientist from May 2000 to December 2001. Prior to joining us in 2002, Dr. Souissi was Principal Staff Engineer in Motorola’s research and development operation from November 1994 to May 2000. Dr. Souissi earned a Ph.D. and a Master of Science in Electrical Engineering from the Georgia Institute of Technology, a Master of Science in Digital Signal Processing from the Ecole Superieure d’Electricite (France) and a Master of Science in Engineering from the Ecole Centrale Marseille (France). Dr. Souissi holds 37 U.S. patents, all related to wireless technology. \r\n \r\n\r\n\r\n\r\n\r\n \r\n\r\n\r\n\r\nRobert M. Hadley, Chief Marketing Officer\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nRobert M. Hadley became our Chief Marketing Officer in March 2009 and served as a Senior Technical Advisor for the Company in the office of the Chief Executive Officer since March 2008. From 2004 to early 2008, Mr. Hadley was the Company’s Senior Vice President of Worldwide Sales and Marketing and was our Vice President of Sales and Marketing in 2003. He served as our Vice President of Strategic Accounts from April 2001 to December 2002. Before initially joining us, Mr. Hadley was Vice President of Sales for e-SIM Ltd., a provider of advanced simulation technology for product development. Mr. Hadley also previously held various senior sales and marketing positions at Aonix, a Thomson Software company providing IT solutions for corporate enterprise reporting and lifestyle software development markets, where he rose to the position of Vice President of Marketing. Mr. Hadley holds a Bachelor of Science in Computer Science from San Diego State University. \r\n\r\n\r\n\r\n\r\n \r\n\r\n\r\n\r\nChris Ross, Senior Vice President of Operations\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nChristopher J. Ross has served as our Vice President of Operations since July 2005 and our Senior Vice President of Operations since August 2007. From 1999 to July 2005, Mr. Ross was Vice President of Operations at Ericsson Wireless Communications where he was responsible for world-wide supply of wireless telecommunications infrastructure based on CDMA radio access technology. From 1994 to 1999, he was Vice President, Manufacturing at QUALCOMM where he was an operations executive. Prior to joining QUALCOMM, he was Vice President of Manufacturing at Spectragraphics where he founded the company’s contract manufacturing subsidiary (SMS Technologies) and also served as its General Manager. Mr. Ross holds both Bachelor and Master of Electrical Engineering degrees from Manhattan College. \r\n\r\n\r\n\r\n\r\n \r\n\r\n\r\n\r\nCatherine F. Ratcliffe, Senior Vice President of Business Affairs and General Counsel\r\n\r\n\r\n\r\n\r\n\r\n\r\nCatherine F. Ratcliffe has served as our Senior Vice President, Business Affairs, General Counsel and Secretary since August 2007 and served as our Vice President, Business Affairs and Secretary from May 2004 until August 2007. From 2002 to 2004, she practiced law, including as a Partner in the law firm of Lamb &amp; Kawakami. From 1997 to 2002 she was Vice President, General Counsel &amp; Human Resources at Day Runner, Inc. She was a Partner in the law firm of Bryan Cave LLP practicing in the areas of corporate finance, securities and mergers and acquisitions, from 1992 to 1997. Ms. Ratcliffe holds a Bachelor of Arts from the University of California at Los Angeles and a Juris Doctor from the University of California at Berkeley.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n ','Management Team','','/about/management-team','2012-08-30 14:49:00','2012-11-05 21:22:26',NULL,0),(172,'Investor Resources\r\n Novatel Wireless, Inc. is a leading provider of wireless broadband access solutions for the worldwide mobile communications market. Our solutions enable the mobile workforce to increase productivity, improve operational efficiencies and maintain a competitive edge.  ','Investors','','/about/investors','2012-08-30 14:49:00','2012-11-05 17:46:21',NULL,0),(173,' Novatel Wireless is a global leader in developing innovative wireless data devices and applications for markets worldwide using advanced wireless networks such as LTE, UMTS, HSDPA, GSM, GPRS, CDMA, and EV-DO. We are a publicly traded company headquartered in San Diego, California. \r\n Innovators- We are a global innovator in 3G &amp; 4G wireless mobility and M2M solutions: \r\n  • 1st to market with the Mifi- personal wireless hotspot \r\n  • 1st to market with EV-DO Rev-A product line \r\n  • 1st USB wireless broadband in North America \r\n  • 1st 3G wireless broadband router in Europe  \r\n  • Exciting LTE M2M Wimax HSPA+ products \r\n Work/Life Balance- We hire passionate people and create great teams. Global- We have offices in San Diego (California), Calgary (Canada), Basingstoke, (United Kingdom), and Shanghai (China). Financially Secure- Novatel Wireless is cash strong with no debt; founded in 1996, IPO in 2000. \r\n Novatel Wireless offers a very competitive benefits package. For our US employees, for example, we offer: \r\n\r\n\r\n\r\n\r\n •   Medical \r\n •   Dental \r\n •   Vision \r\n\r\n\r\n •   Health Spending Accounts     \r\n •   Life Insurances    \r\n •   Discounted Employee Stock Purchase Plan \r\n\r\n\r\n •   Stock Options \r\n •   401k Match Program \r\n •   Generous  Vacation Policy \r\n\r\n\r\n\r\n\r\n Novatel Wireless offers competitive salaries, comprehensive benefits, the opportunity for stock options, and an environment that supports creativity, open communication, and teamwork. Only applicants whose experience matches the skills sought for our positions will be contacted. \r\n Novatel Wireless is an Equal Opportunity Employer.  All jobs are subject to pre-employment background check and reference check.  ','Careers','','/about/careers','2012-08-30 14:49:00','2012-11-05 17:58:36',NULL,0),(268,'','M2M Career Opportunities','','/about/careers/m2m-career-oppourtunites','2012-10-24 18:20:00','2012-10-24 18:21:00',NULL,0),(174,'Contact Information:\r\nCorporate Offices\r\n\r\n\r\nNovatel Wireless, Inc\r\n\r\n\r\nOther Offices\r\n\r\n\r\nCalgary Office\r\nEurope, Middle East, Africa, Southern Asia, Australia and New Zealand Headquarters\r\n\r\n\r\nM2M Sales Inquiries\r\n\r\n\r\nSales Inquries\r\n\r\n\r\n \r\nMedia-Related Inquiries\r\n\r\n\r\nSenior Director, Public Relations\r\nInvestor Relations\r\n\r\n\r\n \r\nTechnical Support\r\n\r\n\r\nMain Support\r\nM2M Support\r\n\r\n\r\nStock or Investor Inquries\r\n\r\n\r\nStock or Investor Inquiries\r\n\r\n\r\n    ','Contact Us','','/about/contact-us','2012-08-30 14:50:00','2012-11-07 00:00:46',NULL,0),(175,'Consumer Devices\r\n    ','Consumer Devices','','/our-partners/mobile-operators','2012-08-30 14:50:00','2012-11-09 22:49:20',NULL,0),(176,'OEM Mobile Computing\r\n The pace of change and technology advances in today\'s world is nothing short of astounding. To be and remain competitive — to survive — companies must constantly innovate, create, design, manufacture and deploy new and better products. The architecture gets you there more rapidly, securely and with connection reliability unsurpassed in the industry. \r\n The Anywhere, Anytime experience is driving a profound technology transformation and broadband wireless users are demanding ubiquitous connectivity for a host of new applications. Whether you are perfecting a reference design, developing a new product or modifying an existing application, Enfora can enhance your time-to-market with innovative solutions that are certified, indemnified and backed with the proven performance demonstrated through hundreds of reference designs globally. Enfora\'s GSM/GPRS, GPS, UMTS/HSPA, 2G, and 3G Low Power platforms deliver small size and industry-leading high performance, driving the essential capabilities, mobile connectivity and device intelligence needed for today\'s demanding design-in and OEM markets. \r\n The Enabler III and HS 1000 platforms are part of Enfora\'s intelligent device offerings and feature superior performance in a small package with ultimate flexibility. Coupled with the robust N4A Communications &amp; Management platform, devices can be provisioned, monitored and reconfigured remotely, most anywhere in the world. Driven by the services architecture, Enfora delivers flexible, modular architecture for development and deployment. \r\n The architecture helps make it simple, but if you have a special design challenge or just want help getting past a small design issue, contact our design services team for assistance. No project is too small or too large. We have assisted many of today\'s global 1000 companies with innovative designs, engineering assistance and creative ways to connect you — Anywhere, Anytime. \r\n With the architecture, custom branding, distinctive designs, and innovative ideas become reality. \r\n    ','OEM Mobile Computing','','/our-partners/system-integrations','2012-08-30 14:50:00','2012-11-09 22:49:23',NULL,0),(177,'Transportation\r\n Enfora pioneered resilient, high-speed, reliable end-point connectivity solutions for the transportation marketplace. Whether you\'re traveling the open road, meeting an on-time delivery or watching your child drive off to school, Enfora\'s innovation empowers you over the highway, on the rail and most anywhere, anytime in the supply chain. Driven by the N4A Services Architecture, Enfora delivers a flexible, modular architecture for fast wireless asset tracking solutions development and deployment. \r\n Over the road fleet operators benefit from Enfora\'s N4A intelligent mobile tracking devices that feature superior performance in a small package for ultimate flexibility. The Pay-As-You-Go insurance, auto financing/leasing and Buy-Here Pay-Here markets leverage the latest in Place-N-Trace vehicle tracking devices with advanced features for motion, acceleration and theft recovery. \r\n Whether mission critical shipments or real-time location services Enfora and its strategic partners deliver the data for better decision-making, improving your performance in your connected supply chain. Riding the rail, Enfora\'s N4A intelligent devices, help you keep a watchful eye on your most precious assets remotely in transit. \r\n Coupled with the robust N4A Communications &amp; Management platform, devices can be provisioned, monitored and reconfigured remotely, most anywhere in the world. Connected Transportation — Anywhere, Anytime. \r\n    ','Transportation','','/our-partners/application-service-providers','2012-08-30 14:51:00','2012-11-09 22:49:16',NULL,0),(178,'Our Partners ','Our Partners','','/about/manufacturing-and-engineering','2012-08-30 14:51:00','2012-11-10 00:05:21',NULL,0),(179,'		\r\n ','Press Releases','','/news-and-events/press-releases','2012-08-30 14:51:00','2012-11-05 17:16:38',NULL,0),(180,'','Novatel Wireless in the News','','/news-and-events/in-the-news','2012-08-30 14:52:00','2012-11-05 17:15:55',NULL,0),(181,'','Events Calendar','','/news-and-events/events','2012-08-30 14:52:00','2012-11-10 00:22:28',NULL,0),(182,'        ','Downloads','','/news-and-events/media-center','2012-08-30 14:52:00','2012-11-05 19:53:14',NULL,0),(183,'','Research and Development','','/our-expertise/target-markets','2012-08-30 14:52:00','2012-10-30 21:06:31',NULL,0),(184,' Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor