ave a method to detect and report potential tamper events, enhancing overall security.  ','Mobile Tracking Solutions','','/products/integrated-m2m-solutions/mobile-tracking','2012-08-30 14:56:00','2012-11-05 22:57:23',NULL,0),(396,'MiFi DLNA® Server  With the MiFi DLNA® Server, you get a front row seat. \r\n The MiFi 2372 Intelligent Mobile Hotspot enables you to access and play your movies, music and photos anywhere, anytime, on any DLNA-capable device. The MiFi DLNA Server connects your devices to provide easy, instant-on access to your media. There\'s no complicated configuration required. \r\n Browse, stream and share your media wherever you are, on the devices you choose. \r\n\r\nNo need to copy, move, and synch your media files.\r\nEnjoy your movies, music and photos, hassle-free.\r\nPlay on DLNA-capable DVD and Blu-ray players, game consoles, televisions, tablets, mobile devices, computers, audio video systems, digital frames, home theater devices and more.\r\n\r\n The MiFi DLNA Server connects your devices to enable easy, configuration-free access to your media. \r\n \r\n \r\n\r\nStream movies to your laptop and/or watch directly on your living room TV\r\nListen to music from your MP3 player on your home sound system\r\nIn the van let the kids watch one video on a Galaxy Tab® and another on an iPod Touch®\r\nShare vacation photos on the grandparents\' TV using their Blu-ray® player\r\nFilm the wedding reception, slip the microSDHC card into the MiFi device, and share the movie instantly on an iPad®\r\n\r\n \r\n   \r\n   How the MiFi DLNA Server Works   Mobile Digital Media Server – The DLNA CERTIFIED® MiFi device takes content stored on the microSDHC card™ and makes it available to wireless networked mobile digital media players (M-DMP) and digital media renderers (DMR) via the MiFi DLNA Server on the MiFi OS™.   Home Network Devices \r\n\r\nVideo – MPEG 2\r\nAudio – MP3\r\nImages – JPG, JPEG\r\n\r\n Mobile Devices \r\n\r\nVideo – MP4\r\nAudio – MP3\r\nImages – JPG, JPEG\r\n\r\n Note: Not all DLNA media players support all formats. Please refer to the dlna.org website for specific information on your DLNA player.   Some examples of devices currently available that are DLNA compliant are: \r\n Computers \r\n\r\nWindows Vista - Media Player 12\r\nWindows 7 – Media Player 12\r\nMac OS X – VLC\r\n\r\n Home Theater Devices \r\n\r\nTelevisions\r\n\r\nSony KDL-32EX308 32\" BRAVIA 720p LCD TV\r\nSamsung LN32C550 32\" Class WiFi Ready DLNA LCD HDTV\r\n\r\nBlu-ray Players\r\n\r\nSony BDPS570\r\nLG BX580 3D\r\nSamsung BD-C5500/XAA\r\n\r\nHome Media Receivers\r\n\r\nYamaha YMC-700BL\r\nDenon RCD-N7\r\n\r\nGaming Consoles\r\n\r\nSony PlayStation 3\r\n\r\nMobile Devices\r\n\r\niOS Devices – Plug Player, Media Connect\r\nAndroid Devices - Plug Player\r\n\r\n\r\n For a full list of DLNA certified products please refer to the dlna.org website.   Supported Media Formats   DLNA-capable Devices   What is DLNA?   The Digital Living Network Alliance (DLNA) is a non-profit collaborative trade organization established by Sony in June 2003, with more than 250 member companies in the mobile, consumer electronics, PC, and service provider industries. \r\n The goal of DLNA is to enable end-to-end interoperability among the digital devices storing, playing and sharing digital content on your digital network. So far that includes DLNA Certified products in twelve different DLNA device classes in three categories. \r\n DLNA categories include: \r\n\r\nHome Network Devices\r\nMobile Handheld Devices\r\nHome Infrastructure Devices\r\n\r\n More than 440 million DLNA CERTIFIED devices – from digital cameras to game consoles to TVs – were installed in users\' homes by the end of 2010 (ABI Research, \"Home Networking Market Data\", January 2011). \r\n The MiFi 2372 Intelligent Mobile Hotspot from Novatel Wireless, Inc. is DLNA CERTIFIED®.  ','MiFi DLNA® Server','The MiFi 2372 Intelligent Mobile Hotspot enables you to access and play your movies, music and photos anywhere, anytime, on any DLNA-capable device. The MiFi DLNA Server connects your devices to provide easy, instant-on access to your media. There\'s no complicated configuration required.','/products/mobile-broadband-solutions/software/mifi-dlna-server','2012-11-01 19:26:00','2012-11-01 19:35:55',NULL,0),(198,'Asset Tracking Solutions\r\n An extension to the Novatel Wireless M2M family of integrated asset management solutions, the Enfora® AT Series is a powered to battery-driven integrated device series that provides internal quad-band GSM/GPRS/GPS antenna functionality for mobile asset monitoring. Based on the Enfora® Enabler® Series module, the built-in programmable software environment enables essential capabilities such as mobile connectivity, location awareness, and device intelligence. The device leverages a unique set of control and automation features that extend device longevity through managing power usage and critical communications parameters. All series devices provide total protection against dust, water spray, and long periods of water immersion under pressure.  ','Asset Tracking Solutions','','/products/integrated-m2m-solutions/asset-tracking','2012-08-30 14:57:00','2012-11-01 18:41:35',NULL,0),(199,'Workforce Monitoring Solutions\r\nLone-workers in hazardous environments who may find themselves in a man-down situation, operators of small fleets needing to maintain simple yet effective communication with their workers, wandering or lost children and Alzheimer’s patients who may need access to a panic button or simple voice communication: these are just a few of the Mobile Resource Management (MRM) challenges that must be addressed by any M2M provider in today’s market. Connectivity combined with location-based features and reporting in a user-friendly format are imperatives to success for any MRM device in the personal and workforce safety market; such devices must be easily deployed and provisioned, and monitored by a reliable end-to-end solution. \r\nDriving Business Applications\r\n The Enfora® Personnel Monitoring Series provides flexibility in global MRM monitoring for the following target markets: \r\n   \r\n - Personal &amp; Remote Worker Tracking \r\n - Child &amp; Teen Tracking \r\n - Mobile/Home Healthcare \r\n - Emergency Response \r\n - Elderly Locator \r\nQuality &amp; Reliability that Keeps Selling\r\nAt Novatel Wireless we infuse quality in all we do, starting with well-defined ISO 9001:2008* engineering processes that cross both the consumer mobile computing and M2M cellular modem teams. Our longstanding relationships with industry leaders like Qualcomm® help us to accurately and efficiently integrate chipset capabilities into our in-house modem designs that ultimately drive our integrated devices while accelerating time to market. Our Enfora® Enabler® Series modules also experience statistically low returns—enhancing overall device stability—while our clients rate our RMA and support processes well above industry averages in yearly Customer Satisfaction Surveys. Those are statistics that engender customer loyalty and keep us working hard to make transitions simple and technology fresh. \r\n   ','Workforce Monitoring','','/products/integrated-m2m-solutions/workforce-monitoring','2012-08-30 14:57:00','2012-10-12 19:34:10',NULL,0),(200,'Telemetry Solutions\r\nThe Enfora® SA Series is a stand-alone telemetry solution designed for cellular M2M applications with a range of business and market needs.  Each SA-G+ series device is driven by our in-house developed Enfora® Enabler® Series embedded modules with our Smart Agent events engine. Novatel Wireless modules are additionally calibrated and aligned with our in-house hardware and low-level firmware to accommodate the needs of the target application. Even with this much intelligence inside, you\'ll find the sub-credit-card-sized SA-G+ will fit with room to spare in most telemetry hardware designs. \r\nDesigned for operational simplicity and price economy, the Enfora® SA Series doesn’t overshoot the needs of most M2M applications with sophisticated features or excessive interfaces. Instead, the series remains focused on Novatel Wireless’ core mission to connect serial-based machines to the cloud—simply, reliably, and economically  ','Telemetry Solutions','','/products/integrated-m2m-solutions/telemetry','2012-08-30 14:57:00','2012-11-01 18:38:20',NULL,0),(201,'Service Delivery Platform \r\nNovatel Wireless has a robust M2M software offering that can quickly build connectivity from your Internet Protocol (IP)-enabled remote assets to your existing enterprise applications. We provide the ability to choose a right-sized option for your enterprise needs. Our platform includes the following products:  the N4ATM Communications and Management Software (CMS) and the N4A™ Device Manager. With our decades of cumulative experience in wireless data and M2M environments, we can help you choose the best products, formats, and options to enhance your remote intelligence gathering capabilities, putting that data at the fingertips of corporate decision makers to identify device issues, decrease out-of-service time, track shipments, improve worker productivity, and more.  ','Service Enablements Services (SES)','','/products/integrated-m2m-solutions/service-delivery-platform','2012-08-30 14:57:00','2012-11-09 22:45:30',NULL,0),(202,'Workforce Monitoring Solutions\r\nLone-workers in hazardous environments who may find themselves in a man-down situation, operators of small fleets needing to maintain simple yet effective communication with their workers, wandering or lost children and Alzheimer’s patients who may need access to a panic button or simple voice communication: these are just a few of the Mobile Resource Management (MRM) challenges that must be addressed by any M2M provider in today’s market. Connectivity combined with location-based features and reporting in a user-friendly format are imperatives to success for any MRM device in the personal and workforce safety market; such devices must be easily deployed and provisioned, and monitored by a reliable end-to-end solution.   ','Workforce Monitoring Solutions','','/products/integrated-m2m-solutions/professional-services','2012-08-30 14:58:00','2012-11-01 18:46:09',NULL,0),(203,'N4A™ Communications and Management Software \r\nHighlights\r\nNovatel Wireless accelerates solution delivery by quickly building connectivity from a customer’s Internet Protocol (IP)-enabled remote assets to their existing enterprise applications. Removing the inherent complexities of wireless networks and their communications protocols, our N4A™ Communications and Management Software (CMS) enables database or web service-driven control and management of Enfora® remote devices. Using a standard web-based user interface, customers have a detailed mobile asset view, enabling proactive management as well as necessary system upgrades. Additionally, using the built-in device configuration and service management capabilities, N4A™ CMS effectively manages and applies device configurations across multiple device groups. \r\nAvailable as an on-premise solution, N4A™ CMS is particularly well suited to customers who: \r\n·       Need a functional application up and running quickly \r\n·       Lack the man hours or expertise necessary to master device and session management \r\n·       Want to capitalize on our experience with wireless devices and network operators \r\n·       Require flexible integration options \r\n·       Prefer to focus resources on their in-house application software development \r\n·       Need a simple web service interface for programmatic interaction \r\nA Scalable Solution\r\n The flexibility of our N4A™ software architecture makes it possible to integrate a broad range of existing solutions. The N4A™ CMS application has been architected to scale, functioning in environments varying from a single-server demo to those with carrier-grade requirements. The application may be scaled vertically and horizontally, depending on customer requirements. N4A™ CMS is designed for the multitenant requirements of resellers and company organizations. \r\nExceptional Support\r\nNovatel Wireless has an exceptional customer support infrastructure, with Technical Account Managers (TAMs) and Field Applications Engineers (FAEs) around the globe available to deliver customer-driven support options both pre- and post-installation.  N4A™ Communications and Management Software  A Scalable Solution   Exceptional Support   The flexibility of our N4A™ software architecture makes it possible to integrate a broad range of existing solutions. The N4A™ CMS application has been architected to scale, functioning in environments varying from a single-server demo to those with carrier-grade requirements. The application may be scaled vertically and horizontally, depending on customer requirements. N4A™ CMS is designed for the multitenant requirements of resellers and company organizations.   Novatel Wireless has an exceptional customer support infrastructure, with Technical Account Managers (TAMs) and Field Applications Engineers (FAEs) around the globe available to deliver customer-driven support options both pre- and post-installation.  Highlights \r\nNovatel Wireless accelerates solution delivery by quickly building connectivity from a customer’s Internet Protocol (IP)-enabled remote assets to their existing enterprise applications. Removing the inherent complexities of wireless networks and their communications protocols, our N4A™ Communications and Management Software (CMS) enables database or web service-driven control and management of Enfora® remote devices. Using a standard web-based user interface, customers have a detailed mobile asset view, enabling proactive management as well as necessary system upgrades. Additionally, using the built-in device configuration and service management capabilities, N4A™ CMS effectively manages and applies device configurations across multiple device groups. \r\nAvailable as an on-premise solution, N4A™ CMS is particularly well suited to customers who: \r\n·       Need a functional application up and running quickly \r\n·       Lack the man hours or expertise necessary to master device and session management \r\n·       Want to capitalize on our experience with wireless devices and network operators \r\n·       Require flexible integration options \r\n·       Prefer to focus resources on their in-house application software development \r\n·       Need a simple web service interface for programmatic interaction   ','CMS','','/products/integrated-m2m-solutions/service-delivery-platform/cms','2012-08-30 14:58:00','2012-11-10 01:08:21',NULL,0),(204,'N4A™ Device Manager\r\n Device Management Software \r\n   \r\n Networking Solutions \r\n The N4A Device Manager solution is a robust environment for the management, configuration and self care/support of Novatel Wireless M2M devices to include the following capabilities: 1) view, change and manage device configuration &amp; firmware updates, 2) manage single devices or groups of devices, 3) complete device history to assist in self care &amp; issue resolution, 4) monitor device health and operational status, and 5) allows device to “check-in” to the hosted environment and report event data to a separate server. Manage user accounts and device privileges to extend self-service device management capabilities to customers. Hosted and on premise versions are available providing complete integration flexibility. \r\n  \r\n Device and Service Management \r\n Create and manage device groups by deploying configuration changes to a set of devices or a single device then set up customer groups. Uploaded shipments are available in the system for immediate use while device orders are in transit (shipping option). Upload, manage and save scripts for device deployments and updates. Information is queued for configuration changes prior to device installation or initial power up. Devices can be contacted for immediate check-in to expedite device changes. Filters and searches are available throughout the system for easy navigation. \r\n     Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.  Device Manager ','Device Manager','','/products/integrated-m2m-solutions/service-delivery-platform/plug-ins','2012-08-30 14:58:00','2012-11-10 01:05:14',NULL,0),(205,' Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.  Cell Based Location (CBL) ','Cell-Based Location (CBL)','','/products/integrated-m2m-solutions/service-delivery-platform/device-manager','2012-08-30 14:58:00','2012-11-10 01:04:04',NULL,0),(206,'Developer Lounge        Privacy Policy        Terms of Use        Copyright © 2012 Novatel Wireless, Inc. All rights reserved.  ','Footer',NULL,'/!stacks/footer','2012-08-30 14:59:12','2012-09-19 22:04:21',NULL,0),(207,' Where to Buy   |   Contact Us      ','Header Alt Nav',NULL,'/!stacks/header-alt-nav','2012-09-04 16:00:28','2012-11-05 18:42:33',NULL,0),(208,'','Company Logo',NULL,'/!stacks/company-logo','2012-09-05 10:39:59','2012-09-12 13:45:00',NULL,0),(209,' See More Mobile Devices &gt;   Accessories   Verizon Wireless™ is now offering a 3,000 mAh battery for the MiFi® 4620L! \r\n Extended Battery for MiFi® 4620L \r\n The MiFi 4620L extended battery accessory is 3000 mAh and offers up to 10 continuous hours of battery life before requiring a recharge – giving Verizon Wireless MiFi 4620L customers a full day of use with their MiFi 4620L and the freedom of staying connected longer while playing, working or travelling.  MiFi® 4620L\r\n Intelligent Mobile Hotspot   Fast, always-on Internet wherever you roam—worldwide* \r\n With the Verizon Jetpack™ 4G LTE Mobile Hotspot MiFi® 4620L by Novatel Wireless, access blazing fast 4G LTE and 3G mobile broadband worldwide and share your connection with up to ten Wi-Fi enabled devices simultaneously. MiFi 4620L is the next generation in the Novatel Wireless MiFi intelligent mobile hotspot portfolio for Verizon Wireless, built on award-winning innovation and design, proven performance and industry leading user experience. \r\n Put the world in the palm of your hand With this 4G LTE MiFi intelligent mobile hotspot, enjoy fast Internet access whenever, wherever you go. MiFi 4620L is backward compatible with high speed DC HSPA+, HSPA+, WCDMA, EDGE and GPRS technologies to keep you connected. The compact MiFi 4620L is perfect for on-the-go connectivity and won’t weigh you down. \r\n Know where you are — monitor device and connection status at a glanceWith the interactive OLED display screen, easily scroll to view battery life, check signal strength, check the number of connected devices, read text messages, view network details, access your password, and much more! \r\n Share the experience—connect up to 10 devices securely† \r\n Create your own personal Wi-Fi cloud and share high speed 4G and 3G Internet connectivity with up to ten devices—notebooks, tablets, e-readers, gaming consoles and more. The MiFi 4620L supports the latest security protocols required by some of the strictest corporate VPNs, including VPN Pass-through and NAT Firewall.  \r\n Smooth sailing—navigate using GPS over Wi-Fi‡ \r\n MiFi 4620L is the first product to support GPS over Wi-Fi, enabling applications to access streaming GPS (NMEA). Stream GPS location services while on the move to up to 10 devices at once, no cables required! \r\n   \r\n * Visit verizonwireless.com for coverage maps \r\n †Security settings must be enabled \r\n ‡Available only on Windows® systems \r\n Service plans, extended battery and other services/options must be purchased separately \r\n   \r\n     mifi_4620l_vzw_datasheet.pdf  ','MiFi® 4620L - Intelligent Mobile Hotspot','MiFi® 4620LIntelligent Mobile Hotspot\r\n\r\nFast, always-on Internet wherever you roam—worldwide*\r\n\r\nWith the Verizon Jetpack™ 4G LTE Mobile Hotspot MiFi® 4620L by Novatel Wireless, access blazing fast 4G LTE and 3G mobile broadband worldwide and share your connection with up to ten Wi-Fi enabled devices simultaneously. MiFi 4620L is the next generation in the Novatel Wireless MiFi intelligent mobile hotspot portfolio for Verizon Wireless, built on award-winning innovation and design, proven performance and industry leading user experience.','/products/mobile-broadband-solutions/mifi-intelligent-mobile-hotspots/mifi-4620l-intelligent-mobile-hotspot','2012-09-11 19:44:00','2012-11-10 00:57:33',NULL,0),(211,'','Search Results','','/support/search-results','2012-09-12 20:50:00','2012-11-05 17:49:40',NULL,0),(212,' Content goes here      Sidebar Content     ','Follow Us','','/follow-us','2012-09-19 23:20:00','2012-09-19 23:25:59',NULL,0),(216,'Industrial Automation\r\n The connected factory – from the simple shop floor to the most advanced robotics-based dark factory, to the intelligent pallet and transportation infrastructure, capturing information from your plant and your products is critical for effective and efficient operations. Today\'s increasing demand for real-time information continues to place a burden on the critical support and systems infrastructure of the most progressive of companies. Automating processes and utilizing wireless communications technology can effectively help you capture and leverage essential data, providing cost reductions while driving operational efficiencies that lead to better, more informed business decisions. \r\n With simple integrated platforms and a host of embedded platforms — Enfora is empowering companies of all sizes with resilient, high-speed, reliable end-point, industrial automation connectivity solutions for today\'s Smart Factory operations. Driven by the N4A Services Architecture, Enfora delivers a flexible, modular architecture for fast wireless connectivity and solutions deployment. \r\n Monitoring and decision support systems have been transformed with the N4A family of intelligent devices, from the Spider AT asset tag family, to the SA Telemetry devices and a host of embedded platforms purpose-designed for the industrial automation and product distribution markets. \r\n Mission-critical infrastructures can be efficiently managed and high-value assets can be located and leveraged using real-time location services. Enfora and its strategic partners deliver the data for better decision-making — improving performance in your connected factory, and driving green and other energy saving initiatives. \r\n Coupled with the robust N4A Communications and Management platform, devices can be provisioned, monitored and reconfigured remotely, most anywhere in the world. The Connected Factory and Connected Industry — Anywhere, Anytime. \r\n    ','Industrial Automation','','/our-partners/transportation','2012-09-19 23:27:00','2012-11-09 22:49:14',NULL,0),(217,'Security\r\n From security panels to secure assets, digital surveillance, and high-speed full motion video, Enfora delivers exceptional connectivity with the industry\'s leading high performance communications platforms. Enabling real-time data for security applications including alarm panels, intelligent locks, asset monitoring devices and the latest in high-speed video capture and transmission, Enfora\'s Enabler III and Enabler HS 1000series of modules deliver. \r\n With simple integrated devices and a host of embedded platforms, Enfora is empowering companies of all sizes with resilient, high-speed, scalable, and reliable end-point security and asset monitoring connectivity solutions. Driven by the N4A Services Architecture, Enfora delivers a flexible, modular architecture for fast wireless connectivity and solutions deployment. \r\n Security Monitoring and Surveillance systems have been transformed with the N4A family of intelligent devices, from the Enabler III and HS embedded platforms to the Spider AT asset tag family, and the SA Telemetry devices purpose-built for the time-sensitive data needed in the security and asset monitoring markets. \r\n Mission-critical infrastructures can be efficiently managed and high-value assets can be located and leveraged using real-time location services. Enfora and its strategic partners deliver the data for better decision-making, improving performance safety and security for your treasured assets. \r\n Coupled with the robust N4A Communications and Management platform, devices can be provisioned, monitored and reconfigured remotely, most anywhere in the world. Connected Security: providing you vision — Anywhere, Anytime. \r\n    ','Security','','/our-partners/security','2012-09-19 23:28:00','2012-11-09 22:49:11',NULL,0),(218,'Telehealth / Medical\r\n Connecting the latest in remote healthcare products and services: from the simple glucose meter with an embedded communications module to a blood pressure monitor and much more. Today’s healthcare delivery network demands reliable communications services; no matter the modality, no matter the location. Enfora-based solutions provide the path for critical data transmission, empowering today’s connected care network, delivering connected health — most Anywhere, Anytime. Intelligent end-point devices and embedded communications platforms ensure fast reliable connectivity throughout the global infrastructure, delivering the time and operational-sensitive data for life-critical healthcare decisions. \r\n With simple Data-Pipe technology to high-speed backhaul embedded platforms, Enfora is empowering remote monitoring device manufacturers of all sizes with resilient, high-speed, reliable end-point, wireless connectivity solutions. Driven by the N4A Services Architecture, Enfora delivers a flexible, modular architecture through its innovative and award-winning Enabler III andEnabler HS 1000 embedded platforms – delivering high-performance wireless connectivity and rapid solutions deployment.  \r\n Mission-critical infrastructures can be efficiently managed and high-value assets can be located and leveraged using real-time location services. Enfora and its strategic partners deliver the data for better decision-making, improving performance in your connected devices — driving critical data for clinicians and patients.  \r\n Coupled with the robust N4A Communications and Management platform, devices can be provisioned, monitored and reconfigured remotely, most anywhere in the world. Connected Telehealth — Anywhere, Anytime.   ','Telehealth/Medical','','/our-partners/telehealth-medical','2012-09-19 23:28:00','2012-11-09 22:49:07',NULL,0),(219,'M2M Modules\r\nA Trusted Brand since 2005\r\nContinuing the successful Enabler® OEM module line that’s been a staple of the Enfora® M2M brand since its introduction in 2005, the Enabler® IIIG Series maintains the core features of using industry-leading chipset manufacturers as the basis of our trusted in-house designs and then overlaying our Smart Agent with its action-based intelligence onto the final modem design. With the recent expansion of the series beyond the Enabler® IIIG into our new HS Series, we provide you with even more module options for integration into your mission critical designs—while preserving the industry-leading intelligence and in-house expertise that’s led to our iconic brand success.  ','M2M Modules','','/products/integrated-m2m-solutions/m2m-modules','2012-09-28 16:52:00','2012-11-09 22:40:49',NULL,0),(397,'MobiLink™ Communications Software Suite  The Novatel Wireless MobiLink™ Communications Software Suite is a family of wireless connectivity applications that connect mobile devices with wireless wide area networks (WWAN) to allow quick and instant access to email, the Internet and corporate networks anytime, anywhere. With MobiLink and a wireless device, mobile users can stay productive and connected to customers and colleagues while out of the office. Now with zero-CD and automatic installation, the MobiLink Communications Software Suite is optimally engineered to work with all Novatel Wireless products for best in class 3G wireless broadband access solutions.   Key Features   Key Benefits   Specifications  \r\nZero-CD and Automatic Installation with new MobiLink Lite\r\nPre-provisioning\r\nNDIS Drivers\r\nInnovative, easy-to-customize skin-based technology\r\nServer/client technology\r\nLaptop, OS, and operator tested\r\nInternational localization\r\nVPN compatibility Enables secure access to corporate documents &amp; applications\r\n \r\nMinimal user interface guarantees quick installation\r\nMakes network connection quick and easy\r\nEnsure always on connectivity\r\nQuick time to market and easily customizable\r\nEnable multiple applications to communicate with one device\r\nComprehensive testing results in reliable performance\r\nSupports up to 17 languages\r\nEnables secure access to corporate documents &amp; applications\r\n\r\n       \r\n Wireless Network Information \r\n\r\nSignal Strength Indicator\r\nAttached to network\r\nCarrier name\r\nDevice properties\r\nByte Counter\r\nCall Duration Timer\r\nTray Icon Signal Strength Indicator\r\nCall Log\r\n\r\n MobiLink Customization Tool \r\n\r\nPreset connection profile\r\nSelect certain features to turn on\r\nMake CD\'s with preset\r\nIP/UMTS Quality of Service (QoS) settings for enterprise customers (ideal for bulk orders)\r\n\r\n Two Way SMS Client \r\n\r\nSend and receive SMS messages\r\nCompose and read SMS in multiple languages\r\nCompose and send to multiple recipients\r\nAddress Book support for mobile contacts\r\nRich edit for launching URL\r\nEmail using embedded addresses\r\n\r\n Connectivity \r\n\r\nConnection Button\r\nAuto Connection Feature\r\nNDIS Network Adapter option\r\nProfile Manager to manage multiple connection properties\r\nAutomatically launch VPN session\r\n\r\n Other Valuable Features \r\n\r\nSIM lock/unlock\r\nNetwork unlock\r\nManual network selection\r\nOn-Line help\r\nMulti-language support\r\nMini Screen status mode\r\n\r\n Address Book Client \r\n\r\nEdit and manage contacts on SIM\r\nInteroperates with Outlook and Windows® address book\r\nSend SMS directly from address book client\r\n\r\n Availability \r\n\r\nGlobally\r\n\r\n    ','MobiLink™ Communications Software Suite','The Novatel Wireless MobiLink™ Communications Software Suite is a family of wireless connectivity applications that connect mobile devices with wireless wide area networks (WWAN) to allow quick and instant access to email, the Internet and corporate networks anytime, anywhere. With MobiLink and a wireless device, mobile users can stay productive and connected to customers and colleagues while out of the office. Now with zero-CD and automatic installation, the MobiLink Communications Software Suite is optimally engineered to work with all Novatel Wireless products for best in class 3G wireless broadband access solutions.','/products/mobile-broadband-solutions/software/mobilink-communications-software-suite','2012-11-01 19:36:00','2012-11-01 19:40:34',NULL,0),(279,'','Video interview: MiFi 2 by Novatel Wireless','Video interview: MiFi 2 by Novatel Wireless','/news-and-events/in-the-news/video-interview-mifi-2-by-novatel-wireless','2012-10-11 17:07:00','2012-10-31 17:34:56',NULL,0),(280,'','Business gets most but not all the focus at MobileCon show','Business gets most but not all the focus at MobileCon show','/news-and-events/in-the-news/business-gets-most-but-not-all-the-focus-at-mobilecon-show','2012-10-10 17:17:00','2012-10-31 17:25:39',NULL,0),(281,'','Cape Town Cruising: Novatel Finds Market in South Africa','Cape Town Cruising: Novatel Finds Market in South Africa','/!drafts/cape-town-cruising-novatel-finds-market-in-south-africa','2012-10-10 17:34:00','2012-10-31 17:34:31',NULL,0),(282,'','Novatel [Wireless] MiFi Liberate','Novatel [Wireless] MiFi Liberate','/!drafts/novatel-wireless-mifi-liberate','2012-10-09 17:35:00','2012-10-31 17:35:48',NULL,0),(283,'','Novatel Wireless MiFi Liberate MiFi for AT&T hands-on','Novatel Wireless MiFi Liberate MiFi for AT&T hands-on','/!drafts/novatel-wireless-mifi-liberate-mifi-for-atandt-hands-on','2012-10-09 17:35:00','2012-10-31 17:36:26',NULL,0),(284,'','Thrifty Car Rental deploys Novatel [Wireless] Mobile Tracking device','Thrifty Car Rental deploys Novatel [Wireless] Mobile Tracking device','/!drafts/thrifty-car-rental-deploys-novatel-wireless-mobile-tracking-device','2012-10-09 17:36:00','2012-10-31 17:37:00',NULL,0),(285,'','Novatel Wireless In Mobile Tracking Deal With Thrifty Car Rental','Novatel Wireless In Mobile Tracking Deal With Thrifty Car Rental','/!drafts/novatel-wireless-in-mobile-tracking-deal-with-thrifty-car-rental','2012-10-09 17:37:00','2012-10-31 17:37:57',NULL,0),(286,'','Top 15 Tech Gifts for 2012','Top 15 Tech Gifts for 2012','/!drafts/top-15-tech-gifts-for-2012','2012-10-04 17:39:00','2012-10-31 17:39:33',NULL,0),(287,'','Novatel Wireless introduces new mobile hotspot with touchscreen display','Novatel Wireless introduces new mobile hotspot with touchscreen display','/!drafts/novatel-wireless-introduces-new-mobile-hotspot-with-touchscreen-display','2012-10-03 17:39:00','2012-10-31 17:40:06',NULL,0),(288,'','Latest Novatel Wireless Products - Novatel [Wirelesss] MiFi Liberate','Latest Novatel Wireless Products - Novatel [Wirelesss] MiFi Liberate','/!drafts/latest-novatel-wireless-products-novatel-wirelesss-mifi-liberate','2012-10-01 17:40:00','2012-10-31 17:40:38',NULL,0),(289,'','AT&T gives hotspots a touch up with touchscreen MiFi Liberate','AT&T gives hotspots a touch up with touchscreen MiFi Liberate','/!drafts/atandt-gives-hotspots-a-touch-up-with-touchscreen-mifi-liberate','2012-09-28 17:40:00','2012-10-31 17:47:14',NULL,0),(290,'','Gadgets of The Week','Gadgets of The Week','/!drafts/gadgets-of-the-week','2012-09-30 17:47:00','2012-10-31 17:47:56',NULL,0),(291,'','AT&T Unveils Touch-Screen MiFi Liberate','AT&T Unveils Touch-Screen MiFi Liberate','/!drafts/atandt-unveils-touch-screen-mifi-liberate','2012-09-27 17:48:00','2012-10-31 17:48:37',NULL,0),(292,'','AT&T Unveils Touch-Screen MiFi Liberate','AT&T Unveils Touch-Screen MiFi Liberate','/!drafts/atandt-unveils-touch-screen-mifi-liberate','2012-09-27 17:52:00','2012-10-31 17:52:56',NULL,0),(293,'','AT&T’s MiFi Liberate LTE is first touch-screen hot spot','AT&T’s MiFi Liberate LTE is first touch-screen hot spot','/!drafts/atandts-mifi-liberate-lte-is-first-touch-screen-hot-spot','2012-09-27 17:53:00','2012-10-31 17:53:59',NULL,0),(294,'','AT&T MiFi Liberate is an all-day LTE hotspot and media server','AT&T MiFi Liberate is an all-day LTE hotspot and media server','/!drafts/atandt-mifi-liberate-is-an-all-day-lte-hotspot-and-media-server','2012-09-27 17:54:00','2012-10-31 17:54:27',NULL,0),(295,'','AT&T Shoved a Touchscreen in Its Latest LTE MiFi Hotspot Because, Hey, Why Not!','AT&T Shoved a Touchscreen in Its Latest LTE MiFi Hotspot Because, Hey, Why Not!','/!drafts/atandt-shoved-a-touchscreen-in-its-latest-lte-mifi-hotspot-because-hey-why-not','2012-09-27 17:54:00','2012-10-31 17:55:09',NULL,0),(296,'','AT&T to Offer Novatel MiFi Liberate, First Hotspot with Touchscreen','AT&T to Offer Novatel MiFi Liberate, First Hotspot with Touchscreen','/!drafts/atandt-to-offer-novatel-mifi-liberate-first-hotspot-with-touchscreen','2012-09-27 17:55:00','2012-10-31 17:55:43',NULL,0),(404,'','Novatel Career Opportunities','','/about/careers/novatel-career-oppourtunities','2012-11-04 04:35:00','2012-11-05 21:41:39',NULL,0),(246,'','M2M Support','','/support/main/m2m-support','2012-10-15 18:09:00','2012-10-15 20:41:57',NULL,0),(247,'','M2M Documentation','','/support/main/m2m-documentation','2012-10-15 18:10:00','2012-10-15 20:42:01',NULL,0),(236,'Professional Services\r\n The Novatel Wireless professional services experience is driving a profound technology transformation and broadband wireless users are demanding ubiquitous connectivity for a host of new applications. Whether you are perfecting a reference design, developing a new product or modifying and existing application our design engineers can help. With a strong knowledge base, real-world experiences in a wide variety of market and vertical segments and a demonstrable, results driving mentality, Novatel Wireless delivers. \r\n Revolutionized antenna designs, creative communications solutions, small form factors, low-power consumption and more, Novatel Wireless brings real-world design experience to help you get there faster, with less effort and on-budget. \r\n Our Product Line Managers and Project Management office is comprised of a team of talented engineers with years of design and product development knowledge, built to work closely with your company to define a project, its time lines and deliverables. Once your project is approved, a dedicated Project Manager is assigned to ensure your ultimate success. \r\n Working in close partnership with our customers, Novatel Wireless has helped to bring many designs to life, shortening product development and deployment cycles. Whether you need to tweak a small parameter in your product, develop something new or start a project and have it managed from the ground up, we can provide the expertise to get your project moving in the right direction. \r\n The architecture helps make it simple, do you have a special design challenge or just want help getting past a small issue? No project is too small or too big; we have assisted many of today’s global 1000 companies with innovative designs, engineering assistance and creative ways to connect to their customers. \r\n    ','Professional Services','','/products/mobile-broadband-solutions/professional-services','2012-10-12 21:20:00','2012-11-01 18:59:25',NULL,0),(244,' Mobile Computing Carriers   Mobile Computing Distributors  Where To Buy  Integrated   OEM Embedded  ','Where To Buy','','/support/where-to-buy','2012-10-12 21:34:00','2012-11-06 23:36:12',NULL,0),(237,'Distributors ','Distributors','','/about/manufacturing-and-engineering/distributors','2012-10-12 21:21:00','2012-11-10 00:05:21',NULL,0),(238,'Industry ','Industry','','/about/manufacturing-and-engineering/industry','2012-10-12 21:21:00','2012-11-10 00:05:21',NULL,0),(239,'Solution Partners ','Solution Partners','','/about/manufacturing-and-engineering/solution-partners','2012-10-12 21:21:00','2012-11-10 00:05:21',NULL,0),(240,'The Connected Home\r\n From security panels to securing personal assets, energy-saving and green initiatives to connected Personal Area Networks (PANs), Enfora delivers exceptional wireless connectivity with the industry’s leading high performance communications platforms. Enabling real-time data for security and applications including alarm panels, intelligent locks, home monitoring devices and the latest in energy-saving PAN devices and high-speed routers, Enfora’s Enabler III and Enabler HS 1000 series of modules, deliver. \r\n With simple integrated devices and a host of embedded platforms — Enfora is empowering the connected home with resilient, high-speed, scalable, and reliable end-point connectivity solutions. Driven by the N4A Services Architecture, Enfora delivers a flexible, modular architecture capable of interfacing with ZigBee, Bluetooth and other near field technologies for fast wireless connectivity and solutions deployment.  \r\n Home Automation systems have been transformed with the N4A family of intelligent devices, from the Enabler III and HS embedded platforms to the family of SA Telemetry devices purpose-built for the time-sensitive data needed in the security and home automation markets. \r\n With intelligent backhaul communications through smart meters or residential gateways, information can be efficiently managed to effectively decrease energy usage. Enfora and its strategic partners deliver the data for better decision-making, improving performance safety and security for your treasured assets. \r\n Coupled with the robust N4A Communications and Management platform, devices can be provisioned, monitored and reconfigured remotely, most anywhere in the world. The Connected Home — Empowered Anywhere, Anytime.   ','Connected Home','','/our-partners/connected-home','2012-10-12 21:23:00','2012-11-09 22:48:28',NULL,0),(241,'Telemetry\r\n From the oil pipeline to the soft drink dispenser, today’s visionary companies rely on remote data communications to collect data from their remote assets, enhancing their bottom line by allowing their business to operate more efficiently through the management and utilization of critical, decision-based data. This certified, quad-band integrated IP-based platform is compact and economical, ensuring cost-effective connectivity in a small robust platform.  \r\n Designed with GSM/GPRS connectivity for global deployments, the SA family has been designed to enhance your visibility into remotely-located fixed assets. Similar to Enfora’s industry-leading portfolio of integrated Mobile Tracking products, the SA family connects the world’s leading companies to their fixed assets, Anywhere, Anytime.  \r\n Fixed assets of various types can benefit greatly from this fully programmable platform, with voice communications, a wide operational environment and much more. the units are designed to be easily deployed and provisioned, supplying critical information from industrial automation applications, supply and cold chain environments, fixed asset deployments, and a host of applications where companies require connectivity to serially-connected and sensor-generated data.  \r\n The SA family is part of Enfora’s intelligent telemetry devices, featuring superior performance in a small package for ultimate flexibility. Coupled with the robust N4A Management and Communications Software platform, devices can be provisioned, monitored and reconfigured remotely, most anywhere in the world. Driven by the services architecture, Enfora delivers a flexible, modular architecture for fast wireless asset tracking, solutions development and deployment. Keeping you connected to your company’s fixed and mobile assets, Anywhere, Anytime. \r\nPopular Use Cases for the Spider SA family:\r\n Spider SA-G+ - the SA-G+ is a full-featured telemetry platform with serial and user-defined I/O ports designed to communicate with sensors and most any serial-based communications device.  ','Telemetry','','/our-partners/telemetry','2012-10-12 21:23:00','2012-11-09 22:54:46',NULL,0),(273,'','CNET','A First Look: MiFi Liberate hotspot gets touchy','/!drafts/cnet','2012-10-30 13:50:00','2012-10-30 13:51:18',NULL,0),(242,'','Patents','','/our-expertise/innovation/patents','2012-10-12 21:25:00','2012-11-10 00:05:21',NULL,0),(243,'','Certifications','','/our-expertise/innovation/certifications','2012-10-12 21:25:00','2012-11-10 00:05:21',NULL,0),(248,'MT 2500\r\n Mobile Tracking Device   Legacy of Innovation \r\n The MT 2500, a certified quad-band, 3-axis accelerometer integrated device is optimized for today’s increasing demand for vehicle recovery, fleet management, and driver and vehicle profiling. Providing complete GSM/GPRS communications, Novatel Wireless helps you track and monitor vehicles from the family car to the largest fleet of commercial vehicles. \r\n Next Generation Technology \r\n Designed to be adaptable to multiple vertical markets including fleet, vehicle recovery, insurance, buy-here-pay-here and more, the new MT 2500 is offered as an economical solution providing enhanced vehicle tracking solutions to the market. With the introduction of the FOTA (Firmware-Over-The-Air) enabled quad band GSM/GPRS device with internal antennas, 3-axis accelerometer, analog inputs and other GPIO (General Purpose Input/Output), the MT 2500 ensures a feature rich solution with low implementation and operation costs.   Features  \r\n3-axis accelerometer for driver behavior reporting\r\nFlexible customization through built-in programmable rules engine and control automation capabilities\r\nPolygon geo-fencing and GPIO’s including analog inputs\r\nInternal antennas on the quad-band MT 2500 for economical installation andserviceability\r\nAuto-registration on power up\r\nFOTA enabled for remote upgrades\r\nIntegrated SMS for commands and messages\r\n\r\n      MT_2500_WEB.pdf  \r\nFleet Management\r\nVehicle Recovery\r\nDriver &amp; Vehicle Profiling\r\nInsurance Applications\r\nTelematics\r\nBuy-Here, Pay-Here\r\n ','MT 2500','The MT 2500, a certified quad-band, 3-axis accelerometer integrated device is optimized for today’s increasing demand for vehicle recovery, fleet management, and driver and vehicle profiling. Providing complete GSM/GPRS communications, Novatel Wireless helps you track and monitor vehicles from the family car to the largest fleet of commercial vehicles.','/products/integrated-m2m-solutions/mobile-tracking/mt-2500','2012-10-19 21:24:00','2012-11-10 00:38:21',NULL,0),(210,' Product Description \r\n Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.  Product Title ','',NULL,NULL,'2012-09-12 17:12:47','2012-11-01 18:33:11',NULL,0),(252,'MT 3000\r\n Mobile Tracking Device   Legacy of Innovation \r\n The MT 2500, a certified quad-band, 3-axis accelerometer integrated device is optimized for today’s increasing demand for vehicle recovery, fleet management, and driver and vehicle profiling. Providing complete GSM/GPRS communications, Novatel Wireless helps you track and monitor vehicles from the family car to the largest fleet of commercial vehicles. \r\n Next Generation Technology \r\n The MT 3000 is an innovative plug-n-play device with internal antennas providing complete GSM/GPRS communications. It supports a host of vehicle engine OBDII permitted protocols while still providing customizable MT features including GPS location, ignition, geo-fencing, trip reporting and events. Combined with the on-board 3-axis accelerometer, the MT 3000 also has built-in threshold events to capture metrics critical to effective fleet and insurance monitoring such as excessive engine speed, rapid acceleration, harsh braking, speed violations, and excessive idling.   Features     \r\n\r\nVehicle diagnostics and reporting capabilities\r\nSupports a host of OBDII permitted protocols\r\nCompact, lightweight, low profile design\r\nIntegrated SMS for commands and messages\r\nOptimized 3-axis accelerometer for driver behavior monitoring\r\nFlexible customization through built-in programmable rules engine\r\n\r\n   \r\n      MT_3000_WEB.pdf  \r\nFleet Management\r\nUser Based Insurance (UBI)\r\nTelematics\r\nTeen Tracking\r\nDriver &amp; Vehicle Profiling\r\nVehicle/Driver \r\nSafety &amp; Security\r\n ','MT 3000','The MT 3000 is an innovative device providing customizable features including GPS location, ignition, geofencing, trip reporting, and event logging. It also has built-in programmable thresholds to capture metrics critical to effective fleet and insurance monitoring of both vehicle and driver, such as rapid acceleration, harsh braking, speed violations, and excessive idling, excessive engine speed, low vehicle battery, check engine light, trip distance, and more.','/products/integrated-m2m-solutions/mobile-tracking/mt-3000','2012-10-19 21:35:00','2012-11-10 00:39:11',NULL,0),(253,'MT 3050\r\n Mobile Tracking Device   Legacy of Innovation \r\n Expanding the Novatel Wireless MT series of products for application service providers, system integrators, enterprises and insurers in the global Fleet Management and Usage-Based Insurance market verticals, the MT 3050 offers an innovative OBDII plugand- play design, enhanced performance utilizing innovative antenna design and a disconnect alert feature using an in-device backup battery, and is available in GSM/GPRS, 1xRTT or HSDPA versions. \r\n Next Generation Technology \r\n The MT 3050 is a flexible telematics solution built for both Fleet Management where managers are charged with improving safety, increasing productivity and reducing costs, as well as for Insurance Telematics or Usage-Based Insurance (UBI) for Pay-As-You- Drive/Pay-How-You-Drive programs, which give the consumer, and even fleets, more control over their insurance premiums through driver behavior reporting, speed violation alerts, distance and duration traveled, and time of day reporting. Novatel Wireless has assembled the complex device and networking components required to build successful and profitable UBI programs, supporting market specific requirements and simplifying UBI program creation and large scale deployments.   Features     \r\n\r\nIndustry leading small plug-and-play form factor for simple s elf-installation\r\nFlexible wireless network technology options (GPRS, CDMA, 1xRTT, and HSDPA versions)\r\nAdvanced application customization through Smart Agent programmable rules and event engine\r\nTri-axis advanced digital accelerometer for motion detection and driver behavior reporting\r\n”Disconnect Alert” for when the device has been removed from the vehicle’ s OBDII port\r\nNo external SIM access for tamper resistance\r\n\r\n   \r\n      MT_3000_WEB.pdf  \r\nFleet Management\r\nTeen Tracking\r\nUser Based Insurance (UBI)\r\nDriver &amp; Vehicle Profiling\r\nTelematics\r\nVehicle/Driver \r\nSafety &amp; Security\r\n ','MT 3050','The MT 3050 is Novatel Wireless’ newest product in the successful Enfora® MT series of OBD-II devices.  The MT 3050 has multiple air interfaces on the same board and housing and provides these technologies through three product SKUs: a quad-band GSM/GPRS version, a dual band 1xRTT (CDMA2000) version, and a dual-band HSDPA/UMTS (+ quad-band GPRS/EDGE) version','/products/integrated-m2m-solutions/mobile-tracking/mt-3050','2012-10-19 22:19:00','2012-11-10 00:39:47',NULL,0),(255,'MT 4000\r\n Mobile Tracking Device   Legacy of Innovation \r\n Designed for application providers, system integrators, and enterprise customers to optimize mobile resources and improve their bottom line, the MT 4000 is a flexible quad-band GSM/GPRS mobile tracking device, delivering the key product features powering the most demanding applications: fleet management, insurance telematics, teen tracking, vehicle location and recovery, and more. \r\n Next Generation Technology \r\n With superior GPS location performance, a robust programmable rules engine, driver behavior reporting, geo-fencing, SMS commands, messaging and much more, the MT 4000 is designed for flexible solution deployment. The MT 4000 also includes optional routing and optimization with Garmin® FMI (Fleet Management Interface) - a key part of today’s most useful, versatile and cost-efficient fleet management solutions.   Features  \r\nFlexible application customization through Smart Agent programmable rules and event engine\r\nInnovative internal cellular and GPS antenna design\r\nConfigurable driver behavior reporting, polygon geo-fencing, driver ID, and multiple GPIO capabilities\r\nSerial interface and Smart Agent support for optional Garmin FMI (Fleet Management Interface) v2.7 with speed limit alerts\r\nDeep sleep and low power management for 12 V &amp; 24 V passenger cars, trucks, and transit vans worldwide\r\n\r\n      MT_4000_WEB.pdf  \r\nFleet Management\r\nEmergency Response Vehicles\r\nUser Based Insurance (UBI)\r\nService &amp; Small Fleet Operations\r\nVehicle Leasing  Recovery\r\nTransportation &amp;  Trucking\r\n ','MT 4000','The feature-rich MT 4000 is a quad-band GSM/GPRS solution that supports driver behavior monitoring and reporting.  With a 22-pin connector, the MT 4000 provides many GPIO options including: 1-Wire® Driver ID; latched outputs; ignition sense; digital and analog inputs; and serial interface.  It also has internal cellular and GPS antennas, dual three-axis accelerometers, 12V and 24V vehicle support, an ultra-low power sleep mode, store-and-forward messaging, and support for Garmin® Fleet Management Interface (FMI).','/products/integrated-m2m-solutions/mobile-tracking/mt-4000','2012-10-19 22:24:00','2012-11-10 00:40:19',NULL,0),(256,'MT 4100\r\n Mobile Tracking Device   Features  \r\nFlexible application customization through Smart Agent programmable rules and event engine\r\nInnovative internal cellular and GPS antenna design\r\nConfigurable driver behavior reporting, polygon geo-fencing, driver ID, and multiple GPIOs\r\nSmart Agent support for Garmin FMI (Fleet Management Interface) v2.6 with speed limit alerts (optional licensed feature)\r\nDeep sleep and low power management for 12 V &amp; 24 V passenger cars, trucks, and transit vans worldwide\r\nAir interface options: CDMA 1xRTT, and HSDPA\r\n\r\n     Legacy of Innovation \r\n The MT 4100 from Novatel Wireless is a full-featured telematics solution designed for application providers, system integrators, and enterprise customers to optimize mobile resources and improve their bottom line. The MT 4100 builds upon its predecessors with enhanced performance and additional digital inputs and a spare RS-232 port. Flexible and easy to deploy, the MT 4100 delivers the key product features that drive the most demanding global applications: fleet management, insurance telematics, stolen vehicle recovery, and more. \r\n \r\n Next Generation Technology \r\n Once fitted to a vehicle and integrated to a fleet management application, fleet managers see immediate return on investment with improvements in driver productivity and performance throughout the day with instant vehicle location monitoring. The MT 4100 delivers on critical features to drive efficiencies and reduce operational costs offering two serial interfaces, 1-wire driver ID support, multiple GPIO, polygon geo-fencing, driver behavior reporting, optional backup battery, and much more. The MT 4100 also includes optional routing and optimization with Garmin® FMI (Fleet Management Interface) - a key part of today’s most useful, versatile and cost-efficient fleet management solutions. \r\n    MT_4000_WEB.pdf  \r\nFleet Management\r\nEmergency Response Vehicles\r\nUser Based Insurance (UBI)\r\nService &amp; Small Fleet Operations\r\nVehicle Leasing Recovery\r\nTransportation &amp; Trucking\r\n ','MT 4100','The feature-rich MT 4100 is a dual-band 1xRTT (CDMA2000) and HSDPA/UMTS two-SKU solution that supports driver behavior monitoring and reporting.  With a 22-pin connector, the MT 4100 provides many GPIO options including: 1-Wire®Driver ID; expanded I/O including digital, analog, and latched outputs; ignition sense; and two serial interfaces.  It also has internal cellular and GPS antennas, 12V and 24V vehicle support, an ultra-low sleep mode, store-and-forward messaging, and support for Garmin® Fleet Management Interface (FMI).','/products/integrated-m2m-solutions/mobile-tracking/mt-4100','2012-10-19 22:25:00','2012-11-10 00:40:54',NULL,0),(257,' Features  ·       Optimized for the longest battery life of all Enfora® AT Series devices: up to 5 years of operation depending on usage patterns \r\n·       Fully integrated with multiple mounting options with no need for external antennas \r\n·       Onboard 3-axis accelerometer for configurable security options \r\n·       Environmental ratings for harsh installation environments – IP 66/68/69 &amp; ATEX Zone 2 \r\n·       Simplified over-the-air provisioning and device management delivered through the N4A Communications &amp; Management service delivery platform   Legacy of Innovation \r\nDesigned for system integrators, network operators, and enterprise companies charged with managing a myriad of assets to control and reduce operational costs, improve asset utilization, and provide better customer service through asset visibility, the AT 3000 provides IP 66/68/69 rating and ATEX Zone 2 certification with up to a 5 year configurable battery life. Fixed or mobile, assets need to be monitored for regulatory compliance, security, national defense, operational efficiencies or just peace of mind.  \r\n Asset Monitoring for the Next Generation \r\nThe GSM/GPRS-based quad-band AT 3000 features a 3-axis accelerometer for motion detection, and includes onboard geo-fencing capabilities as well as dynamic geo-fencing for asset security, locking assets to new locations without the need for over-the-air reconfiguration. The AT 3000 can be provisioned through the N4A™ Communications and Management platform to optimize motion detection, location monitoring, reporting and geo-fencing capabilities, all of which will help match battery life and service availability to the application.  AT 3000\r\n Battery-powered Asset Tracking Device    AT_3000_WEB.pdf  \r\nRegulatory Compliance\r\nNational Defense\r\nAsset Utilization\r\nHAZMAT\r\nTruck or Rail Shipments\r\nShipping Containers: Logistics\r\nSecurity\r\nConstruction\r\n ','AT 3000','The long-life battery-powered Enfora® AT 3000 is a quad-band integrated device with internal GSM/GPRS and GPS antenna functionality for mobile asset monitoring. Based on the Enfora® Enabler® Series module, the built-in programmable software environment enables essential capabilities such as mobile connectivity, location awareness, and device intelligence.','/products/integrated-m2m-solutions/asset-tracking/at-3000','2012-10-19 22:29:00','2012-11-10 00:42:26',NULL,0),(259,'Mini MT\r\n Personal Tracking Device  Legacy of Innovation The certified quad-band Mini MT is optimized for today’s demanding mobile workforce and private citizens where location based safety, security and connectivity are paramount. Providing complete GSM/GPRS communications Novatel Wireless helps you track and monitor your workforce from the lone-worker to the operators of small fleets - and closer to home; the Alzheimer’s patient, children, teenagers on the go and a host of other applications. \r\nNext Generation Technology  Excellent GPS performance and sensitivity in a small, ruggedized voice enabled platform. The Mini MT is fully programmable with panic/emergency response button, two-way voice communications, messaging and much more. The units are designed to be easily deployed and provisioned supplying critical information for the most demanding workforce tracking applications. This device is designed with a motion sensor and vibrating alerts for personal and remote worker programs of all sizes.   Features  \r\nQuad-band GSM/GPRS (850/900/1800/1900 MHz)\r\nMotion sensor and vibrating alerts\r\nDesigned for personal/remote worker programs\r\nFOTA (Firmware-Over-The-Air) enabled for remote upgrades\r\nRugged and voice enabled\r\nProgrammable with panic/emergency response button\r\n   Mini_MT_WEB.pdf  \r\nPersonal &amp; Remote Worker Tracking\r\nEmergency Response\r\nChild &amp; Teen Tracking\r\nElderly Locator\r\nMobile/Home Healthcare\r\n\r\n    ','Mini MT','The certified quad-band Mini MT is optimized for today’s demanding mobile workforce and private citizens where location based safety, security and connectivity are paramount. Providing complete GSM/GPRS communications Novatel Wireless helps you track and monitor your workforce from the lone-worker to the operators of small fleets - and closer to home; the Alzheimer’s patient, children, teenagers on the go and a host of other applications.','/products/integrated-m2m-solutions/professional-services/mini-mt','2012-10-19 22:31:00','2012-11-10 00:46:21',NULL,0),(260,'Enabler IIIG\r\n Dual-Band/Quad-Band Module   Diverse Options \r\n The Enabler IIIG is form factor compatible across GPRS modules, allowing manufacturers tremendous flexibility and versatility in developing and deploying worldwide solutions. \r\n Versatile Design \r\n The modular architecture is shared across all platforms and powered by a programmable rules engine. The network router, control, and automation capabilities provide manufacturers with a flexible structural design for rapid product development and deployment.   Features  \r\n100-pin connector form factor is compatible across technolog ies\r\nOptional SIM carrier provides smallest overall system size\r\nIntegration with N4A Software for quick development and deployment\r\nVoice\r\nSMS\r\nPacket Data\r\nTCP/IP and UDP/IP software stack with Packet Assembler Disassembler\r\nNetwork router and control/automation\r\n  Datasheets    Enabler_IIIG_Dual_WEB.pdf \r\n  Enabler_IIIG_Quad_WEB.pdf   Use Cases  \r\nSecurity/Safety/Alarm\r\nUtilities\r\nTelemetry\r\nTelematics\r\nAMR/AMI End Points\r\nRemote Monitor/Control (RMAC)\r\nTransportation\r\nAutomotive\r\n\r\n    ','Enabler IIIG','The Enabler IIIG is form factor compatible across GPRS modules, allowing manufacturers tremendous flexibility and versatility in developing and deploying worldwide solutions.','/products/integrated-m2m-solutions/m2m-modules/enabler-iiig','2012-10-19 22:32:00','2012-11-10 00:36:03',NULL,0),(261,'HS 3001\r\n CDMA/1xRTT Module   Diverse Options \r\n The HS 3001 is form factor compatible across 1xRTT modules, allowing manufacturers tremendous flexibility and versatility in developing and de