n\r\n     Datasheets    Enabler_HS_3002_WEB.pdf  \r\nSecurity/Safety/Alarm\r\nUtilities\r\nTransportation\r\nTelemetry\r\nAMR/AMI End Points\r\nRemote Monitor/Control (RMAC)\r\nTelematics\r\nmHealth\r\n ','HS 3002','The HS 3002 is form factor compatible across HSDPA modules, allowing manufacturers tremendous flexibility and versatility in developing and deploying worldwide solutions.','/products/integrated-m2m-solutions/m2m-modules/hs-3002','2012-10-19 22:34:00','2012-11-10 00:37:00',NULL,0),(263,'Enabler III Abundant Integrator Choices\r\n At Novatel Wireless, we know that each module integrator has unique design goals, technical constraints, and business drivers and that no two roadmaps are alike. For that reason we provide our GSM/GPRS integrators with a generous and flexible line of cellular module choices with our Enabler® IIIG Series of OEM modules.  Customer loyalty is important to us, so we maintain a broad line of module options that you can count on long after you go to market. Some of these choices include: \r\n ·       Dual- or Quad-band radio modems \r\n ·       100-pin Molex® and Ball grid array (BGA) I/O connections \r\n ·       Texas Instrument chipset \r\n ·       Optional SIM connection \r\n ·       Board-to-board (B2B), micro or ultra-mini coaxial, or pin RF connections \r\n ·       Expandable I/O  \r\nCustomer-Centric Expansion \r\nBecause we value our M2M customers and understand the complexities module integrators face, we’ve designed our Enfora® Enabler® Series module expansion around you to create a made-for-migration technology line. Most Enfora® 2G GSM/GPRS modules in the Enabler® IIIG Series are upwardly compatible with our newer 2G and 3G Enabler® HS Series modules.  \r\n As we designed our newest series members we took into account the ease of transition needed for our current customers and created a “common-by-design” module roadmap. We preserved the 100-pin I/O and B2B RF connectors as well as a compatible x-y size and mounting of our most popular Enabler® IIIG products. Beyond this we maintained the same firmware API, including our mission-critical Smart Agent events engine. Keeping these items standard ensures that—whether you’re a new or existing Enabler® IIIG customer—if your needs change and migration becomes essential, you’ll not only be able to substitute a compatible module using our simple transition guide, but also reuse most of your valuable script features. \r\nArchitected for Target Applications &amp; Global Markets\r\n A strong differentiator of our Enabler® IIIG cellular modems that’s not immediately obvious is that—beyond working with world-class chipset manufacturers and integrating our actionable intelligence into our designs—we calibrate and align our hardware and low-level firmware to accommodate the needs of the target applications. So whether your battery-free telematics application needs extra low power or your fixed exterior monitoring site needs extended low temperature, we have you covered.  Some key target applications include: \r\n\r\n\r\n\r\n·     Security/Safety/Alarm\r\n·    Utilities\r\n·    Telemetry\r\n·    Telematics\r\n\r\n\r\n·     AMR/AMI End Points\r\n·    Remote Monitor/Control (RMAC)\r\n·    Transportation\r\n·    Automotive\r\n\r\n\r\n\r\n    ','Enabler III','Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.','/products/integrated-m2m-solutions/m2m-modules/enabler-iii','2012-10-19 22:35:00','2012-10-23 19:10:11',NULL,0),(264,' Driving Business Applications   Advanced Monitoring &amp; Visibility  The SA-G+ is available in two product SKUs, based on air interface. Our original Enfora® SA Series device, the quad-band GSM/GPRS SA-G+ provides serial connectivity plus voice/data/SMS and a SIM locking security feature designed for low power, extended temperature applications for the global market. Our newest series device is a dual-band 1xRTT (CDMA2000) SA-G+, which provides simplicity and economy in a serial-connected telemetry device. With increased uplink/downlink speeds, SMS, and the same extended temperature profile as the GSM/GPRS version, the SA-G+ 1xRTT is designed for North American applications.   All Enfora® SA Series devices are designed for full compatibility with our N4A® Software Platformthat includes the N4A® Communications and Management Software (CMS) and N4A® Device Manager. These on-premise or cloud-based solutions provide accelerated device provisioning, deployment, shipping, monitoring, and tracking worldwide.   With Novatel Wireless’ SA-G+ M2M hardware, standard Firmware Over-the-Air (FOTA) upgrades, and a targeted N4A® Software solution for your unique enterprise needs, you’ll experience a level of visibility and control over your field deployed machines and other static assets that will free up resources, increase immediacy of your decisions, and lessen your overall risk.  SA-G+\r\n Telemetry Platform    SA-G_WEB.pdf  \r\nWireless POS Terminal\r\nSafety &amp; Security\r\nVending Machines\r\nPublic Traffic  Services\r\nGauge Monitoring (light, water, telephone)\r\nRemote Monitoring Automation and Control (RMAC)\r\nIndustrial/SCADA\r\nService/Maintenance (gas fields/chemical plants/water)\r\nKiosks, Billboards (Public Service, other)\r\nParking Meters\r\nElectricity Tower Monitoring\r\n With its compact design and low power consumption, the SA-G+ is an ideal device to connect remote assets requiring low data throughput to the cloud via advanced monitoring to the business enterprise.  ','SA-G+','With its compact design and low power consumption, the SA-G+ is an ideal device to connect remote assets requiring low data throughput to the cloud via advanced monitoring to the business enterprise.','/products/integrated-m2m-solutions/telemetry/sa-g','2012-10-19 22:36:00','2012-11-10 01:01:24',NULL,0),(433,' Title \r\n Lorem ips