n San Diego (California), Calgary (Canada), Basingstoke, (United Kingdom), and Shanghai (China). Financially Secure- Novatel Wireless is cash strong with no debt; founded in 1996, IPO in 2000. \r\nThis position may be filled at Staff or Principal level depending upon experience. \r\nMain Duties: \r\nImplement &amp; validate customer requirements for Novatel products. \r\nDevelop all aspects of the device software, including device drivers, radio interfaces, power management and embedded applications. \r\nSupport and debug issues pertaining to certifying NVTL data products through customer labs and certification processes. \r\nRequired Knowledge:  \r\n•    Solid knowledge of wireless technologies in 2G/3G/4G.  Must have 4 years experience working in any of those wireless technologies. \r\n•    Strong C, C++ programming skills in an embedded RTOS environment.  Must have 6 years coding experience in the embedded environment. \r\n•    Good knowledge of software development lifecycle. \r\n•    Excellent coding, documentation, and debugging practices. \r\n•    Worked with Lauterbach JTAG ICD/ICE. \r\n•    Must have ability to debug complex hardware/software interactions in an embedded RTOS environment working alongside hardware design team. \r\nRequired Experience:  \r\n6 years of experience working within embedded environment. \r\nEducation:  \r\nRequires BS/MS degree in EE/CE/CS disciplines. \r\nCompensation &amp; Benefits: Our successful candidate will be entitled to a compensation package commensurate with qualifications, experience and performance, plus a comprehensive benefits plan. \r\nHow to Apply: \r\nThank you for your interest on becoming part of our innovative, market leading wireless family. \r\n• Please select the “apply to” button on top of the page above the skills needed section. \r\n• Candidates that complete the technical questions (If listed) receive special priority. \r\n• Please feel free to apply for more than 1 position or refer a friend as we are always looking to build great teams.  ','Staff/Principal Firmware Engineer','','/about/careers/novatel-career-oppourtunities/staffprincipal-firmware-engineer','2012-11-04 12:32:00','2012-11-04 13:04:44',NULL,0),(395,'The MiFi® Intelligent Mobile Hotspot Operating System—More than Mobile Connectivity  With the MiFi OS™ the MiFi Intelligent Mobile Hotspot provides more than mobile connectivity alone. The MiFi OS offers a flexible, powerful platform to browse, install, update and develop applications and run them on the MiFi device. With the MiFi web interface users can access widgets, applications and files using any Wi-Fi enabled device, eliminating the need to install and maintain software on multiple products. \r\n With the MiFi OS, you can: \r\n\r\nCustomize and enhance your mobile experience.\r\nRun applications on the MiFi OS without having to install software on each connecting Wi-Fi device.\r\nCheck your data usage in real time and see details about connected devices.\r\nSend and receive text messages from any web browser using the MiFi device\'s mobile broadband account.\r\nUse the MiFi device\'s GPS to get the local weather forecast or search nearby locations.\r\nSeamlessly share media across multiple devices simultaneously using the MiFi DLNA® Server.\r\nAccess files both locally and on the cloud from any web enabled device.\r\n  Applications Available  \r\nAutoVPN – Provide secure VPN access to all connected devices without installation or configuration.\r\nMiFi DLNA Server – Browse, stream and play movies, music and photos on any DLNA-compatible Wi-Fi device.\r\nData Usage – Proactively manage your broadband usage with current data usage statistics.\r\nConnected Devices – See which devices are currently connected to the MiFi device.\r\nSMS Messaging – Send and receive text messages from any browser-enabled device.\r\nGeoSearch – Search near your current location for businesses, services, directions and more.\r\nGeoWeather – See the current weather and forecast wherever you are or want to be.\r\nFile Sharing – Insert your microSD™ or microSDHC™ card into the MiFi device and share files securely across connected devices.\r\n ','MiFi® OS','With the MiFi OS™ the MiFi Intelligent Mobile Hotspot provides more than mobile connectivity alone. The MiFi OS offers a flexible, powerful platform to browse, install, update and develop applications and run them on the MiFi device. With the MiFi web interface users can access widgets, applications and files using any Wi-Fi enabled device, eliminating the need to install and maintain software on multiple products.','/products/mobile-broadband-solutions/software/mifi-os','2012-11-01 18:21:00','2012-11-01 19:25:51',NULL,0),(369,'AT 3010\r\n Battery-powered Asset Tracking Device   Legacy of Innovation \r\n Designed for system integrators, network operators, and enterprise companies charged with managing a myriad of assets to control and reduce operational costs, improve asset utilization, and provide better customer service through asset visibility, the AT 3010 provides IP 66/68/69 rating and ATEX Zone 2 certification with up to a 5 year configurable battery life. Fixed or mobile, assets need to be monitored for regulatory compliance, security, national defense, operational efficiencies or just peace of mind. \r\n Asset Monitoring for the Next Generation \r\n The GSM/GPRS-based quad-band AT 3010 is purpose-built for cold temperature environments (up to -40C) without sacrificing performance and while maintaining up to four (4) years of continuous operation (based on configuration and reporting frequency). The AT 3010 features a 3-axis accelerometer for motion detection, and includes onboard geo-fencing capabilities as well as dynamic geo-fencing for asset security, locking assets to new locations without the need for over-the-air reconfiguration. The AT 3010 can be provisioned through the N4A Communications and Management platform to optimize motion detection, location monitoring, reporting and geo-fencing capabilities, all of which will help match battery life and service availability to the application.   Features  \r\nIdeal for colder environments (up to -40C) while still providing up to four (4) years of operation based on configuration and reporting frequency\r\nFully integrated with multiple mounting options with no need for external antennas\r\nOnboard 3-axis accelerometer for configurable security options\r\nEnvironmental ratings for harsh installation environments – IP 66/68/69 &amp; ATEX Zone 2\r\nSimplified over-the-air provisioning and device management delivered through the N4A Communications &amp; Management service delivery platform\r\n   AT_3010_WEB.pdf  \r\nInsurance Applications\r\nAsset Utilization/Recovery\r\nLeasing\r\nHigh-Value Asset Monitoring\r\nSecurity\r\nConstruction\r\n\r\n    ','AT 3010','Designed for system integrators, network operators, and enterprise companies charged with managing a myriad of assets to control and reduce operational costs, improve asset utilization, and provide better customer service through asset visibility, the AT 3010 provides IP 66/68/69 rating and ATEX Zone 2 certification with up to a 5 year configurable battery life. Fixed or mobile, assets need to be monitored for regulatory compliance, security, national defense, operational efficiencies or just peace of mind.','/products/integrated-m2m-solutions/asset-tracking/at-3010','2012-10-30 21:53:00','2012-11-10 00:43:46',NULL,0),(269,'MT-Gμ\r\n Mobile Tracking Device   Legacy of Innovation \r\n The certified quad-band MT-Gu is optimized for today’s increasing demand for vehicle recovery, fuel-efficient fleet operations, driver and vehicle profiling, and interactive communications. Providing complete GSM/GPRS communications Novatel Wireless helps you track and monitor vehicles from the family car to the largest fleet of commercial vehicles. \r\n Next Generation Technology \r\n With superior GPS sensitivity, enhanced business intelligence logic provided by the programmable rules engine, polygon geo-fencing, integrated SMS commands, messaging and much more. The units are designed to be easily deployed and provisioned supplying critical information for the most demanding fleet operator, the buy-here pay-here dealers to the pay as you go insurance company.   Features  \r\nSupport for Garmin’s Fleet Management Interface (FMI) (optional)\r\nFlexible customization through built-in programmable rules engine &amp; control automation capabilities\r\nWireless data and voice port available\r\nPolygon geo-fencing and GPIO’ s\r\nAuto-registration on power up\r\nInternal battery back-up allows for continued operation when main input power is removed\r\nFOTA enabled for remote upgrades\r\nIntegrated SMS for commands and messages\r\nNow with 3-axis accelerometer for driver behavior reporting\r\n\r\n      MT-G_WEB.pdf  \r\nFleet Management\r\nEmergency Response\r\nHigh-end Buy-Here, Pay-Here\r\nUser Based Insurance (UBI)\r\nVehicle Recovery\r\nDriver &amp; Vehicle Profiling\r\nTelematics\r\nOver-the-Road Carriers\r\n ','MT-Gu','The certified quad-band MT-Gu is optimized for today’s increasing demand for vehicle recovery, fuel-efficient fleet operations, driver and vehicle profiling, and interactive communications. Providing complete GSM/GPRS communications Novatel Wireless helps you track and monitor vehicles from the family car to the largest fleet of commercial vehicles.','/products/integrated-m2m-solutions/mobile-tracking/mt-gu','2012-10-24 20:17:00','2012-11-10 00:41:33',NULL,0),(271,'Ovation MC551 4G LTE USB Modem    \r\nOvation™ MC551 4G LTE Modem The 4G LTE Ovation™ MC551 is the next generation of the Novatel Wireless Ovation USB mobile broadband modem portfolio, building on award-winning innovation and design, proven performance and industry-leading flexibility and reliability.      \r\nStay Connected This 4G LTE USB modem provides LTE peak download speeds of up to 100 Mbps*(theoretical) and peak upload speeds of up to 50 Mbps. Designed with 3G CDMA 1xEVDO Rev A backwards compatibility, the MC551 will ensure you stay connected.  Slim, durable and compact design The 4G LTE Ovation MC551 is the market\'s slimmest and most compact 4G LTE North America USB modum currently available.   Advanced Antenna Technology Novatel Wireless proprietary internal advanced antenna design optimized for best performance  \r\n Additional Features   \r\n\r\nHinge USB connector for flexible orientation\r\nWindows® / Mac® /Linux® compatible\r\nMobiLink Connection Manager software\r\nVPN/NDIS support  \r\n\r\n \r\n    ','Ovation MC551 4G LTE USB Modem','Experience life in the fast lane with blazing fast 4G LTE mobile broadband!  \r\nIntroducing the 4G LTE Ovation™ MC551 by Novatel Wireless.','/products/mobile-broadband-solutions/usb-devices/ovation-mc551-4g-lte-usb-modem','2012-10-29 16:56:00','2012-10-31 22:03:12',NULL,0),(274,'','A First Look: MiFi Liberate hotspot gets touchy','A First Look: MiFi Liberate hotspot gets touchy','/news-and-events/in-the-news/a-first-look-mifi-liberate-hotspot-gets-touchy','2012-10-10 13:53:00','2012-10-31 17:25:14',NULL,0),(222,' See More Mobile Devices &gt;  MiFi® 4620L  MiFi® 4620L Intelligent Mobile Hotspot \r\n Fast, always-on Internet wherever you roam—worldwide* With the Verizon Jetpack™ 4G LTE Mobile Hotspot MiFi® 4620L by Novatel Wireless, access blazing fast 4G LTE and 3G mobile broadband worldwide and share your connection with up to ten Wi-Fi enabled devices simultaneously. MiFi 4620L is the next generation in the Novatel Wireless MiFi intelligent mobile hotspot portfolio for Verizon Wireless, built on award-winning innovation and design, proven performance and industry leading user experience. \r\n Put the world in the palm of your hand With this 4G LTE MiFi intelligent mobile hotspot, enjoy fast Internet access whenever, wherever you go. MiFi 4620L is backward compatible with high speed DC HSPA+, HSPA+, WCDMA, EDGE and GPRS technologies to keep you connec