™ 4G LTE Mobile Hotspot MiFi® 4620L by Novatel Wireless, access blazing fast 4G LTE and 3G mobile broadband worldwide and share your connection with up to ten Wi-Fi enabled devices simultaneously. MiFi 4620L is the next generation in the Novatel Wireless MiFi intelligent mobile hotspot portfolio for Verizon Wireless, built on award-winning innovation and design, proven performance and industry leading user experience.','/products/mobile-broadband-solutions/usb-devices/mifi-4620l-2-2','2012-09-11 19:44:00','2012-10-30 21:25:59',NULL,0),(277,' Introducing the next generation MiFi device by Novatel Wireless, MiFi 2, the world’s first mobile hotspot with a touchscreen display and the most feature rich mobile hotspot available.  \r\n Novatel Wireless has again set the design and usability standard for mobile connectivity with this next generation device that puts freedom at your fingertips. This next generation MiFi device\'s new iconic design and leap-forward innovation take Novatel Wireless\' industry leading user experience to new levels of ease and functionality. MiFi 2\'s vibrant, feature-rich touchscreen makes it easier than ever to connect up to 10 Wi-Fi enabled devices to fast 4G LTE™ Internet. You can check data usage, manage connected devices, change settings, enable MiFi Media Center and more…directly on the touchscreen. With up to 11 hours of battery life and the industry’s most advanced security features, MiFi 2 lets you connect with confidence and power through your day.  \r\n Experience MiFi 2 soon, with the all-new MiFi Liberate by AT&amp;T…  MiFi® 2\r\n Next Generation MiFi – Available soon with AT&amp;T    mifi_liberate_datasheet.pdf  ','MiFi® 2 – Next Generation MiFi – Available soon with AT&T','A brilliant interactive touchscreen, 11 hour battery and 4G LTE connectivity for up to 10 devices for the best user experience ever imagined.\r\nIntroducing the next generation MiFi device by Novatel Wireless, the world’s first mobile hotspot with a touchscreen display and the most feature rich mobile hotspot available.','/products/mobile-broadband-solutions/mifi-intelligent-mobile-hotspots/mifi-2-next-generation-mifi-available-soon-with-atandt','2012-10-30 21:43:00','2012-11-10 00:56:37',NULL,0),(297,'','AT&T MiFi Liberate shares 10hrs of LTE with touchscreen simplicity','AT&T MiFi Liberate shares 10hrs of LTE with touchscreen simplicity','/!drafts/atandt-mifi-liberate-shares-10hrs-of-lte-with-touchscreen-simplicity','2012-09-27 17:55:00','2012-10-31 17:56:25',NULL,0),(278,' Features   Features \r\n\r\nConnects up to five Wi-Fi enabled devices simultaneously\r\nComputers, PDAs, cameras, music players, personal and game players and more\r\nRechargeable Lithium Ion Battery \r\nGPS-enabled\r\nAdvanced internal antenna system\r\nNovaSpeed® Capable\r\nBuilt-in security\r\n  Benefits   Benefits \r\n\r\nWireless and secure internet connectivity from virtually anywhere\r\nPortable and convenient – smaller than a deck of cards\r\nGreat for travel – family, friends and colleagues can connect\r\nPerfect for the mobile professional – creates a virtual office wherever you go for you and your co-workers\r\nEnhanced performance and less connectivity interruptions with NovaSpeed®\r\n  MiFi®.  Freedom. My Way.®  \r\n The 4G LTE MiFi 4510 is the next generation of the Novatel Wireless MiFi Intelligent Mobile Hotspot portfolio, building on award winning innovation and design, proven performance and industry-leading flexibility, convenience, and reliability.  Experience life in the fast lane with blazing fast 4G LTE mobile broadband.  The reliable MiFi 4510 is backward compatible with the 3G CDMA 1XEvDO Rev A network and includes new features, such as integrated status display on the device showing signal strength, roaming, battery level, and number of devices connected.  MiFi® 4510\r\n Intelligent Mobile Hotspot for LTE Networks  ','MiFi® 4510 - Intelligent Mobile Hotspot for LTE Networks','The 4G LTE MiFi 4510 is the next generation of the Novatel Wireless MiFi Intelligent Mobile Hotspot portfolio, building on award winning innovation and design, proven performance and industry-leading flexibility, convenience, and reliability.  Experience life in the fast lane with blazing fast 4G LTE mobile broadband.  The reliable MiFi 4510 is backward compatible with the 3G CDMA 1XEvDO Rev A network and includes new features, such as integrated status display on the device showing signal strength, roaming, battery level, and number of devices connected.','/products/mobile-broadband-solutions/mifi-intelligent-mobile-hotspots/mifi-4510-intelligent-mobile-hotspot-for-lte-networks','2012-10-30 21:53:00','2012-11-01 22:03:14',NULL,0),(298,'','Touchscreen LTE-ready mobile hotspot to be offered by AT&T','Touchscreen LTE-ready mobile hotspot to be offered by AT&T','/!drafts/touchscreen-lte-ready-mobile-hotspot-to-be-offered-by-atandt','2012-09-27 17:56:00','2012-10-31 17:57:04',NULL,0),(299,'','AT&T’s new MiFi Liberate is LTE-capable, ‘world’s first’ with touchscreen display','AT&T’s new MiFi Liberate is LTE-capable, ‘world’s first’ with touchscreen display','/!drafts/atandts-new-mifi-liberate-is-lte-capable-worlds-first-with-touchscreen-display','2012-09-27 17:57:00','2012-10-31 17:57:34',NULL,0),(300,'','US HOT STOCKS: Tempur-Pedic, Thor Industries, Discover, Achillion','US HOT STOCKS: Tempur-Pedic, Thor Industries, Discover, Achillion','/!drafts/us-hot-stocks-tempur-pedic-thor-industries-discover-achillion','2012-09-27 17:57:00','2012-10-31 17:58:10',NULL,0),(301,'','SlashGear Morning Wrap-up: September 27, 2012','SlashGear Morning Wrap-up: September 27, 2012','/!drafts/slashgear-morning-wrap-up-september-27-2012','2012-09-27 17:58:00','2012-10-31 17:58:43',NULL,0),(302,'','AT&T 4G LTE MiFi Liberate Brings Touchscreen and Long Battery Life','AT&T 4G LTE MiFi Liberate Brings Touchscreen and Long Battery Life','/!drafts/atandt-4g-lte-mifi-liberate-brings-touchscreen-and-long-battery-life','2012-09-27 17:59:00','2012-10