 is the world’s first 4G LTE Mobile Hotspot with a touchscreen','AT&T MiFi Liberate is the world’s first 4G LTE Mobile Hotspot with a touchscreen','/!drafts/atandt-mifi-liberate-is-the-worlds-first-4g-lte-mobile-hotspot-with-a-touchscreen','2012-09-27 18:29:00','2012-10-31 18:30:04',NULL,0),(313,'','MiFi® Liberate – World’s First Touchscreen Mobile Hotspot Coming Soon','MiFi® Liberate – World’s First Touchscreen Mobile Hotspot Coming Soon','/!drafts/mifi-liberate-worlds-first-touchscreen-mobile-hotspot-coming-soon','2012-09-27 18:30:00','2012-10-31 18:30:49',NULL,0),(314,'','AT&T announces the MiFi Liberate, a 4G LTE mobile hotspot with a touchscreen display','AT&T announces the MiFi Liberate, a 4G LTE mobile hotspot with a touchscreen display','/!drafts/atandt-announces-the-mifi-liberate-a-4g-lte-mobile-hotspot-with-a-touchscreen-display','2012-09-27 18:31:00','2012-10-31 18:31:22',NULL,0),(315,'','AT&T announces MiFi Liberate touchscreen hotspot','AT&T announces MiFi Liberate touchscreen hotspot','/!drafts/atandt-announces-mifi-liberate-touchscreen-hotspot','2012-09-27 18:31:00','2012-10-31 18:31:47',NULL,0),(312,' Features  \r\nConnects up to five Wi-Fi enabled devices simultaneously, such as computers, PDAs, cameras, music players, personal and game players and more\r\nExternal status display providing at-a-glance information on signal strength, roaming status, battery levels and number of connected devices\r\nE-ink® technology used in external status display does not drain the battery like LCD displays \r\nmicroSDHC™ memory card slot with up to 32GB support\r\nMiFi OS™ provides access to widgets and advanced configuration options via a user-friendly web interface – no software to install!\r\nSupports the latest security features that even the strictest corporate VPNs require\r\nRechargeable Lithium Ion Battery: Best in class battery performance keeps you connected when you need to be (over 4 hours of active use and 60 hours of standby)\r\nGPS-enabled\r\n  Benefits  \r\nUltra-fast speeds with 4G capability offer quicker downloads and seamless video streaming\r\nSwitches seamlessly between 3G and 4G networks (reconnecting to secure VPNs is required after switching between 3G/4G)\r\nWireless and secure internet connectivity from virtually anywhere\r\nPortable and convenient – smaller than a deck of cards\r\nGreat for travel – family, friends and colleagues can connect &amp; share information over the MiFi OS™\r\nPerfect for the mobile professional – creates a virtual office wherever you go for you and your co-workers\r\n MiFi® 4082\r\n Intelligent Mobile Hotspot   MiFi®.  Freedom. My Way.® \r\n The 3G/4G MiFi 4082 is the next generation in the Novatel Wireless MiFi Intelligent Mobile Hotspot portfolio, building on award winning innovation and design, proven performance and industry-leading flexibility, convenience, and reliability. Experience life in the fast lane with blazing fast 4G WiMAX mobile broadband. The reliable MiFi 4082 is backward-compatible with the 3G CDMA 1XEvDO Rev A network, and includes new features such as the MiFi OS™, microSDHC™ card slot and an external status display providing information at-a-glance on signal strength, roaming status, battery levels and the number of devices connected.  ','MiFi® 4082 - Intelligent Mobile Hotspot','MiFi®.  Freedom. My Way.®\r\nThe 3G/4G MiFi 4082 is the next generation in the Novatel Wireless MiFi Intelligent Mobile Hotspot portfolio, building on award winning innovation and design, proven performance and industry-leading flexibility, convenience, and reliability. Experience life in the fast lane with blazing fast 4G WiMAX mobile broadband. The reliable MiFi 4082 is backward-compatible with the 3G CDMA 1XEvDO Rev A network, and includes new features such as the MiFi OS™, microSDHC™ card slot and an external status display providing information at-a-glance on signal strength, roaming status, battery levels and the number of devices connected.','/products/mobile-broadban