ble intuitive, plug-and-play integration, customization and branding. With its short order cycle and award-winning Novatel Wireless Engineering Support, the module delivers rapid deployment and quick time to market.  \r\n Mobile Broadband Data Speeds Around the Globe \r\n 3G technology provides data speeds up to 14.4 Mbps† from virtually anywhere you are in the world. The Expedite E396 3G PCI Express Mini Card empowers devices with global mobile broadband connectivity.  \r\n Anytime…Anywhere \r\n The small, cost effective Expedite E396 module leverages the HSPA+ and CDMA networks. Switching between networks enables your customers to work, play, and stay connected anytime, anywhere worldwide†.   \r\n Performance When It Counts… \r\n High efficiency compact broadband design provides consistent throughput performance.  The condensed trace routing and compact component layout increases power efficiency and decreases overall weight. WHQL certification, on/off NDIS capabilities and a complete Software Development Kit provide flexibility and expedite product development. \r\n Advanced GOBI™ Technology \r\n Advanced GOBI technology provides for standard GOBI APIs as well as QDL™, allowing the end user to select which network operator to use. \r\n GPS CapabilityAllows you to retrieve location data from GPS satellites and utilize GPS navigation and location-based applications. \r\n Technology Revolution \r\n Global anywhere capabilities, enhanced applications, and extended coverage provide full mobility for the fast paced world we live in. \r\n † Network operator dependent.  Expedite® E396 PCI Express Mini Card ','Expedite® E396 PCI Express Mini Card','Novatel Wireless’ Expedite® E396 PCI Express Mini Card is an embedded module that can be integrated into laptops, tablets, M2M hosts and other devices for 3G mobile data applications. Powered by the Qualcomm® MDM6600 chipset, the Expedite E396 offers high performance to the user on HSPA+ and EVDO Rev A bands with global fallback to 2G. 3G technology provides data speeds up to 14.4 Mbps† from virtually anywhere in the world.','/products/mobile-broadband-solutions/embedded-modules/expedite-e396-pci-express-mini-card','2012-10-31 20:21:00','2012-11-13 00:05:16',NULL,0),(368,'AT 4000\r\n Fixed Powered Asset Tracking Device   Features  \r\nFully Integrated, no need for an external antenna\r\nSelf-Contained, powered\r\nSimplified Over-the-Air Configuration &amp; Provisioning delivered through the Device Manager\r\n   AT_4000_WEB.pdf   Legacy of Innovation \r\n Fixed or mobile, a myriad of assets need to be monitored for regulatory compliance, security, national defense, operational efficiencies or just peace of mind. Whether you are monitoring a Hazmat shipment on a truck or railroad car, the location of a construction trailer, a shipping container, ATM machine, refrigeration unit, air conditioning compressor or any other powered valuable asset, the AT 4000 is the right solution. \r\n Designed for the intelligent monitoring of powered mobile and fixed assets the AT 4000 is easily installed and managed. The AT 4000 is provisioned through the N4A™ Communications &amp; Management platform and can be configured to optimize motion detection, location monitoring, reporting and geo-fence settings, all of which will help match battery life and service availability to the application. \r\n    \r\nTrailers\r\nAlternate Power Source Assets\r\nRefrigeration Units\r\nPowered Assets\r\n\r\n    ','AT 4000','Fixed or mobile, a myriad of assets need to be monitored for regulatory compliance, security, national defense, operational efficiencies or just peace of mind. Whether you are monitoring a Hazmat shipment on a truck or railroad car, the location of a construction trailer, a shipping container, ATM machine, refrigeration unit, air conditioning compressor or any other powered valuable asset, the AT 4000 is the right solution.','/products/integrated-m2m-solutions/asset-tracking/at-4000','2012-10-31 21:10:00','2012-11-10 00:43:46',NULL,0),(370,'Ovation™ MC679 LTE/DC HSPA+ USB Modem  Introducing the 4G LTE Ovation™ MC679, the market’s slimmest and most compact 4G LTE USB modem. The MC679 is the next generation of the Novatel Wireless Ovation USBmobile broadband modem portfolio, building on award-winning innovation and design, proven performance and industry-leading flexibility, convenience and reliability.  Experience life in the fast lane with blazing fast 4G LTE mobile broadband. \r\n   \r\n Stay Connected \r\n WitThis 4G LTE USB modem provides LTE download speeds of up to 100 Mbps* and upload speeds of up to 50 Mbps and boasts a broad band designation. Now, you can stay connected to high-speed networks from virtually anywhere since the GPS-capable MC679  supports LTE AWS/700, DC HSPA/HSPA+ 850/1900/2100 and quad-band GPRS/EDGE. \r\n   \r\n Slim, Durable and Compact Design \r\n Perfect for the frequent traveler! The MC679 is the market’s slimmest and most compact 4G LTE USB modem currently available for North America. Its hinged USB connector provides flexible orientation, ease of use and can simply fold closed for additional protection in transport. \r\n   \r\n Internal Advanced Antenna with MIMO \r\n Connectivity when you need it the most. The tri-band advanced antenna includes MIMO withreceive diversity, providing optimal performance when you need it most. Thecompact internal antenna is designed without fragile external pieces. The device itself extends only an inch out of your notebook.  \r\n   \r\n Versatility and Compatibility \r\n The perfect solution. The MC679 is backward-compatible to high-speed DC HSPA+ and HSPA+ networks.  The MC679 device also comes complete with MobiLink™ Connection Manager software for a quick setup. Compatible on Windows® , Mac® and Linux® operating systems, it is the perfect solution to get up and running quickly and easily.  ','Ovation™ MC679 LTE/DC HSPA+ USB Modem','The Ovation™ MC679  is the market\'s slimmest, most compact LTE USB modem currently available, providing LTE download speeds of up to 100 Mbps* and upload speeds of up to 50 Mbps.\r\nSupporting LTE AWS/700 with MiMo, DC HSPA/HSPA+ 850/1900/2100 and quad-band GPRS/EDGE, the GPS capable MC679 ensures you stay connected from virtually anywhere.','/products/mobile-broadband-solutions/usb-devices/ovation-mc679-ltedc-hspa-usb-modem','2012-10-31 22:06:00','2012-10-31 22:09:16',NULL,0),(371,' Ovation™ MC545 Dual-Carrier HSPA+ USB Modem   The Ovation™ MC545 Wireless Broadband USB modem is the most compact dual-carrier HSPA+ device currently available with an integrated microSDHC slot. The device boasts download speeds of up to 42 Mbps and upload speeds of up to 5.76 Mbps. With 900, 1900, and 2100 MHz HSPA+/UMTS bands and Quad Band GPRS/EDGE, the MC545 allows you to connect anywhere in the world be it from home, office, hotel, or airport. \r\n Ovation™ MC545 DC HSPA+ Modem \r\n The Ovation MC545 includes all the benefits of Novatel Wireless mobile broadband engineering, while being the world\'s smallest, most compact and light-weight DC HSPA+ USB device available. \r\n Ultra Fast Mobile Broadband Speeds \r\n Experience speed that won’t leave you waiting. With peak download speeds of 42 Mbps and upload speeds of 5.76 Mbps, mobile broadband connectivity has never been smoother. The Ovation MC545 offers unprecedented speed and advanced antenna technologies to maximize data throughput and operating range. \r\n One Product for both Business and Consumers \r\n With its leading edge technology and its innovative sleek style, the Ovation MC545 suits both consumers and business professionals alike. It\'s versatility makes it perfect for use in the office, at home and while traveling. \r\n Integrated microSDHC up to 32GB \r\n Ovation MC545 is equipped with an integrated microSDHC™ slot to provide flexible and high-capacity memory storage options while on the go. Ideal for large presentations that need to be accessed and shared on the fly!  ','Ovation™ MC545 Dual-Carrier HSPA+ USB Modem','The Ovation™ MC545 Wireless Broadband USB modem is the most compact dual-carrier HSPA+ device currently available with an integrated microSDHC slot. The device boasts download speeds of up to 42 Mbps and upload speeds of up to 5.76 Mbps. With 900, 1900, and 2100 MHz HSPA+/UMTS bands and Quad Band GPRS/EDGE, the MC545 allows you to connect anywhere in the world be it from home, office, hotel, or airport.','/products/mobile-broadband-solutions/usb-devices/ovation-mc545-dual-carrier-hspa-usb-modem','2012-10-31 22:11:00','2012-11-01 17:11:35',NULL,0),(372,' Introducing Ovation™ MC760: the only micro-sized broadband Internet device currently available with high-capacity removable memory storage. The powerful performance of EVDO Rev.A Broadband Internet, microSD™, and GPS is now all wrapped up in a thumb-drive sized device. \r\n NovaSpeed™ Capable* \r\n Your broadband internet experience can be even better with the Novatel Wireless proprietary software, NovaSpeed. NovaSpeed enhances broadband connections by allowing simultaneous upload and download, online gaming, video streaming, GPS maps and large file transfers with virtually no interruptions or buffering. \r\n High-Capacity microSD Storage \r\n The integrated microSD slot of Ovation MC760 provides flexible memory storage options without hindering your Internet connection performance. Memory cards are available in various capacity sizes up to 8GB, for quick and easy transport of large files, like presentations, videos, pictures, and music files. \r\n Internal Antenna Design \r\n Features an advanced internal dual band antenna system that includes diversity for enhanced performance on network fringe areas. \r\n No CD Required for Installation \r\n Windows and Mac users no longer need to hassle with CDs. With MobiLink Lite software and device drivers built right into the device, installation is quick and easy.   Features  \r\nHighspeed Wireless Data:\r\n\r\nEV-DO Rev. A Networks (backwards compatible to Rev 0 and 1xRTT) CDMA 800 MHz and CDMA 1900 MHz. Up to 3.1 Mbps on the downlink and up to 1.8 Mbps on the uplink on EV-DO Rev A capable networks.\r\n\r\nNovaSpeed Software Capability:\r\n\r\nSerious performance boost with virtually no interruptions or buffering.\r\n\r\nRemovable Memory:\r\n\r\nHot-swappable removable memory via microSD™ up to 8GB!\r\n\r\nGPS Capability:\r\n\r\nRetrieve location data from GPS satellites and utilize GPS navigation and location-based applications.\r\n\r\nCompact size:\r\n\r\nOnly two inches.\r\n\r\nInternal Antenna Design:\r\n\r\nIncludes diversity for enhanced performance on network fringe areas.\r\n\r\nSupports Multiple Platforms:\r\n\r\nWindows Vista, XP, 2000, Mac OS X 10.3.9 or Higher, Linux.\r\n\r\nCompact and Sleek Design:\r\n\r\nJust under three inches, Ovation’s glossy finish includes a vanishing LED system that displays connection status when powered.\r\n\r\nFeature-rich:\r\n\r\n2-way text messaging\r\nNDIS support\r\nExternal antenna option\r\nIntuitive MobiLink Lite software, zero-CD installation\r\nLow power consumption\r\nAccessories\r\nLead-free\r\nField-firmware upgradeable.\r\n\r\n  Benefits  \r\nRemovable memory up to 8GB\r\nSmall &amp; Compact\r\nLarge data files can be sent and received more quickly\r\nPlug-and-play\r\nSecure internet access\r\nDependable, reliable product\r\n Ovation™ MC760 EVDO Rev.A Micro USB Modem ','Ovation™ MC760 EVDO Rev.A Micro USB Modem','Introducing Ovation™ MC760: the only micro-sized broadband Internet device currently available with high-capacity removable memory storage. The powerful performance of EVDO Rev.A Broadband Internet, microSD™, and GPS is now all wrapped up in a thumb-drive sized device.','/products/mobile-broadband-solutions/usb-devices/ovation-mc760-evdo-rev.a-micro-usb-modem','2012-10-31 22:16:00','2012-11-01 17:14:00',NULL,0),(373,' Single Global SKU – Expedite® E346 PCI Express Mini Card Embedded Module \r\n Novatel Wireless’ Expedite® E346 PCI Expres