volution \r\n Global anywhere capabilities, enhanced applications, and extended coverage provide full mobility for the fast paced world we live in. \r\n † Network operator dependent.  Expedite® E346 PCI Express Mini Card ','Expedite® E346 PCI Express Mini Card','Expedite® E346 PCI Express Mini Card\r\nNovatel Wireless’ Expedite® E346 PCI Express Mini Card is an embedded module that can be integrated into laptops, tablets, M2M hosts and other devices for 3G mobile data applications. Powered by the Qualcomm® MDM6200 chipset, the Expedite E346 offers high performance to the user on HSPA+ bands with global fallback to 2G. 3G technology provides data speeds up to 14.4 Mbps† from virtually anywhere in the world. With the network selection feature, now OEMs only need to stock a single SKU.','/products/mobile-broadband-solutions/embedded-modules/expedite-e346-pci-express-mini-card','2012-10-31 22:36:00','2012-11-13 00:04:58',NULL,0),(374,'Expedite® E371 PCI Express Mini Card  Novatel Wireless\' Expedite® E371 PCI Express Mini Card is an embedded module that can be integrated into laptops and other devices for 3G/4G mobile data applications. Powered by the Qualcomm® MDM9200 chipset, the Expedite E371 offers high performance to the user on LTE 700 MHz and AWS bands with global fallback to HSPA+/UMTS. \r\n Beyond Broadband Data Speeds on the Move \r\n LTE technology provides data speeds up to 100 Mbps† (much greater than many wired broadband data services). Offers fast, wireless broadband speeds to customers and helps them achieve blistering fast connection speeds adequate for video streaming and VoIP. \r\n Anytime... Anywhere \r\n The small Expedite E371 module leverages the LTE and HSPA+/UMTS networks. Switching between networks enables your customers to work, play, and stay connected anytime, anywhere worldwide†. \r\n Performance When It Counts... \r\n High efficiency compact broadband design provides consistent throughput performance. The condensed trace routing and compac