s, vendors and Contract Manufacturers both foreign and domestic. \r\nRequired Knowledge: • Must be proficient in Pro Engineer Wildfire CAD tools and have a good fundamental understanding of RF shielding, antenna and surface mount technology concerns. • Must have working knowledge of injection molding mold construction and metal stamping tooling. \r\nRequired Experience: • 5 years’ experience designing plastic, sheet metal and rubber parts for the telecommunication industry. • Must have at least 4 years on Pro Engineer Wildfire 2 or greater. \r\nSpecial Requirement: • Must be willing to travel to our factories in Korea and China and to meet with vendors worldwide. Expect to travel at least 3-4 times per year. \r\nEducation: BSME with 5 years’ experience in telecommunications industry Compensation &amp; Benefits. \r\nCompensation &amp; Benefits: Our successful candidate will be entitled to a compensation package commensurate with qualifications, experience and performance, plus a comprehensive benefits plan. \r\nHow to Apply: Thank you for your interest on becoming part of our innovative, market leading wireless family. • Please select the “apply to” button on top of the page above the skills needed section. • Candidates that complete the technical questions (If listed) receive special priority. • Please feel free to apply for more than 1 position or refer a friend as we are always looking to build great teams.   Preferred Skills: \r\n    ','Senior Mechanical Engineer (Contractor)','','/about/careers/novatel-career-oppourtunities/senior-mechanical-engineer-contractor','2012-11-04 12:44:00','2012-11-04 13:04:09',NULL,0),(408,'Sourcing Manager  APPLY FOR SOURCING MANAGER POSITION   Posted On: Thursday, 27 September 2012    Location: San Diego, California   Pay Rate:    Duration:    Travel:    Job Description:  \r\nSourcing Manager \r\nNovatel Wireless seeks a Sourcing Manager to drive sourcing strategy &amp; processes for its business. Responsibilities include: \r\nManage the company purchasing function and develops department policies, processes and procedures \r\nDrive acquisition cost reduction in all products/components \r\nAccepts and analyzes vendor bids and proposals \r\nArranges vendor contracts and negotiates prices \r\nCoordinates activities with engineering, production, quality and other relevant functions \r\nBuilds solid strategic relationships with suppliers \r\nManage and negotiate strategic sourcing agreements and relationships \r\nDevelop new strategic suppliers in categories previously untouched by company \r\nAchieve strategic goals and deliverables \r\nDevelop, implement and manage strategic supplier-based projects \r\nRequired Experience and Knowledge: \r\n10+ years progressive experience in strategic sourcing/procurement \r\nStrong project management and organizational skills \r\nExceptional negotiating skills and experience, and the capability and desire to train others in this strategic skill set \r\nExperience in establishing, communicating and managing Supplier Performance Metrics (cost/timeliness/quality) \r\nDomestic and international supplier relationship management experience including travel \r\nProven ability to drive business results, knowledge/experience with cost saving metrics \r\nEducation:  Bachelors Degree, (MBA or other graduate degree a plus)  \r\nWho is Novatel Wireless? \r\nNovatel Wireless is a global leader in developing innovative wireless data devices and applications for markets worldwide using advanced wireless networks such as LTE, UMTS, HSDPA, GSM, GPRS, CDMA, and EV-DO. We are a publicly traded company headquartered in San Diego, California. \r\nInnovators- We are a global innovator in 3G &amp; 4G wireless mobility solutions \r\n• 1st to market with the Mifi- personal wireless hotspot \r\n• 1st to market with EV-DO Rev-A product line \r\n• 1st USB wireless broadband in North America \r\n• 1st 3G wireless broadband router in Europe \r\n• Exciting LTE M2M Wimax HSPA+ products \r\nWork/Life Balance- We hire passionate people and create great teams. \r\nGlobal- We have offices in San Diego (California), Calgary (Canada), Basingstoke, (United Kingdom), and Shanghai (China). \r\nFinancially Secure- Novatel Wireless is cash strong with no debt; founded in 1996, IPO in 2000. \r\nCompensation &amp; Benefits: Our successful candidate will be entitled to a compensation package commensurate with qualifications, experience and performance, plus a comprehensive benefits plan. \r\nHow to Apply:  \r\n• Thank you for your interest on becoming part of our innovative, market leading wireless family.  \r\n• Please select the apply to button at the top of this page.  \r\n• Candidates that complete the pre-qualification questions receive special priority.   Preferred Skills: \r\n    ','Sourcing Manager','','/about/careers/novatel-career-oppourtunities/sourcing-manager','2012-11-04 12:46:00','2012-11-04 13:03:46',NULL,0),(409,'Accounts Payable Supervisor  APPLY FOR ACCOUNTS PAYABLE SUPERVISOR   Posted On: Thursday, 20 September 2012    Location: San Diego, California   Job Type: Direct Hire   Pay Rate:    Duration:    Travel:    Job Description:  \r\n Novatel Wireless Highlights: \r\n Innovators- We are a global innovator in 3G &amp; 4G wireless mobility solutions. * 1st to market with EV-DO Rev-A product line * 1st USB wireless broadband in North America * 1st 3G wireless broadband router in Europe * Exciting LTE M2M Wimax HSPA+ products Work/Life Balance- We hire passionate people and create great teams. Global- We have offices in San Diego (California) Calgary (Canada) Basingstoke (United Kingdom) and Shanghai (China). Financially Secure- Novatel Wireless is cash strong with no debt; founded in 1996 IPO in 2000. \r\n Main Job Duties: Accounts Payable Supervisor is responsible for the overall management of the accounts payable operations including expense reporting, procedures and policies to improve the efficiency of the department. Review general ledger codings, accruals, account reconciliations and reports prepared by staff for accuracy, completeness and adherence to GAAP. Perform all month-end close duties including timely close of accounts payable system and working with accounting department to record accrued liabilities for invoices not yet received, prepare Month End A/P Accruals Review transactions for completeness, reasonability, and occurrence including expense reports, invoice entry, disbursements. Ensure strong internal and external audit support. Address transaction overflow and resource functions effectively. Manage two Analysts   Preferred Skills: \r\n    ','Accounts Payable Supervisor','','/!drafts/accounts-payable-supervisor','2012-11-04 19:43:00','2012-11-04 19:45:12',NULL,0),(410,'Senior Buyer (Contract)  APPLY FOR SENIOR BUYER   Posted On: Thursday, 20 September 2012    Location: San Diego, California   Job Type: Contract   Pay Rate:    Travel:    Job Description:  \r\n Novatel Wireless Highlights:  \r\n Innovators- We are a global innovator in 3G &amp; 4G wireless mobility solutions. * 1st to market with EV-DO Rev-A product line * 1st USB wireless broadband in North America * 1st 3G wireless broadband router in Europe * Exciting LTE, M2M, Wimax, HSPA+ products Work/Life Balance- We hire passionate people and create great teams. Global- We have offices in San Diego (California), Calgary (Canada), Basingstoke, (United Kingdom), and Shanghai (China). Financially Secure- Novatel Wireless is cash strong with no debt; founded in 1996, IPO in 2000. \r\n Job Description: \r\n Main Job Duties: Sourcing lead for New Product Introduction programs. Also involved in new part/commodity sourcing, supplier qualification, price negotiations, RFQs, supplier management, supply agreements etc. Occasional MRO purchasing as well as Strategic and Tactical sourcing. \r\n Required Knowledge: - Purchasing fundamentals, as well as strategic Sourcing and NPI Purchasing - Working knowledge of ERP systems (Oracle a preferrred) - Proficient in MS business applications (Excel, Outlook, Word ...) \r\n Required Experience: - 5+ years purchasing experience in manufacturing environment (Electronics preferred) - Experience supporting NPI programs - International Sourcing experience a plus \r\n Education: BA/BS \r\n Compensation &amp; Benefits: Our successful candidate will be entitled to a compensation package commensurate with qualifications, experience and performance, plus a comprehensive benefits plan. \r\n How to Apply: Thank you for your interest on becoming part of our innovative, market leading wireless family. • Please select the \"apply to\" button on top of the page above the skills needed section. • Candidates that complete the technical questions (If listed) receive special priority. • Please feel free to apply for more than 1 position or refer a friend as we are always looking to build great teams.   Preferred Skills: \r\n     Duration: This is a 9 month contract assignment  ','Senior Buyer (Contract)','','/about/careers/novatel-career-oppourtunities/senior-buyer-contract','2012-11-04 19:45:00','2012-11-04 19:49:37',NULL,0),(411,'Senior Product Manager  APPLY FOR SENIOR PRODUCT MANAGER   Posted On: Friday, 14 September 2012    Location: San Diego, California   Job Type: Direct Hire   Pay Rate:     Duration:     Travel:     Preferred Skills: \r\n Leadership qualities, vision and the ability to work independently in an exciting fast paced environment • Strong analytic skills • Superior written and verbal communication skills • Demonstrated track record of relevant achievement • Proficiency and experience at managing several projects simultaneously • Prior experience working for a wireless data provider • Good understanding of HSPA and EVDO technologies plus knowledge of telecom competitive landscape. • Bachelor’s degree, MBA and 7 + years experience in a product management or marketing role within a telecommunications or related technology company. • Must have an understanding of current and emerging technologies. • Knowledge of data communications technologies is essential. • Must be detail-oriented and possess exceptional organizational and time management skills.   Job Description:   \r\n Novatel Wireless Highlights: \r\n Innovators- We are a global innovator in 3G &amp; 4G wireless mobility solutions. * 1st to market with EV-DO Rev-A product line * 1st USB wireless broadband in North America * 1st 3G wireless broadband router in Europe * Exciting LTE, M2M, Wimax, HSPA+ products Work/Life Balance- We hire passionate people and create great teams. Global- We have offices in San Diego (California), Calgary (Canada), Basingstoke, (United Kingdom), and Shanghai (China). Financially Secure- Novatel Wireless is cash strong with no debt; founded in 1996, IPO in 2000. \r\n RESPONSIBILITIES In this position you will be responsible for managing the life cycle of an assigned product segment for Novatel Wireless. Goas are to increase revenue, gross margin and market share, while improving customer satisfaction and loyalty. The Senior Product Manager provides market, product and technology vision to the day-to-day execution of Novatel Wireless’ product decisions. \r\n Other responsibilities include: • Performing Market Research and Maintaining a good understanding of the business and consumer data services market • Defining, documenting and implementing new products and features • Revenue, gross margin, net margin, reporting and P&amp;L business analysis • Championing product across the organization and getting buy-in from executive team • Creation of pricing models • Creation of marketing collateral content • Cross-functional lead for product development efforts • Managing the introduction and life cycle of assigned Novatel wireless products. • Assisting in development of the Novatel Wireless product roadmap. Apply a thorough understanding of competition in setting product strategies. • Product documentation and coordinating development of product collateral. • Establishing revenue forecasts and margin criteria for assigned products and create financial models to establish Product business case, gross margin levels and ROI. \r\n RESPONSIBILITIES In this position you will be responsible for managing the life cycle of an assigned product segment for Novatel Wireless. Goas are to increase revenue, gross margin and market share, while improving customer satisfaction and loyalty. The Senior Product Manager provides market, product and technology vision to the day-to-day execution of Novatel Wireless’ product decisions. \r\n Other responsibilities include: • Performing Market Research and Maintaining a good understanding of the business and consumer data services market • Defining, documenting and implementing new products and features • Revenue, gross margin, net margin, reporting and P&amp;L business analysis • Championing product across the organization and getting buy-in from executive team • Creation of pricing models • Creation of marketing collateral content • Cross-functional lead for product development efforts • Managing the introduction and life cycle of assigned Novatel wireless products. • Assisting in development of the Novatel Wireless product roadmap. Apply a thorough understanding of competition in setting product strategies. • Product documentation and coordinating development of product collateral. • Establishing revenue forecasts and margin criteria for assigned products and create financial models to establish Product business case, gross margin levels and ROI. \r\n    ','Novatel Wireless, Inc.  Senior Product Manager','','/about/careers/novatel-career-oppourtunities/novatel-wireless-inc.-senior-product-manager','2012-11-04 19:53:00','2012-11-04 19:57:10',NULL,0),(412,'Principal Engineer/System Architect (Networking)  APPLY FOR PRINCIPAL ENGINEER/SYSTEM ARCHITECT (NETWORKING)   Posted On: Thursday, 19 July 2012    Location: San Diego, California   Job Type: Direct Hire   Pay Rate:     Duration: Full-Time    Travel:     Preferred Skills: \r\n     Job Description:  \r\n Internal Job Description: Principal Engineer/System Architect (Networking) \r\n • Leading the system architecture (software) of next generation mobile hotspot devices \r\n • Leading IP development and module designs working with a group of software developers or individuals  \r\n • Driving LOE and technical requirement documents (TRD) for software components  \r\n • Participate in code development/code review/ debugging/ testing/release processes \r\n • Tracking project progress, keeping work on track, meeting deadlines \r\n • Interacting with product marketing, external parties to make architectural decisions.  \r\n • Reporting status/progress/issues to management on regular basis.  \r\n Required Experience and Knowledge:  \r\n • 12+ years experience as architect, designer and/or developer of networking products and system software  \r\n • Technically strong in the areas such as networking protocols, power management, and system optimization \r\n • In-depth knowledge and hands on experience on embedded software development  \r\n • Good knowledge on consumer products and user experience  \r\n • Fluency in C programming language. Others such as C++, Java, Perl or scripting languages are plus.  \r\n • Familiar with product certification process and requirements.  \r\n Education:  MS in EE, Computer Science or similar fields.  \r\n Who is Novatel Wireless? \r\n Novatel Wireless is a global leader in developing innovative wireless data devices and applications for markets worldwide using advanced wireless networks such as LTE, UMTS, HSDPA, GSM, GPRS, CDMA, and EV-DO. We are a publicly traded company headquartered in San Diego, California. \r\n Innovators- We are a global innovator in 3G &amp; 4G wireless mobility solutions \r\n • 1st to market with the Mifi- personal wireless hotspot \r\n • 1st to market with EV-DO Rev-A product line \r\n • 1st USB wireless broadband in North America \r\n • 1st 3G wireless broadband router in Europe \r\n • Exciting LTE M2M Wimax HSPA+ products \r\n Work/Life Balance- We hire passionate people and create great teams. \r\n Global- We have offices in San Diego (California), Calgary (Canada), Basingstoke, (United Kingdom), and Shanghai (China). \r\n Financially Secure- Novatel Wireless is cash strong with no debt; founded in 1996, IPO in 2000. \r\n Compensation &amp; Benefits: Our successful candidate will be entitled to a compensation package commensurate with qualifications, experience and performance, plus a comprehensive benefits plan. \r\n How to Apply:  \r\n • Thank you for your interest on becoming part of our innovative, market leading wireless family.  \r\n • Please select the apply to button at the top of this page.  \r\n • Candidates that complete the pre-qualification questions receive special priority.  ','Principal Engineer/System Architect (Networking)','','/about/careers/novatel-career-oppourtunities/principal-engineersystem-architect-networking','2012-11-04 19:58:00','2012-11-04 20:01:52',NULL,0),(413,'','Sidebar Careers',NULL,'/!stacks/sidebar-careers','2012-11-05 16:56:19','2012-11-05 17:02:02',NULL,0),(415,'','Sidebar Upcoming Events',NULL,'/!stacks/sidebar-upcoming-events','2012-11-05 17:05:02','2012-11-05 17:12:42',NULL,0),(416,'','Sidebar Latest News',NULL,'/!stacks/sidebar-latest-news','2012-11-05 17:14:35','2012-11-05 17:16:38',NULL,0),(422,'Calgary Office\r\nAddress: \r\n6715 8th Street N.E. Suite 200 Calgary, Alberta, Canada T2E 7H7 \r\nTelephone: +1 403.295.4800 / Toll Free: +1 888.888.9231 \r\nFax: +1 403.295.4801  ','Calgary Office','','/about/contact-us/calgary-office','2012-11-05 19:00:00','2012-11-05 21:38:18',NULL,0),(423,'Europe, Middle East, Africa, Southern Asia, Australia and New Zealand Headquarters\r\nAddress: \r\n7th Floor Belvedere,  Basing View, Basingstoke Hampshire UK RG21 4HG \r\nTelephone: +44 1256 405 600 \r\nFax: +44 1256 405 602  ','Europe, Middle East, Africa, Southern Asia, Australi