INSERT INTO `SystemNotifications` VALUES (1,10,'/index.php/dashboard/system/backup_restore/update/',NULL,'2012-09-07 14:17:49',0,1,'A new version of concrete5 is now available.','','\n	\n			<h2>Huge Update!</h2>\n			\n			<p>\n			Version 5.6 introduces a completely revampled permissions and workflow system, along with a large number of bug fixes and behavioral improvements. \n			It\'s great, but if you\'re running a mission critical website you should absolutely make a backup of your site and apply the upgrade to your backup stage\n			first to make sure you\'re happy with the results.\n			</p>\n			<p>\n			As always, backup your data and site before running the upgrade live.\n			</p>			\n\n			<h3>What\'s new in 5.6.0</h3>\n			\n			<ul>\n			<li>Completely revampled, overhauled and improved advanced permissions system.</li>\n			<li>Complete new extendable workflow system, including basic workflow and waiting for me.</li>\n			<li>Improved interface work, including bootstrap 2 integration.</li>\n			<li>Improved Mobile Support</li>\n			<li><strong>And much, much more.</strong></li>\n			</ul>\n			\n			<h3><a href=\"http://www.concrete5.org/documentation/background/version_history/5-6-0-release-notes/\" target=\"_blank\">Full 5.6.0 Release Notes</a></h3>\n			<h3><a href=\"http://www.concrete5.org/documentation/background/version_history/5-6-0-1/\" target=\"_blank\">Full 5.6.0.1 Release Notes</a></h3>\n	\n	'),(2,10,'/index.php/dashboard/system/backup_restore/update/',NULL,'2012-09-10 10:06:41',0,1,'A new version of concrete5 is now available.','','\n	\n			<h2>Huge Update!</h2>\n			\n			<p>\n			Version 5.6 introduces a completely revampled permissions and workflow system, along with a large number of bug fixes and behavioral improvements. \n			It\'s great, but if you\'re running a mission critical website you should absolutely make a backup of your site and apply the upgrade to your backup stage\n			first to make sure you\'re happy with the results.\n			</p>\n			<p>\n			As alw