INSERT INTO `btContentLocal` VALUES (1,'	<div id=\"newsflow-header-first-run\"><h1>Welcome to concrete5.</h1>\n						<h2>It\'s easy to edit content and add pages using in-context editing.</h2></div>\n						'),(2,'<div class=\"newsflow-column-first-run\">\n							<h3>Building Your Own Site</h3>\n							<p>Editing with concrete5 is a breeze. Just point and click to make changes.</p>\n							<br/>\n							<p><a href=\"javascript:void(0)\" onclick=\"ccm_getNewsflowByPath(\'/welcome/editors\')\" class=\"btn primary\">Editor\'s Guide</a></p>\n							</div>'),(3,'<div class=\"newsflow-column-first-run\">\n							<h3>Developing Applications</h3>\n							<p>If you’re comfortable in PHP concrete5 should be a breeze to learn. Take a few moments to understand the architecture.</p>\n							<p><a href=\"javascript:void(0)\" onclick=\"ccm_getNewsflowByPath(\'/welcome/developers\')\" class=\"btn primary\">Developer\'s Guide</a></p>\n							</div>'),(4,'<div class=\"newsflow-column-first-run\">\n							<h3>Designing Websites</h3>\n							<p>Good with CSS and HTML? You can easily theme anything with concrete5.</p>\n							<br/>\n							<p><a href=\"javascript:void(0)\" onclick=\"ccm_getNewsflowByPath(\'/welcome/designers\')\" class=\"btn primary\">Designer\'s Guide</a></p>\n							</div>'),(5,'\n						<div class=\"newsflow-column-first-run\">\n						<h3>Business Background</h3>\n						<p>Worried about license structures, white-labeling or why concrete5 is a good choice for your agency?</p>\n						<p><a href=\"javascript:void(0)\" onclick=\"ccm_getNewsflowByPath(\'/welcome/executives\')\" class=\"btn primary\">Executive\'s Guide</a></p>\n						</div>'),(20,''),(21,'<p><img src=\"http://rtio.nl/i/?w=1024&amp;h=400\" alt=\"Home News\" /></p>'),(22,'<p>Homepage Text Goes Here</p>'),(27,'<p>Content Goes Here</p>'),(28,'<p>Content goes here</p>'),(29,'<p>Content goes here</p>'),(50,'<p>Featured content goes here</p>'),(52,'<p>Homepage content goes here</p>'),(53,'<p><img src=\"http://rtio.nl/i/?w=1024&amp;h=400&amp;\" alt=\"Content Header / Banner\" /></p>'),(57,'<p>Homepage Text Goes Here</p>'),(58,'<p><img src=\"http://rtio.nl/i/?w=1024&amp;h=400\" alt=\"Home News\" /></p>'),(60,'<p><a href=\"#\">Where to Buy</a> | <a href=\"#\">Contact Us</a> </p>'),(61,'<p><a href=\"#\">Where to Buy</a> | <a href=\"#\">Contact Us</a> <img title=\"search\" src=\"http://rtio.nl/i/?w=150&amp;h=25&amp;message=search\" alt=\"search\" width=\"150\" height=\"25\" /></p>'),(62,'<a href=\"/\"><img src=\"/themes/novatel/img/logo.png\" alt=\"Novatel Wireless\"></a>'),(63,'<p><a href=\"#\">Where to Buy</a> | <a href=\"#\">Contact Us</a>    <img title=\"search\" src=\"http://rtio.nl/i/?w=150&amp;h=25&amp;message=search\" alt=\"search\" width=\"150\" height=\"25\" /></p>'),(64,'<p><a href=\"#\">Where to Buy</a>   |   <a href=\"#\">Contact Us</a>    <img title=\"search\" src=\"http://rtio.nl/i/?w=150&amp;h=25&amp;message=search\" alt=\"search\" width=\"150\" height=\"25\" /></p>'),(68,'<img src=\"http://rtio.nl/i/?w=250&h=250\">'),(74,'<p class=\"small\"><a href=\"#\">Privacy Policy</a>        <a href=\"#\">Terms of Use</a>        Copyright <strong><span>©</span></strong> 2012 Novatel Wireless, Inc. All rights reserved.</p>'),(81,'<p><span style=\"font-size: 11px; background-color: #ffffff;\">The flagship of Enfora’s industry-leading portfolio of integrated Spider Mobile Tracking products, the MT series of platforms connect the world’s leading companies to their valuable mobile assets. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">The certified dual &amp; quad-band integrated devices are optimized for today’s increasing demand for vehicle recovery, fuel-efficient fleet operations, driver and vehicle profiling, and interactive communications. Providing complete GSM/GPRS communications, Enfora helps you track and monitor vehicles from the family car to the largest fleet of commercial vehicles. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">With superior GPS sensitivity, a programmable rules engine, polygon Geo-Fencing, integrated SMS commands, messaging and much more, the units are designed to be easily deployed and provisioned, supplying critical information for the most demanding fleet operator, buy-here pay-here dealers, or pay-as-you-go insurance company. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">Enfora’s intelligent mobile tracking devices feature superior performance in a small package for ultimate flexibility. Coupled with the robust N4A Communications and Management platform, devices can be provisioned, monitored and reconfigured remotely, most anywhere in the world. Driven by our services architecture, Enfora delivers a flexible, modular architecture for fast wireless asset tracking, solutions development and deployment. Keeping you Connected to your Assets, Anywhere, Anytime.</span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><strong style=\"font-size: 11px; background-color: #ffffff;\">Popular Use Cases for the Spider MT family:</strong><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfoFlash:CONTENT_ID=577&amp;User:LANGUAGE=en\">MT 4000/4100</a><span style=\"font-size: 11px; background-color: #ffffff;\"> – Designed for application providers, system integrators, and enterprise customers to optimize mobile resources and improve their bottom line, the MT 4000 is a flexible quad-band GSM/GPRS mobile tracking device, delivering the key product features powering the most demanding applications: fleet management, insurance telematics, teen tracking, vehicle location and recovery, and more.</span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfoFlash:CONTENT_ID=481&amp;User:LANGUAGE=en\">MT 3000/3050</a><span style=\"font-size: 11px; background-color: #ffffff;\"> – A certified dual-band integrated device, purpose-built for the Usage Based Insurance (UBI), telematics, and fleet management markets. Providing easy plug-and-play installation, the MT 3000 is designed for passenger cars, light trucks, and service vans.</span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfoFlash:CONTENT_ID=471&amp;User:LANGUAGE=en\">MT 2500</a><span style=\"font-size: 11px; background-color: #ffffff;\"> – Economical and feature rich, this quad-band 3-axis accelerometer equipped platform is enhanced with a 16 pin multi-I/O connector that includes two analog inputs, polygon geo-fencing capabilities, and more. An economical solution for vehicle recovery &amp; fleets with driver behavior reporting and multiple I/O requirements.</span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfoFlash:CONTENT_ID=68&amp;User:LANGUAGE=en\">MT-Gu w/Accelerometer</a><span style=\"font-size: 11px; background-color: #ffffff;\"> – Full-featured for the demanding fleet operator, this quad-band platform with voice capabilities provides an interface to select Garmin PNDs via the optional FMI plug-in, I/O support for sensor connectivity and an optional battery for communication when power is lost. The Spider MT-Gu is specially designed to grow as your business does. </span></p>'),(83,'<p><span style=\"font-size: 11px; background-color: #ffffff;\">Enfora’s industry-leading reputation is rooted in a legacy of success, innovation and experience that spans the globe. Working closely with customers, Enfora’s engineering team has the experience, specialized knowledge and intimate understanding of the challenges that face the dynamic world of asset monitoring today. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">Fixed or mobile, a myriad of assets need to be monitored for regulatory compliance, security, national defense, operational efficiencies &amp; state conditions or just peace of mind. Whether you are monitoring a Hazmat shipment on a truck or railroad car, the location of a construction trailer, a shipping container, ATM machine, spool of copper cable, refrigeration unit, air conditioning compressor, pallet or any other high-value asset, Enfora has the right solution for you. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">Enfora’s intelligent asset monitoring devices feature external and internal power options for ultimate flexibility. Coupled with the robust N4A Communications and Management platform, devices can be provisioned, monitored and reconfigured remotely, most anywhere in the world. Coupled with our Services Architecture, Enfora delivers a flexible, modular architecture for fast wireless asset management, solutions development and deployment. Keeping you Connected to your Assets, Anywhere, Anytime.</span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><strong style=\"font-size: 11px; background-color: #ffffff;\">Popular Use Cases for the Spider AT family:</strong><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfoFlash:CONTENT_ID=64&amp;User:LANGUAGE=en\">Spider AT 3000</a><span style=\"font-size: 11px; background-color: #ffffff;\"> – with up to a three-year battery life, the Spider AT 3000 is optimized for assets that are fixed or move infrequently. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfoFlash:CONTENT_ID=65&amp;User:LANGUAGE=en\">Spider AT 4000</a><span style=\"font-size: 11px; background-color: #ffffff;\"> – possessing the battery life of the Spider AT 3000, the Spider AT 4000 features a non-charging power option for those applications that may move and need more frequent reporting while powered and/or mobile.</span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfoFlash:CONTENT_ID=66&amp;User:LANGUAGE=en\">Spider AT 3010</a><span style=\"font-size: 11px; background-color: #ffffff;\"> – Similar features to the Spider AT 3000, but with fewer reports over the life of the product; the Spider AT 3010, however, can produce more frequent reporting for “recovery” conditions. </span></p>'),(84,'<p><span style=\"font-size: 11px; background-color: #ffffff;\">From the oil pipeline to the soft drink dispenser, today’s visionary companies rely on remote data communications to collect data from their remote assets, enhancing their bottom line by allowing their business to operate more efficiently through the management and utilization of critical, decision-based data. This certified, quad-band integrated IP-based platform is compact and economical, ensuring cost-effective connectivity in a small robust platform. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">Designed with GSM/GPRS connectivity for global deployments, the SA family has been designed to enhance your visibility into remotely-located fixed assets. Similar to Enfora’s industry-leading portfolio of integrated Mobile Tracking products, the SA family connects the world’s leading companies to their fixed assets, Anywhere, Anytime. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">Fixed assets of various types can benefit greatly from this fully programmable platform, with voice communications, a wide operational environment and much more. the units are designed to be easily deployed and provisioned, supplying critical information from industrial automation applications, supply and cold chain environments, fixed asset deployments, and a host of applications where companies require connectivity to serially-connected and sensor-generated data. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">The SA family is part of Enfora’s intelligent telemetry devices, featuring superior performance in a small package for ultimate flexibility. Coupled with the robust </span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfo:CONTENT_ID=104&amp;User:LANGUAGE=en\">N4A Management and Communications Software</a><span style=\"font-size: 11px; background-color: #ffffff;\"> platform, devices can be provisioned, monitored and reconfigured remotely, most anywhere in the world. Driven by the </span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfo:CONTENT_ID=78&amp;User:LANGUAGE=en\">services architecture</a><span style=\"font-size: 11px; background-color: #ffffff;\">, Enfora delivers a flexible, modular architecture for fast wireless asset tracking, solutions development and deployment. Keeping you connected to your company’s fixed and mobile assets, Anywhere, Anytime.</span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><strong style=\"font-size: 11px; background-color: #ffffff;\">Popular Use Cases for the Spider SA family:</strong><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfoFlash:CONTENT_ID=70&amp;User:LANGUAGE=en\">Spider SA-G+</a><span style=\"font-size: 11px; background-color: #ffffff;\"> - the SA-G+ is a full-featured telemetry platform with serial and user-defined I/O ports designed to communicate with sensors and most any serial-based communications device.</span></p>'),(85,'<div class=\"space\" style=\"padding: 10px; margin: 0px; color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\">\r\n<p style=\"margin-bottom: 15px; margin-top: 10px;\"><span style=\"font-family: arial; font-size: 11px;\">Novatel Wireless, Inc. is a leader in the design and development of intelligent wireless solutions based on 2G, 3G and 4G technologies providing wireless connectivity. The Company delivers specialized wireless solutions to carriers, distributors, retailers, OEMs and vertical markets worldwide. Novatel Wireless\' intelligent mobile hotspot products, software, USB modems, embedded modules and smart M2M modules provide innovative anywhere, anytime communications solutions for consumers and enterprises.</span></p>\r\n<p style=\"margin-bottom: 15px; margin-top: 10px;\"><span style=\"font-family: arial; font-size: 11px;\">Headquartered in San Diego, California, Novatel Wireless, Inc. has been issued over 30 technology patents and has established partnerships with leading telecom operators, infrastructure providers and device manufacturers around the world. Novatel Wireless, Inc. is listed on NASDAQ: NVTL. <br /></span></p>\r\n</div>\r\n<div class=\"space\" style=\"padding: 10px; margin: 0px; color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\"><span style=\"font-family: arial; font-size: 11px;\"><span style=\"font-family: arial; font-size: 11px;\"><strong>Target</strong><br />Novatel Wireless, Inc. partners with wireless network operators, distributors, original equipment manufacturers (OEMs), and vertical markets worldwide to offer wireless connectivity solutions that meet the unique needs of the following markets:<br /><br /></span></span>\r\n<table class=\"spectable\" style=\"border-right-width: 1px; border-right-style: solid; border-right-color: #cccccc; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: #cccccc;\" width=\"100%\" border=\"0\" cellspacing=\"0\" cellpadding=\"4\">\r\n<tbody>\r\n<tr>\r\n<td class=\"specheader\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333; background-color: #eeeeee;\" valign=\"top\"><strong>Mobile Workforce</strong></td>\r\n<td class=\"speccell\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333;\" valign=\"top\">Business Professionals, Consumers, Sales Force, Field Service</td>\r\n</tr>\r\n<tr>\r\n<td class=\"specheader\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333; background-color: #eeeeee;\" valign=\"top\"><strong>Public Safety</strong></td>\r\n<td class=\"speccell\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333;\" valign=\"top\">Homeland Security, Police, Fire, Traffic, Highway, Bridge</td>\r\n</tr>\r\n<tr>\r\n<td class=\"specheader\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333; background-color: #eeeeee;\" valign=\"top\"><strong>Telematics</strong></td>\r\n<td class=\"speccell\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333;\" valign=\"top\">Automated Vehicle Location, Theft Recovery, Vehicle Monitoring</td>\r\n</tr>\r\n<tr>\r\n<td class=\"specheader\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333; background-color: #eeeeee;\" valign=\"top\"><strong>Telemetry</strong></td>\r\n<td class=\"speccell\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333;\" valign=\"top\">Point Of Sale, ATM, Machine to Machine, Plant, Video, Theft Recovery, Vending, Meter Reading, Location Based Services</td>\r\n</tr>\r\n<tr>\r\n<td class=\"specheader\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333; background-color: #eeeeee;\" valign=\"top\"><strong>Transportation</strong></td>\r\n<td class=\"speccell\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333;\" valign=\"top\">Trucking, Courier, Fleet Management</td>\r\n</tr>\r\n<tr>\r\n<td class=\"specheader\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333; background-color: #eeeeee;\" valign=\"top\"><strong>Utilities</strong></td>\r\n<td class=\"speccell\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333;\" valign=\"top\">Gas, Electric, Cable, Telephone</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<span style=\"font-family: arial; font-size: 11px;\"><br /><br /><strong>Direction for the Future</strong><br />Novatel Wireless, Inc. is uniquely poised to take advantage of the burgeoning wireless market. The company has built a reputation for quality, reliable, innovative products that serve a broad audience. On the road ahead, Novatel Wireless, Inc. intends to stay ahead of the curve by continuing to form alliances with industry-leading partners, diversifying its product offerings and supporting the latest wireless technologies. <br /></span></div>'),(86,'<table class=\"blog\" style=\"padding: 10px; margin: 0px; width: 670px; color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: start;\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\">\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td class=\"contentheading\" style=\"padding: 10px; margin: 0px; font-size: 18px; line-height: 18px; color: #00245d; font-weight: bold;\" width=\"100%\">Peter V. Leparulo, Chairman and Chief Executive Officer</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\" valign=\"top\">\r\n<div class=\"space\" style=\"padding: 10px; margin: 0px;\"><img title=\"Peter V. Leparulo, Chairman and Chief Executive Officer\" src=\"http://www.novatelwireless.com/images/stories/aboutus/PeterLeparulo.jpg\" alt=\"Peter V. Leparulo, Chairman and Chief Executive Officer\" align=\"left\" border=\"0\" hspace=\"5\" />\r\n<div><em>Peter V. Leparulo</em> has served as a director since May 2003, as our Chairman since November 2006 and as our Chief Executive Officer since April 2008. He also served as our Chief Executive Officer from January 2003 to November 2007. From May 2001 to January 2003, he served as our Senior Vice President, General Manager, CDMA Operations. From September 2000 to May 2001, he served as our Senior Vice President, Corporate and Strategic Development and General Counsel. From June 1998 until September 2000, Mr. Leparulo was a Senior Partner at the law firm of Orrick, Herrington &amp; Sutcliffe LLP, where he specialized in corporate finance, mergers and acquisitions, securities, intellectual property and general corporate matters. Prior to joining Orrick, Mr. Leparulo was a Partner at the law firm of Pillsbury Madison &amp; Sutro LLP, from January 1992 until June 1998, and an Associate at that firm from October 1989 until January 1992. He holds a Bachelor of Science from Colgate University and a Juris Doctor from Case Western Reserve University.</div>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<span class=\"article_separator\"> </span></td>\r\n</tr>\r\n<tr>\r\n<td valign=\"top\">\r\n<table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"article_column\" valign=\"top\" width=\"100%\">\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td class=\"contentheading\" style=\"padding: 10px; margin: 0px; font-size: 18px; line-height: 18px; color: #00245d; font-weight: bold;\" width=\"100%\">Kenneth Leddon, Senior Vice President and Chief Financial Officer</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\" valign=\"top\">\r\n<div class=\"space\" style=\"padding: 10px; margin: 0px;\"><img title=\"Kenneth Leddon, Senior Vice President and Chief Financial Officer\" src=\"http://www.novatelwireless.com/images/stories/aboutus/Leddon-hires.jpg\" alt=\"Kenneth Leddon, Senior Vice President and Chief Financial Officer\" width=\"153\" height=\"214\" align=\"left\" border=\"0\" hspace=\"5\" /><em>Kenneth G. Leddon</em> has served as our Senior Vice President and Chief Financial Officer since January 2008. From November 2007 to January 2008, he served as our interim Chief Financial Officer. Before joining us, Mr. Leddon was a principal in the management consulting firm of Leddon &amp; Associates from September 2006 until November 2007. Prior to that, he was a principal in the management consulting firm of Pathway Strategic Partners from November 2002 to September 2006. Mr. Leddon also served as an interim executive or financial advisor for several companies while employed with two nationally recognized management consulting firms, XRoads Solutions Group, LLC and Buccino &amp; Associates, Inc. He also served as Chief Financial Officer and Vice President for several portfolio companies of Milhous Group, a private equity firm that was based in California. Mr. Leddon started his career at U.S. Steel Corporation, where he held several financial management positions during his 10 year tenure. Mr. Leddon holds a Bachelor of Science in Business Administration from California State University-Northridge and a Master of Science in Business Administration from Robert Morris University.</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<span class=\"article_separator\"> </span>\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td class=\"contentheading\" style=\"padding: 10px; margin: 0px; font-size: 18px; line-height: 18px; color: #00245d; font-weight: bold;\" width=\"100%\">Slim S. Souissi, Senior Vice President and Chief Technology Officer</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\" valign=\"top\">\r\n<div class=\"space\" style=\"padding: 10px; margin: 0px;\">\r\n<p style=\"margin-bottom: 15px; margin-top: 10px;\"><img title=\"Slim S. Souissi, Senior Vice President and Chief Technology Officer\" src=\"http://www.novatelwireless.com/images/stories/aboutus/SlimSouissi.jpg\" alt=\"Slim S. Souissi, Senior Vice President and Chief Technology Officer\" align=\"left\" border=\"0\" hspace=\"5\" /></p>\r\n<p style=\"margin-bottom: 15px; margin-top: 10px;\"><em>Slim S. Souissi</em> has served as our Senior Vice President and Chief Technology Officer since 2004 and served as our Vice President and Chief Technology Officer from October 2002 to 2004. He previously served as our Vice President of Emerging Technologies from December 2001 to October 2002 and as our Principal Research Scientist from May 2000 to December 2001. Prior to joining us in 2002, Dr. Souissi was Principal Staff Engineer in Motorola’s research and development operation from November 1994 to May 2000. Dr. Souissi earned a Ph.D. and a Master of Science in Electrical Engineering from the Georgia Institute of Technology, a Master of Science in Digital Signal Processing from the Ecole Superieure d’Electricite (France) and a Master of Science in Engineering from the Ecole Centrale Marseille (France). Dr. Souissi holds 37 U.S. patents, all related to wireless technology.</p>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<span class=\"article_separator\"> </span>\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td class=\"contentheading\" style=\"padding: 10px; margin: 0px; font-size: 18px; line-height: 18px; color: #00245d; font-weight: bold;\" width=\"100%\">Robert M. Hadley, Chief Marketing Officer</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\" valign=\"top\">\r\n<div class=\"space\" style=\"padding: 10px; margin: 0px;\"><img src=\"http://www.novatelwireless.com/images/stories/rob_headshot.png\" alt=\"\" align=\"left\" border=\"0\" hspace=\"5\" /><em>Robert M. Hadley</em> became our Chief Marketing Officer in March 2009 and served as a Senior Technical Advisor for the Company in the office of the Chief Executive Officer since March 2008. From 2004 to early 2008, Mr. Hadley was the Company’s Senior Vice President of Worldwide Sales and Marketing and was our Vice President of Sales and Marketing in 2003. He served as our Vice President of Strategic Accounts from April 2001 to December 2002. Before initially joining us, Mr. Hadley was Vice President of Sales for e-SIM Ltd., a provider of advanced simulation technology for product development. Mr. Hadley also previously held various senior sales and marketing positions at Aonix, a Thomson Software company providing IT solutions for corporate enterprise reporting and lifestyle software development markets, where he rose to the position of Vice President of Marketing. Mr. Hadley holds a Bachelor of Science in Computer Science from San Diego State University.</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<span class=\"article_separator\"> </span>\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td class=\"contentheading\" style=\"padding: 10px; margin: 0px; font-size: 18px; line-height: 18px; color: #00245d; font-weight: bold;\" width=\"100%\">Chris Ross, Senior Vice President of Operations</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\" valign=\"top\">\r\n<div class=\"space\" style=\"padding: 10px; margin: 0px;\"><img title=\"Chris Ross, Senior Vice President of Operations\" src=\"http://www.novatelwireless.com/images/stories/aboutus/ChrisRoss.jpg\" alt=\"Chris Ross, Senior Vice President of Operations\" align=\"left\" border=\"0\" hspace=\"5\" /><em>Christopher J. Ross</em> has served as our Vice President of Operations since July 2005 and our Senior Vice President of Operations since August 2007. From 1999 to July 2005, Mr. Ross was Vice President of Operations at Ericsson Wireless Communications where he was responsible for world-wide supply of wireless telecommunications infrastructure based on CDMA radio access technology. From 1994 to 1999, he was Vice President, Manufacturing at QUALCOMM where he was an operations executive. Prior to joining QUALCOMM, he was Vice President of Manufacturing at Spectragraphics where he founded the company’s contract manufacturing subsidiary (SMS Technologies) and also served as its General Manager. Mr. Ross holds both Bachelor and Master of Electrical Engineering degrees from Manhattan College.</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<span class=\"article_separator\"> </span>\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td class=\"contentheading\" style=\"padding: 10px; margin: 0px; font-size: 18px; line-height: 18px; color: #00245d; font-weight: bold;\" width=\"100%\">Catherine F. Ratcliffe, Senior Vice President of Business Affairs and General Counsel</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\" valign=\"top\"><img title=\"Catherine F. Ratcliffe, Senior Vice President of Business Affairs and General Counsel\" src=\"http://www.novatelwireless.com/images/stories/aboutus/Ratcliff1.jpg\" alt=\"Catherine F. Ratcliffe, Senior Vice President of Business Affairs and General Counsel\" align=\"left\" border=\"0\" hspace=\"5\" /><em>Catherine F. Ratcliffe</em> has served as our Senior Vice President, Business Affairs, General Counsel and Secretary since August 2007 and served as our Vice President, Business Affairs and Secretary from May 2004 until August 2007. From 2002 to 2004, she practiced law, including as a Partner in the law firm of Lamb &amp; Kawakami. From 1997 to 2002 she was Vice President, General Counsel &amp; Human Resources at Day Runner, Inc. She was a Partner in the law firm of Bryan Cave LLP practicing in the areas of corporate finance, securities and mergers and acquisitions, from 1992 to 1997. Ms. Ratcliffe holds a Bachelor of Arts from the University of California at Los Angeles and a Juris Doctor from the University of California at Berkeley.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>'),(87,'<p>Latest News: Vestibulum id ligula porta felis euismod semper. Nulla vitae elit libero, a pharetra auguMorbi leo risus, porta ac con.</p>'),(88,'<img style=\"margin-left:10px\" src=\"/themes/novatel/img/home/spotlight-4.png\">\r\n<img style=\"margin-left:10px\" src=\"/themes/novatel/img/home/spotlight-3.png\">\r\n<img style=\"margin-left:10px\" src=\"/themes/novatel/img/home/spotlight-2.png\">\r\n<img style=\"margin-left:10px\" src=\"/themes/novatel/img/home/spotlight-1.png\">'),(89,'<img style=\"margin-left:40px\" src=\"/themes/novatel/img/home/spotlight-4.png\">\r\n<img style=\"margin-left:20px\" src=\"/themes/novatel/img/home/spotlight-3.png\">\r\n<img style=\"margin-left:20px\" src=\"/themes/novatel/img/home/spotlight-2.png\">\r\n<img style=\"margin-left:20px\" src=\"/themes/novatel/img/home/spotlight-1.png\">'),(90,'<img style=\"margin-left:38px\" src=\"/themes/novatel/img/home/spotlight-4.png\">\r\n<img style=\"margin-left:27px\" src=\"/themes/novatel/img/home/spotlight-3.png\">\r\n<img style=\"margin-left:27px\" src=\"/themes/novatel/img/home/spotlight-2.png\">\r\n<img style=\"margin-left:27px\" src=\"/themes/novatel/img/home/spotlight-1.png\">'),(91,'<img style=\"margin-left:35px\" src=\"/themes/novatel/img/home/spotlight-4.png\">\r\n<img style=\"margin-left:35px\" src=\"/themes/novatel/img/home/spotlight-3.png\">\r\n<img style=\"margin-left:35px\" src=\"/themes/novatel/img/home/spotlight-2.png\">\r\n<img style=\"margin-left:35px\" src=\"/themes/novatel/img/home/spotlight-1.png\">'),(93,'<p><a href=\"#\">Where to Buy</a>   |   <a href=\"#\">Contact Us</a>    </p>'),(94,'<p><img src=\"{CCM:FID_3}\" alt=\"generic_rightrail.png\" width=\"242\" height=\"231\" /></p>'),(106,'<p><a href=\"#\">See More Mobile Devices &gt;</a></p>'),(107,'<h1>MiFi® 4620L</h1>'),(109,'<p>MiFi® 4620LIntelligent Mobile Hotspot</p>\r\n<p><strong>Fast, always-on Internet wherever you roam—worldwide*</strong></p>\r\n<p>With the Verizon Jetpack™ 4G LTE Mobile Hotspot MiFi® 4620L by Novatel Wireless, access blazing fast 4G LTE and 3G mobile broadband worldwide and share your connection with up to ten Wi-Fi enabled devices simultaneously. MiFi 4620L is the next generation in the Novatel Wireless MiFi intelligent mobile hotspot portfolio for Verizon Wireless, built on award-winning innovation and design, proven performance and industry leading user experience.</p>\r\n<p><strong>Put the world in the palm of your hand</strong></p>\r\n<p>With this 4G LTE MiFi intelligent mobile hotspot, enjoy fast Internet access whenever, wherever you go. MiFi 4620L is backward compatible with high speed DC HSPA+, HSPA+, WCDMA, EDGE and GPRS technologies to keep you connected. The compact MiFi 4620L is perfect for on-the-go connectivity and won’t weigh you down.</p>\r\n<p><a href=\"#\"><img src=\"{CCM:FID_7}\" alt=\"where-to-buy-button.png\" width=\"101\" height=\"27\" /></a></p>'),(111,'<p>MiFi® 4620L Intelligent Mobile Hotspot</p>\r\n<p><strong>Fast, always-on Internet wherever you roam—worldwide*</strong></p>\r\n<p>With the Verizon Jetpack™ 4G LTE Mobile Hotspot MiFi® 4620L by Novatel Wireless, access blazing fast 4G LTE and 3G mobile broadband worldwide and share your connection with up to ten Wi-Fi enabled devices simultaneously. MiFi 4620L is the next generation in the Novatel Wireless MiFi intelligent mobile hotspot portfolio for Verizon Wireless, built on award-winning innovation and design, proven performance and industry leading user experience.</p>\r\n<p><strong>Put the world in the palm of your hand</strong></p>\r\n<p>With this 4G LTE MiFi intelligent mobile hotspot, enjoy fast Internet access whenever, wherever you go. MiFi 4620L is backward compatible with high speed DC HSPA+, HSPA+, WCDMA, EDGE and GPRS technologies to keep you connected. The compact MiFi 4620L is perfect for on-the-go connectivity and won’t weigh you down.</p>\r\n<p><a href=\"#\"><img src=\"{CCM:FID_7}\" alt=\"where-to-buy-button.png\" width=\"101\" height=\"27\" /></a></p>'),(112,'<h1>MiFi® 4620L</h1>'),(113,'<p>MiFi® 4620L Intelligent Mobile Hotspot</p>\r\n<p><strong>Fast, always-on Internet wherever you roam—worldwide*<br /></strong>With the Verizon Jetpack™ 4G LTE Mobile Hotspot MiFi® 4620L by Novatel Wireless, access blazing fast 4G LTE and 3G mobile broadband worldwide and share your connection with up to ten Wi-Fi enabled devices simultaneously. MiFi 4620L is the next generation in the Novatel Wireless MiFi intelligent mobile hotspot portfolio for Verizon Wireless, built on award-winning innovation and design, proven performance and industry leading user experience.</p>\r\n<p><strong>Put the world in the palm of your hand<br /></strong>With this 4G LTE MiFi intelligent mobile hotspot, enjoy fast Internet access whenever, wherever you go. MiFi 4620L is backward compatible with high speed DC HSPA+, HSPA+, WCDMA, EDGE and GPRS technologies to keep you connected. The compact MiFi 4620L is perfect for on-the-go connectivity and won’t weigh you down.</p>\r\n<p><a href=\"#\"><img src=\"{CCM:FID_7}\" alt=\"where-to-buy-button.png\" width=\"101\" height=\"27\" /></a></p>'),(117,'<p class=\"small\"><a href=\"#\">Developer Lounge</a>        <a href=\"#\">Privacy Policy</a>        <a href=\"#\">Terms of Use</a>        Copyright <strong><span>©</span></strong> 2012 Novatel Wireless, Inc. All rights reserved.</p>'),(127,'<h1>Another Block</h1>\r\n<ul>\r\n<li>List Item</li>\r\n<li>List Item</li>\r\n<li>List Item</li>\r\n</ul>'),(128,'<h1>Sidebar Header Example</h1>\r\n<p>Sidebar Content</p>'),(129,'<h1>Another Block</h1>\r\n<ul>\r\n<li>List Item</li>\r\n<li>List Item</li>\r\n<li>List Item</li>\r\n</ul>'),(131,'<p class=\"MsoNormal\"><span style=\"font-size: 8.5pt; line-height: 115%; font-family: Verdana; background-color: white; background-position: initial initial; background-repeat: initial initial;\">The Novatel Wireless professional services experience is driving a profound technology transformation and broadband wireless users are demanding ubiquitous connectivity for a host of new applications. Whether you are perfecting a reference design, developing a new product or modifying and existing application our design engineers can help. With a strong knowledge base, real-world experiences in a wide variety of market and vertical segments and a demonstrable, results driving mentality, Novatel Wireless delivers.</span><span style=\"font-size: 8.5pt; line-height: 115%; font-family: Verdana;\"><br /> <br /> <span style=\"background: white;\">Revolutionized antenna designs, creative communications solutions, small form factors, low-power consumption and more, Novatel Wireless brings real-world design experience to help you get there faster, with less effort and on-budget.</span><br /> <br /> <span style=\"background: white;\">Our Product Line Managers and Project Management office is comprised of a team of talented engineers with years of design and product development knowledge, built to work closely with your company to define a project, its time lines and deliverables. Once your project is approved, a dedicated Project Manager is assigned to ensure your ultimate success.</span><br /> <br /> <span style=\"background: white;\">Working in close partnership with our customers, Novatel Wireless has helped to bring many designs to life, shortening product development and deployment cycles. Whether you need to tweak a small parameter in your product, develop something new or start a project and have it managed from the ground up, we can provide the expertise to get your project moving in the right direction.</span><br /> <br /> <span style=\"background: white;\">The<span class=\"apple-converted-space\"> </span></span></span><a href=\"http://www.enfora.com/index.cgi?PageInfo:CONTENT_ID=78&amp;User:LANGUAGE=en\"><span style=\"font-size: 8.5pt; line-height: 115%; font-family: Verdana; color: windowtext; background: white; mso-bidi-font-weight: bold; text-decoration: none; text-underline: none;\">architecture</span></a><span class=\"apple-converted-space\"><span style=\"font-size: 8.5pt; line-height: 115%; font-family: Verdana; background-color: white; background-position: initial initial; background-repeat: initial initial;\"> </span></span><span style=\"font-size: 8.5pt; line-height: 115%; font-family: Verdana; background-color: white; background-position: initial initial; background-repeat: initial initial;\">helps make it simple, do you have a special design challenge or just want help getting past a small issue? No project is too small or too big; we have assisted many of today’s global 1000 companies with innovative designs, engineering assistance and creative ways to connect to their customers.</span></p>'),(133,'<p class=\"HeadingProductname\"><span style=\"font-size: 11pt; line-height: 115%; font-family: Calibri;\">Novatel Wireless has a robust M2M software offering that can quickly build connectivity from your Internet Protocol (IP)-enabled remote assets to your existing enterprise applications. We provide the ability to choose a right-sized option for your enterprise needs. Our platform includes the following products: <a href=\"http://www.enfora.com/index.cgi?CONTENT_ID=1723&amp;User:LANGUAGE=en\"> the <span style=\"color: windowtext; text-decoration: none; text-underline: none;\">N4A</span><sup><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; color: windowtext; position: relative; top: -2.0pt; mso-text-raise: 2.0pt; text-decoration: none; text-underline: none;\">TM</span></sup><span style=\"color: windowtext; text-decoration: none; text-underline: none;\"> Communications and Management Software (CMS)</span> </a><span class=\"MsoHyperlink\">and the N4A</span></span><span class=\"MsoHyperlink\"><span style=\"font-size: 11.0pt; line-height: 115%; font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">™</span><span style=\"font-size: 11.0pt; line-height: 115%; font-family: Calibri; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"> Device Manager. </span></span><span style=\"font-size: 11pt; line-height: 115%; font-family: Calibri;\">With our decades of cumulative experience in wireless data and M2M environments, we can help you choose the best products, formats, and options to enhance your remote intelligence gathering capabilities, putting that data at the fingertips of corporate decision makers to identify device issues, decrease out-of-service time, track shipments, improve worker productivity, and more.</span></p>'),(134,'<h3>Highlights</h3>\r\n<p class=\"t1\"><span class=\"ccm-note\">Novatel Wireless accelerates solution delivery by quickly building connectivity from a customer’s Internet Protocol (IP)-enabled remote assets to their existing enterprise applications. Removing the inherent complexities of wireless networks and their communications protocols, our N4A™ Communications and Management Software (CMS) enables database or web service-driven control and management of Enfora® remote devices. Using a standard web-based user interface, customers have a detailed mobile asset view, enabling proactive management as well as necessary system upgrades. Additionally, using the built-in device configuration and service management capabilities, N4A™ CMS effectively manages and applies device configurations across multiple device groups.</span></p>\r\n<p class=\"t1\">Available as an on-premise solution, N4A™ CMS is particularly well suited to customers who:</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Need a functional application up and running quickly</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Lack the man hours or expertise necessary to master device and session management</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Want to capitalize on our experience with wireless devices and network operators</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Require flexible integration options</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Prefer to focus resources on their in-house application software development</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Need a simple web service interface for programmatic interaction</p>\r\n<h3>A Scalable Solution</h3>\r\n<p class=\"t1\">The flexibility of our N4A™ software architecture makes it possible to integrate a broad range of existing solutions. The N4A™ CMS application has been architected to scale, functioning in environments varying from a single-server demo to those with carrier-grade requirements. The application may be scaled vertically and horizontally, depending on customer requirements. N4A™ CMS is designed for the multitenant requirements of resellers and company organizations.</p>\r\n<h3>Exceptional Support</h3>\r\n<p class=\"t1\">Novatel Wireless has an exceptional customer support infrastructure, with Technical Account Managers (TAMs) and Field Applications Engineers (FAEs) around the globe available to deliver customer-driven support options both pre- and post-installation.</p>\r\n<!--EndFragment-->\r\n<p> </p>'),(135,'<p><span style=\"font-size: medium;\"><span style=\"line-height: 115%; font-family: Calibri;\">Novatel Wireless has a robust M2M software offering that can quickly build connectivity from your Internet Protocol (IP)-enabled remote assets to your existing enterprise applications. We provide the ability to choose a right-sized option for your enterprise needs. Our platform includes the following products: <a href=\"http://www.enfora.com/index.cgi?CONTENT_ID=1723&amp;User:LANGUAGE=en\"> the <span style=\"color: windowtext; text-decoration: none;\">N4A</span><sup><span style=\"line-height: 115%; color: windowtext; position: relative; top: -2pt; text-decoration: none;\">TM</span></sup><span style=\"color: windowtext; text-decoration: none;\"> Communications and Management Software (CMS)</span> </a><span class=\"MsoHyperlink\">and the N4A</span></span><span class=\"MsoHyperlink\"><span style=\"line-height: 115%; font-family: Calibri;\">™</span><span style=\"line-height: 115%; font-family: Calibri;\"> Device Manager. </span></span><span style=\"line-height: 115%; font-family: Calibri;\">With our decades of cumulative experience in wireless data and M2M environments, we can help you choose the best products, formats, and options to enhance your remote intelligence gathering capabilities, putting that data at the fingertips of corporate decision makers to identify device issues, decrease out-of-service time, track shipments, improve worker productivity, and more.</span></span></p>'),(136,'<h3>Highlights</h3>\r\n<p class=\"t1\"><span class=\"ccm-note\">Novatel Wireless accelerates solution delivery by quickly building connectivity from a customer’s Internet Protocol (IP)-enabled remote assets to their existing enterprise applications. Removing the inherent complexities of wireless networks and their communications protocols, our N4A™ Communications and Management Software (CMS) enables database or web service-driven control and management of Enfora® remote devices. Using a standard web-based user interface, customers have a detailed mobile asset view, enabling proactive management as well as necessary system upgrades. Additionally, using the built-in device configuration and service management capabilities, N4A™ CMS effectively manages and applies device configurations across multiple device groups.</span></p>\r\n<p class=\"t1\">Available as an on-premise solution, N4A™ CMS is particularly well suited to customers who:</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Need a functional application up and running quickly</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Lack the man hours or expertise necessary to master device and session management</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Want to capitalize on our experience with wireless devices and network operators</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Require flexible integration options</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Prefer to focus resources on their in-house application software development</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Need a simple web service interface for programmatic interaction</p>\r\n<h3>A Scalable Solution</h3>\r\n<p class=\"t1\">The flexibility of our N4A™ software architecture makes it possible to integrate a broad range of existing solutions. The N4A™ CMS application has been architected to scale, functioning in environments varying from a single-server demo to those with carrier-grade requirements. The application may be scaled vertically and horizontally, depending on customer requirements. N4A™ CMS is designed for the multitenant requirements of resellers and company organizations.</p>\r\n<h3>Exceptional Support</h3>\r\n<p class=\"t1\">Novatel Wireless has an exceptional customer support infrastructure, with Technical Account Managers (TAMs) and Field Applications Engineers (FAEs) around the globe available to deliver customer-driven support options both pre- and post-installation.</p>\r\n<!--EndFragment-->\r\n<p> </p>'),(137,'<p><span style=\"font-size: small;\"><span style=\"line-height: 115%; font-family: Calibri;\">Novatel Wireless has a robust M2M software offering that can quickly build connectivity from your Internet Protocol (IP)-enabled remote assets to your existing enterprise applications. We provide the ability to choose a right-sized option for your enterprise needs. Our platform includes the following products: <a href=\"http://www.enfora.com/index.cgi?CONTENT_ID=1723&amp;User:LANGUAGE=en\"> the <span style=\"color: windowtext; text-decoration: none;\">N4A</span><sup><span style=\"line-height: 115%; color: windowtext; position: relative; top: -2pt; text-decoration: none;\">TM</span></sup><span style=\"color: windowtext; text-decoration: none;\"> Communications and Management Software (CMS)</span> </a><span class=\"MsoHyperlink\">and the N4A</span></span><span class=\"MsoHyperlink\"><span style=\"line-height: 115%; font-family: Calibri;\">™</span><span style=\"line-height: 115%; font-family: Calibri;\"> Device Manager. </span></span><span style=\"line-height: 115%; font-family: Calibri;\">With our decades of cumulative experience in wireless data and M2M environments, we can help you choose the best products, formats, and options to enhance your remote intelligence gathering capabilities, putting that data at the fingertips of corporate decision makers to identify device issues, decrease out-of-service time, track shipments, improve worker productivity, and more.</span></span></p>'),(138,'<h3>Highlights </h3>\r\n<p class=\"t1\">The N4A™ Device Manager is a user interface that provides logical management and device provisioning of IP-based M2M devices.  It speeds time to market while managing a large number of devices within a system. It is compatible with all Enfora® M2M devices and may be purchased as a hosted or on-premise solution. N4A™ Device Manager increases your control of your remote assets by providing the following features:                      </p>\r\n<p><!--[if !supportLists]--><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">  </span></span><!--[endif]-->View, change and manage device configuration and scripts</p>\r\n<p><!--[if !supportLists]--><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">  </span></span><!--[endif]-->Manage single devices or groups of devices</p>\r\n<p><!--[if !supportLists]--><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">  </span></span><!--[endif]-->Complete device history to assist in self-care and issue resolution (plus alerting and logging capability with on-premise solution</p>\r\n<p><!--[if !supportLists]--><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">  </span></span><!--[endif]-->Monitor device health and operational status</p>\r\n<p><!--[if !supportLists]--><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">  </span></span><!--[endif]-->Provide Over-The-Air updates</p>\r\n<p><!--[if !supportLists]--><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">  </span></span><!--[endif]-->Manage user accounts and device privileges with multiple administration levels</p>\r\n<p><!--[if !supportLists]--><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">  </span></span><!--[endif]-->Access shipment tracking</p>\r\n<h3>Exceptional Support</h3>\r\n<p>Novatel Wireless has an exceptional customer support infrastructure, with Technical Account Managers (TAMs) and Field Applications Engineers (FAEs) around the globe available to deliver customer-driven support options both pre- and post-installation.</p>\r\n<p> </p>'),(139,'<h3 class=\"HeadingProductname\">Workforce Monitoring Solutions</h3>\r\n<p class=\"t1\">Lone-workers in hazardous environments who may find themselves in a man-down situation, operators of small fleets needing to maintain simple yet effective communication with their workers, wandering or lost children and Alzheimer’s patients who may need access to a panic button or simple voice communication: these are just a few of the Mobile Resource Management (MRM) challenges that must be addressed by any M2M provider in today’s market. Connectivity combined with location-based features and reporting in a user-friendly format are imperatives to success for any MRM device in the personal and workforce safety market; such devices must be easily deployed and provisioned, and monitored by a reliable end-to-end solution.</p>\r\n<h3>Driving Business Applications</h3>\r\n<p>The Enfora<sup>®</sup> Personnel Monitoring Series provides flexibility in global MRM monitoring for the following target markets:</p>\r\n<p> </p>\r\n<p>- Personal &amp; Remote Worker Tracking</p>\r\n<p>- Child &amp; Teen Tracking</p>\r\n<p>- Mobile/Home Healthcare</p>\r\n<p>- Emergency Response</p>\r\n<p>- Elderly Locator</p>\r\n<h3>Quality &amp; Reliability that Keeps Selling</h3>\r\n<p class=\"t1\">At Novatel Wireless we infuse quality in all we do, starting with well-defined <em><span style=\"text-decoration: underline;\"><span style=\"color: #7030a0;\">ISO 9001:2008</span></span></em><span style=\"color: #7030a0;\">*</span> engineering processes that cross both the consumer mobile computing and M2M cellular modem teams. Our longstanding relationships with industry leaders like Qualcomm® help us to accurately and efficiently integrate chipset capabilities into our in-house modem designs that ultimately drive our integrated devices while accelerating time to market. Our <em><span style=\"text-decoration: underline;\"><span style=\"color: #7030a0;\">Enfora® Enabler® Series </span></span></em>modules also experience statistically low returns—enhancing overall device stability—while our clients rate our RMA and support processes well above industry averages in yearly Customer Satisfaction Surveys. Those are statistics that engender customer loyalty and keep us working hard to make transitions simple and technology fresh.</p>\r\n<p class=\"MsoNormal\"> </p>'),(140,'<p> </p>\r\n<h2 class=\"HeadingProductname\">M2M Modules</h2>\r\n<h3>A Trusted Brand since 2005</h3>\r\n<p class=\"t1\">Continuing the successful Enabler® OEM module line that’s been a staple of the Enfora® M2M brand since its introduction in 2005, the Enabler® IIIG Series maintains the core features of using industry-leading chipset manufacturers as the basis of our trusted in-house designs and then overlaying our Smart Agent with its action-based intelligence onto the final modem design. With the recent expansion of the series beyond the Enabler® IIIG into our new HS Series, we provide you with even more module options for integration into your mission critical designs—while preserving the industry-leading intelligence and in-house expertise that’s led to our iconic brand success.</p>\r\n<h3>A Made-for-Migration Technology Line</h3>\r\n<p class=\"t1\">Whether you’re eager to migrate from 2G to 3G or between other technologies in our GSM/GPRS, 1xRTT (CDMA2000), and HSDPA/UMTS module line up, it will be easy to do with the common-by-design build of our extended HS Series of OEM modules. We’ve preserved the same 100-pin I/O and B2B RF connectors; a compatible x-y size and mounting; and the same firmware API, including our Smart Agent from our popular Enabler® IIIG Series. Another benefit of an Enabler® Series transition is that you can even reuse most of your valuable script features. So if you require a longer product life for your next-generation design—or your business plans include worldwide deployments, international roaming, regional expansion, carrier change, and/or better cellular coverage—we’ve already eased your transition and lessened your risk.</p>\r\n<h3>Enhancing Integrator Success</h3>\r\n<p class=\"t1\">Novatel Wireless supports module integrators by bringing an in-depth understanding of complex carrier networks and actively working with clients to achieve numerous regulatory approvals. In fact, we’ve taken Enfora® M2M modules through about 60 PTCRB and 10 new GCF certification approvals, have been a participant in the development of the GCF and PTCRB M2M approval requirements, and have expertise in nearly 20 other regulatory approval types. Novatel Wireless additionally can lower risk, speed time to market, and achieve cost discounts for our clients through long-standing relationships with third-party certifying labs.</p>\r\n<h3>Architected for Target Applications &amp; Markets</h3>\r\n<p class=\"t1\">A strong differentiator of our Enabler® HS Series of cellular modems that’s not immediately obvious is that—beyond working with world-class chipset manufacturers and integrating our actionable intelligence into our designs—we calibrate and align our hardware and low-level firmware to accommodate the needs of the target applications. So whether your battery-free telematics application needs extra low power or your fixed exterior monitoring site needs extended low temperature, we have you covered.  Some key target applications include:</p>\r\n<!--[if gte mso 9]><xml>\r\n <o:DocumentProperties>\r\n  <o:Revision>0</o:Revision>\r\n  <o:TotalTime>0</o:TotalTime>\r\n  <o:Pages>1</o:Pages>\r\n  <o:Words>20</o:Words>