arge;\">Data Card Modems</span></strong></p>\r\n<p><span style=\"color: #333333; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 12px; line-height: 20px; background-color: #ffffff;\">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</span></p>'),(258,'<p><strong><span style=\"font-size: large;\">Embedded Modules</span></strong></p>\r\n<p><span style=\"color: #333333; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 12px; line-height: 20px; background-color: #ffffff;\">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</span></p>'),(262,'<h1><span style=\"font-size: large;\"><strong>Novatel In the News</strong></span></h1>'),(267,'<p><span style=\"font-size: large;\"><strong><span style=\"background-color: #ffffff;\">Mobile Tracking</span></strong></span></p>\r\n<p><span style=\"font-size: 11px; background-color: #ffffff;\">The flagship of Enfora’s industry-leading portfolio of integrated Spider Mobile Tracking products, the MT series of platforms connect the world’s leading companies to their valuable mobile assets. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">The certified dual &amp; quad-band integrated devices are optimized for today’s increasing demand for vehicle recovery, fuel-efficient fleet operations, driver and vehicle profiling, and interactive communications. Providing complete GSM/GPRS communications, Enfora helps you track and monitor vehicles from the family car to the largest fleet of commercial vehicles. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">With superior GPS sensitivity, a programmable rules engine, polygon Geo-Fencing, integrated SMS commands, messaging and much more, the units are designed to be easily deployed and provisioned, supplying critical information for the most demanding fleet operator, buy-here pay-here dealers, or pay-as-you-go insurance company. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">Enfora’s intelligent mobile tracking devices feature superior performance in a small package for ultimate flexibility. Coupled with the robust N4A Communications and Management platform, devices can be provisioned, monitored and reconfigured remotely, most anywhere in the world. Driven by our services architecture, Enfora delivers a flexible, modular architecture for fast wireless asset tracking, solutions development and deployment. Keeping you Connected to your Assets, Anywhere, Anytime.</span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><strong style=\"font-size: 11px; background-color: #ffffff;\">Popular Use Cases for the Spider MT family:</strong><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfoFlash:CONTENT_ID=577&amp;User:LANGUAGE=en\">MT 4000/4100</a><span style=\"font-size: 11px; background-color: #ffffff;\"> – Designed for application providers, system integrators, and enterprise customers to optimize mobile resources and improve their bottom line, the MT 4000 is a flexible quad-band GSM/GPRS mobile tracking device, delivering the key product features powering the most demanding applications: fleet management, insurance telematics, teen tracking, vehicle location and recovery, and more.</span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfoFlash:CONTENT_ID=481&amp;User:LANGUAGE=en\">MT 3000/3050</a><span style=\"font-size: 11px; background-color: #ffffff;\"> – A certified dual-band integrated device, purpose-built for the Usage Based Insurance (UBI), telematics, and fleet management markets. Providing easy plug-and-play installation, the MT 3000 is designed for passenger cars, light trucks, and service vans.</span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfoFlash:CONTENT_ID=471&amp;User:LANGUAGE=en\">MT 2500</a><span style=\"font-size: 11px; background-color: #ffffff;\"> – Economical and feature rich, this quad-band 3-axis accelerometer equipped platform is enhanced with a 16 pin multi-I/O connector that includes two analog inputs, polygon geo-fencing capabilities, and more. An economical solution for vehicle recovery &amp; fleets with driver behavior reporting and multiple I/O requirements.</span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfoFlash:CONTENT_ID=68&amp;User:LANGUAGE=en\">MT-Gu w/Accelerometer</a><span style=\"font-size: 11px; background-color: #ffffff;\"> – Full-featured for the demanding fleet operator, this quad-band platform with voice capabilities provides an interface to select Garmin PNDs via the optional FMI plug-in, I/O support for sensor connectivity and an optional battery for communication when power is lost. The Spider MT-Gu is specially designed to grow as your business does. </span></p>'),(283,'<h1><span style=\"font-size: large;\">News &amp; Events</span></h1>\r\n<p><span style=\"font-size: small;\">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</span></p>\r\n<p><span style=\"font-size: small;\">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</span></p>\r\n<p><span style=\"font-size: small;\">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor