0in;\r\n	mso-para-margin-right:0in;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0in;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:Calibri;\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;}\r\n</style>\r\n<![endif]--> <!--StartFragment--></span></span></p>\r\n<h3>Highlights</h3>\r\n<p><span style=\"font-size: small;\"><span style=\"line-height: 115%; font-family: Calibri;\"></span></span></p>\r\n<p class=\"t1\">Novatel Wireless accelerates solution delivery by quickly building connectivity from a customer’s Internet Protocol (IP)-enabled remote assets to their existing enterprise applications. Removing the inherent complexities of wireless networks and their communications protocols, our N4A™ Communications and Management Software (CMS) enables database or web service-driven control and management of Enfora® remote devices. Using a standard web-based user interface, customers have a detailed mobile asset view, enabling proactive management as well as necessary system upgrades. Additionally, using the built-in device configuration and service management capabilities, N4A™ CMS effectively manages and applies device configurations across multiple device groups.</p>\r\n<p><span style=\"font-size: small;\"><span style=\"line-height: 115%; font-family: Calibri;\"></span></span></p>\r\n<p class=\"t1\">Available as an on-premise solution, N4A™ CMS is particularly well suited to customers who:</p>\r\n<p><span style=\"font-size: small;\"><span style=\"line-height: 115%; font-family: Calibri;\"></span></span></p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Need a functional application up and running quickly</p>\r\n<p><span style=\"font-size: small;\"><span style=\"line-height: 115%; font-family: Calibri;\"></span></span></p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Lack the man hours or expertise necessary to master device and session management</p>\r\n<p><span style=\"font-size: small;\"><span style=\"line-height: 115%; font-family: Calibri;\"></span></span></p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Want to capitalize on our experience with wireless devices and network operators</p>\r\n<p><span style=\"font-size: small;\"><span style=\"line-height: 115%; font-family: Calibri;\"></span></span></p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Require flexible integration options</p>\r\n<p><span style=\"font-size: small;\"><span style=\"line-height: 115%; font-family: Calibri;\"></span></span></p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Prefer to focus resources on their in-house application software development</p>\r\n<p><span style=\"font-size: small;\"><span style=\"line-height: 115%; font-family: Calibri;\"></span></span></p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Need a simple web service interface for programmatic interaction</p>\r\n<p><span style=\"font-size: small;\"><span style=\"line-height: 115%; font-family: Calibri;\"></span></span></p>\r\n<h3>A Scalable Solution</h3>\r\n<p><span style=\"font-size: small;\"><span style=\"line-height: 115%; font-family: Calibri;\"></span></span></p>\r\n<p class=\"t1\">The flexibility of our N4A™ software architecture makes it possible to integrate a broad range of existing solutions. The N4A™ CMS application has been architected to scale, functioning in environments varying from a single-server demo to those with carrier-grade requirements. The application may be scaled vertically and horizontally, depending on customer requirements. N4A™ CMS is designed for the multitenant requirements of resellers and company organizations.</p>\r\n<p><span style=\"font-size: small;\"><span style=\"line-height: 115%; font-family: Calibri;\"></span></span></p>\r\n<h3>Exceptional Support</h3>\r\n<p><span style=\"font-size: small;\"><span style=\"line-height: 115%; font-family: Calibri;\"></span></span></p>\r\n<p class=\"t1\">Novatel Wireless has an exceptional customer support infrastructure, with Technical Account Managers (TAMs) and Field Applications Engineers (FAEs) around the globe available to deliver customer-driven support options both pre- and post-installation.</p>\r\n<p><span style=\"font-size: small;\"><span style=\"line-height: 115%; font-family: Calibri;\"></span></span></p>\r\n<h2 class=\"HeadingProductname\">N4A™ <span style=\"background: white;\">Device Manager</span></h2>\r\n<h3>Highlights</h3>\r\n<p class=\"t1\">The N4A™ Device Manager is a user interface that provides logical management and device provisioning of IP-based M2M devices.  It speeds time to market while managing a large number of devices within a system. It is compatible with all Enfora® M2M devices and may be purchased as a hosted or on-premise solution. N4A™ Device Manager increases your control of your remote assets by providing the following features:                      </p>\r\n<p class=\"b1\"><!--[if !supportLists]--><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]-->View, change and manage device configuration and scripts</p>\r\n<p class=\"b1\"><!--[if !supportLists]--><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]-->Manage single devices or groups of devices</p>\r\n<p class=\"b1\"><!--[if !supportLists]--><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]-->Complete device history to assist in self-care and issue resolution (plus alerting and logging capability with on-premise solution)</p>\r\n<p class=\"b1\"><!--[if !supportLists]--><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]-->Monitor device health and operational status</p>\r\n<p class=\"b1\"><!--[if !supportLists]--><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]-->Provide Over-The-Air updates</p>\r\n<p class=\"b1\"><!--[if !supportLists]--><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]-->Manage user accounts and device privileges with multiple administration levels</p>\r\n<p class=\"b1\"><!--[if !supportLists]--><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]-->Access shipment tracking</p>\r\n<h3>Exceptional Support</h3>\r\n<p class=\"MsoNormal\">Novatel Wireless has an exceptional customer support infrastructure, with Technical Account Managers (TAMs) and Field Applications Engineers (FAEs) around the globe available to deliver customer-driven support options both pre- and post-installation.</p>\r\n<p><span style=\"font-size: small;\"><span style=\"line-height: 115%; font-family: Calibri;\"></span></span></p>\r\n<p class=\"t1\"> </p>\r\n<p><span style=\"font-size: small;\"><span style=\"line-height: 115%; font-family: Calibri;\"><!--EndFragment--><!--EndFragment--></span></span></p>'),(358,'<h1><span style=\"font-size: large;\"><strong>Distributors</strong></span></h1>'),(360,'<h1><span style=\"font-size: large;\"><strong>Industry</strong></span></h1>'),(366,'<h1><span style=\"font-size: large;\"><strong>Solution Partners</strong></span></h1>'),(369,'<h1><span style=\"font-size: large;\"><strong>O