e following products: <a href=\"http://www.enfora.com/index.cgi?CONTENT_ID=1723&amp;User:LANGUAGE=en\"> the <span style=\"color: windowtext; text-decoration: none;\">N4A</span><sup><span style=\"line-height: 115%; color: windowtext; position: relative; top: -2pt; text-decoration: none;\">TM</span></sup><span style=\"color: windowtext; text-decoration: none;\"> Communications and Management Software (CMS)</span> </a><span class=\"MsoHyperlink\">and the N4A</span></span><span class=\"MsoHyperlink\"><span style=\"line-height: 115%; font-family: Calibri;\">™</span><span style=\"line-height: 115%; font-family: Calibri;\"> Device Manager. </span></span><span style=\"line-height: 115%; font-family: Calibri;\">With our decades of cumulative experience in wireless data and M2M environments, we can help you choose the best products, formats, and options to enhance your remote intelligence gathering capabilities, putting that data at the fingertips of corporate decision makers to identify device issues, decrease out-of-service time, track shipments, improve worker productivity, and more.</span></span></p>\r\n<h2 class=\"HeadingProductname\">N4A™ Communications and Management Software</h2>\r\n<h3>Highlights</h3>\r\n<p class=\"t1\">Novatel Wireless accelerates solution delivery by quickly building connectivity from a customer’s Internet Protocol (IP)-enabled remote assets to their existing enterprise applications. Removing the inherent complexities of wireless networks and their communications protocols, our N4A™ Communications and Management Software (CMS) enables database or web service-driven control and management of Enfora® remote devices. Using a standard web-based user interface, customers have a detailed mobile asset view, enabling proactive management as well as necessary system upgrades. Additionally, using the built-in device configuration and service management capabilities, N4A™ CMS effectively manages and applies device configurations across multiple device groups.</p>\r\n<p class=\"t1\">Available as an on-premise solution, N4A™ CMS is particularly well suited to customers who:</p>\r\n<p> </p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Need a functional application up and running quickly</p>\r\n<p> </p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Lack the man hours or expertise necessary to master device and session management</p>\r\n<p> </p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Want to capitalize on our experience with wireless devices and network operators</p>\r\n<p> </p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Require flexible integration options</p>\r\n<p> </p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Prefer to focus resources on their in-house application software development</p>\r\n<p> </p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Need a simple web service interface for programmatic interaction</p>\r\n<h3>A Scalable Solution</h3>\r\n<p class=\"t1\">The flexibility of our N4A™ software architecture makes it possible to integrate a broad range of existing solutions. The N4A™ CMS application has been architected to scale, functioning in environments varying from a single-server demo to those with carrier-grade requirements. The application may be scaled vertically and horizontally, depending on customer requirements. N4A™ CMS is designed for the multitenant requirements of resellers and company organizations.</p>\r\n<h3>Exceptional Support</h3>\r\n<p class=\"t1\">Novatel Wireless has an exceptional customer support infrastructure, with Technical Account Managers (TAMs) and Field Applications Engineers (FAEs) around the globe available to deliver customer-driven support options both pre- and post-installation.</p>\r\n<h2 class=\"HeadingProductname\">N4A™ <span style=\"background: white;\">Device Manager</span></h2>\r\n<h3>Highlights</h3>\r\n<p class=\"t1\">The N4A™ Device Manager is a user interface that provides logical management and device provisioning of IP-based M2M devices.  It speeds time to market while managing a large number of devices within a system. It is compatible with all Enfora® M2M devices and may be purchased as a hosted or on-premise solution. N4A™ Device Manager increases your control of your remote assets by providing the following features:                      </p>\r\n<p class=\"b1\"><!--[if !supportLists]--><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]-->View, change and manage device configuration and scripts</p>\r\n<p class=\"b1\"><!--[if !supportLists]--><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]-->Manage single devices or groups of devices</p>\r\n<p class=\"b1\"><!--[if !supportLists]--><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]-->Complete device history to assist in self-care and issue resolution (plus alerting and logging capability with on-premise solution)</p>\r\n<p class=\"b1\"><!--[if !supportLists]--><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]-->Monitor device health and operational status</p>\r\n<p class=\"b1\"><!--[if !supportLists]--><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]-->Provide Over-The-Air updates</p>\r\n<p class=\"b1\"><!--[if !supportLists]--><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]-->Manage user accounts and device privileges with multiple administration levels</p>\r\n<p class=\"b1\"><!--[if !supportLists]--><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span><!--[endif]-->Access shipment tracking</p>\r\n<h3>Exceptional Support</h3>\r\n<p class=\"MsoNormal\">Novatel Wireless has an exceptional customer support infrastructure, with Technical Account Managers (TAMs) and Field Applications Engineers (FAEs) around the globe available to deliver customer-driven support options both pre- and post-installation.</p>\r\n<p> </p>\r\n<p class=\"t1\"> </p>\r\n<p> </p>'),(374,'<h1><span style=\"font-size: large;\"><strong>Support Main Page</strong></span></h1>'),(377,'<h1><span style=\"font-size: large;\"><strong>Certification</strong></span></h1>'),(382,'<h1><span style=\"font-size: large;\"><strong>Where To Buy</strong></span></h1>'),(386,'<p class=\"HeadingProductname\">N4A™ Communications and Management Software</p>\r\n<h1>Highlights</h1>\r\n<p class=\"t1\">Novatel Wireless accelerates solution delivery by quickly building connectivity from a customer’s Internet Protocol (IP)-enabled remote assets to their existing enterprise applications. Removing the inherent complexities of wireless networks and their communications protocols, our N4A™ Communications and Management Software (CMS) enables database or web service-driven control and management of Enfora® remote devices. Using a standard web-based user interface, customers have a detailed mobile asset view, enabling proactive management as well as necessary system upgrades. Additionally, using the built-in device configuration and service management capabilities, N4A™ CMS effectively manages and applies device configurations across multiple device groups.</p>\r\n<p class=\"t1\">Available as an on-premise solution, N4A™ CMS is particularly well suited to customers who:</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-weight: normal; font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Need a functional application up and running quickly</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-weight: normal; font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Lack the man hours or expertise necessary to master device and session management</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-weight: normal; font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Want to capitalize on our experience with wireless devices and network operators</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-weight: normal; font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Require flexible integration options</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-weight: normal; font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Prefer to focus resources on their in-house application software development</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-weight: normal; font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Need a simple web service interface for programmatic interaction</p>\r\n<h1>A Scalable Solution</h1>\r\n<p>The flexibility of our N4A™ software architecture makes it possible to integrate a broad range of existing solutions. The N4A™ CMS application has been architected to scale, functioning in environments varying from a single-server demo to those with carrier-grade requirements. The application may be scaled vertically and horizontally, depending on customer requirements. N4A™ CMS is designed for the multitenant requirements of resellers and company organizations.</p>\r\n<h1>Exceptional Support</h1>\r\n<p class=\"t1\">Novatel Wireless has an exceptional customer support infrastructure, with Technical Account Managers (TAMs) and Field Applications Engineers (FAEs) around the globe available to deliver customer-driven support options both pre- and post-installation.</p>'),(390,'<h3><span style=\"line-height: 115%; font-family: Calibri; font-size: medium;\">Service Delivery Platform</span></h3>\r\n<p><span style=\"font-size: small;\"><span style=\"line-height: 115%; font-family: Calibri;\">Novatel Wireless has a robust M2M software offering that can quickly build connectivity from your Internet Protocol (IP)-enabled remote assets to your existing enterprise applications. We provide the ability to choose a right-sized option for your enterprise needs. Our platform includes the following products: <a href=\"http://www.enfora.com/index.cgi?CONTENT_ID=1723&amp;User:LANGUAGE=en\"> the <span style=\"color: windowtext; text-decoration: none;\">N4A</span><sup><span style=\"line-height: 115%; color: windowtext; position: relative; top: -2pt; text-decoration: none;\">TM</span></sup><span style=\"color: windowtext; text-decoration: none;\"> Communications and Management Software (CMS)</span> </a><span class=\"MsoHyperlink\">and the N4A</span></span><span class=\"MsoHyperlink\"><span style=\"line-height: 115%; font-family: Calibri;\">™</span><span style=\"line-height: 115%; font-family: Calibri;\"> Device Manager. </span></span><span style=\"line-height: 115%; font-family: Calibri;\">With our decades of cumulative experience in wireless data and M2M environments, we can help you choose the best products, formats, and options to enhance your remote intelligence gathering capabilities, putting that data at the fingertips of corporate decision makers to identify device issues, decrease out-of-service time, track shipments, improve worker productivity, and more.</span></span> </p>\r\n<p class=\"t1\"> </p>\r\n<p> </p>'),(391,'<h2 class=\"HeadingProductname\">N4A™ <span style=\"background: white;\">Device Manager</span></h2>\r\n<h3>Highlights</h3>\r\n<p class=\"t1\">The N4A™ Device Manager is a user interface that provides logical management and device provisioning of IP-based M2M devices.  It speeds time to market while managing a large number of devices within a system. It is compatible with all Enfora® M2M devices and may be purchased as a hosted or on-premise solution. N4A™ Device Manager increases your control of your remote assets by providing the following features:                      </p>\r\n<p class=\"b1\"><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span>View, change and manage device configuration and scripts</p>\r\n<p class=\"b1\"><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span>Manage single devices or groups of devices</p>\r\n<p class=\"b1\"><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span>Complete device history to assist in self-care and issue resolution (plus alerting and logging capability with on-premise solution)</p>\r\n<p class=\"b1\"><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span>Monitor device health and operational status</p>\r\n<p class=\"b1\"><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span>Provide Over-The-Air updates</p>\r\n<p class=\"b1\"><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span>Manage user accounts and device privileges with multiple administration levels</p>\r\n<p class=\"b1\"><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\">§<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">  </span></span>Access shipment tracking</p>\r\n<h3>Exceptional Support</h3>\r\n<p class=\"MsoNormal\">Novatel Wireless has an exceptional customer support infrastructure, with Technical Account Managers (TAMs) and Field Applications Engineers (FAEs) around the globe available to deliver customer-driven support options both pre- and post-installation.</p>\r\n<div> </div>'),(394,''),(395,'<p> </p>\r\n<h1 class=\"HeadingProductname\">Mini MT</h1>\r\n<h2>Highlights</h2>\r\n<p class=\"t1\">The Mini MT is a rugged, voice-enabled quad-band GSM/GPRS device that provides complete functionality for mobile as well as personal tracking applications. Its integrated GPS capabilities include tracking and location reporting through SMS and GPRS. With its motion sensing and vibrating alerts, a programmable panic/emergency response button, and rechargeable battery, the Mini MT is ideal for personal tracking and remote worker Mobile Resource Management (MRM) programs.</p>\r\n<p class=\"t1\">Core Features:</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l1 level1 lfo2;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Rugged and voice enabled</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l1 level1 lfo2;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Push To Call (PTC) button allows user to call a preprogrammed phone number</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l1 level1 lfo2;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->A programmable button allows use of a predefined or user-set geofence radius; breach of the radius will cause an SMS alert</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l1 level1 lfo2;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->A user-defined button gives many options for variable call numbers, geofence parameters, SMS, and server calls to increase use case flexibility</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l1 level1 lfo2;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Clip for easy attachment to clothes, belts, backpacks, or can be used on remote equipment</p>\r\n<h2>Driving Business Applications</h2>\r\n<p class=\"t1\">The Mini MT is designed for the specific needs of the mobile workforce and personal tracking market segments, where location-based safety, security, and connectivity are paramount. A few such markets are </p>\r\n<table class=\"MsoTableGrid\" style=\"width: 369.0pt; border-collapse: collapse; border: none; mso-yfti-tbllook: 1184; mso-padding-alt: 0in 5.4pt 0in 5.4pt; mso-border-insideh: none; mso-border-insidev: none;\" width=\"369\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 3.0in; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"216\">\r\n<p class=\"Tabledata\"><!--[if !supportLists]--><span style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">          </span></span><!--[endif]--><span style=\"font-size: x-small;\">Personal &amp; Remote Worker Tracking</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Emergency Response</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Child &amp; Teen Tracking</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Elderly Locator</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Mobile/Home Healthcare</span></p>\r\n</td>\r\n<td style=\"width: 153.0pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"153\">\r\n<p class=\"Tabledata\" style=\"margin-left: 17.1pt; text-indent: 0in; mso-list: none;\"><span style=\"font-size: 11.0pt;\">  </span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h2>View Enterprise Assets As Never Before</h2>\r\n<p class=\"t1\">All Enfora® M2M integrated devices are designed for full compatibility with our <em><span style=\"text-decoration: underline;\"><span style=\"color: #7030a0;\">N4A® Software Platform</span></span></em>that includes the N4A® Communications and Management Software (CMS) and N4A® Device Manager, which provide accelerated device provisioning, deployment, shipping, monitoring, and tracking worldwide. Once you’ve experienced this level of visibility and control over your decision-clarifying assets, you won’t know how you managed without it.</p>\r\n<p> </p>\r\n<!--EndFragment-->\r\n<p> </p>'),(396,'<h1 class=\"feature\"><span style=\"font-family: Arial, Helvetica, sans; font-size: 11px; line-height: 14px; text-align: justify;\"><img src=\"{CCM:FID_19}\" alt=\"content_arrow_green.png\" width=\"23\" height=\"24\" /> <span style=\"font-size: large;\">Innovation</span></span></h1>\r\n<p class=\"feature\"><span style=\"font-size: small;\">L