p><a title=\"M2M Support\" href=\"{CCM:CID_246}\">M2M Support</a></p>\r\n<p><a title=\"M2M Documentation\" href=\"{CCM:CID_247}\">M2M Documentation</a></p>'),(422,'<p>The Novatel Wireless professional services experience is driving a profound technology transformation and broadband wireless users are demanding ubiquitous connectivity for a host of new applications. Whether you are perfecting a reference design, developing a new product or modifying and existing application our design engineers can help. With a strong knowledge base, real-world experiences in a wide variety of market and vertical segments and a demonstrable, results driving mentality, Novatel Wireless delivers.</p>\r\n<p>Revolutionized antenna designs, creative communications solutions, small form factors, low-power consumption and more, Novatel Wireless brings real-world design experience to help you get there faster, with less effort and on-budget.</p>\r\n<p>Our Product Line Managers and Project Management office is comprised of a team of talented engineers with years of design and product development knowledge, built to work closely with your company to define a project, its time lines and deliverables. Once your project is approved, a dedicated Project Manager is assigned to ensure your ultimate success.</p>\r\n<p>Working in close partnership with our customers, Novatel Wireless has helped to bring many designs to life, shortening product development and deployment cycles. Whether you need to tweak a small parameter in your product, develop something new or start a project and have it managed from the ground up, we can provide the expertise to get your project moving in the right direction.</p>\r\n<p>The architecture helps make it simple, do you have a special design challenge or just want help getting past a small issue? No project is too small or too big; we have assisted many of today’s global 1000 companies with innovative designs, engineering assistance and creative ways to connect to their customers.</p>\r\n<div> </div>'),(426,'<p><strong><span style=\"font-size: large;\">Title</span></strong></p>\r\n<p><span style=\"color: #333333; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 12px; line-height: 20px; background-color: #ffffff;\">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</span></p>'),(431,'<p><strong><span style=\"font-size: large;\">Title</span></strong></p>\r\n<p><span style=\"color: #333333; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 12px; line-height: 20px; background-color: #ffffff;\">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</span></p>'),(445,'<p><strong>Product Description</strong></p>\r\n<p><span style=\"color: #333333; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 12px; line-height: 20px; background-color: #ffffff;\">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupida