><span style=\"font-size: medium;\"><strong>Product Description</strong></span></p>\r\n<p><span style=\"color: #333333; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 12px; line-height: 20px; background-color: #ffffff;\">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</span></p>'),(493,'<p><strong>Diverse Options</strong></p>\r\n<p>The HS 3001 is form factor compatible across 1xRTT modules, allowing manufacturers tremendous flexibility and versatility in developing and deploying worldwide solutions.</p>\r\n<p><strong>Versatile Design</strong></p>\r\n<p>The modular architecture is shared across all platforms and powered by a programmable rules engine. The network router, control, and automation capabilities provide manufacturers with a flexible structural design for rapid product development and deployment.</p>\r\n<p> </p>'),(494,'<p><strong>Diverse Options</strong></p>\r\n<p>The HS 3002 is form factor compatible across HSDPA modules, allowing manufacturers tremendous flexibility and versatility in developing and deploying worldwide solutions.</p>\r\n<p><strong>Versatile Design</strong></p>\r\n<p>The modular architecture is shared across all platforms and powered by a programmable rules engine. The network router, control, and automation capabilities provide manufacturers with a flexible structural design for rapid product development and deployment.</p>'),(495,'<p class=\"t1\">The SA-G+ is available in two product SKUs, based on air interface. Our original Enfora® SA Series device, the quad-band GSM/GPRS SA-G+ provides serial connectivity plus voice/data/SMS and a SIM locking security feature designed for low power, extended temperature applications for the global market. Our newest series device is a dual-band 1xRTT (CDMA2000) SA-G+, which provides simplicity and economy in a serial-connected telemetry device. With increased uplink/downlink speeds, SMS, and the same extended temperature profile as the GSM/GPRS version, the SA-G+ 1xRTT is designed for North American applications.</p>\r\n<h3>Driving Business Applications</h3>\r\n<p class=\"t1\">With its compact design and low power consumption, the SA-G+ is an ideal device to connect remote assets requiring low data throughput to the cloud via advanced monitoring to the business enterprise. Some applications include:</p>\r\n<table class=\"MsoTableGrid\" style=\"width: 562.5pt; border-collapse: collapse; border: none; mso-yfti-tbllook: 1184; mso-padding-alt: 0in 5.4pt 0in 5.4pt; mso-border-insideh: none; mso-border-insidev: none;\" width=\"563\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 166.5pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"167\">\r\n<p class=\"Tabledata\" style=\"margin-left: 12.6pt; text-indent: -13.5pt; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">     </span></span><!--[endif]-->Wireless POS Terminal</p>\r\n</td>\r\n<td style=\"width: 2.0in; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"144\">\r\n<p class=\"Tabledata\" style=\"margin-left: 12.6pt; text-indent: -13.5pt; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">     </span></span><!--[endif]-->Safety &amp; Security</p>\r\n</td>\r\n<td style=\"width: 117.0pt; padding: 0in 5.4pt 0in 5.4