t-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">     </span></span><!--[endif]-->Industrial/SCADA</p>\r\n<p class=\"Tabledata\" style=\"margin-left: 12.6pt; text-indent: -13.5pt; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">     </span></span><!--[endif]-->Service/Maintenance (gas fields/chemical plants/water)</p>\r\n</td>\r\n<td style=\"width: 117.0pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"117\">\r\n<p class=\"Tabledata\" style=\"margin-left: 12.6pt; text-indent: -13.5pt; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">     </span></span><!--[endif]-->Kiosks, Billboards (Public Service, other)</p>\r\n<p class=\"Tabledata\" style=\"margin-left: 12.6pt; text-indent: -13.5pt; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">     </span></span><!--[endif]-->Parking Meters</p>\r\n</td>\r\n<td style=\"width: 135.0pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"135\">\r\n<p class=\"Tabledata\" style=\"margin-left: 12.6pt; text-indent: -13.5pt; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">     </span></span><!--[endif]-->Electricity Tower Monitoring</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3>Advanced Monitoring &amp; Visibility</h3>\r\n<p class=\"t1\">All Enfora® SA Series devices are designed for full compatibility with our <em><span style=\"text-decoration: underline;\"><span style=\"color: #7030a0;\">N4A® Software Platform</span></span></em>that includes the N4A® Communications and Management Software (CMS) and N4A® Device Manager. These on-premise or cloud-based solutions provide accelerated device provisioning, deployment, shipping, monitoring, and tracking worldwide.   With Novatel Wireless’ SA-G+ M2M hardware, standard Firmware Over-the-Air (FOTA) upgrades, and a targeted N4A® Software solution for your unique enterprise needs, you’ll experience a level of visibility and control over your field deployed machines and other static assets that will free up resources, increase immediacy of your decisions, and lessen your overall risk.</p>'),(496,'<h3>Abundant Integrator Choices</h3>\r\n<p>At Novatel Wireless, we know that each module integrator has unique design goals, technical constraints, and business drivers and that no two roadmaps are alike. For that reason we provide our GSM/GPRS integrators with a generous and flexible line of cellular module choices with our Enabler® IIIG Series of OEM modules.  Customer loyalty is important to us, so we maintain a broad line of module options that you can count on long after you go to market. Some of these choices include:</p>\r\n<p><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Dual- or Quad-band radio modems</p>\r\n<p><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->100-pin Molex® and Ball grid array (BGA) I/O connections</p>\r\n<p><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Texas Instrument chipset</p>\r\n<p><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Optional SIM connection</p>\r\n<p><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Board-to-board (B2B), micro or ultra-mini coaxial, or pin RF connections</p>\r\n<p><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Expandable I/O </p>\r\n<h3>Customer-Centric Expansion </h3>\r\n<p class=\"t1\">Because we value our M2M customers and understand the complexities module integrators face, we’ve designed our Enfora® Enabler® Series module expansion around you to create a made-for-migration technology line. Most Enfora® 2G GSM/GPRS modules in the Enabler® IIIG Series are upwardly compatible with our newer 2G and 3G Enabler® HS Series modules. </p>\r\n<p>As we designed our newest series members we took into account the ease of transition needed for our current customers and created a “common-by-design” module roadmap. We preserved the 100-pin I/O and B2B RF connectors as well as a compatible x-y size and mounting of our most popular Enabler® IIIG products. Beyond this we maintained the same firmware API, including our mission-critical Smart Agent events engine. Keeping these items standard ensures that—whether you’re a new or existing Enabler® IIIG customer—if your needs change and migration becomes essential, you’ll not only be able to substitute a compatible module using our simple transition guide, but also reuse most of your valuable script features.</p>\r\n<h3>Architected for Target Applications &amp; Global Markets</h3>\r\n<p>A strong differentiator of our Enabler® IIIG cellular modems that’s not immediately obvious is that—beyond working with world-class chipset manufacturers and integrating our actionable intelligence into our designs—we calibrate and align our hardware and low-level firmware to accommodate the needs of the target applications. So whether your battery-free telematics application needs extra low power or your fixed exterior monitoring site needs extended low temperature, we have you covered.  Some key target applications include:</p>\r\n<table class=\"MsoTableGrid\" style=\"border-collapse: collapse; mso-table-layout-alt: fixed; border: none; mso-yfti-tbllook: 1184; mso-padding-alt: 0in 5.4pt 0in 5.4pt; mso-border-insideh: none; mso-border-insidev: none;\" width=\"544\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 139.5pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"140\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">     </span></span><!--[endif]-->Security/Safety/Alarm</td>\r\n<td style=\"width: 2.5in; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"180\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">    </span></span><!--[endif]-->Utilities</td>\r\n<td style=\"width: 1.5in; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"108\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">    </span></span><!--[endif]-->Telemetry</td>\r\n<td style=\"width: 116.65pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"117\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">    </span></span><!--[endif]-->Telematics</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 139.5pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"140\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">     </span></span><!--[endif]-->AMR/AMI End Points</td>\r\n<td style=\"width: 2.5in; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"180\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">    </span></span><!--[endif]-->Remote Monitor/Control (RMAC)</td>\r\n<td style=\"width: 1.5in; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"108\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">    </span></span><!--[endif]-->Transportation</td>\r\n<td style=\"width: 116.65pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"117\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">    </span></span><!--[endif]-->Automotive</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p> </p>'),(497,'<h3>Highlights</h3>\r\n<p class=\"t1\">Economical and feature rich, the quad-band GSM/GPRS MT 2500 has a three-axis accelerometer, a programmable rules engine, polygon geofencing, multi-I/O, and much more. Optimized for the mass market, the Novatel Wireless MT 2500 captures and monitors driver behavior and relays information on rapid acceleration, harsh braking, speed violations, and excessive idling.  With an optional battery for continued communication when power is lost, the MT 2500 can report removal or potential tampering immediately.</p>\r\n<h3>Driving Business Applications</h3>\r\n<p class=\"t1\">For global applications supporting 12V passenger cars, light trucks, and service vans, the all-internal-antenna MT 2500 provides the lowest installed total cost of ownership among fleet solutions. With its high versatility and low operational cost, the MT 2500 is popular in the following markets:</p>\r\n<table class=\"MsoTableGrid\" style=\"width: 457.3pt; border-collapse: collapse; border: none; mso-yfti-tbllook: 1184; mso-padding-alt: 0in 5.4pt 0in 5.4pt; mso-border-insideh: none; mso-border-insidev: none;\" width=\"457\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 175.5pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"176\">\r\n<p class=\"Tabledata\" style=\"margin-left: 30.6pt; text-indent: -12.6pt; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-size: x-small;\"><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">    </span></span><!--[endif]-->Fleet Management</span></p>\r\n</td>\r\n<td style=\"width: 139.5pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"140\">\r\n<p class=\"Tabledata\" style=\"margin-left: 17.1pt; text-indent: -13.5pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">    </span></span><!--[endif]-->Vehicle Recovery</span></p>\r\n</td>\r\n<td style=\"width: 142.3pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"142\">\r\n<p class=\"Tabledata\" style=\"margin-left: 12.6pt; text-indent: -13.5pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">     </span></span><!--[endif]-->Driver &amp; Vehicle Profiling</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 175.5pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"176\">\r\n<p class=\"Tabledata\" style=\"margin-left: 30.6pt; text-indent: -12.6pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">    </span></span><!--[endif]-->Insurance Applications</span></p>\r\n</td>\r\n<td style=\"width: 139.5pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"140\">\r\n<p class=\"Tabledata\" style=\"margin-left: 17.1pt; text-indent: -13.5pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">    </span></span><!--[endif]-->Telematics</span></p>\r\n</td>\r\n<td style=\"width: 142.3pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"142\">\r\n<p class=\"Tabledata\" style=\"margin-left: 12.6pt; text-indent: -13.5pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">     </span></span><!--[endif]-->Buy-Here, Pay-Here</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3>View Enterprise Assets As Never Before</h3>\r\n<p class=\"t1\">All Enfora® M2M integrated devices are designed for full compatibility with our <em><span style=\"text-decoration: underline;\"><span style=\"color: #7030a0;\">N4A® Software Platform</span></span></em>that includes the N4A® Communications and Management Software (CMS) and N4A® Device Manager, which provide accelerated device provisioning, deployment, shipping, monitoring, and tracking worldwide. Once you’ve experienced this level of visibility and control over your decision-clarifying assets, you won’t know how you managed without it.</p>\r\n<!--EndFragment-->\r\n<p> </p>'),(498,'<h3>Highlights </h3>\r\n<p>The dual-band GSM/GPRS MT 3000, a well-established member of the Enfora® MT Series by Novatel Wireless, is self-contained On-Board Diagnostic (OBD) device. This plug-and-play mobile tracker supports five OBD-II protocols including J1850 PWM, J1850 VPW, ISO-9141-2, ISO-14230 KWP2000, and ISO-15765 CAN.  The MT 3000 is an innovative device providing customizable features including GPS location, ignition, geofencing, trip reporting, and event logging. It also has built-in programmable thresholds to capture metrics critical to effective fleet and insurance monitoring of both vehicle and driver, such as rapid acceleration, harsh braking, speed violations, and excessive idling, excessive engine speed, low vehicle battery, check engine light, trip distance, and more.</p>\r\n<h3>Driving Business Applications</h3>\r\n<p>The MT 3000 is ideal for simple, consumer-oriented installations in applications requiring 12V vehicle support (passenger cars, light trucks, and service vans) in the following global markets:</p>\r\n<table class=\"MsoTableGrid\" style=\"width: 644.5pt; border-collapse: collapse; border: none; mso-yfti-tbllook: 1184; mso-padding-alt: 0in 5.4pt 0in 5.4pt; mso-border-insideh: none; mso-border-insidev: none;\" width=\"645\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 2.0in; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"144\"><span style=\"font-size: x-small;\"> <!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Fleet Management </span></td>\r\n<td style=\"width: 184.5pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"185\"><span style=\"font-size: x-small;\"> <!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->User Based Insurance (UBI) </span></td>\r\n<td style=\"width: 2.75in; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"198\"><span style=\"font-size: x-small;\"> <!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Telematics </span></td>\r\n<td style=\"width: 118.0pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"118\"><span style=\"font-size: x-small;\">   </span></td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 2.0in; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"144\"><span style=\"font-size: x-small;\"> <!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Teen Tracking </span></td>\r\n<td style=\"width: 184.5pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"185\"><span style=\"font-size: x-small;\"> <!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Driver &amp; Vehicle Profiling </span></td>\r\n<td style=\"width: 2.75in; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"198\"><span style=\"font-size: x-small;\"> <!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Vehicle/Driver Safety &amp; Security </span></td>\r\n<td style=\"width: 118.0pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"118\"><span style=\"font-size: x-small;\">  </span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3><span style=\"font-size: small;\">View Enterprise Assets As Never Before</span></h3>\r\n<p>All Enfora® M2M integrated devices are designed for full compatibility with our <em><span style=\"text-decoration: underline;\"><span style=\"color: #7030a0;\">N4A® Software Platform</span></span></em>that includes the N4A® Communications and Management Software (CMS) and N4A® Device Manager, which provide accelerated device provisioning, deployment, shipping, monitoring, and tracking worldwide. Once you’ve experienced this level of visibility and control over your decision-clarifying assets, you won’t know how you managed without it.</p>\r\n<p> </p>'),(499,'<h1>MT 3000</h1>'),(500,'<p> </p>\r\n<h3>Highlights</h3>\r\n<p class=\"t1\">The MT 3050 is Novatel Wireless’ newest product in the successful Enfora® MT series of OBD-II devices.  The MT 3050 has multiple air interfaces on the same board and housing and provides these technologies through three product SKUs: a quad-band GSM/GPRS version, a dual band 1xRTT (CDMA2000) version, and a dual-band HSDPA/UMTS (+ quad-band GPRS/EDGE) version. Its in-device backup battery option facilitates easy disconnect alerting/ fraud detection and it also has a performance-enhancing internal cellular antenna. As in other Novatel Wireless OBD devices, five light duty OBD-II protocols are supported (J1850 PWM, J1850 VPW, ISO-9141-2, ISO-14230 KWP2000, and ISO-15765 CAN)  and its on-board three-axis accelerometer provides critical driver behavior reporting.</p>\r\n<h3>Driving Business Applications</h3>\r\n<p class=\"t1\">With its broad technology options and sleek, unassuming profile, the MT 3050 will be popular in a variety of North American and global market applications that require OBD-II functionality for 12V vehicles (passenger cars, light trucks, and service vans). Popular markets for the MT 3050 include:</p>\r\n<table class=\"MsoTableGrid\" style=\"width: 653.5pt; border-collapse: collapse; border: none; mso-yfti-tbllook: 1184; mso-padding-alt: 0in 5.4pt 0in 5.4pt; mso-border-insideh: none; mso-border-insidev: none;\" width=\"654\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 2.0in; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"144\">\r\n<p class=\"Tabledata\"><!--[if !supportLists]--><span style=\"font-size: small;\"><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Fleet Management</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Teen Tracking</span></p>\r\n</td>\r\n<td style=\"width: 184.5pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"185\">\r\n<p class=\"Tabledata\"><span style=\"font-size: small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->User Based Insurance (UBI)</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Driver &amp; Vehicle Profiling</span></p>\r\n</td>\r\n<td style=\"width: 207.0pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"207\">\r\n<p class=\"Tabledata\"><span style=\"font-size: small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Telematics</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Vehicle/Driver Safety &amp; Security</span></p>\r\n</td>\r\n<td style=\"width: 118.0pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"118\">\r\n<p class=\"Tabledata\" style=\"margin-left: 13.5pt; text-indent: -9.0pt; mso-list: none;\"><span style=\"font-size: 11.0pt;\"> </span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3>View Enterprise Assets As Never Before</h3>\r\n<p class=\"t1\">All Enfora® M2M integrated devices are designed for full compatibility with our <em><span style=\"text-decoration: underline;\"><span style=\"color: #7030a0;\">N4A® Software Platform</span></span></em>that includes the N4A® Communications and Management Software (CMS) and N4A® Device Manager, which provide accelerated device provisioning, deployment, shipping, monitoring, and tracking worldwide. Once you’ve experienced this level of visibility and control over your decision-clarifying assets, you won’t know how you managed without it.</p>\r\n<!--EndFragment-->\r\n<p> </p>'),(501,'<h3>Highlights</h3>\r\n<p class=\"t1\">The feature-rich MT 4000 is a quad-band GSM/GPRS solution that supports driver behavior monitoring and reporting.  With a 22-pin connector, the MT 4000 provides many GPIO options including: 1-Wire® Driver ID; latched outputs; ignition sense; digital and analog inputs; and serial interface.  It also has internal cellular and GPS antennas, dual three-axis accelerometers, 12V and 24V vehicle support, an ultra-low power sleep mode, store-and-forward messaging, and support for Garmin® Fleet Management Interface (FMI). With its backup battery option, the MT 4000 can immediately detect and report removal from primary vehicle power. Other notable value-add features of the device are:</p>\r\n<p class=\"Tabledata\"><!--[if !supportLists]--><span style=\"font-size: x-small;\"><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Voice capability</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Expanded power range for 12V and 24V vehicle support <em>in a single device</em></span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Driver identity confirmation</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Polygon geofencing</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Driver behavior reporting &amp; unauthorized vehicle movement </span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Lower cost two-way dispatch communications, optimization &amp; routing access</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->More engine diagnostics &amp; monitoring options through add-on peripheral capabilities </span></p>\r\n<h3><span style=\"font-size: small;\">Driving Business Applications</span></h3>\r\n<p class=\"t1\">The Novatel Wireless MT 4000 is a global solution that supports advanced management of variable-vehicle-type fleets as well as monitoring of driver behavior. These activities support worldwide market segments including:</p>\r\n<table class=\"MsoTableGrid\" style=\"width: 569.25pt; border-collapse: collapse; border: none; mso-yfti-tbllook: 1184; mso-padding-alt: 0in 5.4pt 0in 5.4pt; mso-border-insideh: none; mso-border-insidev: none;\" width=\"569\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 189.0pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"189\">\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Fleet Management</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Emergency Response Vehicles</span></p>\r\n</td>\r\n<td style=\"width: 184.5pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"185\">\r\n<p class=\"Tabledata\" style=\"margin-left: .3in; mso-list: l0 level1 lfo1;\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->User Based Insurance (UBI)</span></p>\r\n<p class=\"Tabledata\" style=\"margin-left: .3in; mso-list: l0 level1 lfo1;\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Service &amp; Small Fleet Operations</span></p>\r\n</td>\r\n<td style=\"width: 195.75pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"196\">\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Vehicle Leasing Recovery</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]--></span><span style=\"font-size: 11.0pt;\"><span style=\"font-size: x-small;\">Transportation &amp; Trucking</span></span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3>View Enterprise Assets As Never Before</h3>\r\n<p class=\"t1\">All Enfora® M2M integrated devices are designed for full compatibility with our <em><span style=\"text-decoration: underline;\"><span style=\"color: #7030a0;\">N4A® Software Platform</span></span></em>that includes the N4A® Communications and Management Software (CMS) and N4A® Device Manager, which provide accelerated device provisioning, deployment, shipping, monitoring, and tracking worldwide. Once you’ve experienced this level of visibility and control over your decision-clarifying assets, you won’t know how you managed without it.</p>'),(502,'<h3>Highlights</h3>\r\n<p class=\"t1\">The feature-rich MT 4100 is a dual-band 1xRTT (CDMA2000) and HSDPA/UMTS two-SKU solution that supports driver behavior monitoring and reporting.  With a 22-pin connector, the MT 4100 provides many GPIO options including: 1-Wire®Driver ID; expanded I/O including digital, analog, and latched outputs; ignition sense; and two serial interfaces.  It also has internal cellular and GPS antennas, 12V and 24V vehicle support, an ultra-low sleep mode, store-and-forward messaging, and support for Garmin® Fleet Management Interface (FMI). With its backup battery option the MT 4100 can immediately detect and report removal from primary vehicle power. Other notable value-add features of the device are:</p>\r\n<p class=\"Tabledata\"><!--[if !supportLists]--><span style=\"font-size: x-small;\"><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Expanded power range for 12V and 24V vehicle support <em>in a single device</em></span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Driver identity confirmation</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Expanded I/O monitoring &amp; control (5 digital inputs, 3 digital outputs, 2 analog inputs)</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Polygon geofencing</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Driver behavior reporting &amp; unauthorized vehicle movement </span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Lower cost two-way dispatch communications, optimization &amp; routing access</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->More engine diagnostics &amp; monitoring options through add-on peripheral capabilities </span></p>\r\n<h3><span style=\"font-size: small;\">Driving Business Applications</span></h3>\r\n<p class=\"t1\">The Novatel Wireless MT 4100 is a solution that supports advanced management of variable-vehicle-type fleets as well as monitoring of driver behavior. These activities support North American and global market segments including:</p>\r\n<table class=\"MsoTableGrid\" style=\"width: 578.25pt; border-collapse: collapse; border: none; mso-yfti-tbllook: 1184; mso-padding-alt: 0in 5.4pt 0in 5.4pt; mso-border-insideh: none; mso-border-insidev: none;\" width=\"578\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 2.75in; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"198\">\r\n<p class=\"Tabledata\"><!--[if !supportLists]--><span style=\"font-size: x-small;\"><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Fleet Management</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Emergency Response Vehicles</span></p>\r\n</td>\r\n<td style=\"width: 184.5pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"185\">\r\n<p class=\"Tabledata\" style=\"margin-left: 17.1pt; text-indent: -13.5pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">    </span></span><!--[endif]-->User Based Insurance (UBI)</span></p>\r\n<p class=\"Tabledata\" style=\"margin-left: 17.1pt; text-indent: -13.5pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">    </span></span><!--[endif]-->Service &amp; Small Fleet Operations</span></p>\r\n</td>\r\n<td style=\"width: 195.75pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"196\">\r\n<p class=\"Tabledata\" style=\"margin-left: 17.1pt; text-indent: -13.5pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">    </span></span><!--[endif]-->Vehicle Leasing Recovery</span></p>\r\n<p class=\"Tabledata\" style=\"margin-left: 17.1pt; text-indent: -13.5pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">    </span></span><!--[endif]-->Transportation &amp; Trucking</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3><span style=\"font-size: small;\">View Enterprise Assets As Never Before</span></h3>\r\n<p class=\"t1\">All Enfora® M2M integrated devices are designed for full compatibility with our <em><span style=\"text-decoration: underline;\"><span style=\"color: #7030a0;\">N4A® Software Platform</span></span></em>that includes the N4A® Communications and Management Software (CMS) and N4A® Device Manager, which provide accelerated device provisioning, deployment, shipping, monitoring, and tracking worldwide. Once you’ve experienced this level of visibility and control over your decision-clarifying assets, you won’t know how you managed without it.</p>\r\n<!--EndFragment-->\r\n<p> </p>'),(503,'<h3>Highlights</h3>\r\n<p class=\"t1\">The long-life battery-powered Enfora<sup>®</sup> AT 3000 is a quad-band integrated device with internal GSM/GPRS and GPS antenna functionality for mobile asset monitoring. Based on the Enfora® Enabler® Series module, the built-in programmable software environment enables essential capabilities such as mobile connectivity, location awareness, and device intelligence. The device leverages a unique set of control and automation features that extend device longevity through managing power usage and critical communications parameters. The AT 3000 also provides total protection against dust, water spray, and long periods of water immersion under pressure.</p>\r\n<p class=\"t1\">Core features include:</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l1 level1 lfo2;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Optimized for the longest battery life of all Enfora® AT Series devices: up to 5 years of operation depending on usage patterns</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l1 level1 lfo2;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Optimized for the highest temperature operation of all Enfora® AT Series devices: + 85 <sup>o</sup>C</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l1 level1 lfo2;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Supports motion detection via its three-axis accelerometer</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l1 level1 lfo2;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Supports two on-board geofences as well as dynamic geofencing</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l1 level1 lfo2;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Provides Firmware Over-the-Air (FOTA) upgrades</p>\r\n<h3>Driving Business Applications</h3>\r\n<p class=\"t1\">The AT 3000 is a global mobile asset monitoring solution designed for applications needing infrequent reporting and/or extended temperatures. Some target markets include:</p>\r\n<table class=\"MsoTableGrid\" style=\"width: 517.5pt; border-collapse: collapse; border: none; mso-yfti-tbllook: 1184; mso-padding-alt: 0in 5.4pt 0in 5.4pt; mso-border-insideh: none; mso-border-insidev: none;\" width=\"518\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 184.5pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"185\">\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Regulatory Compliance</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->National Defense</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Asset Utilization</span></p>\r\n</td>\r\n<td style=\"width: 2.5in; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"180\">\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->HAZMAT</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Truck or Rail Shipments</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Shipping Containers: Logistics</span></p>\r\n</td>\r\n<td style=\"width: 153.0pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"153\">\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Security</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Construction</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3><span style=\"font-size: small;\">View Enterprise Assets As Never Before</span></h3>\r\n<p class=\"t1\">All Enfora® M2M integrated devices are designed for full compatibility with our N4A® Software Platform that includes the N4A® Communications and Management Software (CMS) and N4A® Device Manager, which provide accelerated device provisioning, deployment, shipping, monitoring, and tracking worldwide. Once you’ve experienced this level of visibility and control over your decision-clarifying assets, you won’t know how you managed without it.</p>'),(504,'<h2>Product Title</h2>'),(505,'<p><span style=\"font-size: medium;\"><strong>Product Description</strong></span></p>\r\n<p><span style=\"color: #333333; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 12px; line-height: 20px; background-color: #ffffff;\">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</span></p>'),(506,'<h2>Product Title</h2>'),(507,'<p><span style=\"font-size: medium;\"><strong>Product Description</strong></span></p>\r\n<p><span style=\"color: #333333; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 12px; line-height: 20px; background-color: #ffffff;\">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</span></p>'),(508,'<div class=\"space\" style=\"padding: 10px; margin: 0px; color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\">\r\n<p style=\"margin-bottom: 15px; margin-top: 10px;\"><span style=\"font-family: arial; font-size: 11px;\">Novatel Wireless, Inc. is a leader in the design and development of intelligent wireless solutions based on 2G, 3G and 4G technologies providing wireless connectivity. The Company delivers specialized wireless solutions to carriers, distributors, retailers, OEMs and vertical markets worldwide. Novatel Wireless\' intelligent mobile hotspot products, software, USB modems, embedded modules and smart M2M modules provide innovative anywhere, anytime communications solutions for consumers and enterprises.</span></p>\r\n<p style=\"margin-bottom: 15px; margin-top: 10px;\"><span style=\"font-family: arial; font-size: 11px;\">Headquartered in San Diego, California, Novatel Wireless, Inc. has been issued over 30 technology patents and has established partnerships with leading telecom operators, infrastructure providers and device manufacturers around the world. Novatel Wireless, Inc. is listed on NASDAQ: NVTL.</span></p>\r\n<p style=\"margin-bottom: 15px; margin-top: 10px;\"><strong style=\"font-family: arial; font-size: 11px;\">Target</strong></p>\r\n<p style=\"margin-bottom: 15px; margin-top: 10px;\"><strong style=\"font-family: arial; font-size: 11px;\"></strong><span style=\"font-family: arial; font-size: 11px;\">Novatel Wireless, Inc. partners with wireless network operators, distributors, original equipment manufacturers (OEMs), and vertical markets worldwide to offer wireless connectivity solutions that meet the unique needs of the following markets:</span></p>\r\n</div>\r\n<div class=\"space\" style=\"padding: 10px; margin: 0px; color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\">\r\n<table class=\"spectable\" style=\"border-right-width: 1px; border-right-style: solid; border-right-color: #cccccc; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: #cccccc;\" width=\"100%\" border=\"0\" cellspacing=\"0\" cellpadding=\"4\">\r\n<tbody>\r\n<tr>\r\n<td class=\"specheader\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333; background-color: #eeeeee;\" valign=\"top\"><strong>Mobile Workforce</strong></td>\r\n<td class=\"speccell\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333;\" valign=\"top\">Business Professionals, Consumers, Sales Force, Field Service</td>\r\n</tr>\r\n<tr>\r\n<td class=\"specheader\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333; background-color: #eeeeee;\" valign=\"top\"><strong>Public Safety</strong></td>\r\n<td class=\"speccell\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333;\" valign=\"top\">Homeland Security, Police, Fire, Traffic, Highway, 