ice provider or distributor from whom you purchased your device, before contacting Novatel Wireless support.</p>\r\n<p class=\"p1\">However, if your service provider or distributor is unable to assist, please call 877-259-2761 or email for assistance.</p>\r\n<p class=\"p1\"><strong>M2M</strong></p>\r\n<p class=\"p1\">Novatel Wireless M2M is committed to providing exceptional support to each and every customer.</p>\r\n<p class=\"p1\">Our experienced support team works closely with the development teams to ensure you receive answers to even the most challenging technical support issues.</p>\r\n<p class=\"p1\">Access the Novatel M2M’s Product Support Website 24* hours a day for:</p>\r\n<p class=\"p3\">·         Technical Support</p>\r\n<p class=\"p3\">·         Product Documents</p>\r\n<p class=\"p3\">·         Firmware Updates</p>\r\n<p class=\"p3\">·         Software Tools</p>\r\n<p class=\"p3\">·         FAQs </p>\r\n<p class=\"p1\">Technical Support personnel are available during standard office hours, 8 to 5 central time zone.  </p>\r\n<p class=\"p1\">Exceeding expectations through continuous improvement.</p>\r\n<p class=\"p4\">*Every effort is made to keep the Product Support website up and running, however, Novatel Wireless cannot be liable for website unavailability due to technical issues.</p>'),(574,'<p><span style=\"font-size: small; font-family: Arial;\">Novatel Wireless is a global leader in developing innovative wireless data devices and applications for markets worldwide using advanced wireless networks such as LTE, UMTS, HSDPA, GSM, GPRS, CDMA, and EV-DO. We are a publicly traded company headquartered in San Diego, California.</span></p>\r\n<p><span style=\"font-family: Arial; font-size: small;\">Innovators- We are a global innovator in 3G &amp; 4G wireless mobility and M2M solutions:</span></p>\r\n<p><span style=\"font-size: small; font-family: Arial;\"> • 1st to market with the Mifi- personal wireless hotspot</span></p>\r\n<p><span style=\"font-size: small; font-family: Arial;\"> • 1st to market with EV-DO Rev-A product line</span></p>\r\n<p><span style=\"font-size: small; font-family: Arial;\"> • 1st USB wireless broadband in North America</span></p>\r\n<p><span style=\"font-size: small; font-family: Arial;\"> • 1st 3G wireless broadband router in Europe </span></p>\r\n<p><span style=\"font-size: small; font-family: Arial;\"> • Exciting LTE M2M Wimax HSPA+ products</span></p>\r\n<p><span style=\"font-size: small; font-family: Arial;\">Work/Life Balance- We hire passionate people and create great teams. Global- We have offices in San Diego (California), Calgary (Canada), Basingstoke, (United Kingdom), and Shanghai (China). Financially Secure- Novatel Wireless is cash strong with no debt; founded in 1996, IPO in 2000.</span></p>\r\n<p><span style=\"font-size: small; font-family: Arial;\">Novatel Wireless offers a very competitive benefits package. For our US employees, for example, we offer:</span></p>\r\n<table class=\"MsoNormalTable\" style=\"border-collapse: collapse; mso-table-layout-alt: fixed; border: none; mso-padding-alt: 0in 5.4pt 0in 5.4pt;\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 91.0pt; border: none; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"91\">\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">Medical</span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">Dental</span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">Vision</span></span></p>\r\n</td>\r\n<td style=\"width: 242.0pt; border: none; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"242\">\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">Health Spending Accounts    </span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">Life Insurances   </span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">Discounted Employee Stock Purchase Plan</span></span></p>\r\n</td>\r\n<td style=\"width: 160.0pt; border: none; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"160\">\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">Stock Options</span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">401k Match Program</span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">Generous  Vacation Policy</span></span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><span style=\"font-size: small; font-family: Arial;\">Novatel Wireless offers competitive salaries, comprehensive benefits, the opportunity for stock options, and an environment that supports creativity, open communication, and teamwork. Only applicants whose experience matches the skills sought for our positions will be contacted.</span></p>\r\n<p><span style=\"font-size: small; font-family: Arial;\">Novatel Wireless is an Equal Opportunity Employer.  All jobs are subject to pre-employment background check and reference check.</span></p>'),(575,'<h2>Ovation MC551 4G LTE USB Modem</h2>'),(576,'<p> </p>\r\n<div style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding: 10px;\"><strong><span style=\"color: #003366;\">Ovation™ MC551 4G LTE Modem</span></strong><br />The 4G LTE Ovation™ MC551 is the next generation of the Novatel Wireless Ovation USB mobile broadband modem portfolio, building on award-winning innovation and design, proven performance and industry-leading flexibility and reliability.     </div>\r\n<div style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding: 10px;\"><strong><span style=\"color: #003366;\">Stay Connected</span></strong><br />This 4G LTE USB modem provides LTE peak download speeds of up to 100 Mbps*(theoretical) and peak upload speeds of up to 50 Mbps. Designed with 3G CDMA 1xEVDO Rev A backwards compatibility, the MC551 will ensure you stay connected.<br /><br /><strong><span style=\"color: #003366;\">Slim, durable and compact design<br /></span></strong>The 4G LTE Ovation MC551 is the market\'s slimmest and most compact 4G LTE North America USB modum currently available. <br /><br /><strong><span style=\"color: #003366;\">Advanced Antenna Technology<br /></span></strong><span style=\"color: #000000;\">Novatel Wireless proprietary internal advanced antenna design optimized for best performance<br /></span></div>\r\n<div style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff; padding: 10px;\"><span style=\"color: #000000;\"><span style=\"color: #333399;\"><strong> </strong></span></span><strong><span style=\"color: #003366;\">Additional Features </span></strong><span style=\"color: #000000;\"><span style=\"color: #333399;\"><strong> </strong></span><br /></span>\r\n<ul>\r\n<li><span style=\"color: #000000;\">Hinge USB connector for flexible orientation</span></li>\r\n<li><span style=\"color: #000000;\">Windows® / Mac® /Linux</span><span style=\"color: #000000;\">®</span><span style=\"color: #000000;\"> compatible</span></li>\r\n<li><span style=\"color: #000000;\">MobiLink Connection Manager software</span></li>\r\n<li><span style=\"color: #000000;\">VPN/NDIS support  </span></li>\r\n</ul>\r\n</div>\r\n<p> </p>'),(594,'<p><a title=\"Press Releases\" href=\"{CCM:CID_179}\"><img src=\"{CCM:FID_74}\" alt=\"press_release.png\" width=\"236\" height=\"197\" /></a><a title=\"Media Center\" href=\"{CCM:CID_182}\"><img src=\"{CCM:FID_72}\" alt=\"media_center.png\" width=\"240\" height=\"197\" /></a><a title=\"Novatel Wireless in the News\" href=\"{CCM:CID_180}\"><img src=\"{CCM:FID_73}\" alt=\"nvtl_news.png\" width=\"241\" height=\"197\" /></a><a title=\"Events\" href=\"{CCM:CID_181}\"><img src=\"{CCM:FID_71}\" alt=\"events.png\" width=\"238\" height=\"197\" /></a></p>'),(595,'<p>   <a title=\"Press Releases\" href=\"{CCM:CID_179}\"><img src=\"{CCM:FID_74}\" alt=\"press_release.png\" width=\"236\" height=\"197\" /></a><a title=\"Media Center\" href=\"{CCM:CID_182}\"><img src=\"{CCM:FID_72}\" alt=\"media_center.png\" width=\"240\" height=\"197\" /></a><a title=\"Novatel Wireless in the News\" href=\"{CCM:CID_180}\"><img src=\"{CCM:FID_73}\" alt=\"nvtl_news.png\" width=\"241\" height=\"197\" /></a><a title=\"Events\" href=\"{CCM:CID_181}\"><img src=\"{CCM:FID_71}\" alt=\"events.png\" width=\"238\" height=\"197\" /></a></p>'),(596,'<p>     <a title=\"Press Releases\" href=\"{CCM:CID_179}\"><img src=\"{CCM:FID_74}\" alt=\"press_release.png\" width=\"236\" height=\"197\" /></a><a title=\"Media Center\" href=\"{CCM:CID_182}\"><img src=\"{CCM:FID_72}\" alt=\"media_center.png\" width=\"240\" height=\"197\" /></a><a title=\"Novatel Wireless in the News\" href=\"{CCM:CID_180}\"><img src=\"{CCM:FID_73}\" alt=\"nvtl_news.png\" width=\"241\" height=\"197\" /></a><a title=\"Events\" href=\"{CCM:CID_181}\"><img 