r distributor is unable to assist, please call 877-259-2761 or email for assistance.</p>\r\n<p class=\"p1\"><strong>M2M</strong></p>\r\n<p class=\"p1\">Novatel Wireless M2M is committed to providing exceptional support to each and every customer.</p>\r\n<p class=\"p1\">Our experienced support team works closely with the development teams to ensure you receive answers to even the most challenging technical support issues.</p>\r\n<p class=\"p1\">Access the Novatel M2M’s Product Support Website 24* hours a day for:</p>\r\n<p class=\"p3\">·         Technical Support</p>\r\n<p class=\"p3\">·         Product Documents</p>\r\n<p class=\"p3\">·         Firmware Updates</p>\r\n<p class=\"p3\">·         Software Tools</p>\r\n<p class=\"p3\">·         FAQs </p>\r\n<p class=\"p1\">Technical Support personnel are available during standard office hours, 8 to 5 central time zone.  </p>\r\n<p class=\"p1\">Exceeding expectations through continuous improvement.</p>\r\n<p class=\"p4\">*Every effort is made to keep the Product Support website up and running, however, Novatel Wireless cannot be liable for website unavailability due to technical issues.</p>'),(614,'<p><span style=\"font-size: small; font-family: Arial;\">Novatel Wireless is a global leader in developing innovative wireless data devices and applications for markets worldwide using advanced wireless networks such as LTE, UMTS, HSDPA, GSM, GPRS, CDMA, and EV-DO. We are a publicly traded company headquartered in San Diego, California.</span></p>\r\n<p><span style=\"font-family: Arial; font-size: small;\">Innovators- We are a global innovator in 3G &amp; 4G wireless mobility and M2M solutions:</span></p>\r\n<p><span style=\"font-size: small; font-family: Arial;\"> • 1st to market with the Mifi- personal wireless hotspot</span></p>\r\n<p><span style=\"font-size: small; font-family: Arial;\"> • 1st to market with EV-DO Rev-A product line</span></p>\r\n<p><span style=\"font-size: small; font-family: Arial;\"> • 1st USB wireless broadband in North America</span></p>\r\n<p><span style=\"font-size: small; font-family: Arial;\"> • 1st 3G wireless broadband router in Europe </span></p>\r\n<p><span style=\"font-size: small; font-family: Arial;\"> • Exciting LTE M2M Wimax HSPA+ products</span></p>\r\n<p><span style=\"font-size: small; font-family: Arial;\">Work/Life Balance- We hire passionate people and create great teams. Global- We have offices in San Diego (California), Calgary (Canada), Basingstoke, (United Kingdom), and Shanghai (China). Financially Secure- Novatel Wireless is cash strong with no debt; founded in 1996, IPO in 2000.</span></p>\r\n<p><span style=\"font-size: small; font-family: Arial;\">Novatel Wireless offers a very competitive benefits package. For our US employees, for example, we offer:</span></p>\r\n<table class=\"MsoNormalTable\" style=\"border-collapse: collapse; mso-table-layout-alt: fixed; border: none; mso-padding-alt: 0in 5.4pt 0in 5.4pt;\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 91.0pt; border: none; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"91\">\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">Medical</span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">Dental</span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">Vision</span></span></p>\r\n</td>\r\n<td style=\"width: 242.0pt; border: none; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"242\">\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">Health Spending Accounts    </span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">Life Insurances   </span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">Discounted Employee Stock Purchase Plan</span></span></p>\r\n</td>\r\n<td style=\"width: 160.0pt; border: none; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"160\">\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">Stock Options</span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">401k Match Program</span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">Generous  Vacation Policy</span></span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><span style=\"font-size: small; font-family: Arial;\">Novatel Wireless offers competitive salaries, comprehensive benefits, the opportunity for stock options, and an environment that supports creativity, open communication, and teamwork. Only applicants whose experience matches the skills sought for our positions will be contacted.</span></p>\r\n<p><span style=\"font-size: small; font-family: Arial;\">Novatel Wireless is an Equal Opportunity Employer.  All jobs are subject to pre-employment background check and reference check.</span></p>'),(616,'<p><span style=\"color: #333333; font-family: arial, verdana, helvetica, sans-serif; font-size: 12px;\">Novatel Wireless, Inc. is a leading provider of wireless broadband access solutions for the worldwide mobile communications market. Our solutions enable the mobile workforce to increase productivity, improve operational efficiencies and maintain a competitive edge.</span></p>'),(617,'<div class=\"space\" style=\"color: #333333; font-size: 12px; line-height: 20px; padding: 10px; margin: 0px; font-family: Arial, Helvetica, sans-serif; background-color: #ffffff;\">\r\n<p style=\"margin: 10px 0px 15px;\"><span style=\"font-family: arial; font-size: small;\">Novatel Wireless, Inc. is a leader in the design and development of intelligent wireless solutions based on 2G, 3G and 4G technologies providing wireless connectivity. The Company delivers specialized wireless solutions to carriers, distributors, retailers, OEMs and vertical markets worldwide. Novatel Wireless\' intelligent mobile hotspot products, software, USB modems, embedded modules and smart M2M modules provide innovative anywhere, anytime communications solutions for consumers and enterprises.</span></p>\r\n<p style=\"margin: 10px 0px 15px;\"><span style=\"font-family: arial; font-size: small;\">Headquartered in San Diego, California, Novatel Wireless, Inc. has been issued over 30 technology patents and has established partnerships with leading telecom operators, infrastructure providers and device manufacturers around the world. Novatel Wireless, Inc. is listed on NASDAQ: NVTL.</span></p>\r\n<p style=\"margin: 10px 0px 15px;\"><span style=\"font-size: small;\"><strong style=\"font-family: arial; font-size: 11px;\">Target</strong></span></p>\r\n<p style=\"margin: 10px 0px 15px;\"><span style=\"font-size: small;\"><strong style=\"font-family: arial; font-size: 11px;\"></strong><span style=\"font-family: arial;\">Novatel Wireless, Inc. partners with wireless network operators, distributors, original equipment manufacturers (OEMs), and vertical markets worldwide to offer wireless connectivity solutions that meet the unique needs of the following markets:</span></span></p>\r\n</div>\r\n<div class=\"space\" style=\"color: #333333; font-size: 12px; line-height: 20px; padding: 10px; margin: 0px; font-family: Arial, Helvetica, sans-serif; background-color: #ffffff;\">\r\n<table class=\"spectable\" style=\"max-width: 100%; background-color: transparent; border-collapse: collapse; border-spacing: 0px; border-right-width: 1px; border-right-style: solid; border-right-color: #cccccc; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: #cccccc;\" width=\"100%\" border=\"0\" cellspacing=\"0\" cellpadding=\"4\">\r\n<tbody>\r\n<tr>\r\n<td class=\"specheader\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333; background-color: #eeeeee;\" valign=\"top\"><span style=\"font-size: small;\"><strong>Mobile Workforce</strong></span></td>\r\n<td class=\"speccell\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333;\" valign=\"top\"><span style=\"font-size: small;\">Business Professionals, Consumers, Sales Force, Field Service</span></td>\r\n</tr>\r\n<tr>\r\n<td class=\"specheader\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333; background-color: #eeeeee;\" valign=\"top\"><span style=\"font-size: small;\"><strong>Public Safety</strong></span></td>\r\n<td class=\"speccell\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; bo