left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333;\" valign=\"top\"><span style=\"font-size: small;\">Business Professionals, Consumers, Sales Force, Field Service</span></td>\r\n</tr>\r\n<tr>\r\n<td class=\"specheader\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333; background-color: #eeeeee;\" valign=\"top\"><span style=\"font-size: small;\">Public Safety</span></td>\r\n<td class=\"speccell\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333;\" valign=\"top\"><span style=\"font-size: small;\">Homeland Security, Police, Fire, Traffic, Highway, Bridge</span></td>\r\n</tr>\r\n<tr>\r\n<td class=\"specheader\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333; background-color: #eeeeee;\" valign=\"top\"><span style=\"font-size: small;\">Telematics</span></td>\r\n<td class=\"speccell\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333;\" valign=\"top\"><span style=\"font-size: small;\">Automated Vehicle Location, Theft Recovery, Vehicle Monitoring</span></td>\r\n</tr>\r\n<tr>\r\n<td class=\"specheader\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-w