-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333;\" valign=\"top\"><span style=\"font-size: small;\">Gas, Electric, Cable, Telephone</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p class=\"space\" style=\"color: #333333; font-size: 12px; line-height: 20px; padding-top: 10px; padding-right: 10px; padding-bottom: 10px; margin: 0px; font-family: Arial, Helvetica, sans-serif; background-color: #ffffff;\"><span style=\"font-family: arial; font-size: small;\">Direction for the Future<br />Novatel Wireless, Inc. is uniquely poised to take advantage of the burgeoning wireless market. The company has built a reputation for quality, reliable, innovative products that serve a broad audience. On the road ahead, Novatel Wireless, Inc. intends to stay ahead of the curve by continuing to form alliances with industry-leading partners, diversifying its product offerings and supporting the latest wireless technologies. </span></p>'),(621,'<h2>Product Title</h2>'),(622,'<p><span style=\"font-size: medium;\"><strong>Product Description</strong></span></p>\r\n<p><span style=\"color: #333333; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 12px; line-height: 20px; background-color: #ffffff;\">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</span></p>'),(623,'<p><span style=\"font-size: 11px; background-color: #ffffff;\">Enfora pioneered resilient, high-speed, reliable end-point connectivity solutions for the transportation marketplace. Whether you’re traveling the open road, meeting an on-time delivery or watching your child drive off to school, Enfora’s innovation empowers you over the highway, on the rail and most anywhere, anytime in the supply chain. Driven by the </span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfo:CONTENT_ID=78&amp;User:LANGUAGE=en\">N4A Services Architecture</a><span style=\"font-size: 11px; background-color: #ffffff;\">, Enfora delivers a flexible, modular architecture for fast wireless asset tracking solutions development and deployment. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">Over the road fleet operators benefit from Enfora’s N4A intelligent mobile tracking devices that feature superior performance in a small package for ultimate flexibility. The Pay-As-You-Go insurance, auto financing/leasing and Buy-Here Pay-Here markets leverage the latest in Place-N-Trace vehicle tracking devices with advanced features for motion, acceleration and theft recovery. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">Whether mission critical shipments or real-time location services Enfora and its strategic partners deliver the data for better decision-making, improving your performance in your connected supply chain. Riding the rail, Enfora’s N4A intelligent devices, help you keep a watchful eye on your most precious assets remotely in transit.</span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">Coupled with the robust </span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfo:CONTENT_ID=74&amp;User:LANGUAGE=en\">N4A Communications &amp; Management</a><span style=\"font-size: 11px; background-color: #ffffff;\"> platform, devices can be provisioned, monitored and reconfigured remotely, most anywhere in the world. Connected Transportation — Anywhere, Anytime.</span></p>'),(624,'<p><span style=\"font-size: 11px; background-color: #ffffff;\">Connected Security — from security panels to secure assets, digital surveillance, and high-speed full motion video, Enfora delivers exceptional connectivity with the industry’s leading high performance communications platforms. Enabling real-time data for security applications including alarm panels, intelligent locks, asset monitoring devices and the latest in high-speed video capture and transmission, Enfora’s </span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfoFlash:CONTENT_ID=72&amp;User:LANGUAGE=en\">Enabler III</a><span style=\"font-size: 11px; background-color: #ffffff;\"> and </span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfoFlash:CONTENT_ID=71&amp;User:LANGUAGE=en\">Enabler HS 1000</a><span style=\"font-size: 11px; background-color: #ffffff;\">series of modules deliver.</span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">With simple integrated devices and a host of embedded platforms, Enfora is empowering companies of all sizes with resilient, high-speed, scalable, and reliable end-point security and asset monitoring connectivity solutions. Driven by the </span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfo:CONTENT_ID=78&amp;User:LANGUAGE=en\">N4A Services Architecture</a><span style=\"font-size: 11px; background-color: #ffffff;\">, Enfora delivers a flexible, modular architecture for fast wireless connectivity and solutions deployment. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">Security Monitoring and Surveillance systems have been transformed with the N4A family of intelligent devices, from the Enabler III and HS embedded platforms to the </span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfoFlash:CONTENT_ID=64&amp;User:LANGUAGE=en\">Spider AT</a><span style=\"font-size: 11px; background-color: #ffffff;\"> asset tag family, and the </span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfo:CONTENT_ID=60&amp;User:LANGUAGE=en\">SA Telemetry</a><span style=\"font-size: 11px; background-color: #ffffff;\"> devices purpose-built for the time-sensitive data needed in the security and asset monitoring markets.</span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">Mission-critical infrastructures can be efficiently managed and high-value assets can be located and leveraged using real-time location services. Enfora and its strategic partners deliver the data for better decision-making, improving performance safety and security for your treasured assets. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">Coupled with the robust N4A Communications and Management platform, devices can be provisioned, monitored and reconfigured remotely, most anywhere in the world. Connected Security: providing you vision — Anywhere, Anytime. </span></p>'),(625,'<p><span style=\"font-size: 11px; background-color: #ffffff;\">The pace of change and technology advances in today’s world is nothing short of astounding. To be and remain competitive — to survive — companies must constantly innovate, create, design, manufacture and deploy new and better products. The </span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfo:CONTENT_ID=78&amp;User:LANGUAGE=en\">architecture</a><span style=\"font-size: 11px; background-color: #ffffff;\"> gets you there more rapidly, securely and with connection reliability unsurpassed in the industry. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">The Anywhere, Anytime experience is driving a profound technology transformation and broadband wireless users are demanding ubiquitous connectivity for a host of new applications. Whether you are perfecting a reference design, developing a new product or modifying an existing application, Enfora can enhance your time-to-market with innovative solutions that are certified, indemnified and backed with the proven performance demonstrated through hundreds of reference designs globally. Enfora’s GSM/GPRS, GPS, UMTS/HSPA, 2G, and 3G Low Power platforms deliver small size and industry-leading high performance, driving the essential capabilities, mobile connectivity and device intelligence needed for today’s demanding design-in and OEM markets. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">The </span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfoFlash:CONTENT_ID=72&amp;User:LANGUAGE=en\">Enabler III</a><span style=\"font-size: 11px; background-color: #ffffff;\"> and </span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfoFlash:CONTENT_ID=71&amp;User:LANGUAGE=en\">HS 1000</a><span style=\"font-size: 11px; background-color: #ffffff;\"> platforms are part of Enfora’s intelligent device offerings and feature superior performance in a small package with ultimate flexibility. Coupled with the robust </span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfo:CONTENT_ID=74&amp;User:LANGUAGE=en\">N4A Communications &amp; Management</a><span style=\"font-size: 11px; background-color: #ffffff;\">platform, devices can be provisioned, monitored and reconfigured remotely, most anywhere in the world. Driven by the aervices architecture, Enfora delivers flexible, modular architecture for development and deployment. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">The architecture helps make it simple, but if you have a special design challenge or just want help getting past a small design issue, contact our design services team for assistance. No project is too small or too large. We have assisted many of today’s global 1000 companies with innovative designs, engineering assistance and creative ways to connect you — Anywhere, Anytime.</span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">With the architecture, custom branding, distinctive designs, and innovative ideas become reality.</span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /></p>'),(627,'<p><span style=\"font-size: 11px; background-color: #ffffff;\">Telehealth — connecting the latest in remote healthcare products and services: from the simple glucose meter with an embedded communications module to a blood pressure monitor and much more. Today’s healthcare delivery network demands reliable communications services; no matter the modality, no matter the location. Enfora-based solutions provide the path for critical data transmission, empowering today’s connected care network, delivering connected health — most Anywhere, Anytime. Intelligent end-point devices and embedded communications platforms ensure fast reliable connectivity throughout the global infrastructure, delivering the time and operational-sensitive data for life-critical healthcare decisions.</span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">With simple Data-Pipe technology to high-speed backhaul embedded platforms, Enfora is empowering remote monitoring device manufacturers of all sizes with resilient, high-speed, reliable end-point, wireless connectivity solutions. Driven by the </span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfo:CONTENT_ID=78&amp;User:LANGUAGE=en\">N4A Services Architecture</a><span style=\"font-size: 11px; background-color: #ffffff;\">, Enfora delivers a flexible, modular architecture through its innovative and award-winning </span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfoFlash:CONTENT_ID=72&amp;User:LANGUAGE=en\">Enabler III</a><span style=\"font-size: 11px; background-color: #ffffff;\"> and</span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfoFlash:CONTENT_ID=71&amp;User:LANGUAGE=en\">Enabler HS 1000</a><span style=\"font-size: 11px; background-color: #ffffff;\"> embedded platforms – delivering high-performance wireless connectivity and rapid solutions deployment. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">Mission-critical infrastructures can be efficiently managed and high-value assets can be located and leveraged using real-time location services. Enfora and its strategic partners deliver the data for better decision-making, improving performance in your connected devices — driving critical data for clinicians and patients. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">Coupled with the robust </span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfo:CONTENT_ID=74&amp;User:LANGUAGE=en\">N4A Communications and Management</a><span style=\"font-size: 11px; background-color: #ffffff;\"> platform, devices can be provisioned, monitored and reconfigured remotely, most anywhere in the world. Connected Telehealth — Anywhere, Anytime. </span></p>'),(630,'<p><span style=\"font-size: 11px; background-color: #ffffff;\">The connected factory – from the simple shop floor to the most advanced robotics-based dark factory, to the intelligent pallet and transportation infrastructure, capturing information from your plant and your products is critical for effective and efficient operations. Today’s increasing demand for real-time information continues to place a burden on the critical support and systems infrastructure of the most progressive of companies. Automating processes and utilizing wireless communications technology can effectively help you capture and leverage essential data, providing cost reductions while driving operational efficiencies that lead to better, more informed business decisions. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">With simple integrated platforms and a host of embedded platforms — Enfora is empowering companies of all sizes with resilient, high-speed, reliable end-point, industrial automation connectivity solutions for today’s Smart Factory operations. Driven by the </span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfo:CONTENT_ID=78&amp;User:LANGUAGE=en\">N4A Services Architecture</a><span style=\"font-size: 11px; background-color: #ffffff;\">, Enfora delivers a flexible, modular architecture for fast wireless connectivity and solutions deployment. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">Monitoring and decision support systems have been transformed with the N4A family of intelligent devices, from the </span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfoFlash:CONTENT_ID=64&amp;User:LANGUAGE=en\">Spider AT asset tag</a><span style=\"font-size: 11px; background-color: #ffffff;\"> family, to the </span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfo:CONTENT_ID=60&amp;User:LANGUAGE=en\">SA Telemetry</a><span style=\"font-size: 11px; background-color: #ffffff;\"> devices and a host of embedded platforms purpose-designed for the industrial automation and product distribution markets.</span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">Mission-critical infrastructures can be efficiently managed and high-value assets can be located and leveraged using real-time location services. Enfora and its strategic partners deliver the data for better decision-making — improving performance in your connected factory, and driving green and other energy saving initiatives. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">Coupled with the robust </span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfo:CONTENT_ID=74&amp;User:LANGUAGE=en\">N4A Communications and Management</a><span style=\"font-size: 11px; background-color: #ffffff;\"> platform, devices can be provisioned, monitored and reconfigured remotely, most anywhere in the world. The Connected Factory and Connected Industry — Anywhere, Anytime. </span></p>'),(631,'<p><span style=\"font-size: 11px; background-color: #ffffff;\">The Connected Home – from security panels to securing personal assets, energy-saving and green initiatives to connected Personal Area Networks (PANs), Enfora delivers exceptional wireless connectivity with the industry’s leading high performance communications platforms. Enabling real-time data for security and applications including alarm panels, intelligent locks, home monitoring devices and the latest in energy-saving PAN devices and high-speed routers, Enfora’s </span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfoFlash:CONTENT_ID=72&amp;User:LANGUAGE=en\">Enabler III</a><span style=\"font-size: 11px; background-color: #ffffff;\"> and </span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfoFlash:CONTENT_ID=71&amp;User:LANGUAGE=en\">Enabler HS 1000</a><span style=\"font-size: 11px; background-color: #ffffff;\"> series of modules, deliver.</span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">With simple integrated devices and a host of embedded platforms — Enfora is empowering the connected home with resilient, high-speed, scalable, and reliable end-point connectivity solutions. Driven by the </span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfo:CONTENT_ID=78&amp;User:LANGUAGE=en\">N4A Services Architecture</a><span style=\"font-size: 11px; background-color: #ffffff;\">, Enfora delivers a flexible, modular architecture capable of interfacing with </span><strong style=\"font-size: 11px; background-color: #ffffff;\">ZigBee</strong><span style=\"font-size: 11px; background-color: #ffffff;\">, </span><strong style=\"font-size: 11px; background-color: #ffffff;\">Bluetooth</strong><span style=\"font-size: 11px; background-color: #ffffff;\"> and other near field technologies for fast wireless connectivity and solutions deployment. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">Home Automation systems have been transformed with the N4A family of intelligent devices, from the Enabler III and HS embedded platforms to the family of </span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfo:CONTENT_ID=60&amp;User:LANGUAGE=en\">SA Telemetry</a><span style=\"font-size: 11px; background-color: #ffffff;\"> devices purpose-built for the time-sensitive data needed in the security and home automation markets.</span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">With intelligent backhaul communications through smart meters or residential gateways, information can be efficiently managed to effectively decrease energy usage. Enfora and its strategic partners deliver the data for better decision-making, improving performance safety and security for your treasured assets.</span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">Coupled with the robust N4A Communications and Management platform, devices can be provisioned, monitored and reconfigured remotely, most anywhere in the world. The Connected Home — Empowered Anywhere, Anytime. </span></p>'),(632,'<p>Technical Support</p>'),(633,'<p>Content</p>'),(634,'<p><span style=\"font-size: 11px; background-color: #ffffff;\">From the oil pipeline to the soft drink dispenser, today’s visionary companies rely on remote data communications to collect data from their remote assets, enhancing their bottom line by allowing their business to operate more efficiently through the management and utilization of critical, decision-based data. This certified, quad-band integrated IP-based platform is compact and economical, ensuring cost-effective connectivity in a small robust platform. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">Designed with GSM/GPRS connectivity for global deployments, the SA family has been designed to enhance your visibility into remotely-located fixed assets. Similar to Enfora’s industry-leading portfolio of integrated Mobile Tracking products, the SA family connects the world’s leading companies to their fixed assets, Anywhere, Anytime. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">Fixed assets of various types can benefit greatly from this fully programmable platform, with voice communications, a wide operational environment and much more. the units are designed to be easily deployed and provisioned, supplying critical information from industrial automation applications, supply and cold chain environments, fixed asset deployments, and a host of applications where companies require connectivity to serially-connected and sensor-generated data. </span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><span style=\"font-size: 11px; background-color: #ffffff;\">The SA family is part of Enfora’s intelligent telemetry devices, featuring superior performance in a small package for ultimate flexibility. Coupled with the robust </span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfo:CONTENT_ID=104&amp;User:LANGUAGE=en\">N4A Management and Communications Software</a><span style=\"font-size: 11px; background-color: #ffffff;\"> platform, devices can be provisioned, monitored and reconfigured remotely, most anywhere in the world. Driven by the </span><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfo:CONTENT_ID=78&amp;User:LANGUAGE=en\">services architecture</a><span style=\"font-size: 11px; background-color: #ffffff;\">, Enfora delivers a flexible, modular architecture for fast wireless asset tracking, solutions development and deployment. Keeping you connected to your company’s fixed and mobile assets, Anywhere, Anytime.</span><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><strong style=\"font-size: 11px; background-color: #ffffff;\">Popular Use Cases for the Spider SA family:</strong><br style=\"font-size: 11px; background-color: #ffffff;\" /><br style=\"font-size: 11px; background-color: #ffffff;\" /><a style=\"color: #ba1b22; font-weight: bold; text-decoration: none; font-size: 11px; background-color: #ffffff;\" href=\"http://www.enfora.com/index.cgi?PageInfoFlash:CONTENT_ID=70&amp;User:LANGUAGE=en\">Spider SA-G+</a><span style=\"font-size: 11px; background-color: #ffffff;\"> - the SA-G+ is a full-featured telemetry platform with serial and user-defined I/O ports designed to communicate with sensors and most any serial-based communications device.</span></p>'),(635,'<h2>Product Title</h2>'),(636,'<p><span style=\"font-size: medium;\"><strong>Product Description</strong></span></p>\r\n<p><span style=\"color: #333333; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 12px; line-height: 20px; background-color: #ffffff;\">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</span></p>'),(637,'<h2><span style=\"color: #00245d; font-family: Arial, Helvetica, sans-serif; font-size: 18px; line-height: 18px; background-color: #ffffff;\">MiFi® 2 – Next Generation MiFi – Available soon with AT&amp;T</span></h2>'),(638,'<p><span style=\"background-color: #ffffff; color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px;\">Introducing the next generation MiFi device by Novatel Wireless, MiFi 2, the world’s first mobile hotspot with a touchscreen display and the most feature rich mobile hotspot available.</span><span style=\"background-color: #ffffff; color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px;\"> </span></p>\r\n<p><br style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\" /><span style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\">Novatel Wireless has again set the design and usability standard for mobile connectivity with this next generation device that puts freedom at your fingertips. This next generation MiFi device\'s new iconic design and leap-forward innovation take Novatel Wireless\' industry leading user experience to new levels of ease and functionality. MiFi 2\'s vibrant, feature-rich touchscreen makes it easier than ever to connect up to 10 Wi-Fi enabled devices to fast 4G LTE™ Internet. You can check data usage, manage connected devices, change settings, enable MiFi Media Center and more…directly on the touchscreen. With up to 11 hours of battery life and the industry’s most advanced security features, MiFi 2 lets you connect with confidence and power through your day. </span><br style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\" /><br style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\" /><span style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\">Experience MiFi 2 soon, with the all-new MiFi Liberate by AT&amp;T…</span></p>'),(639,'<h2><span style=\"color: #00245d; font-family: Arial, Helvetica, sans-serif; font-size: 18px; line-height: 18px; background-color: #ffffff;\">MiFi® 4510 - Intelligent Mobile Hotspot for LTE Networks</span></h2>'),(640,'<p><strong style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\">MiFi®.  Freedom. My Way.®</strong><span style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\"> </span><br style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\" /><span style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\">The 4G LTE MiFi 4510 is the next generation of the Novatel Wireless MiFi Intelligent Mobile Hotspot portfolio, building on award winning innovation and design, proven performance and industry-leading flexibility, convenience, and reliability.  Experience life in the fast lane with blazing fast 4G LTE mobile broadband.  The reliable MiFi 4510 is backward compatible with the 3G CDMA 1XEvDO Rev A network and includes new features, such as integrated status display on the device showing signal strength, roaming, battery level, and number of devices connected.</span></p>'),(641,'<p><strong style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\"><strong>MiFi®.  Freedom. My Way.®</strong> <br /></strong><span style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\">The 4G LTE MiFi 4510 is the next generation of the Novatel Wireless MiFi Intelligent Mobile Hotspot portfolio, building on award winning innovation and design, proven performance and industry-leading flexibility, convenience, and reliability.  Experience life in the fast lane with blazing fast 4G LTE mobile broadband.  The reliable MiFi 4510 is backward compatible with the 3G CDMA 1XEvDO Rev A network and includes new features, such as integrated status display on the device showing signal strength, roaming, battery level, and number of devices connected.</span></p>'),(642,'<p><span style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\">Features</span></p>'),(643,'<p style=\"margin-bottom: 15px; margin-top: 10px; color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\">Features</p>\r\n<ul style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\">\r\n<li>Connects up to five Wi-Fi enabled devices simultaneously</li>\r\n<li>Computers, PDAs, cameras, music players, personal and game players and more</li>\r\n<li>Rechargeable Lithium Ion Battery </li>\r\n<li>GPS-enabled</li>\r\n<li>Advanced internal antenna system</li>\r\n<li>NovaSpeed® Capable</li>\r\n<li>Built-in security</li>\r\n</ul>'),(644,'<p><span style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\">Benefits</span></p>'),(645,'<p style=\"margin-bottom: 15px; margin-top: 10px; color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\">Benefits</p>\r\n<ul style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\">\r\n<li>Wireless and secure internet connectivity from virtually anywhere</li>\r\n<li>Portable and convenient – smaller than a deck of cards</li>\r\n<li>Great for travel – family, friends and colleagues can connect</li>\r\n<li>Perfect for the mobile professional – creates a virtual office wherever you go for you and your co-workers</li>\r\n<li>Enhanced performance and less connectivity interruptions with NovaSpeed®</li>\r\n</ul>'),(646,'<p><span style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px;\">Features</span></p>'),(647,'<p><span style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px;\">Benefits</span></p>'),(648,'<p>Accessories</p>'),(649,'<h2><span style=\"color: #333333; font-family: Arial, Helvetica, sans-serif;\"><span style=\"font-size: 12px;\">Verizon Wireless™ is now offering a 3,000 mAh battery for the MiFi® 4620L!</span></span></h2>\r\n<h2><span style=\"font-size: 12px; color: #333333; font-family: Arial, Helvetica, sans-serif;\">Extended Battery for MiFi® 4620L</span></h2>\r\n<p style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; background-color: #ffffff;\"><span style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px;\">The MiFi 4620L extended battery accessory is 3000 mAh and offers up to 10 continuous hours of battery life before requiring a recharge – giving Verizon Wireless MiFi 4620L customers a full day of use with their MiFi 4620L and the freedom of staying connected longer while playing, working or travelling.</span></p>'),(650,'<h2><span style=\"color: #333333; font-family: Arial, Helvetica, sans-serif;\"><span style=\"font-size: 12px;\">Verizon Wireless™ is now offering a 3,000 mAh battery for the MiFi® 4620L!</span></span><span style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px;\">Extended Battery for MiFi® 4620L</span></h2>\r\n<p style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; background-color: #ffffff;\"><span style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px;\">The MiFi 4620L extended battery accessory is 3000 mAh and offers up to 10 continuous hours of battery life before requiring a recharge – giving Verizon Wireless MiFi 4620L customers a full day of use with their MiFi 4620L and the freedom of staying connected longer while playing, working or travelling.</span></p>'),(651,'<h3>Verizon Wireless™ is now offering a 3,000 mAh battery for the MiFi® 4620L!</h3>\r\n<h3>Extended Battery for MiFi® 4620L</h3>\r\n<p>The MiFi 4620L extended battery accessory is 3000 mAh and offers up to 10 continuous hours of battery life before requiring a recharge – giving Verizon Wireless MiFi 4620L customers a full day of use with their MiFi 4620L and the freedom of staying connected longer while playing, working or travelling.</p>'),(652,'<p><strong>Verizon Wireless™ is now offering a 3,000 mAh battery for the MiFi® 4620L!</strong></p>\r\n<p><strong>Extended Battery for MiFi® 4620L</strong></p>\r\n<p>The MiFi 4620L extended battery accessory is 3000 mAh and offers up to 10 continuous hours of battery life before requiring a recharge – giving Verizon Wireless MiFi 4620L customers a full day of use with their MiFi 4620L and the freedom of staying connected longer while playing, working or travelling.</p>'),(653,'<p>MiFi® 4620L Intelligent Mobile Hotspot</p>\r\n<p><strong>Fast, always-on Internet wherever you roam—worldwide*<br /></strong>With the Verizon Jetpack™ 4G LTE Mobile Hotspot MiFi® 4620L by Novatel Wireless, access blazing fast 4G LTE and 3G mobile broadband worldwide and share your connection with up to ten Wi-Fi enabled devices simultaneously. MiFi 4620L is the next generation in the Novatel Wireless MiFi intelligent mobile hotspot portfolio for Verizon Wireless, built on award-winning innovation and design, proven performance and industry leading user experience.</p>\r\n<p><strong>Put the world in the palm of your hand<br /></strong>With this 4G LTE MiFi intelligent mobile hotspot, enjoy fast Internet access whenever, wherever you go. MiFi 4620L is backward compatible with high speed DC HSPA+, HSPA+, WCDMA, EDGE and GPRS technologies to keep you connected. The compact MiFi 4620L is perfect for on-the-go connectivity and won’t weigh you down.</p>\r\n<p><strong>Know where you are — monitor device and connection status at a glance</strong>With the interactive OLED display screen, easily scroll to view battery life, check signal strength, check the number of connected devices, read text messages, view network details, access your password, and much more!</p>\r\n<p><strong>Share the experience—connect up to 10 devices securely†</strong></p>\r\n<p><strong></strong>Create your own personal Wi-Fi cloud and share high speed 4G and 3G Internet connectivity with up to ten devices—notebooks, tablets, e-readers, gaming consoles and more. The MiFi 4620L supports the latest security protocols required by some of the strictest corporate VPNs, including VPN Pass-through and NAT Firewall.</p>\r\n<p> </p>\r\n<p><strong>Smooth sailing—navigate using GPS over Wi-Fi‡</strong></p>\r\n<p>MiFi 4620L is the first product to support GPS over Wi-Fi, enabling applications to access streaming GPS (NMEA). Stream GPS location services while on the move to up to 10 devices at once, no cables required!</p>\r\n<p> </p>\r\n<p>* Visit verizonwireless.com for coverage maps</p>\r\n<p>†Security settings must be enabled</p>\r\n<p>‡Available only on Windows® systems</p>\r\n<p>Service plans, extended battery and other services/options must be purchased separately</p>\r\n<p> </p>\r\n<p><a href=\"#\"><img src=\"{CCM:FID_7}\" alt=\"where-to-buy-button.png\" width=\"101\" height=\"27\" /></a></p>'),(655,'<h2><span style=\"color: #00245d; font-family: Arial, Helvetica, sans-serif; font-size: 18px; line-height: 18px; background-color: #ffffff;\">MiFi® 4082 - Intelligent Mobile Hotspot</span></h2>'),(656,'<p><strong>MiFi®.  Freedom. My Way.®</strong></p>\r\n<p>The 3G/4G MiFi 4082 is the next generation in the Novatel Wireless MiFi Intelligent Mobile Hotspot portfolio, building on award winning innovation and design, proven performance and industry-leading flexibility, convenience, and reliability. Experience life in the fast lane with blazing fast 4G WiMAX mobile broadband. The reliable MiFi 4082 is backward-compatible with the 3G CDMA 1XEvDO Rev A network, and includes new features such as the MiFi OS™, microSDHC™ card slot and an external status display providing information at-a-glance on signal strength, roaming status, battery levels and the number of devices connected.   </p>'),(657,'<p><strong>Features</strong></p>'),(658,'<ul>\r\n<li>Connects up to five Wi-Fi enabled devices simultaneously, such as computers, PDAs, cameras, music players, personal and game players and more</li>\r\n<li>External status display providing at-a-glance information on signal strength, roaming status, battery levels and number of connected devices</li>\r\n<li>E-ink® technology used in external status display does not drain the battery like LCD displays </li>\r\n<li>microSDHC™ memory card slot with up to 32GB support</li>\r\n<li>MiFi OS™ provides access to widgets and advanced configuration options via a user-friendly web interface – no software to install!</li>\r\n<li>Supports the latest security features that even the strictest corporate VPNs require</li>\r\n<li>Rechargeable Lithium Ion Battery: Best in class battery performance keeps you connected when you need to be (over 4 hours of active use and 60 hours of standby)</li>\r\n<li>GPS-enabled</li>\r\n</ul>'),(659,'<p><strong>Benefits</strong></p>'),(660,'<ul>\r\n<li>Ultra-fast speeds with 4G capability offer quicker downloads and seamless video streaming</li>\r\n<li>Switches seamlessly between 3G and 4G networks (reconnecting to secure VPNs is required after switching between 3G/4G)</li>\r\n<li>Wireless and secure internet connectivity from virtually anywhere</li>\r\n<li>Portable and convenient – smaller than a deck of cards</li>\r\n<li>Great for travel – family, friends and colleagues can connect &amp; share information over the MiFi OS™</li>\r\n<li>Perfect for the mobile professional – creates a virtual office wherever you go for you and your co-workers</li>\r\n</ul>'),(661,'<h2>MiFi® 3352 – Intelligent Mobile Hotspot for HSPA Networks with MiFi OS™</h2>'),(662,'<p>MiFi® is your own cloud of connectivity: great for personal and business use providing instant access to email, download large files, and surf the web with your laptop while simultaneously allowing up to five computers or personal devices to be connected. Easily swap and transfer files with built-in microSDHC slot providing expandable storage capacity of up to 16GB.</p>'),(663,'<p>Features</p>'),(664,'<ul>\r\n<li>Connects up to five Wi-Fi enabled devices simultaneously</li>\r\n<li>Computers, PDA\'s, cameras, music players, personal and game players and more</li>\r\n<li>MiFi OS™ , a browser based web user interface, capable of hosting advanced software applications and widgets </li>\r\n<li>Rechargeable Lithium Ion Battery</li>\r\n<li>GPS- enabled</li>\r\n<li>Advanced internal antenna system</li>\r\n<li>NovaSpeed® capable</li>\r\n<li>Auto-install and auto-connectivity</li>\r\n<li>10M (30 ft) range of network coverage</li>\r\n</ul>'),(665,'<p>Benefits</p>'),(666,'<ul>\r\n<li>Wireless and secure internet connectivity from virtually anywhere</li>\r\n<li>Portable and convenient – smaller than a deck of cards</li>\r\n<li>Great for travel – family, friends and colleagues can connect</li>\r\n<li>Perfect for the mobile professional – creates a virtual office wherever you go for your and your co-workers</li>\r\n<li>Easy installation with MobiLink™ Connection Manager- no CD required</li>\r\n<li>Enhanced performance and less connectivity interruptions with NovaSpeed®</li>\r\n<li>Lasts up to 4 hours on a single charge so you can be anywhere and have connectivity (when connected to one Wi-Fi device)</li>\r\n</ul>'),(667,'<p>Patents</p>'),(668,'<p>6,829,481</p>\r\n<p>7,319,715</p>\r\n<p>7,392,039</p>\r\n<p>7,574,737</p>'),(669,'<p>MiFi® 2200 – Intelligent Mobile Hotspot for CDMA 1xEVDO RevA Networks</p>'),(670,'<p>MiFi® delivers the ultimate in personal freedom. With the simple push of a button, wirelessly access the Internet from virtually anywhere with any WiFi-enabled device. And because it supports multiple users, you can share your high-speed connection with friends, family members and coworkers. The world\'s first Intelligent Mobile Hotspot, MiFi® is the fastest and easiest way to get online on the go—and it even fits in the palm of your hand. My Internet, my applications, my content, my way.</p>\r\n<p>MiFi® is your own cloud of connectivity: great for personal and business use providing instant access to email, download large files, and surf the web with your laptop while simultaneously allowing up to five computers or personal devices to be connected.</p>'),(671,'<p>Features</p>'),(672,'<ul>\r\n<li>Connects up to five Wi-Fi enabled devices simultaneously</li>\r\n<li>Computers, PDA\'s, cameras, music players, personal and game players and more</li>\r\n<li>Rechargeable Lithium Ion Battery</li>\r\n<li>GPS-enabled</li>\r\n<li>Advanced internal antenna system</li>\r\n<li>NovaSpeed® Capable</li>\r\n<li>Auto-install and auto-connectivity</li>\r\n<li>30-foot range of network coverage</li>\r\n<li>Built-in security</li>\r\n</ul>'),(673,'<p>Benefits</p>'),(674,'<ul>\r\n<li>Wireless and secure internet connectivity from virtually anywhere</li>\r\n<li>Portable and convenient – smaller than a deck of cards</li>\r\n<li>Great for travel – family, friends and colleagues can connect</li>\r\n<li>Perfect for the mobile professional – creates a virtual office wherever you go for your and your co-workers</li>\r\n<li>Easy installation with MobiLink™ Connection Manager- no CD required</li>\r\n<li>Enhanced performance and less connectivity interruptions with NovaSpeed®</li>\r\n<li>Lasts up to 4 hours on a single charge so you can be anywhere and have connectivity (when connected to one Wi-Fi device)</li>\r\n</ul>'),(675,'<p>MiFi® 2352 – Intelligent Mobile Hotspot for HSPA Networks (for Europe)</p>'),(676,'<p>MiFi® is your own cloud of connectivity: great for personal and business use providing instant access to email, download large files, and surf the web with your laptop while simultaneously allowing up to five computers or personal devices to be connected. Easily swap and transfer files with built-in microSDHC slot providing expandable storage capacity of up to 16GB.</p>'),(677,'<p>Features</p>'),(678,'<ul>\r\n<li>Connects up to five Wi-Fi enabled devices simultaneously</li>\r\n<li>Computers, PDA\'s, cameras, music players, personal and game players and more</li>\r\n<li>Rechargeable Lithium Ion Battery</li>\r\n<li>GPS- enabled</li>\r\n<li>Advanced internal antenna system</li>\r\n<li>NovaSpeed® capable</li>\r\n<li>Auto-install and auto-connectivity</li>\r\n<li>10M (30 ft) range of network coverage</li>\r\n</ul>'),(679,'<p>Benefits</p>'),(680,'<ul>\r\n<li>Wireless and secure internet connectivity from virtually anywhere</li>\r\n<li>Portable and convenient – smaller than a deck of cards</li>\r\n<li>Great for travel – family, friends and colleagues can connect</li>\r\n<li>Perfect for the mobile professional – creates a virtual office wherever you go for your and your co-workers</li>\r\n<li>Easy installation with MobiLink™ Connection Manager- no CD required</li>\r\n<li>Enhanced performance and less connectivity interruptions with NovaSpeed®</li>\r\n<li>Lasts up to 4 hours on a single charge so you can be anywhere and have connectivity (when connected to one Wi-Fi device)</li>\r\n</ul>'),(681,'<p>Patents</p>'),(682,'<p>6,829,481</p>\r\n<p>7,319,715</p>\r\n<p>7,392,039</p>\r\n<p>7,574,737</p>'),(683,'<h1>MiFi® 2372 – Intelligent Mobile Hotspot for HSPA Networks (for North America)</h1>'),(684,'<p><strong>MiFi®. Freedom. My way®.</strong> - (7.2 Mpbs download and 5.76 Mbps upload)</p>\r\n<p>MiFi® delivers the ultimate in personal freedom. With the simple push of a button, wirelessly access the Internet from virtually anywhere with any WiFi-enabled device. MiFi® supports multiple users, you can share your high-speed connection with friends, family members and co-workers. The world\'s first Intelligent Mobile Hotspot, MiFi® is the fastest and easiest way to get online on the go—and it even fits in the palm of your hand. My Internet, my applications, my content, my way.</p>\r\n<p>MiFi® is your own cloud of connectivity: great for personal and business use providing instant access to email, download large files, and surf the web with your laptop while simultaneously allowing up to five computers or personal devices to be connected. Easily swap and transfer files with built-in microSDHC slot providing expandable storage capacity of up to 16GB.</p>'),(685,'<h2>Expedite® E396 PCI Express Mini Card</h2>'),(686,'<p><strong>Single Global SKU – Expedite® E396 PCI Express Mini Card Embedded Module</strong></p>\r\n<p>Novatel Wireless’ Expedite® E396 PCI Express Mini Card is an embedded module that can be integrated into laptops, tablets, M2M hosts and other devices for 3G mobile data applications. Powered by the Qualcomm® MDM6600 chipset, the Expedite E396 offers high performance to the user on HSPA+ and EVDO Rev A bands with global fallback to 2G. 3G technology provides data speeds up to 14.4 Mbps† from virtually anywhere in the world. With the network selection feature, OEMs can now stock a single global SKU rather than having to procure and support multiple cards.  </p>\r\n<p>The Expedite E396 module’s MobiLink™ Connection Manager and SDK with API enable intuitive, plug-and-play integration, customization and branding. With its short order cycle and award-winning Novatel Wireless Engineering Support, the module delivers rapid deployment and quick time to market. </p>\r\n<p><strong>Mobile Broadband Data Speeds Around the Globe</strong></p>\r\n<p>3G technology provides data speeds up to 14.4 Mbps† from virtually anywhere you are in the world. The Expedite E396 3G PCI Express Mini Card empowers devices with global mobile broadband connectivity. </p>\r\n<p><strong>Anytime…Anywhere</strong></p>\r\n<p>The small, cost effective Expedite E396 module leverages the HSPA+ and CDMA networks. Switching between networks enables your customers to work, play, and stay connected anytime, anywhere worldwide†.  </p>\r\n<p><strong>Performance When It Counts…</strong></p>\r\n<p>High efficiency compact broadband design provides consistent throughput performance.  The condensed trace routing and compact component layout increases power efficiency and decreases overall weight. WHQL certification, on/off NDIS capabilities and a complete Software Development Kit provide flexibility and expedite product development.</p>\r\n<p><strong>Advanced GOBI™ Technology</strong></p>\r\n<p>Advanced GOBI technology provides for standard GOBI APIs as well as QDL™, allowing the end user to select which network operator to use.</p>\r\n<p>GPS CapabilityAllows you to retrieve location data from GPS satellites and utilize GPS navigation and location-based applications.</p>\r\n<p><strong>Technology Revolution</strong></p>\r\n<p>Global anywhere capabilities, enhanced applications, and extended coverage provide full mobility for the fast paced world we live in.</p>\r\n<p>† Network operator dependent.</p>'),(687,'<h3>Highlights</h3>\r\n<p class=\"t1\">The feature-rich MT 4100 is a dual-band 1xRTT (CDMA2000) and HSDPA/UMTS two-SKU solution that supports driver behavior monitoring and reporting.  With a 22-pin connector, the MT 4100 provides many GPIO options including: 1-Wire®Driver ID; expanded I/O including digital, analog, and latched outputs; ignition sense; and two serial interfaces.  It also has internal cellular and GPS antennas, 12V and 24V vehicle support, an ultra-low sleep mode, store-and-forward messaging, and support for Garmin® Fleet Management Interface (FMI). With its backup battery option the MT 4100 can immediately detect and report removal from primary vehicle power. Other notable value-add features of the device are:</p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span>Expanded power range for 12V and 24V vehicle support <em>in a single device</em></span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span>Driver identity confirmation</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span>Expanded I/O monitoring &amp; control (5 digital inputs, 3 digital outputs, 2 analog inputs)</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span>Polygon geofencing</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span>Driver behavior reporting &amp; unauthorized vehicle movement</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span>Lower cost two-way dispatch communications, optimization &amp; routing access</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span>More engine diagnostics &amp; monitoring options through add-on peripheral capabilities</span></p>\r\n<h3><span style=\"font-size: small;\">MT-Gμ Device Benefits:</span></h3>\r\n<table style=\"color: #000000; font-size: 11px; text-align: start; background-color: #ffffff;\" width=\"450\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td align=\"left\" valign=\"top\" width=\"208\">Support for Garmin’s Fleet Management Interface (FMI) (optional)</td>\r\n<td align=\"center\" valign=\"top\" width=\"19\">:</td>\r\n<td align=\"left\" valign=\"top\" width=\"223\">Flexible customization through built-in programmable rules engine &amp; control automation capabilities</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"3\" align=\"center\" valign=\"middle\" height=\"15\"><hr /></td>\r\n</tr>\r\n<tr>\r\n<td align=\"left\" valign=\"top\">Wireless data and voice port available</td>\r\n<td align=\"center\" valign=\"top\">:</td>\r\n<td align=\"left\" valign=\"top\">Polygon geo-fencing &amp; GPIO’s</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"3\" align=\"center\" valign=\"middle\" height=\"15\"><hr /></td>\r\n</tr>\r\n<tr>\r\n<td align=\"left\" valign=\"top\">Auto-registration on power up</td>\r\n<td align=\"center\" valign=\"top\">:</td>\r\n<td align=\"left\" valign=\"top\">Internal battery back-up allows for continued operation when main input power is removed</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"3\" align=\"center\" valign=\"middle\" height=\"15\"><hr /></td>\r\n</tr>\r\n<tr>\r\n<td align=\"left\" valign=\"top\">FOTA enabled for remote upgrades</td>\r\n<td align=\"center\" valign=\"top\">:</td>\r\n<td align=\"left\" valign=\"top\">Integrated SMS for commands &amp; messages</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"3\" align=\"center\" valign=\"middle\" height=\"15\"><hr /></td>\r\n</tr>\r\n<tr>\r\n<td align=\"left\" valign=\"top\">Now with 3-axis accelerometer for driver behavior reporting (GSM2438)</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3><span style=\"font-size: small;\">View Enterprise Assets As Never Before</span></h3>\r\n<p class=\"t1\">All Enfora® M2M integrated devices are designed for full compatibility with our <em><span style=\"text-decoration: underline;\"><span style=\"color: #7030a0;\">N4A® Software Platform</span></span></em>that includes the N4A® Communications and Management Software (CMS) and N4A® Device Manager, which provide accelerated device provisioning, deployment, shipping, monitoring, and tracking worldwide. Once you’ve experienced this level of visibility and control over your decision-clarifying assets, you won’t know how you managed without it.</p>\r\n<p> </p>'),(688,'<h2>Product Title</h2>'),(689,'<p><span style=\"font-size: medium;\"><strong>Product Description</strong></span></p>\r\n<p><span style=\"color: #333333; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 12px; line-height: 20px; background-color: #ffffff;\">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</span></p>'),(690,'<h1><span style=\"font-size: x-large;\"><strong>Mobile Broadband Portfolio</strong></span></h1>'),(691,'<h1><span style=\"font-size: x-large;\"><strong>M2M Portfolio</strong></span></h1>'),(694,'<h3>Highlights</h3>\r\n<p class=\"t1\"><span style=\"font-size: 11px;\">The flagship of Enfora’s industry-leading portfolio of integrated Mobile Tracking products, the MT series of platforms connect the world’s leading companies to their valuable mobile assets. The certified quad-band integrated device is optimized for today’s increasing demand for vehicle recovery, fuel efficient fleet operations, driver and vehicle profiling and interactive communications. Providing complete GSM/GPRS communications Enfora helps you track and monitor vehicles from the family car to the largest fleet of commercial vehicles. With superior GPS sensitivity, enhanced business intelligence logic provided by the programmable rules engine, polygon Geo-Fencing, integrated SMS commands, messaging and much more, the units are designed to be easily deployed and provisioned supplying critical information for the most demanding fleet operator, the buy-here pay-here dealers to the pay as you go insurance company. This device has demonstrable results in a host of vertical market segments including:</span></p>\r\n<p class=\"Tabledata\"><span><span><span style=\"font-family: Symbol; font-size: xx-small;\">·</span><span style=\"font-family: \'Times New Roman\';\">       </span><span><span style=\"font-size: xx-small;\">Over the Road – Long Haul Carriers</span></span></span></span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span>Emergency Response Vehicles</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span>Common Carriers</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span>Owner - Operators</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span>Small Fleet Operators</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span>High End – Buy-Here, Pay-Here</span></p>\r\n<p class=\"Tabledata\"><span style=\"font-size: x-small;\"><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span>Independent Truckers</span></p>\r\n<h3><span style=\"font-size: small;\">MT-Gμ Device Benefits:</span></h3>\r\n<table style=\"color: #000000; font-size: 11px; text-align: start; background-color: #ffffff;\" width=\"450\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td align=\"left\" valign=\"top\" width=\"208\">Support for Garmin’s Fleet Management Interface (FMI) (optional)</td>\r\n<td align=\"center\" valign=\"top\" width=\"19\">:</td>\r\n<td align=\"left\" valign=\"top\" width=\"223\">Flexible customization through built-in programmable rules engine &amp; control automation capabilities</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"3\" align=\"center\" valign=\"middle\" height=\"15\"><hr /></td>\r\n</tr>\r\n<tr>\r\n<td align=\"left\" valign=\"top\">Wireless data and voice port available</td>\r\n<td align=\"center\" valign=\"top\">:</td>\r\n<td align=\"left\" valign=\"top\">Polygon geo-fencing &amp; GPIO’s</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"3\" align=\"center\" valign=\"middle\" height=\"15\"><hr /></td>\r\n</tr>\r\n<tr>\r\n<td align=\"left\" valign=\"top\">Auto-registration on power up</td>\r\n<td align=\"center\" valign=\"top\">:</td>\r\n<td align=\"left\" valign=\"top\">Internal battery back-up allows for continued operation when main input power is removed</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"3\" align=\"center\" valign=\"middle\" height=\"15\"><hr /></td>\r\n</tr>\r\n<tr>\r\n<td align=\"left\" valign=\"top\">FOTA enabled for remote upgrades</td>\r\n<td align=\"center\" valign=\"top\">:</td>\r\n<td align=\"left\" valign=\"top\">Integrated SMS for commands &amp; messages</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"3\" align=\"center\" valign=\"middle\" height=\"15\"><hr /></td>\r\n</tr>\r\n<tr>\r\n<td align=\"left\" valign=\"top\">Now with 3-axis accelerometer for driver behavior reporting (GSM2438)</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3> </h3>'),(695,'<h2>MT-Gμ</h2>\r\n<h4>Mobile Tracking Device</h4>'),(696,'<h2>AT 4000</h2>'),(697,'<p><span style=\"font-size: medium;\"><strong>Product Description</strong></span></p>\r\n<p><span style=\"color: #333333; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 12px; line-height: 20px; background-color: #ffffff;\">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</span></p>'),(698,'<p> </p>\r\n<h2 class=\"HeadingProductname\">M2M Modules</h2>\r\n<h3>A Trusted Brand since 2005</h3>\r\n<p class=\"t1\">Continuing the successful Enabler® OEM module line that’s been a staple of the Enfora® M2M brand since its introduction in 2005, the Enabler® IIIG Series maintains the core features of using industry-leading chipset manufacturers as the basis of our trusted in-house designs and then overlaying our Smart Agent with its action-based intelligence onto the final modem design. With the recent expansion of the series beyond the Enabler® IIIG into our new HS Series, we provide you with even more module options for integration into your mission critical designs—while preserving the industry-leading intelligence and in-house expertise that’s led to our iconic brand success.</p>\r\n<h3>A Made-for-Migration Technology Line</h3>\r\n<p class=\"t1\">Whether you’re eager to migrate from 2G to 3G or between other technologies in our GSM/GPRS, 1xRTT (CDMA2000), and HSDPA/UMTS module line up, it will be easy to do with the common-by-design build of our extended HS Series of OEM modules. We’ve preserved the same 100-pin I/O and B2B RF connectors; a compatible x-y size and mounting; and the same firmware API, including our Smart Agent from our popular Enabler® IIIG Series. Another benefit of an Enabler® Series transition is that you can even reuse most of your valuable script features. So if you require a longer product life for your next-generation design—or your business plans include worldwide deployments, international roaming, regional expansion, carrier change, and/or better cellular coverage—we’ve already eased your transition and lessened your risk.</p>\r\n<h3>Enhancing Integrator Success</h3>\r\n<p class=\"t1\">Novatel Wireless supports module integrators by bringing an in-depth understanding of complex carrier networks and actively working with clients to achieve numerous regulatory approvals. In fact, we’ve taken Enfora® M2M modules through about 60 PTCRB and 10 new GCF certification approvals, have been a participant in the development of the GCF and PTCRB M2M approval requirements, and have expertise in nearly 20 other regulatory approval types. Novatel Wireless additionally can lower risk, speed time to market, and achieve cost discounts for our clients through long-standing relationships with third-party certifying labs.</p>\r\n<h3>Architected for Target Applications &amp; Markets</h3>\r\n<p class=\"t1\">A strong differentiator of our Enabler® HS Series of cellular modems that’s not immediately obvious is that—beyond working with world-class chipset manufacturers and integrating our actionable intelligence into our designs—we calibrate and align our hardware and low-level firmware to accommodate the needs of the target applications. So whether your battery-free telematics application needs extra low power or your fixed exterior monitoring site needs extended low temperature, we have you covered.  Some key target applications include:</p>\r\n<!--[if gte mso 9]><xml>\r\n <o:DocumentProperties>\r\n  <o:Revision>0</o:Revision>\r\n  <o:TotalTime>0</o:TotalTime>\r\n  <o:Pages>1</o:Pages>\r\n  <o:Words>20</o:Words>\r\n  <o:Characters>119</o:Characters>\r\n  <o:Company>Rational Interaction</o:Company>\r\n  <o:Lines>1</o:Lines>\r\n  <o:Paragraphs>1</o:Paragraphs>\r\n  <o:CharactersWithSpaces>138</o:CharactersWithSpaces>\r\n  <o:Version>14.0</o:Version>\r\n </o:DocumentProperties>\r\n <o:OfficeDocumentSettings>\r\n  <o:RelyOnVML></o:RelyOnVML>