o-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Security/Safety/Alarm</p>\r\n</td>\r\n<td style=\"width: 184.5pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"185\">\r\n<p class=\"Tabledata\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Utilities</p>\r\n</td>\r\n<td style=\"width: 1.5in; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"108\">\r\n<p class=\"Tabledata\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Transportation</p>\r\n</td>\r\n<td style=\"width: 1.75in; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"126\">\r\n<p class=\"Tabledata\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Telemetry</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 1.95in; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"140\">\r\n<p class=\"Tabledata\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->AMR/AMI End Points</p>\r\n</td>\r\n<td style=\"width: 184.5pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"185\">\r\n<p class=\"Tabledata\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Remote Monitor/Control (RMAC)</p>\r\n</td>\r\n<td style=\"width: 1.5in; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"108\">\r\n<p class=\"Tabledata\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Telematics</p>\r\n<p class=\"Tabledata\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Automotive</p>\r\n</td>\r\n<td style=\"width: 1.75in; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"126\">\r\n<p class=\"Tabledata\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->mHealth</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<!--EndFragment-->\r\n<h3>View Enterprise Assets As Never Before</h3>\r\n<p class=\"t1\">All Enfora® modems are designed for full compatibility with our <em><span style=\"text-decoration: underline;\"><span style=\"color: #7030a0;\">N4A® Software Platform</span></span></em>that includes the N4A® Communications and Management Software (CMS) and N4A® Device Manager, which provide accelerated device provisioning, deployment, shipping, monitoring, and tracking worldwide. Once you’ve experienced this level of visibility and control over your decision-clarifying assets, you won’t know how you managed without it. </p>\r\n<h3>Quality &amp; Reliability that Keeps Selling</h3>\r\n<p class=\"t1\">At Novatel Wireless we infuse quality in all we do, starting with well-defined <em><span style=\"text-decoration: underline;\"><span style=\"color: #7030a0;\">ISO 9001:2008*</span></span></em>engineering processes that cross both the consumer mobile computing and M2M cellular modem teams. Our longstanding relationships with industry leaders like Qualcomm® help us to accurately and efficiently integrate chipset capabilities into our modem designs while accelerating time to market. Our modules also experience statistically low returns, while our clients rate our RMA and support processes well above industry averages in yearly Customer Satisfaction Surveys. Those are statistics that engender customer loyalty and keep us working hard to make transitions simple and technology fresh.</p>\r\n<!--EndFragment-->\r\n<p> </p>'),(699,'<h3>Highlights</h3>\r\n<p class=\"t1\">Our versatile Enfora® MT Series of mobile tracking devices has been installed worldwide across a variety of markets. To accommodate the needs of the widest range of applications and end users, Novatel Wireless\' series devices offer a number of Mobile Resource Management (MRM) features and options including 12V and 24V vehicle support; GSM/GPRS, 1xRTT (CDMA), and HSDPA/UMTS air interfaces; and variable hardware formats. Some of these formats include wired, unwired with optional rechargeable backup battery, and OBD-II plug-and-play with optional backup battery. Most of our MT Series devices have a method to detect and report potential tamper events, enhancing overall security.</p>\r\n<h3>Stay in Control with Multiple Installation Options</h3>\r\n<p class=\"t1\">A customer- or self-installation, applicable to our MT 3000 and MT 3050 devices, is particularly favorable for fleet management applications as it removes the complexity, install costs, and out-of-service time often associated with a wired vehicle installation, thereby lowering total up-front costs. Many Usage Based Insurance (UBI) applications also favor this type of plug-and-play format to provide their insured members a simple self-install/uninstall experience, while enhancing the company’s rapid reuse capability for the device.</p>\r\n<p class=\"t1\">Professional installations, common with wired devices—especially those with positioning brackets such as our MT 2500, MT 4000, and MT 4100—can be perceived as more secure and/or covert and, therefore, less likely to be tampered with or removed. When you choose an Enfora® M2M wired device you’re already minimizing your installation costs by choosing a product with built-in GPS and cellular antennas, which eliminates the need to pay for additional time to properly fit an external antenna in the vehicle.</p>\r\n<h3>Quality &amp; Reliability that Keeps Selling</h3>\r\n<p class=\"t1\">At Novatel Wireless we infuse quality in all we do, starting with well-defined <em><span style=\"text-decoration: underline;\"><span style=\"color: #7030a0;\">ISO 9001:2008</span></span></em><span style=\"color: #7030a0;\">*</span> engineering processes that cross both the consumer mobile computing and M2M cellular modem teams. Our longstanding relationships with industry leaders like Qualcomm® help us to accurately and efficiently integrate chipset capabilities into our in-house modem designs that ultimately drive our integrated devices while accelerating time to market. Our <em><span style=\"text-decoration: underline;\"><span style=\"color: #7030a0;\">Enfora® Enabler® Series </span></span></em>modules also experience statistically low returns—enhancing overall device stability—while our clients rate our RMA and support processes well above industry averages in yearly Customer Satisfaction Surveys. Those are statistics that engender customer loyalty and keep us working hard to make transitions simple and technology fresh.</p>'),(701,'<h3>Highlights</h3>\r\n<p>An extension to the Novatel Wireless M2M family of integrated asset management solutions, the Enfora® AT Series is a powered to battery-driven integrated device series that provides internal quad-band GSM/GPRS/GPS antenna functionality for mobile asset monitoring. Based on the Enfora® Enabler® Series module, the built-in programmable software environment enables essential capabilities such as mobile connectivity, location awareness, and device intelligence. The device leverages a unique set of control and automation features that extend device longevity through managing power usage and critical communications parameters. All series devices provide total protection against dust, water spray, and long periods of water immersion under pressure.</p>\r\n<h3>Driving Business Applications</h3>\r\n<p>The Enfora<sup>®</sup> AT Series provides global mobile asset monitoring solution for the following target markets:</p>\r\n<table class=\"MsoTableGrid ccm-note small\" style=\"width: 526.5pt; border-collapse: collapse; border: none; mso-yfti-tbllook: 1184; mso-padding-alt: 0in 5.4pt 0in 5.4pt; mso-border-insideh: none; mso-border-insidev: none;\" width=\"527\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 175.5pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"176\">\r\n<p><span style=\"font-size: x-small;\"> <!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Regulatory Compliance </span></p>\r\n<p><span style=\"font-size: x-small;\"> <!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->National Defense </span></p>\r\n<p><span style=\"font-size: x-small;\"> <!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Asset Utilization/Recovery </span></p>\r\n<p><span style=\"font-size: x-small;\"> <!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Leasing </span></p>\r\n<p><span style=\"font-size: x-small;\"> <!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Trailers </span></p>\r\n</td>\r\n<td style=\"width: 171.0pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"171\">\r\n<p><span style=\"font-size: x-small;\"> <!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">    </span></span><!--[endif]-->HAZMAT </span></p>\r\n<p><span style=\"font-size: x-small;\"> <!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">    </span></span><!--[endif]-->Truck or Rail Shipments </span></p>\r\n<p><span style=\"font-size: x-small;\"> <!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">    </span></span><!--[endif]-->Shipping Containers/Logistics </span></p>\r\n<p><span style=\"font-size: x-small;\"> <!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">    </span></span><!--[endif]-->High-Value Asset Monitoring </span></p>\r\n<p><span style=\"font-size: x-small;\"> <!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">    </span></span><!--[endif]-->Powered Assets </span></p>\r\n</td>\r\n<td style=\"width: 2.5in; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"180\">\r\n<p><span style=\"font-size: x-small;\"> <!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">  </span></span><!--[endif]-->Security </span></p>\r\n<p><span style=\"font-size: x-small;\"> <!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">  </span></span><!--[endif]-->Construction </span></p>\r\n<p><span style=\"font-size: x-small;\"> <!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">  </span></span><!--[endif]-->Insurance Applications </span></p>\r\n<p><span style=\"font-size: x-small;\"> <!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">  </span></span><!--[endif]-->Refrigeration Units </span></p>\r\n<p><span style=\"font-size: x-small;\"> <!--[if !supportLists]--><span style=\"font-family: Symbol;\">·<span style=\"font-family: \'Times New Roman\';\">  </span></span><!--[endif]-->Alternate Power Source Assets</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3>Quality &amp; Reliability that Keeps Selling</h3>\r\n<p>At Novatel Wireless we infuse quality in all we do, starting with well-defined <em><span style=\"text-decoration: underline;\"><span style=\"color: #7030a0;\">ISO 9001:2008</span></span></em><span style=\"color: #7030a0;\">*</span> engineering processes that cross both the consumer mobile computing and M2M cellular modem teams. Our longstanding relationships with industry leaders like Qualcomm® help us to accurately and efficiently integrate chipset capabilities into our in-house modem designs that ultimately drive our integrated devices while accelerating time to market. Our <em><span style=\"text-decoration: underline;\"><span style=\"color: #7030a0;\">Enfora® Enabler® Series </span></span></em>modules also experience statistically low returns—enhancing overall device stability—while our clients rate our RMA and support processes well above industry averages in yearly Customer Satisfaction Surveys. Those are statistics that engender customer loyalty and keep us working hard to make transitions simple and technology fresh.</p>\r\n<p> </p>'),(702,'<h3>Highlights</h3>\r\n<p class=\"t1\"> The Enfora® SA Series is a stand-alone telemetry solution designed for cellular M2M applications with a range of business and market needs.  Each SA-G+ series device is driven by our in-house developed Enfora® Enabler® Series embedded modules with our Smart Agent events engine. Novatel Wireless modules are additionally calibrated and aligned with our in-house hardware and low-level firmware to accommodate the needs of the target application. Even with this much intelligence inside, you\'ll find the sub-credit-card-sized SA-G+ will fit with room to spare in most telemetry hardware designs.</p>\r\n<p class=\"t1\">Designed for operational simplicity and price economy, the Enfora® SA Series doesn’t overshoot the needs of most M2M applications with sophisticated features or excessive interfaces. Instead, the series remains focused on Novatel Wireless’ core mission to connect serial-based machines to the cloud—simply, reliably, and economically. </p>\r\n<h3>Driving Business Applications</h3>\r\n<p class=\"t1\">With its compact design and low power consumption, the SA-G+ is an ideal device to connect remote assets requiring low data throughput to the Internet and via Advanced Asset Management, to the business enterprise. Some applications include:</p>\r\n<p class=\"Tabledata\"><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span>Wireless POS Terminal</p>\r\n<p class=\"Tabledata\"><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span>Safety &amp; Security</p>\r\n<p class=\"Tabledata\"><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span>Vending Machines</p>\r\n<p class=\"Tabledata\"><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span>Public Traffic Services</p>\r\n<p class=\"Tabledata\"><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span>Gauge Monitoring (light, water, telephone)</p>\r\n<p class=\"Tabledata\"><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span>Industrial/SCADA</p>\r\n<p class=\"Tabledata\"><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span>Service/Maintenance (gas fields/chemical plants/water)</p>\r\n<p class=\"Tabledata\"><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span>Kiosks, Billboards (Public Service, other)</p>\r\n<p class=\"Tabledata\"><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span>Parking Meters</p>\r\n<p><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: x-small; font-family: \'Times New Roman\';\">    </span></span><span style=\"font-size: x-small;\">Electricity Tower Monitoring</span></p>\r\n<p><span style=\"font-size: x-small;\"><span style=\"font-family: Symbol; font-size: 10px;\">·    RMAC</span></span></p>\r\n<h3>Advanced Monitoring &amp; Visibility</h3>\r\n<p>All Enfora® SA Series devices are designed for full compatibility with our <em><span style=\"text-decoration: underline;\"><span style=\"color: #7030a0;\">N4A® Software Platform</span></span></em>that includes the N4A® Communications and Management Software (CMS) and N4A® Device Manager. These on-premise or cloud-based solutions provide accelerated device provisioning, deployment, shipping, monitoring, and tracking worldwide.   With Novatel Wireless’ SA-G+ M2M hardware, standard Firmware Over-the-Air (FOTA) upgrades, and a targeted N4A® Software solution for your unique enterprise needs, you’ll experience a level of visibility and control over your field deployed machines and other static assets that will free up resources, increase the immediacy of your decisions, and lessen your overall risk.Advanced Monitoring &amp; Visibility</p>\r\n<h3>Quality &amp; Reliability that Keeps Selling</h3>\r\n<p class=\"t1\">At Novatel Wireless we infuse quality in all we do, starting with well-defined <em><span style=\"text-decoration: underline;\"><span style=\"color: #7030a0;\">ISO 9001:2008</span></span></em><span style=\"color: #7030a0;\">*</span> engineering processes that cross both the consumer mobile computing and M2M cellular modem teams. Our longstanding relationships with industry leaders like Qualcomm® help us to accurately and efficiently integrate chipset capabilities into our in-house modem designs that ultimately drive our integrated devices while accelerating time to market. Our <em><span style=\"text-decoration: underline;\"><span style=\"color: #7030a0;\">Enfora® Enabler® Series </span></span></em>modules also experience statistically low returns—enhancing overall device stability—while our clients rate our RMA and support processes well above industry averages in yearly Customer Satisfaction Surveys. Those are statistics that engender customer loyalty and keep us working hard to make transitions simple and technology fresh.</p>'),(703,'<h3>Service Delivery Platform</h3>\r\n<h3>Highlights</h3>\r\n<p>The Enfora® SA Series is a stand-alone telemetry solution designed for cellular M2M applications with a range of business and market needs.  Each SA-G+ series device is driven by our in-house developed Enfora® Enabler® Series embedded modules with our Smart Agent events engine. Novatel Wireless modules are additionally calibrated and aligned with our in-house hardware and low-level firmware to accommodate the needs of the target application. Even with this much intelligence inside, you\'ll find the sub-credit-card-sized SA-G+ will fit with room to spare in most telemetry hardware designs.</p>'),(704,'<h3>Legacy of Innovation</h3>\r\n<p class=\"t1\">Designed for system integrators, network operators, and enterprise companies charged with managing a myriad of assets to control and reduce operational costs, improve asset utilization, and provide better customer service through asset visibility, the AT 3000 provides IP 66/68/69 rating and ATEX Zone 2 certification with up to a 5 year configurable battery life. Fixed or mobile, assets need to be monitored for regulatory compliance, security, national defense, operational efficiencies or just peace of mind. </p>\r\n<h3>Asset Monitoring for the Next Generation</h3>\r\n<p class=\"t1\">The GSM/GPRS-based quad-band AT 3000 features a 3-axis accelerometer for motion detection, and includes onboard geo-fencing capabilities as well as dynamic geo-fencing for asset security, locking assets to new locations without the need for over-the-air reconfiguration. The AT 3000 can be provisioned through the N4A™ Communications and Management platform to optimize motion detection, location monitoring, reporting and geo-fencing capabilities, all of which will help match battery life and service availability to the application.</p>\r\n<p class=\"t1\">Core features include:</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l1 level1 lfo2;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Optimized for the longest battery life of all Enfora® AT Series devices: up to 5 years of operation depending on usage patterns</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l1 level1 lfo2;\"><!--[if !supportLists]--><span><span style=\"font-family: Symbol;\">·</span><span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span><span>Fully integrated with multiple mounting options with no need for external antennas</span></span></p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l1 level1 lfo2;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Onboard 3-axis accelerometer for configurable security options</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l1 level1 lfo2;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Environmental ratings for harsh installation environments – IP 66/68/69 &amp; ATEX Zone 2</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l1 level1 lfo2;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Simplified over-the-air provisioning and device management delivered through the N4A Communications &amp; Management service delivery platform</p>'),(705,'<h2>AT 3000</h2>\r\n<h3>Battery-powered Asset Tracking Device</h3>'),(706,'<h2>AT 3000</h2>\r\n<h4>Battery-powered Asset Tracking Device</h4>'),(707,'<h3>Legacy of Innovation</h3>\r\n<p class=\"t1\">Designed for system integrators, network operators, and enterprise companies charged with managing a myriad of assets to control and reduce operational costs, improve asset utilization, and provide better customer service through asset visibility, the AT 3000 provides IP 66/68/69 rating and ATEX Zone 2 certification with up to a 5 year configurable battery life. Fixed or mobile, assets need to be monitored for regulatory compliance, security, national defense, operational efficiencies or just peace of mind. </p>\r\n<h3>Asset Monitoring for the Next Generation</h3>\r\n<p class=\"t1\">The GSM/GPRS-based quad-band AT 3000 features a 3-axis accelerometer for motion detection, and includes onboard geo-fencing capabilities as well as dynamic geo-fencing for asset security, locking assets to new locations without the need for over-the-air reconfiguration. The AT 3000 can be provisioned through the N4A™ Communications and Management platform to optimize motion detection, location monitoring, reporting and geo-fencing capabilities, all of which will help match battery life and service availability to the application.</p>\r\n<p class=\"t1\"><strong>Core features include:</strong></p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l1 level1 lfo2;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Optimized for the longest battery life of all Enfora® AT Series devices: up to 5 years of operation depending on usage patterns</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l1 level1 lfo2;\"><!--[if !supportLists]--><span><span style=\"font-family: Symbol;\">·</span><span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span><span>Fully integrated with multiple mounting options with no need for external antennas</span></span></p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l1 level1 lfo2;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Onboard 3-axis accelerometer for configurable security options</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l1 level1 lfo2;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Environmental ratings for harsh installation environments – IP 66/68/69 &amp; ATEX Zone 2</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l1 level1 lfo2;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Simplified over-the-air provisioning and device management delivered through the N4A Communications &amp; Management service delivery platform</p>'),(708,'<h2>AT 2010</h2>\r\n<h4>Battery-powered Asset Tracking Device</h4>'),(709,'<p><span style=\"font-size: small;\"><strong>Legacy of Innovation</strong></span></p>\r\n<p><span style=\"color: #333333; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 12px; line-height: 20px; background-color: #ffffff;\">Designed for system integrators, network operators, and enterprise companies charged with managing a myriad of assets to control and reduce operational costs, improve asset utilization, and provide better customer service through asset visibility, the AT 3010 provides IP 66/68/69 rating and ATEX Zone 2 certification with up to a 5 year configurable battery life. Fixed or mobile, assets need to be monitored for regulatory compliance, security, national defense, operational efficiencies or just peace of mind. </span></p>\r\n<p><span style=\"font-size: small;\"><strong>Asset Monitoring for the Next Generation</strong></span></p>\r\n<p> </p>\r\n<p style=\"color: #000000; font-size: 10px; line-height: normal; font-family: Verdana, Arial, Helvetica, sans-serif;\"><span style=\"color: #333333; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 12px; line-height: 20px; background-color: #ffffff;\">The GSM/GPRS-based quad-band AT 3010 is purpose-built for cold temperature environments (up to -40C) without sacrificing performance and while maintaining up to four (4) years of continuous operation (based on configuration and reporting frequency). The AT 3010 features a 3-axis accelerometer for motion detection, and includes onboard geo-fencing capabilities as well as dynamic geo-fencing for asset security, locking assets to new locations without the need for over-the-air reconfiguration. The AT 3010 can be provisioned through the N4A Communications and Management platform to optimize motion detection, location monitoring, reporting and geo-fencing capabilities, all of which will help match battery life and service availability to the application.</span></p>\r\n<p style=\"color: #000000; font-size: 10px; line-height: normal;\"><strong><span style=\"color: #333333; font-size: 12px; line-height: 20px;\">Core Features Include:</span></strong></p>\r\n<ul>\r\n<li><span style=\"font-size: 12px; line-height: 20px;\">Ideal for colder environments (up to -40C) while still providing up to four (4) years of operation based on configuration and reporting frequency</span></li>\r\n<li><span style=\"font-size: 12px; line-height: 20px;\">Fully integrated with multiple mounting options with no need for external antennas</span></li>\r\n<li><span style=\"font-size: 12px; line-height: 20px;\">Onboard 3-axis accelerometer for configurable security options</span></li>\r\n<li><span style=\"font-size: 12px; line-height: 20px;\">Environmental ratings for harsh installation environments – IP 66/68/69 &amp; ATEX Zone 2</span></li>\r\n<li><span style=\"font-size: 12px; line-height: 20px;\">Simplified over-the-air provisioning and device management delivered through the N4A Communications &amp; Management service delivery platform</span></li>\r\n</ul>\r\n<p> </p>'),(710,'<h2><span style=\"font-size: small;\"><strong>Legacy of Innovation</strong></span></h2>\r\n<p><span style=\"color: #333333; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 12px; line-height: 20px; background-color: #ffffff;\">Designed for system integrators, network operators, and enterprise companies charged with managing a myriad of assets to control and reduce operational costs, improve asset utilization, and provide better customer service through asset visibility, the AT 3010 provides IP 66/68/69 rating and ATEX Zone 2 certification with up to a 5 year configurable battery life. Fixed or mobile, assets need to be monitored for regulatory compliance, security, national defense, operational efficiencies or just peace of mind. </span></p>\r\n<h2><span style=\"font-size: small;\"><strong>Asset Monitoring for the Next Generation</strong></span></h2>\r\n<p> </p>\r\n<p style=\"color: #000000; font-size: 10px; line-height: normal; font-family: Verdana, Arial, Helvetica, sans-serif;\"><span style=\"color: #333333; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 12px; line-height: 20px; background-color: #ffffff;\">The GSM/GPRS-based quad-band AT 3010 is purpose-built for cold temperature environments (up to -40C) without sacrificing performance and while maintaining up to four (4) years of continuous operation (based on configuration and reporting frequency). The AT 3010 features a 3-axis accelerometer for motion detection, and includes onboard geo-fencing capabilities as well as dynamic geo-fencing for asset security, locking assets to new locations without the need for over-the-air reconfiguration. The AT 3010 can be provisioned through the N4A Communications and Management platform to optimize motion detection, location monitoring, reporting and geo-fencing capabilities, all of which will help match battery life and service availability to the application.</span></p>\r\n<p style=\"color: #000000; font-size: 10px; line-height: normal;\"><strong><span style=\"color: #333333; font-size: 12px; line-height: 20px;\">Core Features Include:</span></strong></p>\r\n<ul>\r\n<li><span style=\"font-size: 12px; line-height: 20px;\">Ideal for colder environments (up to -40C) while still providing up to four (4) years of operation based on configuration and reporting frequency</span></li>\r\n<li><span style=\"font-size: 12px; line-height: 20px;\">Fully integrated with multiple mounting options with no need for external antennas</span></li>\r\n<li><span style=\"font-size: 12px; line-height: 20px;\">Onboard 3-axis accelerometer for configurable security options</span></li>\r\n<li><span style=\"font-size: 12px; line-height: 20px;\">Environmental ratings for harsh installation environments – IP 66/68/69 &amp; ATEX Zone 2</span></li>\r\n<li><span style=\"font-size: 12px; line-height: 20px;\">Simplified over-the-air provisioning and device management delivered through the N4A Communications &amp; Management service delivery platform</span></li>\r\n</ul>\r\n<p> </p>'),(711,'<h2>Legacy of Innovation</h2>\r\n<p>Designed for system integrators, network operators, and enterprise companies charged with managing a myriad of assets to control and reduce operational costs, improve asset utilization, and provide better customer service through asset visibility, the AT 3010 provides IP 66/68/69 rating and ATEX Zone 2 certification with up to a 5 year configurable battery life. Fixed or mobile, assets need to be monitored for regulatory compliance, security, national defense, operational efficiencies or just peace of mind.</p>\r\n<h2>Asset Monitoring for the Next Generation</h2>\r\n<p>The GSM/GPRS-based quad-band AT 3010 is purpose-built for cold temperature environments (up to -40C) without sacrificing performance and while maintaining up to four (4) years of continuous operation (based on configuration and reporting frequency). The AT 3010 features a 3-axis accelerometer for motion detection, and includes onboard geo-fencing capabilities as well as dynamic geo-fencing for asset security, locking assets to new locations without the need for over-the-air reconfiguration. The AT 3010 can be provisioned through the N4A Communications and Management platform to optimize motion detection, location monitoring, reporting and geo-fencing capabilities, all of which will help match battery life and service availability to the application.</p>\r\n<p><strong>Core Features Include:</strong></p>\r\n<ul>\r\n<li><span style=\"font-size: 12px; line-height: 20px;\">Ideal for colder environments (up to -40C) while still providing up to four (4) years of operation based on configuration and reporting frequency</span></li>\r\n<li><span style=\"font-size: 12px; line-height: 20px;\">Fully integrated with multiple mounting options with no need for external antennas</span></li>\r\n<li><span style=\"font-size: 12px; line-height: 20px;\">Onboard 3-axis accelerometer for configurable security options</span></li>\r\n<li><span style=\"font-size: 12px; line-height: 20px;\">Environmental ratings for harsh installation environments – IP 66/68/69 &amp; ATEX Zone 2</span></li>\r\n<li><span style=\"font-size: 12px; line-height: 20px;\">Simplified over-the-air provisioning and device management delivered through the N4A Communications &amp; Management service delivery platform</span></li>\r\n</ul>'),(712,'<h2>Ovation™ MC679 LTE/DC HSPA+ USB Modem</h2>'),(713,'<p>Introducing the 4G LTE Ovation™ MC679, the market’s slimmest and most compact 4G LTE USB modem. The MC679 is the next generation of the Novatel Wireless Ovation USBmobile broadband modem portfolio, building on award-winning innovation and design, proven performance and industry-leading flexibility, convenience and reliability.  Experience life in the fast lane with blazing fast 4G LTE mobile broadband.</p>\r\n<p> </p>\r\n<p>Stay Connected</p>\r\n<p>WitThis 4G LTE USB modem provides LTE download speeds of up to 100 Mbps* and upload speeds of up to 50 Mbps and boasts a broad band designation. Now, you can stay connected to high-speed networks from virtually anywhere since the GPS-capable MC679  supports LTE AWS/700, DC HSPA/HSPA+ 850/1900/2100 and quad-band GPRS/EDGE.</p>\r\n<p> </p>\r\n<p>Slim, Durable and Compact Design</p>\r\n<p>Perfect for the frequent traveler! The MC679 is the market’s slimmest and most compact 4G LTE USB modem currently available for North America. Its hinged USB connector provides flexible orientation, ease of use and can simply fold closed for additional protection in transport.</p>\r\n<p> </p>\r\n<p>Internal Advanced Antenna with MIMO</p>\r\n<p>Connectivity when you need it the most. The tri-band advanced antenna includes MIMO withreceive diversity, providing optimal performance when you need it most. Thecompact internal antenna is designed without fragile external pieces. The device itself extends only an inch out of your notebook. </p>\r\n<p> </p>\r\n<p>Versatility and Compatibility</p>\r\n<p>The perfect solution. The MC679 is backward-compatible to high-speed DC HSPA+ and HSPA+ networks.  The MC679 device also comes complete with MobiLink™ Connection Manager software for a quick setup. Compatible on Windows® , Mac® and Linux® operating systems, it is the perfect solution to get up and running quickly and easily.</p>'),(714,'<p>Introducing the 4G LTE Ovation™ MC679, the market’s slimmest and most compact 4G LTE USB modem. The MC679 is the next generation of the Novatel Wireless Ovation USBmobile broadband modem portfolio, building on award-winning innovation and design, proven performance and industry-leading flexibility, convenience and reliability.  Experience life in the fast lane with blazing fast 4G LTE mobile broadband.</p>\r\n<p> </p>\r\n<p><strong>Stay Connected</strong></p>\r\n<p>WitThis 4G LTE USB modem provides LTE download speeds of up to 100 Mbps* and upload speeds of up to 50 Mbps and boasts a broad band designation. Now, you can stay connected to high-speed networks from virtually anywhere since the GPS-capable MC679  supports LTE AWS/700, DC HSPA/HSPA+ 850/1900/2100 and quad-band GPRS/EDGE.</p>\r\n<p> </p>\r\n<p><strong>Slim, Durable and Compact Design</strong></p>\r\n<p>Perfect for the frequent traveler! The MC679 is the market’s slimmest and most compact 4G LTE USB modem currently available for North America. Its hinged USB connector provides flexible orientation, ease of use and can simply fold closed for additional protection in transport.</p>\r\n<p> </p>\r\n<p><strong>Internal Advanced Antenna with MIMO</strong></p>\r\n<p>Connectivity when you need it the most. The tri-band advanced antenna includes MIMO withreceive diversity, providing optimal performance when you need it most. Thecompact internal antenna is designed without fragile external pieces. The device itself extends only an inch out of your notebook. </p>\r\n<p> </p>\r\n<p><strong>Versatility and Compatibility</strong></p>\r\n<p>The perfect solution. The MC679 is backward-compatible to high-speed DC HSPA+ and HSPA+ networks.  The MC679 device also comes complete with MobiLink™ Connection Manager software for a quick setup. Compatible on Windows® , Mac® and Linux® operating systems, it is the perfect solution to get up and running quickly and easily.</p>'),(715,'<p>Ovation™ MC545 Dual-Carrier HSPA+ USB Modem</p>'),(716,'<p>The Ovation™ MC545 Wireless Broadband USB modem is the most compact dual-carrier HSPA+ device currently available with an integrated microSDHC slot. The device boasts download speeds of up to 42 Mbps and upload speeds of up to 5.76 Mbps. With 900, 1900, and 2100 MHz HSPA+/UMTS bands and Quad Band GPRS/EDGE, the MC545 allows you to connect anywhere in the world be it from home, office, hotel, or airport.</p>\r\n<p><strong>Ovation™ MC545 DC HSPA+ Modem</strong></p>\r\n<p>The Ovation MC545 includes all the benefits of Novatel Wireless mobile broadband engineering, while being the world\'s smallest, most compact and light-weight DC HSPA+ USB device available.</p>\r\n<p><strong>Ultra Fast Mobile Broadband Speeds</strong></p>\r\n<p>Experience speed that won’t leave you waiting. With peak download speeds of 42 Mbps and upload speeds of 5.76 Mbps, mobile broadband connectivity has never been smoother. The Ovation MC545 offers unprecedented speed and advanced antenna technologies to maximize data throughput and operating range.</p>\r\n<p><strong>One Product for both Business and Consumers</strong></p>\r\n<p>With its leading edge technology and its innovative sleek style, the Ovation MC545 suits both consumers and business professionals alike. It\'s versatility makes it perfect for use in the office, at home and while traveling.</p>\r\n<p><strong>Integrated microSDHC up to 32GB</strong></p>\r\n<p>Ovation MC545 is equipped with an integrated microSDHC™ slot to provide flexible and high-capacity memory storage options while on the go. Ideal for large presentations that need to be accessed and shared on the fly!</p>'),(717,'<p>Ovation™ MC760 EVDO Rev.A Micro USB Modem</p>'),(718,'<p>Introducing Ovation™ MC760: the only micro-sized broadband Internet device currently available with high-capacity removable memory storage. The powerful performance of EVDO Rev.A Broadband Internet, microSD™, and GPS is now all wrapped up in a thumb-drive sized device.</p>\r\n<p><strong>NovaSpeed™ Capable*</strong></p>\r\n<p>Your broadband internet experience can be even better with the Novatel Wireless proprietary software, NovaSpeed. NovaSpeed enhances broadband connections by allowing simultaneous upload and download, online gaming, video streaming, GPS maps and large file transfers with virtually no interruptions or buffering.</p>\r\n<p><strong>High-Capacity microSD Storage</strong></p>\r\n<p>The integrated microSD slot of Ovation MC760 provides flexible memory storage options without hindering your Internet connection performance. Memory cards are available in various capacity sizes up to 8GB, for quick and easy transport of large files, like presentations, videos, pictures, and music files.</p>\r\n<p><strong>Internal Antenna Design</strong></p>\r\n<p>Features an advanced internal dual band antenna system that includes diversity for enhanced performance on network fringe areas.</p>\r\n<p><strong>No CD Required for Installation</strong></p>\r\n<p>Windows and Mac users no longer need to hassle with CDs. With MobiLink Lite software and device drivers built right into the device, installation is quick and easy.</p>'),(719,'<h2>AT 3010</h2>\r\n<h4>Battery-powered Asset Tracking Device</h4>'),(720,'<p>Features</p>'),(721,'<ul>\r\n<li>Highspeed Wireless Data:</li>\r\n<ul>\r\n<li>EV-DO Rev. A Networks (backwards compatible to Rev 0 and 1xRTT) CDMA 800 MHz and CDMA 1900 MHz. Up to 3.1 Mbps on the downlink and up to 1.8 Mbps on the uplink on EV-DO Rev A capable networks.</li>\r\n</ul>\r\n<li>NovaSpeed Software Capability:</li>\r\n<ul>\r\n<li>Serious performance boost with virtually no interruptions or buffering.</li>\r\n</ul>\r\n<li>Removable Memory:</li>\r\n<ul>\r\n<li>Hot-swappable removable memory via microSD™ up to 8GB!</li>\r\n</ul>\r\n<li>GPS Capability:</li>\r\n<ul>\r\n<li>Retrieve location data from GPS satellites and utilize GPS navigation and location-based applications.</li>\r\n</ul>\r\n<li>Compact size:</li>\r\n<ul>\r\n<li>Only two inches.</li>\r\n</ul>\r\n<li>Internal Antenna Design:</li>\r\n<ul>\r\n<li>Includes diversity for enhanced performance on network fringe areas.</li>\r\n</ul>\r\n<li>Supports Multiple Platforms:</li>\r\n<ul>\r\n<li>Windows Vista, XP, 2000, Mac OS X 10.3.9 or Higher, Linux.</li>\r\n</ul>\r\n<li>Compact and Sleek Design:</li>\r\n<ul>\r\n<li>Just under three inches, Ovation’s glossy finish includes a vanishing LED system that displays connection status when powered.</li>\r\n</ul>\r\n<li>Feature-rich:</li>\r\n<ul>\r\n<li>2-way text messaging</li>\r\n<li>NDIS support</li>\r\n<li>External antenna option</li>\r\n<li>Intuitive MobiLink Lite software, zero-CD installation</li>\r\n<li>Low power consumption</li>\r\n<li>Accessories</li>\r\n<li>Lead-free</li>\r\n<li>Field-firmware upgradeable.</li>\r\n</ul>\r\n</ul>'),(722,'<p>Benefits</p>'),(723,'<ul>\r\n<li>Removable memory up to 8GB</li>\r\n<li>Small &amp; Compact</li>\r\n<li>Large data files can be sent and received more quickly</li>\r\n<li>Plug-and-play</li>\r\n<li>Secure internet access</li>\r\n<li>Dependable, reliable product</li>\r\n</ul>'),(724,'<p>Expedite® E346 PCI Express Mini Card</p>'),(725,'<p><strong>Single Global SKU – Expedite® E346 PCI Express Mini Card Embedded Module</strong></p>\r\n<p>Novatel Wireless’ Expedite® E346 PCI Express Mini Card is an embedded module that can be integrated into laptops, tablets, M2M hosts and other devices for 3G mobile data applications. Powered by the Qualcomm® MDM6200 chipset, the Expedite E346 offers high performance to the user on HSPA+ bands with global fallback to 2G. 3G technology provides data speeds up to 14.4 Mbps† from virtually any location worldwide. With the network selection feature, OEMs can now stock a single global SKU rather than having to procure and support multiple cards.  </p>\r\n<p>The Expedite E346 module’s MobiLink™ Connection Manager and SDK with API enable intuitive, plug-and-play integration, customization and branding. With its short order cycle and award-winning Novatel Wireless Engineering Support, the Expedite E346 module delivers rapid deployment and quick time to market. </p>\r\n<p><strong>Mobile Broadband Data Speeds Around the Globe</strong></p>\r\n<p>3G technology provides data speeds up to 14.4 Mbps† from virtually anywhere in the world. The Expedite E346 3G PCI Express Mini Card empowers devices with global mobile broadband connectivity. </p>\r\n<p><strong>Anytime…Anywhere </strong>The small, cost effective Expedite E346 module leverages the HSPA+ and GSM technologies. Switching between networks enables your customers to work, play, and stay connected anytime, anywhere worldwide†.  </p>\r\n<p><strong>Performance When It Counts…</strong>High efficiency compact broadband design provides consistent throughput performance.  The condensed trace routing and compact component layout increases power efficiency and decreases overall weight. WHQL certification, on/off NDIS capabilities and a complete Software Development Kit provide flexibility and expedite product development.</p>\r\n<p><strong>Advanced GOBI™ Technology</strong></p>\r\n<p>Advanced GOBI™ technology provides for standard GOBI APIs as well as QDL™, allowing the end user to select which network operator to use.</p>\r\n<p><strong>GPS Capability</strong></p>\r\n<p>Allows you to retrieve location data from GPS satellites and utilize GPS navigation and location-based applications.</p>\r\n<p><strong>Technology Revolution</strong></p>\r\n<p>Global anywhere capabilities, enhanced applications, and extended coverage provide full mobility for the fast paced world we live in.</p>\r\n<p>† Network operator dependent.</p>'),(726,'<h2>Expedite® E371 PCI Express Mini Card</h2>'),(727,'<p>Novatel Wireless\' Expedite® E371 PCI Express Mini Card is an embedded module that can be integrated into laptops and other devices for 3G/4G mobile data applications. Powered by the Qualcomm® MDM9200 chipset, the Expedite E371 offers high performance to the user on LTE 700 MHz and AWS bands with global fallback to HSPA+/UMTS.</p>\r\n<p><strong>Beyond Broadband Data Speeds on the Move</strong></p>\r\n<p>LTE technology provides data speeds up to 100 Mbps† (much greater than many wired broadband data services). Offers fast, wireless broadband speeds to customers and helps them achieve blistering fast connection speeds adequate for video streaming and VoIP.</p>\r\n<p><strong>Anytime... Anywhere</strong></p>\r\n<p>The small Expedite E371 module leverages the LTE and HSPA+/UMTS networks. Switching between networks enables your customers to work, play, and stay connected anytime, anywhere worldwide†.</p>\r\n<p><strong>Performance When It Counts...</strong></p>\r\n<p>High efficiency compact broadband design provides consistent throughput performance. The condensed trace routing and compact component layout increases power efficiency and decreases overall weight. WHQL certified with on/off NDIS capabilities and a complete Software Development Kit provides flexibility and expedites product development.</p>\r\n<p><strong>Advanced Antenna Technology</strong></p>\r\n<p>Expedite E371 comes equipped with \"multiple input multiple output\" (MIMO) and diversity antenna support technologies to maximize data throughput and operating range.</p>\r\n<p><strong>GPS Capability</strong></p>\r\n<p>Allows you to retrieve location data from GPS satellites and utilize GPS navigation and location-based applications.</p>\r\n<p><strong>Technology Revolution</strong></p>\r\n<p>Beyond Broadband data speeds, enhanced applications, and extended coverage provide full mobility for the fast paced world we live in.</p>'),(728,'<h2>Expedite® E362 PCI Express Mini Card</h2>'),(729,'<p>Novatel Wireless\' Expedite® E362 PCI Express Mini Card is an embedded module that can be integrated into laptops and other devices for 3G/4G mobile data applications. Powered by Qualcomm® MDM9600 chipset, the Expedite E362 offers high performance to the user on LTE 700 MHz with global fallback to CDMA and HSPA+/UMTS.</p>\r\n<p><strong>Beyond Broadband Data Speeds on the Move</strong></p>\r\n<p>LTE technology provides data speeds up to 100 Mbps† (much greater than many wired broadband data services). Offers fast, wireless broadband speeds to customers and helps them achieve blistering fast connection speeds adequate for video streaming and VoIP.</p>\r\n<p><strong>Anytime... Anywhere</strong></p>\r\n<p>The small Expedite E362 module leverages the LTE, CDMA, and HSPA+/UMTS networks. Switching between networks enables your customers to work, play, and stay connected anytime, anywhere worldwide†.</p>\r\n<p><strong>Performance When It Counts...</strong></p>\r\n<p>High efficiency compact broadband design provides consistent throughput performance. The condensed trace routing and compact component layout increases power efficiency and decreases overall weight. WHQL certified with on/off NDIS capabilities and a complete Software Development Kit provides flexibility and expedites product development.</p>\r\n<p><strong>Advanced Antenna Technology</strong></p>\r\n<p>Expedite E362 comes equipped with \"multiple input multiple output\" (MIMO) and diversity antenna support technologies to maximize data throughput and operating range.</p>\r\n<p><strong>GPS Capability</strong></p>\r\n<p>Allows you to retrieve location data from GPS satellites and utilize GPS navigation and location-based applications.</p>\r\n<p><strong>Technology Revolution</strong></p>\r\n<p>Beyond Broadband data speeds, enhanced applications, and extended coverage provide full mobility for the fast paced world we live in.</p>'),(734,'<h2>MiFi® 2352 – Intelligent Mobile Hotspot for HSPA Networks (for Europe)</h2>'),(735,'<h3>MiFi® 2352 – Intelligent Mobile Hotspot for HSPA Networks (for Europe)</h3>'),(736,'<p><strong>MiFi® 2352 – Intelligent Mobile Hotspot for HSPA Networks (for Europe)</strong></p>'),(737,'<h4><strong>MiFi® 2352 – Intelligent Mobile Hotspot for HSPA Networks (for Europe)</strong></h4>'),(738,'<h4>MiFi® 2372 – Intelligent Mobile Hotspot for HSPA Networks (for North America)</h4>'),(739,'<h4>MiFi® 3352 – Intelligent Mobile Hotspot for HSPA Networks with MiFi OS™</h4>'),(741,'<h4>Ovation™ MC760 EVDO Rev.A Micro USB Modem</h4>'),(742,'<p>Features</p>'),(743,'<h3>Legacy of Innovation</h3>\r\n<p class=\"t1\">Designed for system integrators, network operators, and enterprise companies charged with managing a myriad of assets to control and reduce operational costs, improve asset utilization, and provide better customer service through asset visibility, the AT 3000 provides IP 66/68/69 rating and ATEX Zone 2 certification with up to a 5 year configurable battery life. Fixed or mobile, assets need to be monitored for regulatory compliance, security, national defense, operational efficiencies or just peace of mind. </p>\r\n<h3>Asset Monitoring for the Next Generation</h3>\r\n<p class=\"t1\">The GSM/GPRS-based quad-band AT 3000 features a 3-axis accelerometer for motion detection, and includes onboard geo-fencing capabilities as well as dynamic geo-fencing for asset security, locking assets to new locations without the need for over-the-air reconfiguration. The AT 3000 can be provisioned through the N4A™ Communications and Management platform to optimize motion detection, location monitoring, reporting and geo-fencing capabilities, all of which will help match battery life and service availability to the application.</p>'),(744,'<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l1 level1 lfo2;\"><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span>Optimized for the longest battery life of all Enfora® AT Series devices: up to 5 years of operation depending on usage patterns</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l1 level1 lfo2;\"><span style=\"font-family: Symbol;\">·</span><span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span>Fully integrated with multiple mounting options with no need for external antennas</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l1 level1 lfo2;\"><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span>Onboard 3-axis accelerometer for configurable security options</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l1 level1 lfo2;\"><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span>Environmental ratings for harsh installation environments – IP 66/68/69 &amp; ATEX Zone 2</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l1 level1 lfo2;\"><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span>Simplified over-the-air provisioning and device management delivered through the N4A Communications &amp; Management service delivery platform</p>'),(745,'<h4>AT 3000</h4>\r\n<h4>Battery-powered Asset Tracking Device</h4>'),(746,'<p><strong>Legacy of Innovation</strong></p>\r\n<p class=\"t1\">Designed for system integrators, network operators, and enterprise companies charged with managing a myriad of assets to control and reduce operational costs, improve asset utilization, and provide better customer service through asset visibility, the AT 3000 provides IP 66/68/69 rating and ATEX Zone 2 certification with up to a 5 year configurable battery life. Fixed or mobile, assets need to be monitored for regulatory compliance, security, national defense, operational efficiencies or just peace of mind. </p>\r\n<p><strong>Asset Monitoring for the Next Generation</strong></p>\r\n<p class=\"t1\">The GSM/GPRS-based quad-band AT 3000 features a 3-axis accelerometer for motion detection, and includes onboard geo-fencing capabilities as well as dynamic geo-fencing for asset security, locking assets to new locations without the need for over-the-air reconfiguration. The AT 3000 can be provisioned through the N4A™ Communications and Management platform to optimize motion detection, location monitoring, reporting and geo-fencing capabilities, all of which will help match battery life and service availability to the application.</p>'),(747,'<h4>AT 3000</h4>\r\n<p><strong>Battery-powered Asset Tracking Device</strong></p>'),(748,'<h4>AT 3010</h4>\r\n<p><strong>Battery-powered Asset Tracking Device</strong></p>'),(749,'<p><strong>Legacy of Innovation</strong></p>\r\n<p>Designed for system integrators, network operators, and enterprise companies charged with managing a myriad of assets to control and reduce operational costs, improve asset utilization, and provide better customer service through asset visibility, the AT 3010 provides IP 66/68/69 rating and ATEX Zone 2 certification with up to a 5 year configurable battery life. Fixed or mobile, assets need to be monitored for regulatory compliance, security, national defense, operational efficiencies or just peace of mind.</p>\r\n<p><strong>Asset Monitoring for the Next Generation</strong></p>\r\n<p>The GSM/GPRS-based quad-band AT 3010 is purpose-built for cold temperature environments (up to -40C) without sacrificing performance and while maintaining up to four (4) years of continuous operation (based on configuration and reporting frequency). The AT 3010 features a 3-axis accelerometer for motion detection, and includes onboard geo-fencing capabilities as well as dynamic geo-fencing for asset security, locking assets to new locations without the need for over-the-air reconfiguration. The AT 3010 can be provisioned through the N4A Communications and Management platform to optimize motion detection, location monitoring, reporting and geo-fencing capabilities, all of which will help match battery life and service availability to the application.</p>'),(750,'<p>Features</p>'),(751,'<ul>\r\n<li><span style=\"font-size: 12px; line-height: 20px;\">Ideal for colder environments (up to -40C) while still providing up to four (4) years of operation based on configuration and reporting frequency</span></li>\r\n<li><span style=\"font-size: 12px; line-height: 20px;\">Fully integrated with multiple mounting options with no need for external antennas</span></li>\r\n<li><span style=\"font-size: 12px; line-height: 20px;\">Onboard 3-axis accelerometer for configurable security options</span></li>\r\n<li><span style=\"font-size: 12px; line-height: 20px;\">Environmental ratings for harsh installation environments – IP 66/68/69 &amp; ATEX Zone 2</span></li>\r\n<li><span style=\"font-size: 12px; line-height: 20px;\">Simplified over-the-air provisioning and device management delivered through the N4A Communications &amp; Management service delivery platform</span></li>\r\n</ul>'),(752,'<h4>AT 4000</h4>\r\n<p><strong>Fixed Powered Asset Tracking Device</strong></p>'),(754,'<p><strong>Legacy of Innovation</strong></p>\r\n<p>Fixed or mobile, a myriad of assets need to be monitored for regulatory compliance, security, national defense, operational efficiencies or just peace of mind. Whether you are monitoring a Hazmat shipment on a truck or railroad car, the location of a construction trailer, a shipping container, ATM machine, refrigeration unit, air conditioning compressor or any other powered valuable asset, the AT 4000 is the right solution.</p>\r\n<p> </p>\r\n<p><strong>Legacy of Innovation</strong></p>\r\n<p>Designed for the intelligent monitoring of powered mobile and fixed assets the AT 4000 is easily installed and managed. The AT 4000 is provisioned through the N4A™ Communications &amp; Management platform and can be configured to optimize motion detection, location monitoring, reporting and geo-fence settings, all of which will help match battery life and service availability to the application.</p>\r\n<p> </p>'),(755,'<p>Features</p>'),(761,'<ul>\r\n<li>Fully Integrated, no need for an external antenna</li>\r\n<li>Self-Contained, powered</li>\r\n<li>Simplified Over-the-Air Configuration &amp; Provisioning delivered through the Device Manager</li>\r\n</ul>'),(762,'<h4>Enabler IIIG</h4>\r\n<p><strong>Dual-Band/Quad-Band Module</strong></p>'),(763,'<p><strong>Diverse Options</strong></p>\r\n<p>The Enabler IIIG is form factor compatible across GPRS modules, allowing manufacturers tremendous flexibility and versatility in developing and deploying worldwide solutions.</p>\r\n<p><strong>Versatile Design</strong></p>\r\n<p>The modular architecture is shared across all platforms and powered by a programmable rules engine. The network router, control, and automation capabilities provide manufacturers with a flexible structural design for rapid product development and deployment.</p>'),(764,'<p>Features</p>'),(765,'<ul>\r\n<li>100-pin connector form factor is compatible across technolog ies</li>\r\n<li>Optional SIM carrier provides smallest overall system size</li>\r\n<li>Integration with N4A Software for quick development and deployment</li>\r\n<li>Voice</li>\r\n<li>SMS</li>\r\n<li>Packet Data</li>\r\n<li>TCP/IP and UDP/IP software stack with Packet Assembler Disassembler</li>\r\n<li>Network router and control/automation</li>\r\n</ul>'),(767,'<h1>Welcome to the Novatel Wireless Media Center</h1>\r\n<p>Access to the latest news as it happens, view the latest press releases, download press kits, photos, and logos, contact our PR team and more.</p>'),(771,'<h1>Related Resources</h1>\r\n<p><img src=\"{CCM:FID_75}\" alt=\"pdf_icon.png\" width=\"13\" height=\"13\" /> NVTL Corporate Background</p>\r\n<p><img src=\"{CCM:FID_75}\" alt=\"pdf_icon.png\" width=\"13\" height=\"13\" /> NVTL Corporate FAQ</p>\r\n<p><img src=\"{CCM:FID_75}\" alt=\"pdf_icon.png\" width=\"13\" height=\"13\" /> NVTL Boiler Plate</p>'),(772,'<h1>About Novatel Wireless</h1>\r\n<p>Novatel Wireless, Inc. is a leader in the design and development of intelligent wireless solutions based on 2G, 3G, and 4G technologies providing wireless connectivity.</p>'),(773,'<h2>Welcome to the Novatel Wireless Media Center</h2>\r\n<p>Access to the latest news as it happens, view the latest press releases, download press kits, photos, and logos, contact our PR team and more.</p>'),(780,'<p><span style=\"font-size: large;\"><strong>Software</strong></span></p>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</p>'),(782,'<h4>The MiFi® Intelligent Mobile Hotspot Operating System—More than Mobile Connectivity</h4>'),(783,'<p>With the MiFi OS™ the MiFi Intelligent Mobile Hotspot provides more than mobile connectivity alone. The MiFi OS offers a flexible, powerful platform to browse, install, update and develop applications and run them on the MiFi device. With the MiFi web interface users can access widgets, applications and files using any Wi-Fi enabled device, eliminating the need to install and maintain software on multiple products.</p>'),(784,'<p>Features</p>'),(785,'<ul>\r\n<li>Leading-edge silicon solutions from Qualcomm</li>\r\n<li>100-pin connector form factor is compatible across technologies</li>\r\n<li>SIM carrier provides smallest overall system size</li>\r\n<li>SMS</li>\r\n<li>Voice</li>\r\n<li>Packet Data</li>\r\n<li>TCP/IP and UDP/IP software stack with Packet Assembler Disassembler</li>\r\n<li>Network router and control/automation</li>\r\n</ul>\r\n<div> </div>'),(786,'<p>Features</p>'),(787,'<ul>\r\n<li>Leading-edge silicon solutions from Qualcomm</li>\r\n<li>100-pin connector form factor is compatible across technologies</li>\r\n<li>Integration with N4A Software for quick development and deployment</li>\r\n<li>SMS</li>\r\n<li>Packet Data</li>\r\n<li>TCP/IP and UDP/IP software stack with Packet Assembler Disassembler</li>\r\n<li>Network router and control/automation</li>\r\n</ul>\r\n<div> </div>'),(788,'<h4>MT 2500</h4>\r\n<p><strong>Mobile Tracking Device</strong></p>'),(789,'<p><strong>Legacy of Innovation</strong></p>\r\n<p>The MT 2500, a certified quad-band, 3-axis accelerometer integrated device is optimized for today’s increasing demand for vehicle recovery, fleet management, and driver and vehicle profiling. Providing complete GSM/GPRS communications, Novatel Wireless helps you track and monitor vehicles from the family car to the largest fleet of commercial vehicles.</p>\r\n<p><strong>Next Generation Technology</strong></p>\r\n<p>Designed to be adaptable to multiple vertical markets including fleet, vehicle recovery, insurance, buy-here-pay-here and more, the new MT 2500 is offered as an economical solution providing enhanced vehicle tracking solutions to the market. With the introduction of the FOTA (Firmware-Over-The-Air) enabled quad band GSM/GPRS device with internal antennas, 3-axis accelerometer, analog inputs and other GPIO (General Purpose Input/Output), the MT 2500 ensures a feature rich solution with low implementation and operation costs.</p>'),(790,'<p>Features</p>'),(791,'<ul>\r\n<li>3-axis accelerometer for driver behavior reporting</li>\r\n<li>Flexible customization through built-in programmable rules engine and control automation capabilities</li>\r\n<li>Polygon geo-fencing and GPIO’s including analog inputs</li>\r\n<li>Internal antennas on the quad-band MT 2500 for economical installation andserviceability</li>\r\n<li>Auto-registration on power up</li>\r\n<li>FOTA enabled for remote upgrades</li>\r\n<li>Integrated SMS for commands and messages</li>\r\n</ul>\r\n<div> </div>'),(792,'<h4>MT 3000</h4>\r\n<p><strong>Mobile Tracking Device</strong></p>'),(793,'<p><strong>Legacy of Innovation</strong></p>\r\n<p>The MT 2500, a certified quad-band, 3-axis accelerometer integrated device is optimized for today’s increasing demand for vehicle recovery, fleet management, and driver and vehicle profiling. Providing complete GSM/GPRS communications, Novatel Wireless helps you track and monitor vehicles from the family car to the largest fleet of commercial vehicles.</p>\r\n<p><strong>Next Generation Technology</strong></p>\r\n<p>The MT 3000 is an innovative plug-n-play device with internal antennas providing complete GSM/GPRS communications. It supports a host of vehicle engine OBDII permitted protocols while still providing customizable MT features including GPS location, ignition, geo-fencing, trip reporting and events. Combined with the on-board 3-axis accelerometer, the MT 3000 also has built-in threshold events to capture metrics critical to effective fleet and insurance monitoring such as excessive engine speed, rapid acceleration, harsh braking, speed violations, and excessive idling.</p>'),(795,'<p>Features</p>'),(796,'<p> </p>\r\n<ul>\r\n<li>Vehicle diagnostics and reporting capabilities</li>\r\n<li>Supports a host of OBDII permitted protocols</li>\r\n<li>Compact, lightweight, low profile design</li>\r\n<li>Integrated SMS for commands and messages</li>\r\n<li>Optimized 3-axis accelerometer for driver behavior monitoring</li>\r\n<li>Flexible customization through built-in programmable rules engine</li>\r\n</ul>\r\n<div> </div>\r\n<p> </p>'),(797,'<p>Driving Business Applications</p>'),(798,'<p>Advanced Monitoring &amp; Visibility</p>'),(799,'<p class=\"t1\">The SA-G+ is available in two product SKUs, based on air interface. Our original Enfora® SA Series device, the quad-band GSM/GPRS SA-G+ provides serial connectivity plus voice/data/SMS and a SIM locking security feature designed for low power, extended temperature applications for the global market. Our newest series device is a dual-band 1xRTT (CDMA2000) SA-G+, which provides simplicity and economy in a serial-connected telemetry device. With increased uplink/downlink speeds, SMS, and the same extended temperature profile as the GSM/GPRS version, the SA-G+ 1xRTT is designed for North American applications.</p>'),(800,'<p class=\"t1\">With its compact design and low power consumption, the SA-G+ is an ideal device to connect remote assets requiring low data throughput to the cloud via advanced monitoring to the business enterprise. Some applications include:</p>\r\n<table class=\"MsoTableGrid\" style=\"width: 562.5pt; border-collapse: collapse; border: none; mso-yfti-tbllook: 1184; mso-padding-alt: 0in 5.4pt 0in 5.4pt; mso-border-insideh: none; mso-border-insidev: none;\" width=\"563\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 166.5pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"167\">\r\n<p class=\"Tabledata\" style=\"margin-left: 12.6pt; text-indent: -13.5pt; mso-list: l0 level1 lfo1;\"><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">     </span></span>Wireless POS Terminal</p>\r\n</td>\r\n<td style=\"width: 2.0in; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"144\">\r\n<p class=\"Tabledata\" style=\"margin-left: 12.6pt; text-indent: -13.5pt; mso-list: l0 level1 lfo1;\"><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">     </span></span>Safety &amp; Security</p>\r\n</td>\r\n<td style=\"width: 117.0pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"117\">\r\n<p class=\"Tabledata\" style=\"margin-left: 12.6pt; text-indent: -13.5pt; mso-list: l0 level1 lfo1;\"><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">     </span></span>Vending Machines</p>\r\n</td>\r\n<td style=\"width: 135.0pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"135\">\r\n<p class=\"Tabledata\" style=\"margin-left: 12.6pt; text-indent: -13.5pt; mso-list: l0 level1 lfo1;\"><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">     </span></span>Public Traffic Services</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 166.5pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"167\">\r\n<p class=\"Tabledata\" style=\"margin-left: 12.6pt; text-indent: -13.5pt; mso-list: l0 level1 lfo1;\"><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">     </span></span>Gauge Monitoring (light, water, telephone)</p>\r\n<p class=\"Tabledata\" style=\"margin-left: 12.6pt; text-indent: -13.5pt; mso-list: l0 level1 lfo1;\"><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">     </span></span>Remote Monitoring Automation and Control (RMAC)</p>\r\n</td>\r\n<td style=\"width: 2.0in; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"144\">\r\n<p class=\"Tabledata\" style=\"margin-left: 12.6pt; text-indent: -13.5pt; mso-list: l0 level1 lfo1;\"><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">     </span></span>Industrial/SCADA</p>\r\n<p class=\"Tabledata\" style=\"margin-left: 12.6pt; text-indent: -13.5pt; mso-list: l0 level1 lfo1;\"><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">     </span></span>Service/Maintenance (gas fields/chemical plants/water)</p>\r\n</td>\r\n<td style=\"width: 117.0pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"117\">\r\n<p class=\"Tabledata\" style=\"margin-left: 12.6pt; text-indent: -13.5pt; mso-list: l0 level1 lfo1;\"><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">     </span></span>Kiosks, Billboards (Public Service, other)</p>\r\n<p class=\"Tabledata\" style=\"margin-left: 12.6pt; text-indent: -13.5pt; mso-list: l0 level1 lfo1;\"><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">     </span></span>Parking Meters</p>\r\n</td>\r\n<td style=\"width: 135.0pt; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"135\">\r\n<p class=\"Tabledata\" style=\"margin-left: 12.6pt; text-indent: -13.5pt; mso-list: l0 level1 lfo1;\"><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-size: 7pt; font-family: \'Times New Roman\';\">     </span></span>Electricity Tower Monitoring</p>\r\n<div> </div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>'),(801,'<p>All Enfora® SA Series devices are designed for full compatibility with our <em><span style=\"text-decoration: underline;\"><span style=\"color: #7030a0;\">N4A® Software Platform</span></span></em>that includes the N4A® Communications and Management Software (CMS) and N4A® Device Manager. These on-premise or cloud-based solutions provide accelerated device provisioning, deployment, shipping, monitoring, and tracking worldwide.   With Novatel Wireless’ SA-G+ M2M hardware, standard Firmware Over-the-Air (FOTA) upgrades, and a targeted N4A® Software solution for your unique enterprise needs, you’ll experience a level of visibility and control over your field deployed machines and other static assets that will free up resources, increase immediacy of your decisions, and lessen your overall risk.</p>'),(802,'<h3 class=\"HeadingProductname\">Workforce Monitoring Solutions</h3>\r\n<p class=\"t1\">Lone-workers in hazardous environments who may find themselves in a man-down situation, operators of small fleets needing to maintain simple yet effective communication with their workers, wandering or lost children and Alzheimer’s patients who may need access to a panic button or simple voice communication: these are just a few of the Mobile Resource Management (MRM) challenges that must be addressed by any M2M provider in today’s market. Connectivity combined with location-based features and reporting in a user-friendly format are imperatives to success for any MRM device in the personal and workforce safety market; such devices must be easily deployed and provisioned, and monitored by a reliable end-to-end solution. </p>'),(803,'<h3 class=\"HeadingProductname\">Telemetry Solutions</h3>\r\n<p class=\"t1\">The Enfora® SA Series is a stand-alone telemetry solution designed for cellular M2M applications with a range of business and market needs.  Each SA-G+ series device is driven by our in-house developed Enfora® Enabler® Series embedded modules with our Smart Agent events engine. Novatel Wireless modules are additionally calibrated and aligned with our in-house hardware and low-level firmware to accommodate the needs of the target application. Even with this much intelligence inside, you\'ll find the sub-credit-card-sized SA-G+ will fit with room to spare in most telemetry hardware designs.</p>\r\n<p class=\"t1\">Designed for operational simplicity and price economy, the Enfora® SA Series doesn’t overshoot the needs of most M2M applications with sophisticated features or excessive interfaces. Instead, the series remains focused on Novatel Wireless’ core mission to connect serial-based machines to the cloud—simply, reliably, and economically</p>'),(804,'<p> </p>\r\n<h3 class=\"HeadingProductname\">Service Delivery Platform</h3>\r\n<p> </p>\r\n<p class=\"MsoNormal\">Novatel Wireless has a robust M2M software offering that can quickly build connectivity from your Internet Protocol (IP)-enabled remote assets to your existing enterprise applications. We provide the ability to choose a right-sized option for your enterprise needs. Our platform includes the following products:  the N4A<sup><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; position: relative; top: -2.0pt; mso-text-raise: 2.0pt;\">TM</span></sup> Communications and Management Software (CMS) <span class=\"MsoHyperlink\">and the N4A</span><span class=\"MsoHyperlink\">™ Device Manager. </span>With our decades of cumulative experience in wireless data and M2M environments, we can help you choose the best products, formats, and options to enhance your remote intelligence gathering capabilities, putting that data at the fingertips of corporate decision makers to identify device issues, decrease out-of-service time, track shipments, improve worker productivity, and more.</p>'),(805,'<h3>Service Delivery Platform </h3>\r\n<p class=\"MsoNormal\">Novatel Wireless has a robust M2M software offering that can quickly build connectivity from your Internet Protocol (IP)-enabled remote assets to your existing enterprise applications. We provide the ability to choose a right-sized option for your enterprise needs. Our platform includes the following products:  the N4A<sup><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; position: relative; top: -2.0pt; mso-text-raise: 2.0pt;\">TM</span></sup> Communications and Management Software (CMS) <span class=\"MsoHyperlink\">and the N4A</span><span class=\"MsoHyperlink\">™ Device Manager. </span>With our decades of cumulative experience in wireless data and M2M environments, we can help you choose the best products, formats, and options to enhance your remote intelligence gathering capabilities, putting that data at the fingertips of corporate decision makers to identify device issues, decrease out-of-service time, track shipments, improve worker productivity, and more.</p>'),(806,'<h3 class=\"HeadingProductname\">M2M Modules</h3>\r\n<h3>A Trusted Brand since 2005</h3>\r\n<p class=\"t1\">Continuing the successful Enabler® OEM module line that’s been a staple of the Enfora® M2M brand since its introduction in 2005, the Enabler® IIIG Series maintains the core features of using industry-leading chipset manufacturers as the basis of our trusted in-house designs and then overlaying our Smart Agent with its action-based intelligence onto the final modem design. With the recent expansion of the series beyond the Enabler® IIIG into our new HS Series, we provide you with even more module options for integration into your mission critical designs—while preserving the industry-leading intelligence and in-house expertise that’s led to our iconic brand success.</p>'),(807,'<h4>SA-G+</h4>\r\n<p><strong>Telemetry Platform</strong></p>'),(808,'<h3>Highlights</h3>\r\n<p class=\"t1\">Our versatile Enfora® MT Series of mobile tracking devices has been installed worldwide across a variety of markets. To accommodate the needs of the widest range of applications and end users, Novatel Wireless\' series devices offer a number of Mobile Resource Management (MRM) features and options including 12V and 24V vehicle support; GSM/GPRS, 1xRTT (CDMA), and HSDPA/UMTS air interfaces; and variable hardware formats. Some of these formats include wired, unwired with optional rechargeable backup battery, and OBD-II plug-and-play with optional backup battery. Most of our MT Series devices have a method to detect and report potential tamper events, enhancing overall security.</p>'),(809,'<h3>Asset Tracking Solutions</h3>\r\n<p>An extension to the Novatel Wireless M2M family of integrated asset management solutions, the Enfora® AT Series is a powered to battery-driven integrated device series that provides internal quad-band GSM/GPRS/GPS antenna functionality for mobile asset monitoring. Based on the Enfora® Enabler® Series module, the built-in programmable software environment enables essential capabilities such as mobile connectivity, location awareness, and device intelligence. The device leverages a unique set of control and automation features that extend device longevity through managing power usage and critical communications parameters. All series devices provide total protection against dust, water spray, and long periods of water immersion under pressure.</p>'),(810,'<h3>Mobile Tracking Solutions</h3>\r\n<p class=\"t1\">Our versatile Enfora® MT Series of mobile tracking devices has been installed worldwide across a variety of markets. To accommodate the needs of the widest range of applications and end users, Novatel Wireless\' series devices offer a number of Mobile Resource Management (MRM) features and options including 12V and 24V vehicle support; GSM/GPRS, 1xRTT (CDMA), and HSDPA/UMTS air interfaces; and variable hardware formats. Some of these formats include wired, unwired with optional rechargeable backup battery, and OBD-II plug-and-play with optional backup battery. Most of our MT Series devices have a method to detect and report potential tamper events, enhancing overall security.</p>'),(816,'<p><strong><span style=\"font-size: large;\">Products</span></strong></p>\r\n<p><span style=\"color: #333333; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 12px; line-height: 20px; background-color: #ffffff;\">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</span></p>'),(817,'<h2>Professional Services</h2>\r\n<p>The Novatel Wireless professional services experience is driving a profound technology transformation and broadband wireless users are demanding ubiquitous connectivity for a host of new applications. Whether you are perfecting a reference design, developing a new product or modifying and existing application our design engineers can help. With a strong knowledge base, real-world experiences in a wide variety of market and vertical segments and a demonstrable, results driving mentality, Novatel Wireless delivers.</p>\r\n<p>Revolutionized antenna designs, creative communications solutions, small form factors, low-power consumption and more, Novatel Wireless brings real-world design experience to help you get there faster, with less effort and on-budget.</p>\r\n<p>Our Product Line Managers and Project Management office is comprised of a team of talented engineers with years of design and product development knowledge, built to work closely with your company to define a project, its time lines and deliverables. Once your project is approved, a dedicated Project Manager is assigned to ensure your ultimate success.</p>\r\n<p>Working in close partnership with our customers, Novatel Wireless has helped to bring many designs to life, shortening product development and deployment cycles. Whether you need to tweak a small parameter in your product, develop something new or start a project and have it managed from the ground up, we can provide the expertise to get your project moving in the right direction.</p>\r\n<p>The architecture helps make it simple, do you have a special design challenge or just want help getting past a small issue? No project is too small or too big; we have assisted many of today’s global 1000 companies with innovative designs, engineering assistance and creative ways to connect to their customers.</p>\r\n<div> </div>'),(818,'<h2>Professional Services</h2>\r\n<p>The Novatel Wireless professional services experience is driving a profound technology transformation and broadband wireless users are demanding ubiquitous connectivity for a host of new applications. Whether you are perfecting a reference design, developing a new product or modifying and existing application our design engineers can help. With a strong knowledge base, real-world experiences in a wide variety of market and vertical segments and a demonstrable, results driving mentality, Novatel Wireless delivers.</p>\r\n<p>Revolutionized antenna designs, creative communications solutions, small form factors, low-power consumption and more, Novatel Wireless brings real-world design experience to help you get there faster, with less effort and on-budget.</p>\r\n<p>Our Product Line Managers and Project Management office is comprised of a team of talented engineers with years of design and product development knowledge, built to work closely with your company to define a project, its time lines and deliverables. Once your project is approved, a dedicated Project Manager is assigned to ensure your ultimate success.</p>\r\n<p>Working in close partnership with our customers, Novatel Wireless has helped to bring many designs to life, shortening product development and deployment cycles. Whether you need to tweak a small parameter in your product, develop something new or start a project and have it managed from the ground up, we can provide the expertise to get your project moving in the right direction.</p>\r\n<p>The architecture helps make it simple, do you have a special design challenge or just want help getting past a small issue? No project is too small or too big; we have assisted many of today’s global 1000 companies with innovative designs, engineering assistance and creative ways to connect to their customers.</p>\r\n<div> </div>'),(819,'		<iframe src=\"http://investor.novatelwireless.com/releases.cfm\" seamless allowtransparency=\"0\" frameborder=\"0\" class=\"embeddedContent\" id=\"iframeContent\" width=\"1024\" height=\"1200\"></iframe>\r\n'),(822,'		<iframe src=\"http://investor.novatelwireless.com/releases.cfm\" seamless allowtransparency=\"0\" frameborder=\"0\" class=\"embeddedContent\" id=\"iframeContent\" width=\"1024\" height=\"1200\" style=\"height: 1100px;width: 885px;margin-left: 140px;\"></iframe>\r\n'),(823,'		<iframe src=\"http://investor.novatelwireless.com/releases.cfm\" seamless allowtransparency=\"0\" frameborder=\"0\" class=\"embeddedContent\" id=\"iframeContent\" width=\"1024\" height=\"1200\" style=\"height: 1100px;width: 885px;margin-left: 130px;\"></iframe>\r\n'),(824,'		<iframe src=\"http://investor.novatelwireless.com/releases.cfm\" seamless allowtransparency=\"0\" frameborder=\"0\" class=\"embeddedContent\" id=\"iframeContent\" width=\"1024\" height=\"1200\" style=\"height: 1200px;width: 885px;margin-left: 130px;\"></iframe>\r\n'),(825,'<h4>Mini MT</h4>\r\n<p><strong>Personal Tracking Device</strong></p>'),(826,'<p class=\"p1\"><strong>Legacy of Innovation<br /></strong>The certified quad-band Mini MT is optimized for today’s demanding mobile workforce and private citizens where location based safety, security and connectivity are paramount. Providing complete GSM/GPRS communications Novatel Wireless helps you track and monitor your workforce from the lone-worker to the operators of small fleets - and closer to home; the Alzheimer’s patient, children, teenagers on the go and a host of other applications.</p>\r\n<p class=\"p2\"><span class=\"s1\"><strong>Next Generation Technology</strong><br /> </span>Excellent GPS performance and sensitivity in a small, ruggedized voice enabled platform. The Mini MT is fully programmable with panic/emergency response button, two-way voice communications, messaging and much more. The units are designed to be easily deployed and provisioned supplying critical information for the most demanding workforce tracking applications. This device is designed with a motion sensor and vibrating alerts for personal and remote worker programs of all sizes.</p>'),(827,'<p>Features</p>'),(828,'<ul class=\"ul1\">\r\n<li class=\"li1\">Quad-band GSM/GPRS (850/900/1800/1900 MHz)</li>\r\n<li class=\"li1\">Motion sensor and vibrating alerts</li>\r\n<li class=\"li1\">Designed for personal/remote worker programs</li>\r\n<li class=\"li1\">FOTA (Firmware-Over-The-Air) enabled for remote upgrades</li>\r\n<li class=\"li1\">Rugged and voice enabled</li>\r\n<li class=\"li1\">Programmable with panic/emergency response button</li>\r\n</ul>'),(829,'<p>With the MiFi OS™ the MiFi Intelligent Mobile Hotspot provides more than mobile connectivity alone. The MiFi OS offers a flexible, powerful platform to browse, install, update and develop applications and run them on the MiFi device. With the MiFi web interface users can access widgets, applications and files using any Wi-Fi enabled device, eliminating the need to install and maintain software on multiple products.</p>\r\n<p><strong>With the MiFi OS, you can:</strong></p>\r\n<ul>\r\n<li>Customize and enhance your mobile experience.</li>\r\n<li>Run applications on the MiFi OS without having to install software on each connecting Wi-Fi device.</li>\r\n<li>Check your data usage in real time and see details about connected devices.</li>\r\n<li>Send and receive text messages from any web browser using the MiFi device\'s mobile broadband account.</li>\r\n<li>Use the MiFi device\'s GPS to get the local weather forecast or search nearby locations.</li>\r\n<li>Seamlessly share media across multiple devices simultaneously using the MiFi DLNA® Server.</li>\r\n<li>Access files both locally and on the cloud from any web enabled device.</li>\r\n</ul>'),(830,'<p>Applications Available</p>'),(831,'<ul>\r\n<li><strong>AutoVPN</strong> – Provide secure VPN access to all connected devices without installation or configuration.</li>\r\n<li><strong>MiFi DLNA Server</strong> – Browse, stream and play movies, music and photos on any DLNA-compatible Wi-Fi device.</li>\r\n<li><strong>Data Usage</strong> – Proactively manage your broadband usage with current data usage statistics.</li>\r\n<li><strong>Connected Devices</strong> – See which devices are currently connected to the MiFi device.</li>\r\n<li><strong>SMS Messaging</strong> – Send and receive text messages from any browser-enabled device.</li>\r\n<li><strong>GeoSearch</strong> – Search near your current location for businesses, services, directions and more.</li>\r\n<li><strong>GeoWeather</strong> – See the current weather and forecast wherever you are or want to be.</li>\r\n<li><strong>File Sharing</strong> – Insert your microSD™ or microSDHC™ card into the MiFi device and share files securely across connected devices.</li>\r\n</ul>'),(832,'<h4>MiFi DLNA® Server</h4>'),(833,'<p><strong>With the MiFi DLNA® Server, you get a front row seat.</strong></p>\r\n<p>The MiFi 2372 Intelligent Mobile Hotspot enables you to access and play your movies, music and photos anywhere, anytime, on any DLNA-capable device. The MiFi DLNA Server connects your devices to provide easy, instant-on access to your media. There\'s no complicated configuration required.</p>\r\n<p>Browse, stream and share your media wherever you are, on the devices you choose.</p>\r\n<ul>\r\n<li>No need to copy, move, and synch your media files.</li>\r\n<li>Enjoy your movies, music and photos, hassle-free.</li>\r\n<li>Play on DLNA-capable DVD and Blu-ray players, game consoles, televisions, tablets, mobile devices, computers, audio video systems, digital frames, home theater devices and more.</li>\r\n</ul>\r\n<div><strong>The MiFi DLNA Server connects your devices to enable easy, configuration-free access to your media.</strong></div>\r\n<div>\r\n<div>\r\n<ul>\r\n<li>Stream movies to your laptop and/or watch directly on your living room TV</li>\r\n<li>Listen to music from your MP3 player on your home sound system</li>\r\n<li>In the van let the kids watch one video on a Galaxy Tab® and another on an iPod Touch®</li>\r\n<li>Share vacation photos on the grandparents\' TV using their Blu-ray® player</li>\r\n<li>Film the wedding reception, slip the microSDHC card into the MiFi device, and share the movie instantly on an iPad®</li>\r\n</ul>\r\n</div>\r\n<div> </div>\r\n</div>'),(835,'<p>How the MiFi DLNA Server Works</p>'),(836,'<p><strong>Mobile Digital Media Server</strong> – The DLNA CERTIFIED® MiFi device takes content stored on the microSDHC card™ and makes it available to wireless networked mobile digital media players (M-DMP) and digital media renderers (DMR) via the MiFi DLNA Server on the MiFi OS™.</p>'),(837,'<p>Which media formats can be delivered through the MiFi DLNA Server?</p>'),(838,'<p><strong>Home Network Devices</strong></p>\r\n<ul>\r\n<li>Video – MPEG 2</li>\r\n<li>Audio – MP3</li>\r\n<li>Images – JPG, JPEG</li>\r\n</ul>\r\n<p><strong>Mobile Devices</strong></p>\r\n<ul>\r\n<li>Video – MP4</li>\r\n<li>Audio – MP3</li>\r\n<li>Images – JPG, JPEG</li>\r\n</ul>\r\n<p><span style=\"color: #414042; font-family: Arial, Helvetica, sans-serif;\"><span style=\"font-size: 12px; line-height: 18px;\"><strong>Note:</strong> Not all DLNA media players support all formats. Please refer to the <a href=\"http://dlna.org\">dlna.org</a> website for specific information on your DLNA player.</span></span></p>'),(839,'<p>Which Devices are DLNA-capable?</p>'),(840,'<p>Some examples of devices currently available that are DLNA compliant are:</p>\r\n<p>Computers</p>\r\n<ul>\r\n<li>Windows Vista - Media Player 12</li>\r\n<li>Windows 7 – Media Player 12</li>\r\n<li>Mac OS X – VLC</li>\r\n</ul>\r\n<p>Home Theater Devices</p>\r\n<ul>\r\n<li>Televisions</li>\r\n<ul>\r\n<li>Sony KDL-32EX308 32\" BRAVIA 720p LCD TV</li>\r\n<li>Samsung LN32C550 32\" Class WiFi Ready DLNA LCD HDTV</li>\r\n</ul>\r\n<li>Blu-ray Players</li>\r\n<ul>\r\n<li>Sony BDPS570</li>\r\n<li>LG BX580 3D</li>\r\n<li>Samsung BD-C5500/XAA</li>\r\n</ul>\r\n<li>Home Media Receivers</li>\r\n<ul>\r\n<li>Yamaha YMC-700BL</li>\r\n<li>Denon RCD-N7</li>\r\n</ul>\r\n<li>Gaming Consoles</li>\r\n<ul>\r\n<li>Sony PlayStation 3</li>\r\n</ul>\r\n<li>Mobile Devices</li>\r\n<ul>\r\n<li>iOS Devices – Plug Player, Media Connect</li>\r\n<li>Android Devices - Plug Player</li>\r\n</ul>\r\n</ul>\r\n<p>For a full list of DLNA certified products please refer to the <a href=\"http://dlna.org\">dlna.org</a> website.</p>'),(841,'<p>Supported Media Formats</p>'),(842,'<p>DLNA-capable Devices</p>'),(843,'<p>What is DLNA?</p>'),(844,'<p>The Digital Living Network Alliance (DLNA) is a non-profit collaborative trade organization established by Sony in June 2003, with more than 250 member companies in the mobile, consumer electronics, PC, and service provider industries.</p>\r\n<p>The goal of DLNA is to enable end-to-end interoperability among the digital devices storing, playing and sharing digital content on your digital network. So far that includes DLNA Certified products in twelve different DLNA device classes in three categories.</p>\r\n<p>DLNA categories include:</p>\r\n<ul>\r\n<li>Home Network Devices</li>\r\n<li>Mobile Handheld Devices</li>\r\n<li>Home Infrastructure Devices</li>\r\n</ul>\r\n<p>More than 440 million DLNA CERTIFIED devices – from digital cameras to game consoles to TVs – were installed in users\' homes by the end of 2010 (ABI Research, \"Home Networking Market Data\", January 2011).</p>\r\n<p>The MiFi 2372 Intelligent Mobile Hotspot from Novatel Wireless, Inc. is DLNA CERTIFIED®.</p>'),(845,'<h4>MobiLink™ Communications Software Suite</h4>'),(846,'<p>The Novatel Wireless MobiLink™ Communications Software Suite is a family of wireless connectivity applications that connect mobile devices with wireless wide area networks (WWAN) to allow quick and instant access to email, the Internet and corporate networks anytime, anywhere. With MobiLink and a wireless device, mobile users can stay productive and connected to customers and colleagues while out of the office. Now with zero-CD and automatic installation, the MobiLink Communications Software Suite is optimally engineered to work with all Novatel Wireless products for best in class 3G wireless broadband access solutions.</p>'),(847,'<p>Key Features</p>'),(848,'<p>Key Benefits</p>'),(849,'<p>Specifications</p>'),(850,'<ul>\r\n<li>Zero-CD and Automatic Installation with new MobiLink Lite</li>\r\n<li>Pre-provisioning</li>\r\n<li>NDIS Drivers</li>\r\n<li>Innovative, easy-to-customize skin-based technology</li>\r\n<li>Server/client technology</li>\r\n<li>Laptop, OS, and operator tested</li>\r\n<li>International localization</li>\r\n<li>VPN compatibility Enables secure access to corporate documents &amp; applications</li>\r\n</ul>'),(851,'<ul>\r\n<li>Minimal user interface guarantees quick installation</li>\r\n<li>Makes network connection quick and easy</li>\r\n<li>Ensure always on connectivity</li>\r\n<li>Quick time to market and easily customizable</li>\r\n<li>Enable multiple applications to communicate with one device</li>\r\n<li>Comprehensive testing results in reliable performance</li>\r\n<li>Supports up to 17 languages</li>\r\n<li>Enables secure access to corporate documents &amp; applications</li>\r\n</ul>\r\n<div> </div>'),(852,'<p> </p>\r\n<p><strong>Wireless Network Information</strong></p>\r\n<ul>\r\n<li>Signal Strength Indicator</li>\r\n<li>Attached to network</li>\r\n<li>Carrier name</li>\r\n<li>Device properties</li>\r\n<li>Byte Counter</li>\r\n<li>Call Duration Timer</li>\r\n<li>Tray Icon Signal Strength Indicator</li>\r\n<li>Call Log</li>\r\n</ul>\r\n<p><strong>MobiLink Customization Tool</strong></p>\r\n<ul>\r\n<li>Preset connection profile</li>\r\n<li>Select certain features to turn on</li>\r\n<li>Make CD\'s with preset</li>\r\n<li>IP/UMTS Quality of Service (QoS) settings for enterprise customers (ideal for bulk orders)</li>\r\n</ul>\r\n<p><strong>Two Way SMS Client</strong></p>\r\n<ul>\r\n<li>Send and receive SMS messages</li>\r\n<li>Compose and read SMS in multiple languages</li>\r\n<li>Compose and send to multiple recipients</li>\r\n<li>Address Book support for mobile contacts</li>\r\n<li>Rich edit for launching URL</li>\r\n<li>Email using embedded addresses</li>\r\n</ul>\r\n<p><strong>Connectivity</strong></p>\r\n<ul>\r\n<li>Connection Button</li>\r\n<li>Auto Connection Feature</li>\r\n<li>NDIS Network Adapter option</li>\r\n<li>Profile Manager to manage multiple connection properties</li>\r\n<li>Automatically launch VPN session</li>\r\n</ul>\r\n<p><strong>Other Valuable Features</strong></p>\r\n<ul>\r\n<li>SIM lock/unlock</li>\r\n<li>Network unlock</li>\r\n<li>Manual network selection</li>\r\n<li>On-Line help</li>\r\n<li>Multi-language support</li>\r\n<li>Mini Screen status mode</li>\r\n</ul>\r\n<p><strong>Address Book Client</strong></p>\r\n<ul>\r\n<li>Edit and manage contacts on SIM</li>\r\n<li>Interoperates with Outlook and Windows® address book</li>\r\n<li>Send SMS directly from address book client</li>\r\n</ul>\r\n<p><strong>Availability</strong></p>\r\n<ul>\r\n<li>Globally</li>\r\n</ul>\r\n<p> </p>'),(853,'<script type=\"text/javascript\">\r\nocument.location.href=\"/products\";\r\n</script>'),(854,'<script type=\"text/javascript\">\r\ndocument.location.href=\"/products\";\r\n</script>'),(855,'<script type=\"text/javascript\">\r\ndocument.location.href=\"/products\";\r\n</script>'),(856,'<h4>MT 3050</h4>\r\n<p><strong>Mobile Tracking Device</strong></p>'),(857,'<p><strong>Legacy of Innovation</strong></p>\r\n<p>Expanding the Novatel Wireless MT series of products for application service providers, system integrators, enterprises and insurers in the global Fleet Management and Usage-Based Insurance market verticals, the MT 3050 offers an innovative OBDII plugand- play design, enhanced performance utilizing innovative antenna design and a disconnect alert feature using an in-device backup battery, and is available in GSM/GPRS, 1xRTT or HSDPA versions.</p>\r\n<p><strong>Next Generation Technology</strong></p>\r\n<p>The MT 3050 is a flexible telematics solution built for both Fleet Management where managers are charged with improving safety, increasing productivity and reducing costs, as well as for Insurance Telematics or Usage-Based Insurance (UBI) for Pay-As-You- Drive/Pay-How-You-Drive programs, which give the consumer, and even fleets, more control over their insurance premiums through driver behavior reporting, speed violation alerts, distance and duration traveled, and time of day reporting. Novatel Wireless has assembled the complex device and networking components required to build successful and profitable UBI programs, supporting market specific requirements and simplifying UBI program creation and large scale deployments.</p>'),(858,'<p>Features</p>'),(859,'<p> </p>\r\n<ul>\r\n<li>Industry leading small plug-and-play form factor for simple s elf-installation</li>\r\n<li>Flexible wireless network technology options (GPRS, CDMA, 1xRTT, and HSDPA versions)</li>\r\n<li>Advanced application customization through Smart Agent programmable rules and event engine</li>\r\n<li>Tri-axis advanced digital accelerometer for motion detection and driver behavior reporting</li>\r\n<li>”Disconnect Alert” for when the device has been removed from the vehicle’ s OBDII port</li>\r\n<li>No external SIM access for tamper resistance</li>\r\n</ul>\r\n<div> </div>\r\n<p> </p>'),(860,'<h4>MT 4000</h4>\r\n<p><strong>Mobile Tracking Device</strong></p>'),(861,'<p><strong>Legacy of Innovation</strong></p>\r\n<p>Designed for application providers, system integrators, and enterprise customers to optimize mobile resources and improve their bottom line, the MT 4000 is a flexible quad-band GSM/GPRS mobile tracking device, delivering the key product features powering the most demanding applications: fleet management, insurance telematics, teen tracking, vehicle location and recovery, and more.</p>\r\n<p><strong>Next Generation Technology</strong></p>\r\n<p>With superior GPS location performance, a robust programmable rules engine, driver behavior reporting, geo-fencing, SMS commands, messaging and much more, the MT 4000 is designed for flexible solution deployment. The MT 4000 also includes optional routing and optimization with Garmin® FMI (Fleet Management Interface) - a key part of today’s most useful, versatile and cost-efficient fleet management solutions.</p>'),(862,'<p>Features</p>'),(863,'<ul>\r\n<li>Flexible application customization through Smart Agent programmable rules and event engine</li>\r\n<li>Innovative internal cellular and GPS antenna design</li>\r\n<li>Configurable driver behavior reporting, polygon geo-fencing, driver ID, and multiple GPIO capabilities</li>\r\n<li>Serial interface and Smart Agent support for optional Garmin FMI (Fleet Management Interface) v2.7 with speed limit alerts</li>\r\n<li>Deep sleep and low power management for 12 V &amp; 24 V passenger cars, trucks, and transit vans worldwide</li>\r\n</ul>\r\n<div> </div>'),(864,'<p><span><span style=\"background-color: #ffffff; color: #333333; font-family: Arial, Helvetica, sans-serif;\">Introducing the next generation MiFi device by Novatel Wireless, MiFi 2, the world’s first mobile hotspot with a touchscreen display and the most feature rich mobile hotspot available.</span><span style=\"background-color: #ffffff; color: #333333; font-family: Arial, Helvetica, sans-serif;\"> </span></span></p>\r\n<p><br style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\" /><span style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\">Novatel Wireless has again set the design and usability standard for mobile connectivity with this next generation device that puts freedom at your fingertips. This next generation MiFi device\'s new iconic design and leap-forward innovation take Novatel Wireless\' industry leading user experience to new levels of ease and functionality. MiFi 2\'s vibrant, feature-rich touchscreen makes it easier than ever to connect up to 10 Wi-Fi enabled devices to fast 4G LTE™ Internet. You can check data usage, manage connected devices, change settings, enable MiFi Media Center and more…directly on the touchscreen. With up to 11 hours of battery life and the industry’s most advanced security features, MiFi 2 lets you connect with confidence and power through your day. </span><br style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\" /><br style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\" /><span style=\"color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; background-color: #ffffff;\">Experience MiFi 2 soon, with the all-new MiFi Liberate by AT&amp;T…</span></p>'),(865,'<h4>MT 4100</h4>\r\n<p><strong>Mobile Tracking Device</strong></p>'),(866,'<p><strong>Legacy of Innovation</strong></p>\r\n<p>The MT 4100 from Novatel Wireless is a full-featured telematics solution designed for application providers, system integrators, and enterprise customers to optimize mobile resources and improve their bottom line. The MT 4100 builds upon its predecessors with enhanced performance and additional digital inputs and a spare RS-232 port. Flexible and easy to deploy, the MT 4100 delivers the key product features that drive the most demanding global applications: fleet management, insurance telematics, stolen vehicle recovery, and more.</p>\r\n<div>\r\n<p style=\"font-weight: bold;\">Next Generation Technology</p>\r\n<p style=\"font-weight: bold;\"> </p>\r\n<p>Once fitted to a vehicle and integrated to a fleet management application, fleet managers see immediate return on investment with improvements in driver productivity and performance throughout the day with instant vehicle location monitoring. The MT 4100 delivers on critical features to drive efficiencies and reduce operational costs offering two serial interfaces, 1-wire driver ID support, multiple GPIO, polygon geo-fencing, driver behavior reporting, optional backup battery, and much more. The MT 4100 also includes optional routing and optimization with Garmin® FMI (Fleet Management Interface) - a key part of today’s most useful, versatile and cost-efficient fleet management solutions.</p>\r\n<strong></strong></div>'),(867,'<p>Features</p>'),(868,'<ul>\r\n<li>Flexible application customization through Smart Agent programmable rules and event engine</li>\r\n<li>Innovative internal cellular and GPS antenna design</li>\r\n<li>Configurable driver behavior reporting, polygon geo-fencing, driver ID, and multiple GPIOs</li>\r\n<li>Smart Agent support for Garmin FMI (Fleet Management Interface) v2.6 with speed limit alerts (optional licensed feature)</li>\r\n<li>Deep sleep and low power management for 12 V &amp; 24 V passenger cars, trucks, and transit vans worldwide</li>\r\n<li>Air interface options: CDMA 1xRTT, and HSDPA</li>\r\n</ul>\r\n<div> </div>'),(869,'<p><strong>Legacy of Innovation</strong></p>\r\n<p>The MT 4100 from Novatel Wireless is a full-featured telematics solution designed for application providers, system integrators, and enterprise customers to optimize mobile resources and improve their bottom line. The MT 4100 builds upon its predecessors with enhanced performance and additional digital inputs and a spare RS-232 port. Flexible and easy to deploy, the MT 4100 delivers the key product features that drive the most demanding global applications: fleet management, insurance telematics, stolen vehicle recovery, and more.</p>\r\n<div>\r\n<p><strong>Next Generation Technology</strong></p>\r\n<p>Once fitted to a vehicle and integrated to a fleet management application, fleet managers see immediate return on investment with improvements in driver productivity and performance throughout the day with instant vehicle location monitoring. The MT 4100 delivers on critical features to drive efficiencies and reduce operational costs offering two serial interfaces, 1-wire driver ID support, multiple GPIO, polygon geo-fencing, driver behavior reporting, optional backup battery, and much more. The MT 4100 also includes optional routing and optimization with Garmin® FMI (Fleet Management Interface) - a key part of today’s most useful, versatile and cost-efficient fleet management solutions.</p>\r\n</div>'),(870,'<p><strong>Introducing the next generation MiFi device by Novatel Wireless, MiFi 2, the world’s first mobile hotspot with a touchscreen display and the most feature rich mobile hotspot available. </strong></p>\r\n<p>Novatel Wireless has again set the design and usability standard for mobile connectivity with this next generation device that puts freedom at your fingertips. This next generation MiFi device\'s new iconic design and leap-forward innovation take Novatel Wireless\' industry leading user experience to new levels of ease and functionality. MiFi 2\'s vibrant, feature-rich touchscreen makes it easier than ever to connect up to 10 Wi-Fi enabled devices to fast 4G LTE™ Internet. You can check data usage, manage connected devices, change settings, enable MiFi Media Center and more…directly on the touchscreen. With up to 11 hours of battery life and the industry’s most advanced security features, MiFi 2 lets you connect with confidence and power through your day. </p>\r\n<p>Experience MiFi 2 soon, with the all-new MiFi Liberate by AT&amp;T…</p>'),(871,'<h4>MT-Gμ</h4>\r\n<p><strong>Mobile Tracking Device</strong></p>'),(872,'<p>MiFi® 4620L Intelligent Mobile Hotspot</p>\r\n<p><strong>Fast, always-on Internet wherever you roam—worldwide*<br /></strong>With the Verizon Jetpack™ 4G LTE Mobile Hotspot MiFi® 4620L by Novatel Wireless, access blazing fast 4G LTE and 3G mobile broadband worldwide and share your connection with up to ten Wi-Fi enabled devices simultaneously. MiFi 4620L is the next generation in the Novatel Wireless MiFi intelligent mobile hotspot portfolio for Verizon Wireless, built on award-winning innovation and design, proven performance and industry leading user experience.</p>\r\n<p><strong>Put the world in the palm of your hand<br /></strong>With this 4G LTE MiFi intelligent mobile hotspot, enjoy fast Internet access whenever, wherever you go. MiFi 4620L is backward compatible with high speed DC HSPA+, HSPA+, WCDMA, EDGE and GPRS technologies to keep you connected. The compact MiFi 4620L is perfect for on-the-go connectivity and won’t weigh you down.</p>\r\n<p><strong>Know where you are — monitor device and connection status at a glance</strong>With the interactive OLED display screen, easily scroll to view battery life, check signal strength, check the number of connected devices, read text messages, view network details, access your password, and much more!</p>\r\n<p><strong>Share the experience—connect up to 10 devices securely†</strong></p>\r\n<p><strong></strong>Create your own personal Wi-Fi cloud and share high speed 4G and 3G Internet connectivity with up to ten devices—notebooks, tablets, e-readers, gaming consoles and more. The MiFi 4620L supports the latest security protocols required by some of the strictest corporate VPNs, including VPN Pass-through and NAT Firewall. </p>\r\n<p><strong>Smooth sailing—navigate using GPS over Wi-Fi‡</strong></p>\r\n<p>MiFi 4620L is the first product to support GPS over Wi-Fi, enabling applications to access streaming GPS (NMEA). Stream GPS location services while on the move to up to 10 devices at once, no cables required!</p>\r\n<p> </p>\r\n<p>* Visit verizonwireless.com for coverage maps</p>\r\n<p>†Security settings must be enabled</p>\r\n<p>‡Available only on Windows® systems</p>\r\n<p>Service plans, extended battery and other services/options must be purchased separately</p>\r\n<p> </p>\r\n<p><a href=\"#\"><img src=\"{CCM:FID_7}\" alt=\"where-to-buy-button.png\" width=\"101\" height=\"27\" /></a></p>'),(873,'<p><strong>Legacy of Innovation</strong></p>\r\n<p>The certified quad-band MT-Gu is optimized for today’s increasing demand for vehicle recovery, fuel-efficient fleet operations, driver and vehicle profiling, and interactive communications. Providing complete GSM/GPRS communications Novatel Wireless helps you track and monitor vehicles from the family car to the largest fleet of commercial vehicles.</p>\r\n<p><strong>Next Generation Technology</strong></p>\r\n<p>With superior GPS sensitivity, enhanced business intelligence logic provided by the programmable rules engine, polygon geo-fencing, integrated SMS commands, messaging and much more. The units are designed to be easily deployed and provisioned supplying critical information for the most demanding fleet operator, the buy-here pay-here dealers to the pay as you go insurance company.</p>'),(874,'<p>Features</p>'),(875,'<ul>\r\n<li>Support for Garmin’s Fleet Management Interface (FMI) (optional)</li>\r\n<li>Flexible customization through built-in programmable rules engine &amp; control automation capabilities</li>\r\n<li>Wireless data and voice port available</li>\r\n<li>Polygon geo-fencing and GPIO’ s</li>\r\n<li>Auto-registration on power up</li>\r\n<li>Internal battery back-up allows for continued operation when main input power is removed</li>\r\n<li>FOTA enabled for remote upgrades</li>\r\n<li>Integrated SMS for commands and messages</li>\r\n<li>Now with 3-axis accelerometer for driver behavior reporting</li>\r\n</ul>\r\n<div> </div>'),(876,'<p><strong>MiFi®.  Freedom. My Way.®<br /></strong></p>\r\n<p>The 4G LTE MiFi 4510 is the next generation of the Novatel Wireless MiFi Intelligent Mobile Hotspot portfolio, building on award winning innovation and design, proven performance and industry-leading flexibility, convenience, and reliability.  Experience life in the fast lane with blazing fast 4G LTE mobile broadband.  The reliable MiFi 4510 is backward compatible with the 3G CDMA 1XEvDO Rev A network and includes new features, such as integrated status display on the device showing signal strength, roaming, battery level, and number of devices connected.</p>'),(877,'<p>Features</p>'),(878,'<p>Features</p>\r\n<ul>\r\n<li>Connects up to five Wi-Fi enabled devices simultaneously</li>\r\n<li>Computers, PDAs, cameras, music players, personal and game players and more</li>\r\n<li>Rechargeable Lithium Ion Battery </li>\r\n<li>GPS-enabled</li>\r\n<li>Advanced internal antenna system</li>\r\n<li>NovaSpeed® Capable</li>\r\n<li>Built-in security</li>\r\n</ul>'),(879,'<p>Benefits</p>'),(880,'<p>Benefits</p>\r\n<ul>\r\n<li>Wireless and secure internet connectivity from virtually anywhere</li>\r\n<li>Portable and convenient – smaller than a deck of cards</li>\r\n<li>Great for travel – family, friends and colleagues can connect</li>\r\n<li>Perfect for the mobile professional – creates a virtual office wherever you go for you and your co-workers</li>\r\n<li>Enhanced performance and less connectivity interruptions with NovaSpeed®</li>\r\n</ul>'),(881,'<h4>MiFi® 4510 - Intelligent Mobile Hotspot for LTE Networks</h4>'),(882,'<p><strong>MiFi®.  Freedom. My Way.®<br /></strong></p>\r\n<p>The 4G LTE MiFi 4510 is the next generation of the Novatel Wireless MiFi Intelligent Mobile Hotspot portfolio, building on award winning innovation and design, proven performance and industry-leading flexibility, convenience, and reliability.  Experience life in the fast lane with blazing fast 4G LTE mobile broadband.  The reliable MiFi 4510 is backward compatible with the 3G CDMA 1XEvDO Rev A network and includes new features, such as integrated status display on the device showing signal strength, roaming, battery level, and number of devices connected.</p>'),(883,'<h4>MiFi® 4620L</h4>'),(884,'<h4 class=\"HeadingProductname\">N4A™ <span style=\"background: white;\">Device Manager</span></h4>\r\n<p><strong><span style=\"background-color: white; background-position: initial initial; background-repeat: initial initial;\">Device Management Software</span></strong></p>\r\n<p><strong><span style=\"background-color: white; background-position: initial initial; background-repeat: initial initial;\"><br /></span></strong></p>\r\n<p><strong>Networking Solutions</strong></p>\r\n<p>The N4A Device Manager solution is a robust environment for the management, configuration and self care/support of Novatel Wireless M2M devices to include the following capabilities: 1) view, change and manage device configuration &amp; firmware updates, 2) manage single devices or groups of devices, 3) complete device history to assist in self care &amp; issue resolution, 4) monitor device health and operational status, and 5) allows device to “check-in” to the hosted environment and report event data to a separate server. Manage user accounts and device privileges to extend self-service device management capabilities to customers. Hosted and on premise versions are available providing complete integration flexibility.</p>\r\n<p class=\"t1\"> </p>\r\n<p><strong>Device and Service Management</strong></p>\r\n<p>Create and manage device groups by deploying configuration changes to a set of devices or a single device then set up customer groups. Uploaded shipments are available in the system for immediate use while device orders are in transit (shipping option). Upload, manage and save scripts for device deployments and updates. Information is queued for configuration changes prior to device installation or initial power up. Devices can be contacted for immediate check-in to expedite device changes. Filters and searches are available throughout the system for easy navigation.</p>\r\n<p> </p>'),(885,'<h4>MiFi® 4082</h4>\r\n<p><strong>Intelligent Mobile Hotspot</strong></p>'),(886,'<p><strong>MiFi®.  Freedom. My Way.®</strong></p>\r\n<p>The 3G/4G MiFi 4082 is the next generation in the Novatel Wireless MiFi Intelligent Mobile Hotspot portfolio, building on award winning innovation and design, proven performance and industry-leading flexibility, convenience, and reliability. Experience life in the fast lane with blazing fast 4G WiMAX mobile broadband. The reliable MiFi 4082 is backward-compatible with the 3G CDMA 1XEvDO Rev A network, and includes new features such as the MiFi OS™, microSDHC™ card slot and an external status display providing information at-a-glance on signal strength, roaming status, battery levels and the number of devices connected.</p>'),(887,'<h3 style=\"text-align: justify;\">Charlotte Rubin</h3>\r\n<p style=\"text-align: justify;\">Senior Director, Public Relations</p>\r\n<p style=\"text-align: justify;\"><strong>P.</strong> +1 858.812.3431</p>\r\n<p style=\"text-align: justify;\"><strong>F.</strong> +1 858.812.3414</p>'),(889,'<p class=\"HeadingProductname\"><strong>Highlights</strong></p>\r\n<p class=\"t1\">Novatel Wireless accelerates solution delivery by quickly building connectivity from a customer’s Internet Protocol (IP)-enabled remote assets to their existing enterprise applications. Removing the inherent complexities of wireless networks and their communications protocols, our N4A™ Communications and Management Software (CMS) enables database or web service-driven control and management of Enfora® remote devices. Using a standard web-based user interface, customers have a detailed mobile asset view, enabling proactive management as well as necessary system upgrades. Additionally, using the built-in device configuration and service management capabilities, N4A™ CMS effectively manages and applies device configurations across multiple device groups.</p>\r\n<p class=\"t1\">Available as an on-premise solution, N4A™ CMS is particularly well suited to customers who:</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-weight: normal; font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Need a functional application up and running quickly</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-weight: normal; font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Lack the man hours or expertise necessary to master device and session management</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-weight: normal; font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Want to capitalize on our experience with wireless devices and network operators</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-weight: normal; font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Require flexible integration options</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-weight: normal; font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Prefer to focus resources on their in-house application software development</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-weight: normal; font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Need a simple web service interface for programmatic interaction</p>\r\n<p><strong>A Scalable Solution</strong></p>\r\n<p>The flexibility of our N4A™ software architecture makes it possible to integrate a broad range of existing solutions. The N4A™ CMS application has been architected to scale, functioning in environments varying from a single-server demo to those with carrier-grade requirements. The application may be scaled vertically and horizontally, depending on customer requirements. N4A™ CMS is designed for the multitenant requirements of resellers and company organizations.</p>\r\n<p><strong>Exceptional Support</strong></p>\r\n<p class=\"t1\">Novatel Wireless has an exceptional customer support infrastructure, with Technical Account Managers (TAMs) and Field Applications Engineers (FAEs) around the globe available to deliver customer-driven support options both pre- and post-installation.</p>'),(890,'<h4>N4A™ Communications and Management Software</h4>'),(891,'<h3 style=\"text-align: justify;\">Charlotte Rubin</h3>\r\n<p style=\"text-align: justify;\"><em>Senior Director, Public Relations</em></p>\r\n<p style=\"text-align: justify;\">9645 Scranton Road, Suite 205</p>\r\n<p style=\"text-align: justify;\">San Diego, California 92121</p>\r\n<p style=\"text-align: justify;\">USA</p>\r\n<p style=\"text-align: justify;\"><strong>P.</strong> +1 858.812.3431</p>\r\n<p style=\"text-align: justify;\"><strong>F.</strong> +1 858.812.3414</p>'),(892,'<h2>Welcome to the Novatel Wireless Media Center</h2>\r\n<p><strong>Access</strong> to the latest news, <strong>view</strong> the latest press releases, <strong>download</strong> press kits, photos, logos, <strong>contact</strong> our PR team and <strong>more</strong>.</p>'),(893,'<h4>MiFi® 2</h4>\r\n<p><strong>Next Generation MiFi – Available soon with AT&amp;T</strong></p>'),(894,'<h4>MiFi® 4620L</h4>\r\n<p><strong>Intelligent Mobile Hotspot</strong></p>'),(895,'<p><strong>Fast, always-on Internet wherever you roam—worldwide*</strong></p>\r\n<p>With the Verizon Jetpack™ 4G LTE Mobile Hotspot MiFi® 4620L by Novatel Wireless, access blazing fast 4G LTE and 3G mobile broadband worldwide and share your connection with up to ten Wi-Fi enabled devices simultaneously. MiFi 4620L is the next generation in the Novatel Wireless MiFi intelligent mobile hotspot portfolio for Verizon Wireless, built on award-winning innovation and design, proven performance and industry leading user experience.</p>\r\n<p><strong>Put the world in the palm of your hand<br /></strong>With this 4G LTE MiFi intelligent mobile hotspot, enjoy fast Internet access whenever, wherever you go. MiFi 4620L is backward compatible with high speed DC HSPA+, HSPA+, WCDMA, EDGE and GPRS technologies to keep you connected. The compact MiFi 4620L is perfect for on-the-go connectivity and won’t weigh you down.</p>\r\n<p><strong>Know where you are — monitor device and connection status at a glance</strong>With the interactive OLED display screen, easily scroll to view battery life, check signal strength, check the number of connected devices, read text messages, view network details, access your password, and much more!</p>\r\n<p><strong>Share the experience—connect up to 10 devices securely†</strong></p>\r\n<p><strong></strong>Create your own personal Wi-Fi cloud and share high speed 4G and 3G Internet connectivity with up to ten devices—notebooks, tablets, e-readers, gaming consoles and more. The MiFi 4620L supports the latest security protocols required by some of the strictest corporate VPNs, including VPN Pass-through and NAT Firewall. </p>\r\n<p><strong>Smooth sailing—navigate using GPS over Wi-Fi‡</strong></p>\r\n<p>MiFi 4620L is the first product to support GPS over Wi-Fi, enabling applications to access streaming GPS (NMEA). Stream GPS location services while on the move to up to 10 devices at once, no cables required!</p>\r\n<p> </p>\r\n<p>* Visit verizonwireless.com for coverage maps</p>\r\n<p>†Security settings must be enabled</p>\r\n<p>‡Available only on Windows® systems</p>\r\n<p>Service plans, extended battery and other services/options must be purchased separately</p>\r\n<p> </p>\r\n<p><a href=\"#\"><img src=\"{CCM:FID_7}\" alt=\"where-to-buy-button.png\" width=\"101\" height=\"27\" /></a></p>'),(896,'<h4>MiFi® 4510</h4>\r\n<p><strong>Intelligent Mobile Hotspot for LTE Networks</strong></p>'),(897,'<h4>MiFi® 2352</h4>\r\n<p><strong>Intelligent Mobile Hotspot for HSPA Networks (for Europe)</strong></p>'),(898,'<h4>MiFi® 2372</h4>\r\n<p><strong>Intelligent Mobile Hotspot for HSPA Networks (for North America)</strong></p>'),(899,'<h4>MiFi® 3352</h4>\r\n<p><strong>Intelligent Mobile Hotspot for HSPA Networks with MiFi OS™</strong></p>'),(900,'<h4>MiFi® 2200</h4>\r\n<p><strong>Intelligent Mobile Hotspot for CDMA 1xEVDO RevA Networks</strong></p>'),(902,'<p>Mobile Computing Carriers</p>'),(903,'<p>Mobile Computing Distributors</p>'),(904,'<p>Integrated Platforms</p>'),(905,'<p>Embedded Modules</p>'),(906,'<h2>Where To Buy</h2>'),(909,'<p>Novatel Wireless, Inc. is a leader in the design and development of intelligent wireless solutions based on 2G, 3G and 4G technologies providing wireless connectivity. The Company delivers specialized wireless solutions to carriers, distributors, retailers, OEMs and vertical markets worldwide. Novatel Wireless\' intelligent mobile hotspot products, software, USB modems, embedded modules and smart M2M modules provide innovative anywhere, anytime communications solutions for consumers and enterprises.</p>\r\n<p>Headquartered in San Diego, California, Novatel Wireless, Inc. has been issued over 30 technology patents and has established partnerships with leading telecom operators, infrastructure providers and device manufacturers around the world. Novatel Wireless, Inc. is listed on NASDAQ: NVTL.</p>\r\n<p><strong>Target</strong></p>\r\n<p>Novatel Wireless, Inc. partners with wireless network operators, distributors, original equipment manufacturers (OEMs), and vertical markets worldwide to offer wireless connectivity solutions that meet the unique needs of the following markets:</p>\r\n<table class=\"spectable\" style=\"border-right-width: 1px; border-right-style: solid; border-right-color: #cccccc; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: #cccccc;\" width=\"100%\" border=\"0\" cellspacing=\"0\" cellpadding=\"4\">\r\n<tbody>\r\n<tr>\r\n<td class=\"specheader\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333; background-color: #eeeeee;\" valign=\"top\"><strong>Mobile Workforce</strong></td>\r\n<td class=\"speccell\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333;\" valign=\"top\">Business Professionals, Consumers, Sales Force, Field Service</td>\r\n</tr>\r\n<tr>\r\n<td class=\"specheader\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333; background-color: #eeeeee;\" valign=\"top\"><strong>Public Safety</strong></td>\r\n<td class=\"speccell\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333;\" valign=\"top\">Homeland Security, Police, Fire, Traffic, Highway, Bridge</td>\r\n</tr>\r\n<tr>\r\n<td class=\"specheader\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333; background-color: #eeeeee;\" valign=\"top\"><strong>Telematics</strong></td>\r\n<td class=\"speccell\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333;\" valign=\"top\">Automated Vehicle Location, Theft Recovery, Vehicle Monitoring</td>\r\n</tr>\r\n<tr>\r\n<td class=\"specheader\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333; background-color: #eeeeee;\" valign=\"top\"><strong>Telemetry</strong></td>\r\n<td class=\"speccell\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333;\" valign=\"top\">Point Of Sale, ATM, Machine to Machine, Plant, Video, Theft Recovery, Vending, Meter Reading, Location Based Services</td>\r\n</tr>\r\n<tr>\r\n<td class=\"specheader\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333; background-color: #eeeeee;\" valign=\"top\"><strong>Transportation</strong></td>\r\n<td class=\"speccell\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333;\" valign=\"top\">Trucking, Courier, Fleet Management</td>\r\n</tr>\r\n<tr>\r\n<td class=\"specheader\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333; background-color: #eeeeee;\" valign=\"top\"><strong>Utilities</strong></td>\r\n<td class=\"speccell\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333;\" valign=\"top\">Gas, Electric, Cable, Telephone</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong>Direction for the Future</strong></p>\r\n<p>Novatel Wireless, Inc. is uniquely poised to take advantage of the burgeoning wireless market. The company has built a reputation for quality, reliable, innovative products that serve a broad audience. On the road ahead, Novatel Wireless, Inc. intends to stay ahead of the curve by continuing to form alliances with industry-leading partners, diversifying its product offerings and supporting the latest wireless technologies. </p>'),(911,'<p>Novatel Wireless, Inc. is a leader in the design and development of intelligent wireless solutions based on 2G, 3G and 4G technologies providing wireless connectivity. The Company delivers specialized wireless solutions to carriers, distributors, retailers, OEMs and vertical markets worldwide. Novatel Wireless\' intelligent mobile hotspot products, software, USB modems, embedded modules and smart M2M modules provide innovative anywhere, anytime communications solutions for consumers and enterprises.</p>\r\n<p>Headquartered in San Diego, California, Novatel Wireless, Inc. has been issued over 30 technology patents and has established partnerships with leading telecom operators, infrastructure providers and device manufacturers around the world. Novatel Wireless, Inc. is listed on NASDAQ: NVTL.</p>\r\n<p><strong>Target</strong></p>\r\n<p>Novatel Wireless, Inc. partners with wireless network operators, distributors, original equipment manufacturers (OEMs), and vertical markets worldwide to offer wireless connectivity solutions that meet the unique needs of the following markets:</p>\r\n<table class=\"spectable\" style=\"border-right-width: 1px; border-right-style: solid; border-right-color: #cccccc; border-bottom-width: 1px; border-bottom-style: solid; border-bottom-color: #cccccc;\" width=\"100%\" border=\"0\" cellspacing=\"0\" cellpadding=\"4\">\r\n<tbody>\r\n<tr>\r\n<td class=\"specheader\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333; background-color: #eeeeee;\" valign=\"top\"><strong>Mobile Workforce</strong></td>\r\n<td class=\"speccell\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333;\" valign=\"top\">Business Professionals, Consumers, Sales Force, Field Service</td>\r\n</tr>\r\n<tr>\r\n<td class=\"specheader\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333; background-color: #eeeeee;\" valign=\"top\"><strong>Public Safety</strong></td>\r\n<td class=\"speccell\" style=\"border-top-width: 1px; border-top-style: solid; border-top-color: #cccccc; border-left-width: 1px; border-left-style: solid; border-left-color: #cccccc; font-family: arial, verdana, helvetica, sans-serif; font-size: 11px; color: #333333;\" valign=\"top\">Homeland Security, Police, Fire, Traffic, Highway, Bridge</td>\r\n</tr>\r\n<tr>\r\n<td class=\"specheader\" sty