parulo, Chairman and Chief Executive Officer\" align=\"left\" border=\"0\" hspace=\"5\" />\r\n<div><em>Peter V. Leparulo</em> has served as a director since May 2003, as our Chairman since November 2006 and as our Chief Executive Officer since April 2008. He also served as our Chief Executive Officer from January 2003 to November 2007. From May 2001 to January 2003, he served as our Senior Vice President, General Manager, CDMA Operations. From September 2000 to May 2001, he served as our Senior Vice President, Corporate and Strategic Development and General Counsel. From June 1998 until September 2000, Mr. Leparulo was a Senior Partner at the law firm of Orrick, Herrington &amp; Sutcliffe LLP, where he specialized in corporate finance, mergers and acquisitions, securities, intellectual property and general corporate matters. Prior to joining Orrick, Mr. Leparulo was a Partner at the law firm of Pillsbury Madison &amp; Sutro LLP, from January 1992 until June 1998, and an Associate at that firm from October 1989 until January 1992. He holds a Bachelor of Science from Colgate University and a Juris Doctor from Case Western Reserve University.</div>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<span class=\"article_separator\"> </span></td>\r\n</tr>\r\n<tr>\r\n<td valign=\"top\">\r\n<table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"article_column\" valign=\"top\" width=\"100%\">\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td class=\"contentheading\" style=\"padding: 10px; margin: 0px; font-size: 18px; line-height: 18px; color: #00245d; font-weight: bold;\" width=\"100%\">Kenneth Leddon, Senior Vice President and Chief Financial Officer</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\" valign=\"top\">\r\n<div class=\"space\" style=\"padding: 10px; margin: 0px;\"><img style=\"float: left; border: 0; margin-left: 15px; margin-right: 15px;\" title=\"Kenneth Leddon, Senior Vice President and Chief Financial Officer\" src=\"http://www.novatelwireless.com/images/stories/aboutus/Leddon-hires.jpg\" alt=\"Kenneth Leddon, Senior Vice President and Chief Financial Officer\" width=\"153\" height=\"214\" align=\"left\" border=\"0\" hspace=\"5\" /><em>Kenneth G. Leddon</em> has served as our Senior Vice President and Chief Financial Officer since January 2008. From November 2007 to January 2008, he served as our interim Chief Financial Officer. Before joining us, Mr. Leddon was a principal in the management consulting firm of Leddon &amp; Associates from September 2006 until November 2007. Prior to that, he was a principal in the management consulting firm of Pathway Strategic Partners from November 2002 to September 2006. Mr. Leddon also served as an interim executive or financial advisor for several companies while employed with two nationally recognized management consulting firms, XRoads Solutions Group, LLC and Buccino &amp; Associates, Inc. He also served as Chief Financial Officer and Vice President for several portfolio companies of Milhous Group, a private equity firm that was based in California. Mr. Leddon started his career at U.S. Steel Corporation, where he held several financial management positions during his 10 year tenure. Mr. Leddon holds a Bachelor of Science in Business Administration from California State University-Northridge and a Master of Science in Business Administration from Robert Morris University.</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<span class=\"article_separator\"> </span>\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td class=\"contentheading\" style=\"padding: 10px; margin: 0px; font-size: 18px; line-height: 18px; color: #00245d; font-weight: bold;\" width=\"100%\">Slim S. Souissi, Senior Vice President and Chief Technology Officer</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\" valign=\"top\">\r\n<div class=\"space\" style=\"padding: 10px; margin: 0px;\">\r\n<p style=\"margin-bottom: 15px; margin-top: 10px;\"><img style=\"float: left; border: 0; margin-left: 15px; margin-right: 15px;\" title=\"Slim S. Souissi, Senior Vice President and Chief Technology Officer\" src=\"http://www.novatelwireless.com/images/stories/aboutus/SlimSouissi.jpg\" alt=\"Slim S. Souissi, Senior Vice President and Chief Technology Officer\" align=\"left\" border=\"0\" hspace=\"5\" /></p>\r\n<p style=\"margin-bottom: 15px; margin-top: 10px;\"><em>Slim S. Souissi</em> has served as our Senior Vice President and Chief Technology Officer since 2004 and served as our Vice President and Chief Technology Officer from October 2002 to 2004. He previously served as our Vice President of Emerging Technologies from December 2001 to October 2002 and as our Principal Research Scientist from May 2000 to December 2001. Prior to joining us in 2002, Dr. Souissi was Principal Staff Engineer in Motorola’s research and development operation from November 1994 to May 2000. Dr. Souissi earned a Ph.D. and a Master of Science in Electrical Engineering from the Georgia Institute of Technology, a Master of Science in Digital Signal Processing from the Ecole Superieure d’Electricite (France) and a Master of Science in Engineering from the Ecole Centrale Marseille (France). Dr. Souissi holds 37 U.S. patents, all related to wireless technology.</p>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<span class=\"article_separator\"> </span>\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td class=\"contentheading\" style=\"padding: 10px; margin: 0px; font-size: 18px; line-height: 18px; color: #00245d; font-weight: bold;\" width=\"100%\">Robert M. Hadley, Chief Marketing Officer</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\" valign=\"top\">\r\n<div class=\"space\" style=\"padding: 10px; margin: 0px;\"><img style=\"float: left; border: 0; margin-left: 15px; margin-right: 15px;\" src=\"http://www.novatelwireless.com/images/stories/rob_headshot.png\" alt=\"\" align=\"left\" border=\"0\" hspace=\"5\" /><em>Robert M. Hadley</em> became our Chief Marketing Officer in March 2009 and served as a Senior Technical Advisor for the Company in the office of the Chief Executive Officer since March 2008. From 2004 to early 2008, Mr. Hadley was the Company’s Senior Vice President of Worldwide Sales and Marketing and was our Vice President of Sales and Marketing in 2003. He served as our Vice President of Strategic Accounts from April 2001 to December 2002. Before initially joining us, Mr. Hadley was Vice President of Sales for e-SIM Ltd., a provider of advanced simulation technology for product development. Mr. Hadley also previously held various senior sales and marketing positions at Aonix, a Thomson Software company providing IT solutions for corporate enterprise reporting and lifestyle software development markets, where he rose to the position of Vice President of Marketing. Mr. Hadley holds a Bachelor of Science in Computer Science from San Diego State University.</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<span class=\"article_separator\"> </span>\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td class=\"contentheading\" style=\"padding: 10px; margin: 0px; font-size: 18px; line-height: 18px; color: #00245d; font-weight: bold;\" width=\"100%\">Chris Ross, Senior Vice President of Operations</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\" valign=\"top\">\r\n<div class=\"space\" style=\"padding: 10px; margin: 0px;\"><img style=\"float: left; border: 0; margin-left: 15px; margin-right: 15px;\" title=\"Chris Ross, Senior Vice President of Operations\" src=\"http://www.novatelwireless.com/images/stories/aboutus/ChrisRoss.jpg\" alt=\"Chris Ross, Senior Vice President of Operations\" align=\"left\" border=\"0\" hspace=\"5\" /><em>Christopher J. Ross</em> has served as our Vice President of Operations since July 2005 and our Senior Vice President of Operations since August 2007. From 1999 to July 2005, Mr. Ross was Vice President of Operations at Ericsson Wireless Communications where he was responsible for world-wide supply of wireless telecommunications infrastructure based on CDMA radio access technology. From 1994 to 1999, he was Vice President, Manufacturing at QUALCOMM where he was an operations executive. Prior to joining QUALCOMM, he was Vice President of Manufacturing at Spectragraphics where he founded the company’s contract manufacturing subsidiary (SMS Technologies) and also served as its General Manager. Mr. Ross holds both Bachelor and Master of Electrical Engineering degrees from Manhattan College.</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<span class=\"article_separator\"> </span>\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td class=\"contentheading\" style=\"padding: 10px; margin: 0px; font-size: 18px; line-height: 18px; color: #00245d; font-weight: bold;\" width=\"100%\">Catherine F. Ratcliffe, Senior Vice President of Business Affairs and General Counsel</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\" valign=\"top\"><img style=\"float: left; border: 0; margin-left: 15px; margin-right: 15px;\" title=\"Catherine F. Ratcliffe, Senior Vice President of Business Affairs and General Counsel\" src=\"http://www.novatelwireless.com/images/stories/aboutus/Ratcliff1.jpg\" alt=\"Catherine F. Ratcliffe, Senior Vice President of Business Affairs and General Counsel\" align=\"left\" border=\"0\" hspace=\"5\" /><em>Catherine F. Ratcliffe</em> has served as our Senior Vice President, Business Affairs, General Counsel and Secretary since August 2007 and served as our Vice President, Business Affairs and Secretary from May 2004 until August 2007. From 2002 to 2004, she practiced law, including as a Partner in the law firm of Lamb &amp; Kawakami. From 1997 to 2002 she was Vice President, General Counsel &amp; Human Resources at Day Runner, Inc. She was a Partner in the law firm of Bryan Cave LLP practicing in the areas of corporate finance, securities and mergers and acquisitions, from 1992 to 1997. Ms. Ratcliffe holds a Bachelor of Arts from the University of California at Los Angeles and a Juris Doctor from the University of California at Berkeley.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>'),(926,'<h1>Learn More About Us</h1>\r\n<p><img style=\"vertical-align: middle;\" src=\"{CCM:FID_77}\" alt=\"twitter_icon.png\" width=\"14\" height=\"14\" /> Keep up to date with Twitter</p>\r\n<p><img style=\"vertical-align: middle;\" src=\"{CCM:FID_76}\" alt=\"facebook_icon.png\" width=\"14\" height=\"14\" /> Become a fan on Facebook</p>'),(927,'<h1>Media Downloads </h1>\r\n<p>Get access to the Novatel Wireless brand kit and product images.<br /><a title=\"Downloads\" href=\"{CCM:CID_182}\">Learn More &gt;</a></p>'),(928,'<h1>About Novatel Wireless</h1>\r\n<p><img src=\"{CCM:FID_75}\" alt=\"pdf_icon.png\" width=\"13\" height=\"13\" /> NVTL Corporate Background</p>\r\n<p><img src=\"{CCM:FID_75}\" alt=\"pdf_icon.png\" width=\"13\" height=\"13\" /> NVTL Corporate FAQ</p>\r\n<p><img src=\"{CCM:FID_75}\" alt=\"pdf_icon.png\" width=\"13\" height=\"13\" /> NVTL Boiler Plate</p>'),(942,'<table class=\"blog\" style=\"padding: 10px; margin: 0px; width: 670px; color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 12px; text-align: start;\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\">\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td class=\"contentheading\" style=\"padding: 10px; margin: 0px; font-size: 18px; line-height: 18px; color: #00245d; font-weight: bold;\" width=\"100%\">Peter V. Leparulo, Chairman and Chief Executive Officer</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\" valign=\"top\">\r\n<div class=\"space\" style=\"padding: 10px; margin: 0px;\"><img style=\"float: left; border: 0; margin-left: 15px; margin-right: 15px;\" title=\"Peter V. Leparulo, Chairman and Chief Executive Officer\" src=\"http://www.novatelwireless.com/images/stories/aboutus/PeterLeparulo.jpg\" alt=\"Peter V. Leparulo, Chairman and Chief Executive Officer\" align=\"left\" border=\"0\" hspace=\"5\" />\r\n<div><em>Peter V. Leparulo</em> has served as a director since May 2003, as our Chairman since November 2006 and as our Chief Executive Officer since April 2008. He also served as our Chief Executive Officer from January 2003 to November 2007. From May 2001 to January 2003, he served as our Senior Vice President, General Manager, CDMA Operations. From September 2000 to