\r\n<div class=\"space\" style=\"padding: 10px; margin: 0px;\"><img style=\"float: left; border: 0; margin-left: 15px; margin-right: 15px;\" src=\"http://www.novatelwireless.com/images/stories/rob_headshot.png\" alt=\"\" align=\"left\" border=\"0\" hspace=\"5\" /><em>Robert M. Hadley</em> became our Chief Marketing Officer in March 2009 and served as a Senior Technical Advisor for the Company in the office of the Chief Executive Officer since March 2008. From 2004 to early 2008, Mr. Hadley was the Company’s Senior Vice President of Worldwide Sales and Marketing and was our Vice President of Sales and Marketing in 2003. He served as our Vice President of Strategic Accounts from April 2001 to December 2002. Before initially joining us, Mr. Hadley was Vice President of Sales for e-SIM Ltd., a provider of advanced simulation technology for product development. Mr. Hadley also previously held various senior sales and marketing positions at Aonix, a Thomson Software company providing IT solutions for corporate enterprise reporting and lifestyle software development markets, where he rose to the position of Vice President of Marketing. Mr. Hadley holds a Bachelor of Science in Computer Science from San Diego State University.</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<span class=\"article_separator\"> </span>\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td class=\"contentheading\" style=\"padding: 10px; margin: 0px; font-size: 18px; line-height: 18px; color: #00245d; font-weight: bold;\" width=\"100%\">Chris Ross, Senior Vice President of Operations</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\" valign=\"top\">\r\n<div class=\"space\" style=\"padding: 10px; margin: 0px;\"><img style=\"float: left; border: 0; margin-left: 15px; margin-right: 15px;\" title=\"Chris Ross, Senior Vice President of Operations\" src=\"http://www.novatelwireless.com/images/stories/aboutus/ChrisRoss.jpg\" alt=\"Chris Ross, Senior Vice President of Operations\" align=\"left\" border=\"0\" hspace=\"5\" /><em>Christopher J. Ross</em> has served as our Vice President of Operations since July 2005 and our Senior Vice President of Operations since August 2007. From 1999 to July 2005, Mr. Ross was Vice President of Operations at Ericsson Wireless Communications where he was responsible for world-wide supply of wireless telecommunications infrastructure based on CDMA radio access technology. From 1994 to 1999, he was Vice President, Manufacturing at QUALCOMM where he was an operations executive. Prior to joining QUALCOMM, he was Vice President of Manufacturing at Spectragraphics where he founded the company’s contract manufacturing subsidiary (SMS Technologies) and also served as its General Manager. Mr. Ross holds both Bachelor and Master of Electrical Engineering degrees from Manhattan College.</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<span class=\"article_separator\"> </span>\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td class=\"contentheading\" style=\"padding: 10px; margin: 0px; font-size: 18px; line-height: 18px; color: #00245d; font-weight: bold;\" width=\"100%\">Catherine F. Ratcliffe, Senior Vice President of Business Affairs and General Counsel</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"contentpaneopen\" style=\"padding: 0px; margin: 0px; clear: both; width: 650px; border-collapse: collapse;\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\" valign=\"top\"><img style=\"float: left; border: 0; margin-left: 15px; margin-right: 15px;\" title=\"Catherine F. Ratcliffe, Senior Vice President of Business Affairs and General Counsel\" src=\"http://www.novatelwireless.com/images/stories/aboutus/Ratcliff1.jpg\" alt=\"Catherine F. Ratcliffe, Senior Vice President of Business Affairs and General Counsel\" align=\"left\" border=\"0\" hspace=\"5\" /><em>Catherine F. Ratcliffe</em> has served as our Senior Vice President, Business Affairs, General Counsel and Secretary since August 2007 and served as our Vice President, Business Affairs and Secretary from May 2004 until August 2007. From 2002 to 2004, she practiced law, including as a Partner in the law firm of Lamb &amp; Kawakami. From 1997 to 2002 she was Vice President, General Counsel &amp; Human Resources at Day Runner, Inc. She was a Partner in the law firm of Bryan Cave LLP practicing in the areas of corporate finance, securities and mergers and acquisitions, from 1992 to 1997. Ms. Ratcliffe holds a Bachelor of Arts from the University of California at Los Angeles and a Juris Doctor from the University of California at Berkeley.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>'),(945,'		<iframe src=\"http://investor.novatelwireless.com/releases.cfm\" seamless allowtransparency=\"0\" frameborder=\"0\" class=\"embeddedContent\" id=\"iframeContent\" width=\"1024\" height=\"1200\" style=\"height: 1200px;width: 885px;margin-left: 0px;\"></iframe>\r\n'),(949,'<h2>Investor Resources</h2>\r\n<p>Novatel Wireless, Inc. is a leading provider of wireless broadband access solutions for the worldwide mobile communications market. Our solutions enable the mobile workforce to increase productivity, improve operational efficiencies and maintain a competitive edge.</p>'),(956,'<h1>Enfora Aquisition</h1>\r\n<p>Enfora will operate as a Novatel Wireless business unit, and the combined company will leverage synergies in product development, sales channels and complimentary resources.</p>\r\n<p><img src=\"{CCM:FID_75}\" alt=\"pdf_icon.png\" width=\"13\" height=\"13\" /> <a href=\"#\">Download Press Release</a></p>'),(957,'<p><span style=\"font-size: small; font-family: Arial;\">Novatel Wireless is a global leader in developing innovative wireless data devices and applications for markets worldwide using advanced wireless networks such as LTE, UMTS, HSDPA, GSM, GPRS, CDMA, and EV-DO. We are a publicly traded company headquartered in San Diego, California.</span></p>\r\n<p><span style=\"font-family: Arial; font-size: small;\">Innovators- We are a global innovator in 3G &amp; 4G wireless mobility and M2M solutions:</span></p>\r\n<p><span style=\"font-size: small; font-family: Arial;\"> • 1st to market with the Mifi- personal wireless hotspot</span></p>\r\n<p><span style=\"font-size: small; font-family: Arial;\"> • 1st to market with EV-DO Rev-A product line</span></p>\r\n<p><span style=\"font-size: small; font-family: Arial;\"> • 1st USB wireless broadband in North America</span></p>\r\n<p><span style=\"font-size: small; font-family: Arial;\"> • 1st 3G wireless broadband router in Europe </span></p>\r\n<p><span style=\"font-size: small; font-family: Arial;\"> • Exciting LTE M2M Wimax HSPA+ products</span></p>\r\n<p><span style=\"font-size: small; font-family: Arial;\">Work/Life Balance- We hire passionate people and create great teams. Global- We have offices in San Diego (California), Calgary (Canada), Basingstoke, (United Kingdom), and Shanghai (China). Financially Secure- Novatel Wireless is cash strong with no debt; founded in 1996, IPO in 2000.</span></p>\r\n<p><span style=\"font-size: small; font-family: Arial;\">Novatel Wireless offers a very competitive benefits package. For our US employees, for example, we offer:</span></p>\r\n<table class=\"MsoNormalTable\" style=\"border-collapse: collapse; mso-table-layout-alt: fixed; border: none; mso-padding-alt: 0in 5.4pt 0in 5.4pt;\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 91.0pt; border: none; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"91\">\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">Medical</span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">Dental</span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">Vision</span></span></p>\r\n</td>\r\n<td style=\"width: 242.0pt; border: none; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"242\">\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">Health Spending Accounts    </span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">Life Insurances   </span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">Discounted Employee Stock Purchase Plan</span></span></p>\r\n</td>\r\n<td style=\"width: 160.0pt; border: none; padding: 0in 5.4pt 0in 5.4pt;\" valign=\"top\" width=\"160\">\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">Stock Options</span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">401k Match Program</span></span></p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Arial;\">•<span style=\"font-family: \'Times New Roman\';\">   </span></span><span style=\"font-family: Arial;\">Generous  Vacation Policy</span></span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><span style=\"font-size: small; font-family: Arial;\">Novatel Wireless offers competitive salaries, comprehensive benefits, the opportunity for stock options, and an environment that supports creativity, open communication, and teamwork. Only applicants whose experience matches the skills sought for our positions will be contacted.</span></p>\r\n<p><span style=\"font-size: small; font-family: Arial;\">Novatel Wireless is an Equal Opportunity Employer.  All jobs are subject to pre-employment background check and reference check.</span></p>'),(960,'<h2>Job Position / Title</h2>'),(961,'<p><a href=\"#\">Link to job application submission page</a></p>'),(962,'<p><strong>Posted On:</strong> -- / -- / ----</p>'),(963,'<p><strong>Location:</strong>  </p>'),(964,'<p><strong>Pay Rate:</strong>  </p>'),(965,'<p><strong>Duration:</strong>  </p>'),(966,'<p><strong>Travel:</strong>  </p>'),(967,'<p><strong>Job Description:</strong> </p>\r\n<p> </p>'),(968,'<p><strong>Preferred Skills:</strong></p>\r\n<p> </p>'),(969,'<h2>Staff/Principal Firmware Engineer</h2>'),(970,'<p><a href=\"https://home.eease.adp.com/recruit/?id=2715611\">APPLY FOR STAFF/PRINCIPAL FIRMWARE ENGINEER</a></p>\r\n<p><span style=\"color: #000000;\"><em>The ideal candidate will have experience on 3GPP/LTE protocols and data stack</em></span></p>'),(971,'<p><strong>Posted On:</strong> Wednesday, 24 October 2012</p>'),(972,'<p><strong>Location:</strong> </p>'),(973,'<p><strong>Pay Rate:</strong> </p>'),(974,'<p><strong>Duration:</strong> </p>'),(975,'<p><strong>Travel:</strong> </p>'),(976,'<p><strong>Job Description:</strong> </p>\r\n<p> </p>'),(977,'<p><strong>Preferred Skills:</strong></p>\r\n<p>Novatel Wireless Highlights:</p>\r\n<p>Innovators- We are a global innovator in 3G &amp; 4G wireless mobility solutions. * 1st to market with EV-DO Rev-A product line * 1st USB wireless broadband in North America * 1st 3G wireless broadband router in Europe * Exciting LTE, M2M, Wimax, HSPA+ products Work/Life Balance- We hire passionate people and create great teams. Global- We have offices in San Diego (California), Calgary (Canada), Basingstoke, (United Kingdom), and Shanghai (China). Financially Secure- Novatel Wireless is cash strong with no debt; founded in 1996, IPO in 2000.</p>\r\n<p>This position may be filled at Staff or Principal level depending upon experience.</p>\r\n<p>Main Duties:</p>\r\n<p>Implement &amp; validate customer requirements for Novatel products.</p>\r\n<p>Develop all aspects of the device software, including device drivers, radio interfaces, power management and embedded applications.</p>\r\n<p>Support and debug issues pertaining to certifying NVTL data products through customer labs and certification processes.</p>\r\n<p>Required Knowledge: </p>\r\n<p>•    Solid knowledge of wireless technologies in 2G/3G/4G.  Must have 4 years experience working in any of those wireless technologies.</p>\r\n<p>•    Strong C, C++ programming skills in an embedded RTOS environment.  Must have 6 years coding experience in the embedded environment.</p>\r\n<p>•    Good knowledge of software development lifecycle.</p>\r\n<p>•    Excellent coding, documentation, and debugging practices.</p>\r\n<p>•    Worked with Lauterbach JTAG ICD/ICE.</p>\r\n<p>•    Must have ability to debug complex hardware/software interactions in an embedded RTOS environment working alongside hardware design team.</p>\r\n<p>Required Experience: </p>\r\n<p>6 years of experience working within embedded environment.</p>\r\n<p>Education: </p>\r\n<p>Requires BS/MS degree in EE/CE/CS disciplines.</p>\r\n<p>Compensation &amp; Benefits: Our successful candidate will be entitled to a compensation package commensurate with qualifications, experience and performance, plus a comprehensive benefits plan.</p>\r\n<p>How to Apply:</p>\r\n<p>Thank you for your interest on becoming part of our innovative, market leading wireless family.</p>\r\n<p>• Please select the “apply to” button on top of the page above the skills needed section.</p>\r\n<p>• Candidates that complete the technical questions (If listed) receive special priority.</p>\r\n<p>• Please feel free to apply for more than 1 position or refer a friend as we are always looking to build great teams.</p>'),(978,'<p><strong>Preferred Skills:</strong></p>\r\n<p> </p>'),(979,'<p><strong>Job Description:</strong> </p>\r\n<p>Novatel Wireless Highlights:</p>\r\n<p>Innovators- We are a global innovator in 3G &amp; 4G wireless mobility solutions. * 1st to market with EV-DO Rev-A product line * 1st USB wireless broadband in North America * 1st 3G wireless broadband router in Europe * Exciting LTE, M2M, Wimax, HSPA+ products Work/Life Balance- We hire passionate people and create great teams. Global- We have offices in San Diego (California), Calgary (Canada), Basingstoke, (United Kingdom), and Shanghai (China). Financially Secure- Novatel Wireless is cash strong with no debt; founded in 1996, IPO in 2000.</p>\r\n<p>This position may be filled at Staff or Principal level depending upon experience.</p>\r\n<p>Main Duties:</p>\r\n<p>Implement &amp; validate customer requirements for Novatel products.</p>\r\n<p>Develop all aspects of the device software, including device drivers, radio interfaces, power management and embedded applications.</p>\r\n<p>Support and debug issues pertaining to certifying NVTL data products through customer labs and certification processes.</p>\r\n<p>Required Knowledge: </p>\r\n<p>•    Solid knowledge of wireless technologies in 2G/3G/4G.  Must have 4 years experience working in any of those wireless technologies.</p>\r\n<p>•    Strong C, C++ programming skills in an embedded RTOS environment.  Must have 6 years coding experience in the embedded environment.</p>\r\n<p>•    Good knowledge of software development lifecycle.</p>\r\n<p>•    Excellent coding, documentation, and debugging practices.</p>\r\n<p>•    Worked with Lauterbach JTAG ICD/ICE.</p>\r\n<p>•    Must have ability to debug complex hardware/software interactions in an embedded RTOS environment working alongside hardware design team.</p>\r\n<p>Required Experience: </p>\r\n<p>6 years of experience working within embedded environment.</p>\r\n<p>Education: </p>\r\n<p>Requires BS/MS degree in EE/CE/CS disciplines.</p>\r\n<p>Compensation &amp; Benefits: Our successful candidate will be entitled to a compensation package commensurate with qualifications, experience and performance, plus a comprehensive benefits plan.</p>\r\n<p>How to Apply:</p>\r\n<p>Thank you for your interest on becoming part of our innovative, market leading wireless family.</p>\r\n<p>• Please select the “apply to” button on top of the page above the skills needed section.</p>\r\n<p>• Candidates that complete the technical questions (If listed) receive special priority.</p>\r\n<p>• Please feel free to apply for more than 1 position or refer a friend as we are always looking to build great teams.</p>'),(981,'<h2>Staff/Principal Firmware Engineer</h2>'),(982,'<p><a href=\"https://home.eease.adp.com/recruit/?id=2715611\">APPLY FOR STAFF/PRINCIPAL FIRMWARE ENGINEER</a></p>\r\n<p><span style=\"color: #000000;\"><em>The ideal candidate will have experience on 3GPP/LTE protocols and data stack</em></span></p>'),(983,'<p><strong>Posted On:</strong> Wednesday, 24 October 2012</p>'),(984,'<p><strong>Location:</strong> </p>'),(985,'<p><strong>Pay Rate:</strong> </p>'),(986,'<p><strong>Duration:</strong> </p>'),(987,'<p><strong>Travel:</strong> </p>'),(988,'<p><strong>Job Description:</strong> </p>\r\n<p>Novatel Wireless Highlights:</p>\r\n<p>Innovators- We are a global innovator in 3G &amp; 4G wireless mobility solutions. * 1st to market with EV-DO Rev-A product line * 1st USB wireless broadband in North America * 1st 3G wireless broadband router in Europe * Exciting LTE, M2M,