button on top of the page above the skills needed section.</p>\r\n<p>• Candidates that complete the technical questions (If listed) receive special priority.</p>\r\n<p>• Please feel free to apply for more than 1 position or refer a friend as we are always looking to build great teams.</p>'),(989,'<p><strong>Preferred Skills:</strong></p>\r\n<p> </p>'),(990,'<p><strong>Job Description:</strong> </p>\r\n<p style=\"padding-left: 30px;\">Novatel Wireless Highlights:</p>\r\n<p style=\"padding-left: 30px;\">Innovators- We are a global innovator in 3G &amp; 4G wireless mobility solutions. * 1st to market with EV-DO Rev-A product line * 1st USB wireless broadband in North America * 1st 3G wireless broadband router in Europe * Exciting LTE, M2M, Wimax, HSPA+ products Work/Life Balance- We hire passionate people and create great teams. Global- We have offices in San Diego (California), Calgary (Canada), Basingstoke, (United Kingdom), and Shanghai (China). Financially Secure- Novatel Wireless is cash strong with no debt; founded in 1996, IPO in 2000.</p>\r\n<p style=\"padding-left: 30px;\">This position may be filled at Staff or Principal level depending upon experience.</p>\r\n<p style=\"padding-left: 30px;\">Main Duties:</p>\r\n<p style=\"padding-left: 30px;\">Implement &amp; validate customer requirements for Novatel products.</p>\r\n<p style=\"padding-left: 30px;\">Develop all aspects of the device software, including device drivers, radio interfaces, power management and embedded applications.</p>\r\n<p style=\"padding-left: 30px;\">Support and debug issues pertaining to certifying NVTL data products through customer labs and certification processes.</p>\r\n<p style=\"padding-left: 30px;\">Required Knowledge: </p>\r\n<p style=\"padding-left: 30px;\">•    Solid knowledge of wireless technologies in 2G/3G/4G.  Must have 4 years experience working in any of those wireless technologies.</p>\r\n<p style=\"padding-left: 30px;\">•    Strong C, C++ programming skills in an embedded RTOS environment.  Must have 6 years coding experience in the embedded environment.</p>\r\n<p style=\"padding-left: 30px;\">•    Good knowledge of software development lifecycle.</p>\r\n<p style=\"padding-left: 30px;\">•    Excellent coding, documentation, and debugging practices.</p>\r\n<p style=\"padding-left: 30px;\">•    Worked with Lauterbach JTAG ICD/ICE.</p>\r\n<p style=\"padding-left: 30px;\">•    Must have ability to debug complex hardware/software interactions in an embedded RTOS environment working alongside hardware design team.</p>\r\n<p style=\"padding-left: 30px;\">Required Experience: </p>\r\n<p style=\"padding-left: 30px;\">6 years of experience working within embedded environment.</p>\r\n<p style=\"padding-left: 30px;\">Education: </p>\r\n<p style=\"padding-left: 30px;\">Requires BS/MS degree in EE/CE/CS disciplines.</p>\r\n<p style=\"padding-left: 30px;\">Compensation &amp; Benefits: Our successful candidate will be entitled to a compensation package commensurate with qualifications, experience and performance, plus a comprehensive benefits plan.</p>\r\n<p style=\"padding-left: 30px;\">How to Apply:</p>\r\n<p style=\"padding-left: 30px;\">Thank you for your interest on becoming part of our innovative, market leading wireless family.</p>\r\n<p style=\"padding-left: 30px;\">• Please select the “apply to” button on top of the page above the skills needed section.</p>\r\n<p style=\"padding-left: 30px;\">• Candidates that complete the technical questions (If listed) receive special priority.</p>\r\n<p style=\"padding-left: 30px;\">• Please feel free to apply for more than 1 position or refer a friend as we are always looking to build great teams.</p>'),(991,'<h2>Senior Mechanical Engineer (Contractor)</h2>'),(992,'<p><span style=\"color: #0000ee;\"><span style=\"text-decoration: underline;\">APPLY FOR SENIOR MECHANICAL ENGINEER (CONTRACT) POSITION</span></span></p>'),(993,'<p><strong>Posted On:</strong> Wednesday, 03 October 2012</p>'),(994,'<p><strong>Location: </strong>San Diego, California</p>'),(995,'<p><strong>Pay Rate:</strong> Direct Hire</p>'),(996,'<p><strong>Duration:</strong> </p>'),(997,'<p><strong>Travel:</strong> </p>'),(998,'<p><strong>Job Description:</strong> </p>\r\n<p style=\"padding-left: 30px;\"><strong>Novatel Wireless Highlights:</strong></p>\r\n<p style=\"padding-left: 30px;\">Innovators- We are a global innovator in 3G &amp; 4G wireless mobility solutions. * 1st to market with EV-DO Rev-A product line * 1st USB wireless broadband in North America * 1st 3G wireless broadband router in Europe * Exciting LTE, M2M, Wimax, HSPA+ products Work/Life Balance- We hire passionate people and create great teams. Global- We have offices in San Diego (California), Calgary (Canada), Basingstoke, (United Kingdom), and Shanghai (China). Financially Secure- Novatel Wireless is cash strong with no debt; founded in 1996, IPO in 2000.</p>\r\n<p style=\"padding-left: 30px;\"><strong>Main Job Duties:</strong> • Design plastic, metal and rubber parts for wireless data products. • Must have good written and communications skills to work with internal development teams, vendors and Contract Manufacturers both foreign and domestic.</p>\r\n<p style=\"padding-left: 30px;\">Required Knowledge: • Must be proficient in Pro Engineer Wildfire CAD tools and have a good fundamental understanding of RF shielding, antenna and surface mount technology concerns. • Must have working knowledge of injection molding mold construction and metal stamping tooling.</p>\r\n<p style=\"padding-left: 30px;\">Required Experience: • 5 years’ experience designing plastic, sheet metal and rubber parts for the telecommunication industry. • Must have at least 4 years on Pro Engineer Wildfire 2 or greater.</p>\r\n<p style=\"padding-left: 30px;\"><strong>Special Requirement:</strong> • Must be willing to travel to our factories in Korea and China and to meet with vendors worldwide. Expect to travel at least 3-4 times per year.</p>\r\n<p style=\"padding-left: 30px;\"><strong>Education:</strong> BSME with 5 years’ experience in telecommunications industry Compensation &amp; Benefits.</p>\r\n<p style=\"padding-left: 30px;\"><strong>Compensation &amp; Benefits:</strong> Our successful candidate will be entitled to a compensation package commensurate with qualifications, experience and performance, plus a comprehensive benefits plan.</p>\r\n<p style=\"padding-left: 30px;\"><strong>How to Apply:</strong> Thank you for your interest on becoming part of our innovative, market leading wireless family. • Please select the “apply to” button on top of the page above the skills needed section. • Candidates that complete the technical questions (If listed) receive special priority. • Please feel free to apply for more than 1 position or refer a friend as we are always looking to build great teams.</p>'),(999,'<p><strong>Preferred Skills:</strong></p>\r\n<p> </p>'),(1000,'<h2>Sourcing Manager</h2>'),(1001,'<p><a href=\"https://home.eease.adp.com/recruit/?id=2384551\">APPLY FOR SOURCING MANAGER POSITION</a></p>'),(1002,'<p><strong>Posted On:</strong> Thursday, 27 September 2012 </p>'),(1003,'<p><strong>Location: </strong>San Diego, California</p>'),(1004,'<p><strong>Pay Rate:</strong> </p>'),(1005,'<p><strong>Duration:</strong> </p>'),(1006,'<p><strong>Travel:</strong> </p>'),(1007,'<p><strong>Job Description:</strong> </p>\r\n<p style=\"padding-left: 30px;\"><strong>Sourcing Manager</strong></p>\r\n<p style=\"padding-left: 30px;\">Novatel Wireless seeks a Sourcing Manager to drive sourcing strategy &amp; processes for its business. Responsibilities include:</p>\r\n<p style=\"padding-left: 30px;\">Manage the company purchasing function and develops department policies, processes and procedures</p>\r\n<p style=\"padding-left: 30px;\">Drive acquisition cost reduction in all products/components</p>\r\n<p style=\"padding-left: 30px;\">Accepts and analyzes vendor bids and proposals</p>\r\n<p style=\"padding-left: 30px;\">Arranges vendor contracts and negotiates prices</p>\r\n<p style=\"padding-left: 30px;\">Coordinates activities with engineering, production, quality and other relevant functions</p>\r\n<p style=\"padding-left: 30px;\">Builds solid strategic relationships with suppliers</p>\r\n<p style=\"padding-left: 30px;\">Manage and negotiate strategic sourcing agreements and relationships</p>\r\n<p style=\"padding-left: 30px;\">Develop new strategic suppliers in categories previously untouched by company</p>\r\n<p style=\"padding-left: 30px;\">Achieve strategic goals and deliverables</p>\r\n<p style=\"padding-left: 30px;\">Develop, implement and manage strategic supplier-based projects</p>\r\n<p style=\"padding-left: 30px;\"><strong>Required Experience and Knowledge:</strong></p>\r\n<p style=\"padding-left: 30px;\">10+ years progressive experience in strategic sourcing/procurement</p>\r\n<p style=\"padding-left: 30px;\">Strong project management and organizational skills</p>\r\n<p style=\"padding-left: 30px;\">Exceptional negotiating skills and experience, and the capability and desire to train others in this strategic skill set</p>\r\n<p style=\"padding-left: 30px;\">Experience in establishing, communicating and managing Supplier Performance Metrics (cost/timeliness/quality)</p>\r\n<p style=\"padding-left: 30px;\">Domestic and international supplier relationship management experience including travel</p>\r\n<p style=\"padding-left: 30px;\">Proven ability to drive business results, knowledge/experience with cost saving metrics</p>\r\n<p style=\"padding-left: 30px;\">Education:  Bachelors Degree, (MBA or other graduate degree a plus) </p>\r\n<p style=\"padding-left: 30px;\"><strong>Who is Novatel Wireless?</strong></p>\r\n<p style=\"padding-left: 30px;\">Novatel Wireless is a global leader in developing innovative wireless data devices and applications for markets worldwide using advanced wireless networks such as LTE, UMTS, HSDPA, GSM, GPRS, CDMA, and EV-DO. We are a publicly traded company headquartered in San Diego, California.</p>\r\n<p style=\"padding-left: 30px;\">Innovators- We are a global innovator in 3G &amp; 4G wireless mobility solutions</p>\r\n<p style=\"padding-left: 30px;\">• 1st to market with the Mifi- personal wireless hotspot</p>\r\n<p style=\"padding-left: 30px;\">• 1st to market with EV-DO Rev-A product line</p>\r\n<p style=\"padding-left: 30px;\">• 1st USB wireless broadband in North America</p>\r\n<p style=\"padding-left: 30px;\">• 1st 3G wireless broadband router in Europe</p>\r\n<p style=\"padding-left: 30px;\">• Exciting LTE M2M Wimax HSPA+ products</p>\r\n<p style=\"padding-left: 30px;\">Work/Life Balance- We hire passionate people and create great teams.</p>\r\n<p style=\"padding-left: 30px;\">Global- We have offices in San Diego (California), Calgary (Canada), Basingstoke, (United Kingdom), and Shanghai (China).</p>\r\n<p style=\"padding-left: 30px;\">Financially Secure- Novatel Wireless is cash strong with no debt; founded in 1996, IPO in 2000.</p>\r\n<p style=\"padding-left: 30px;\"><strong>Compensation &amp; Benefits:</strong> Our successful candidate will be entitled to a compensation package commensurate with qualifications, experience and performance, plus a comprehensive benefits plan.</p>\r\n<p style=\"padding-left: 30px;\"><strong>How to Apply: </strong></p>\r\n<p style=\"padding-left: 30px;\">• Thank you for your interest on becoming part of our innovative, market leading wireless family. </p>\r\n<p style=\"padding-left: 30px;\">• Please select the apply to button at the top of this page. </p>\r\n<p style=\"padding-left: 30px;\">• Candidates that complete the pre-qualification questions receive special priority.</p>'),(1008,'<p><strong>Preferred Skills:</strong></p>\r\n<p> </p>'),(1009,'<p><strong>Job Type:</strong>  </p>'),(1020,'<h2>Accounts Payable Supervisor</h2>'),(1021,'<p><span style=\"color: #0000ee; text-decoration: underline;\"><a href=\"https://home.eease.adp.com/recruit/?id=2299031\">APPLY FOR ACCOUNTS PAYABLE SUPERVISOR</a></span></p>'),(1022,'<p><strong>Posted On:</strong> Thursday, 20 September 2012 </p>'),(1023,'<p><strong>Location:</strong> San Diego, California</p>'),(1024,'<p><strong>Job Type:</strong> Direct Hire</p>'),(1025,'<p><strong>Pay Rate:</strong> </p>'),(1026,'<p><strong>Duration:</strong> </p>'),(1027,'<p><strong>Travel:</strong> </p>'),(1028,'<p><strong>Job Description:</strong> </p>\r\n<p><strong>Novatel Wireless Highlights:</strong></p>\r\n<p>Innovators- We are a global innovator in 3G &amp; 4G wireless mobility solutions. * 1st to market with EV-DO Rev-A product line * 1st USB wireless broadband in North America * 1st 3G wireless broadband router in Europe * Exciting LTE M2M Wimax HSPA+ products Work/Life Balance- We hire passionate people and create great teams. Global- We have offices in San Diego (California) Calgary (Canada) Basingstoke (United Kingdom) and Shanghai (China). Financially Secure- Novatel Wireless is cash strong with no debt; founded in 1996 IPO in 2000.</p>\r\n<p><strong>Main Job Duties:</strong> Accounts Payable Supervisor is responsible for the overall management of the accounts payable operations including expense reporting, procedures and policies to improve the efficiency of the department. Review general ledger codings, accruals, account reconciliations and reports prepared by staff for accuracy, completeness and adherence to GAAP. Perform all month-end close duties including timely close of accounts payable system and working with accounting department to record accrued liabilities for invoices not yet received, prepare Month End A/P Accruals Review transactions for completeness, reasonability, and occurrence including expense reports, invoice entry, disbursements. Ensure strong internal and external audit support. Address transaction overflow and resource functions effectively. Manage two Analysts</p>'),(1029,'<p><strong>Preferred Skills:</strong></p>\r\n<p> </p>'),(1030,'<h2>Senior Buyer (Contract)</h2>'),(1031,'<p><a href=\"https://home.eease.adp.com/recruit/?id=2299071\">APPLY FOR SENIOR BUYER</a></p>'),(1032,'<p><strong>Posted On:</strong> Thursday, 20 September 2012 </p>'),(1033,'<p><strong>Location:</strong> San Diego, California</p>'),(1034,'<p><strong>Job Type:</strong> Contract</p>'),(1035,'<p><strong>Pay Rate:</strong> </p>'),(1036,'<p><strong>Duration: </strong>This is a 9 month contract assignment</p>\r\n<p> </p>'),(1037,'<p><strong>Travel:</strong> </p>'),(1038,'<p><strong>Job Description:</strong> </p>\r\n<p><strong>Novatel Wireless Highlights:</strong> </p>\r\n<p>Innovators- We are a global innovator in 3G &amp; 4G wireless mobility solutions. * 1st to market with EV-DO Rev-A product line * 1st USB wireless broadband in North America * 1st 3G wireless broadband router in Europe * Exciting LTE, M2M, Wimax, HSPA+ products Work/Life Balance- We hire passionate people and create great teams. Global- We have offices in San Diego (California), Calgary (Canada), Basingstoke, (United Kingdom), and Shanghai (China). Financially Secure- Novatel Wireless is cash strong with no debt; founded in 1996, IPO in 2000.</p>\r\n<p><strong>Job Description:</strong></p>\r\n<p>Main Job Duties: Sourcing lead for New Product Introduction programs. Also involved in new part/commodity sourcing, supplier qualification, price negotiations, RFQs, supplier management, supply agreements etc. Occasional MRO purchasing as well as Strategic and Tactical sourcing.</p>\r\n<p>Required Knowledge: - Purchasing fundamentals, as well as strategic Sourcing and NPI Purchasing - Working knowledge of ERP systems (Oracle a preferrred) - Proficient in MS business applications (Excel, Outlook, Word ...)</p>\r\n<p>Required Experience: - 5+ years purchasing experience in manufacturing environment (Electronics preferred) - Experience supporting NPI programs - International Sourcing experience a plus</p>\r\n<p>Education: BA/BS</p>\r\n<p>Compensation &amp; Benefits: Our successful candidate will be entitled to a compensation package commensurate with qualifications, experience and performance, plus a comprehensive benefits plan.</p>\r\n<p><strong>How to Apply:</strong> Thank you for your interest on becoming part of our innovative, market leading wireless family. • Please select the \"apply to\" button on top of the page above the skills needed section. • Candidates that complete the technical questions (If listed) receive special priority. • Please feel free to apply for more than 1 position or refer a friend as we are always looking to build great teams.</p>'),(1039,'<p><strong>Preferred Skills:</strong></p>\r\n<p> </p>'),(1040,'<p><strong>Duration: </strong>This is a 9 month contract assignment</p>'),(1041,'<h2><span style=\"font-size: 15px;\">Senior Product Manager</span></h2>'),(1042,'<p><span style=\"color: #0000ee; text-decoration: underline;\"><a href=\"https://home.eease.adp.com/recruit/?id=2223531\">APPLY FOR SENIOR PRODUCT MANAGER</a></span></p>'),(1043,'<p><strong>Posted On:</strong> Friday, 14 September 2012 </p>'),(1044,'<p><strong>Location:</strong> San Diego, California</p>'),(1045,'<p><strong>Job Type:</strong> Direct Hire</p>'),(1046,'<p><strong>Pay Rate:</strong>  </p>'),(1047,'<p><strong>Duration:</strong>  </p>'),(1048,'<p><strong>Travel:</strong>  </p>'),(1049,'<p><strong>Job Description:</strong> </p>\r\n<p> </p>\r\n<p><strong>Novatel Wireless Highlights:</strong></p>\r\n<p>Innovators- We are a global innovator in 3G &amp; 4G wireless mobility solutions. * 1st to market with EV-DO Rev-A product line * 1st USB wireless broadband in North America * 1st 3G wireless broadband router in Europe * Exciting LTE, M2M, Wimax, HSPA+ products Work/Life Balance- We hire passionate people and create great teams. Global- We have offices in San Diego (California), Calgary (Canada), Basingstoke, (United Kingdom), and Shanghai (China). Financially Secure- Novatel Wireless is cash strong with no debt; founded in 1996, IPO in 2000.</p>\r\n<p>RESPONSIBILITIES In this position you will be responsible for managing the life cycle of an assigned product segment for Novatel Wireless. Goas are to increase revenue, gross margin and market share, while improving customer satisfaction and loyalty. The Senior Product Manager provides market, product and technology vision to the day-to-day execution of Novatel Wireless’ product decisions.</p>\r\n<p>Other responsibilities include: • Performing Market Research and Maintaining a good understanding of the business and consumer data services market • Defining, documenting and implementing new products and features • Revenue, gross margin, net margin, reporting and P&amp;L business analysis • Championing product across the organization and getting buy-in from executive team • Creation of pricing models • Creation of marketing collateral content • Cross-functional lead for product development efforts • Managing the introduction and life cycle of assigned Novatel wireless products. • Assisting in development of the Novatel Wireless product roadmap. Apply a thorough understanding of competition in setting product strategies. • Product documentation and coordinating development of product collateral. • Establishing revenue forecasts and margin criteria for assigned products and create financial models to establish Product business case, gross margin levels and ROI.</p>\r\n<p>RESPONSIBILITIES In this position you will be responsible for managing the life cycle of an assigned product segment for Novatel Wireless. Goas are to increase revenue, gross margin and market share, while improving customer satisfaction and loyalty. The Senior Product Manager provides market, product and technology vision to the day-to-day execution of Novatel Wireless’ product decisions.</p>\r\n<p>Other responsibilities include: • Performing Market Research and Maintaining a good understanding of the business and consumer data services market • Defining, documenting and implementing new products and features • Revenue, gross margin, net margin, reporting and P&amp;L business analysis • Championing product across the organization and getting buy-in from executive team • Creation of pricing models • Creation of marketing collateral content • Cross-functional lead for product development efforts • Managing the introduction and life cycle of assigned Novatel wireless products. • Assisting in development of the Novatel Wireless product roadmap. Apply a thorough understanding of competition in setting product strategies. • Product documentation and coordinating development of product collateral. • Establishing revenue forecasts and margin criteria for assigned products and create financial models to establish Product business case, gross margin levels and ROI.</p>\r\n<p> </p>'),(1050,'<p><strong>Preferred Skills:</strong></p>\r\n<p>Leadership qualities, vision and the ability to work independently in an exciting fast paced environment • Strong analytic skills • Superior written and verbal communication skills • Demonstrated track record of relevant achievement • Proficiency and experience at managing several projects simultaneously • Prior experience working for a wireless data provider • Good understanding of HSPA and EVDO technologies plus knowledge of telecom competitive landscape. • Bachelor’s degree, MBA and 7 + years experience in a product management or marketing role within a telecommunications or related technology company. • Must have an understanding of current and emerging technologies. • Knowledge of data communications technologies is essential. • Must be detail-oriented and possess exceptional organizational and time management skills.</p>'),(1051,'<p><strong>Job Description:</strong>  </p>\r\n<p><strong>Novatel Wireless Highlights:</strong></p>\r\n<p>Innovators- We are a global innovator in 3G &amp; 4G wireless mobility solutions. * 1st to market with EV-DO Rev-A product line * 1st USB wireless broadband in North America * 1st 3G wireless broadband router in Europe * Exciting LTE, M2M, Wimax, HSPA+ products Work/Life Balance- We hire passionate people and create great teams. Global- We have offices in San Diego (California), Calgary (Canada), Basingstoke, (United Kingdom), and Shanghai (China). Financially Secure- Novatel Wireless is cash strong with no debt; founded in 1996, IPO in 2000.</p>\r\n<p>RESPONSIBILITIES In this position you will be responsible for managing the life cycle of an assigned product segment for Novatel Wireless. Goas are to increase revenue, gross margin and market share, while improving customer satisfaction and loyalty. The Senior Product Manager provides market, product and technology vision to the day-to-day execution of Novatel Wireless’ product decisions.</p>\r\n<p>Other responsibilities include: • Performing Market Research and Maintaining a good understanding of the business and consumer data services market • Defining, documenting and implementing new products and features • Revenue, gross margin, net margin, reporting and P&amp;L business analysis • Championing product across the organization and getting buy-in from executive team • Creation of pricing models • Creation of marketing collateral content • Cross-functional lead for product development efforts • Managing the introduction and life cycle of assigned Novatel wireless products. • Assisting in development of the Novatel Wireless product roadmap. Apply a thorough understanding of competition in setting product strategies. • Product documentation and coordinating development of product collateral. • Establishing revenue forecasts and margin criteria for assigned products and create financial models to establish Product business case, gross margin levels and ROI.</p>\r\n<p>RESPONSIBILITIES In this position you will be responsible for managing the life cycle of an assigned product segment for Novatel Wireless. Goas are to increase revenue, gross margin and market share, while improving customer satisfaction and loyalty. The Senior Product Manager provides market, product and technology vision to the day-to-day execution of Novatel Wireless’ product decisions.</p>\r\n<p>Other responsibilities include: • Performing Market Research and Maintaining a good understanding of the business and consumer data services market • Defining, documenting and implementing new products and features • Revenue, gross margin, net margin, reporting and P&amp;L business analysis • Championing product across the organization and getting buy-in from executive team • Creation of pricing models • Creation of marketing collateral content • Cross-functional lead for product development efforts • Managing the introduction and life cycle of assigned Novatel wireless products. • Assisting in development of the Novatel Wireless product roadmap. Apply a thorough understanding of competition in setting product strategies. • Product documentation and coordinating development of product collateral. • Establishing revenue forecasts and margin criteria for assigned products and create financial models to establish Product business case, gross margin levels and ROI.</p>\r\n<p> </p>'),(1052,'<h2>Principal Engineer/System Architect (Networking)</h2>'),(1053,'<p><a href=\"https://home.eease.adp.com/recruit/?id=1661981\">APPLY FOR PRINCIPAL ENGINEER/SYSTEM ARCHITECT (NETWORKING)</a></p>'),(1054,'<p><strong>Posted On:</strong> Thursday, 19 July 2012 </p>'),(1055,'<p><strong>Location:</strong> San Diego, California</p>'),(1056,'<p><strong>Job Type:</strong> Direct Hire</p>'),(1057,'<p><strong>Pay Rate:</strong>  </p>'),(1058,'<p><strong>Duration:</strong> Full-Time </p>'),(1059,'<p><strong>Travel:</strong>  </p>'),(1060,'<p><strong>Job Description:</strong> </p>\r\n<p>I<strong>nternal Job Description:</strong> Principal Engineer/System Architect (Networking)</p>\r\n<p>• Leading the system architecture (software) of next generation mobile hotspot devices</p>\r\n<p>• Leading IP development and module designs working with a group of software developers or individuals </p>\r\n<p>• Driving LOE and technical requirement documents (TRD) for software components </p>\r\n<p>• Participate in code development/code review/ debugging/ testing/release processes</p>\r\n<p>• Tracking project progress, keeping work on track, meeting deadlines</p>\r\n<p>• Interacting with product marketing, external parties to make architectural decisions. </p>\r\n<p>• Reporting status/progress/issues to management on regular basis. </p>\r\n<p><strong>Required Experience and Knowledge: </strong></p>\r\n<p>• 12+ years experience as architect, designer and/or developer of networking products and system software </p>\r\n<p>• Technically strong in the areas such as networking protocols, power management, and system optimization</p>\r\n<p>• In-depth knowledge and hands on experience on embedded software development </p>\r\n<p>• Good knowledge on consumer products and user experience </p>\r\n<p>• Fluency in C programming language. Others such as C++, Java, Perl or scripting languages are plus. </p>\r\n<p>• Familiar with product certification process and requirements. </p>\r\n<p>Education:  MS in EE, Computer Science or similar fields. </p>\r\n<p><strong>Who is Novatel Wireless?</strong></p>\r\n<p>Novatel Wireless is a global leader in developing innovative wireless data devices and applications for markets worldwide using advanced wireless networks such as LTE, UMTS, HSDPA, GSM, GPRS, CDMA, and EV-DO. We are a publicly traded company headquartered in San Diego, California.</p>\r\n<p>Innovators- We are a global innovator in 3G &amp; 4G wireless mobility solutions</p>\r\n<p>• 1st to market with the Mifi- personal wireless hotspot</p>\r\n<p>• 1st to market with EV-DO Rev-A product line</p>\r\n<p>• 1st USB wireless broadband in North America</p>\r\n<p>• 1st 3G wireless broadband router in Europe</p>\r\n<p>• Exciting LTE M2M Wimax HSPA+ products</p>\r\n<p>Work/Life Balance- We hire passionate people and create great teams.</p>\r\n<p>Global- We have offices in San Diego (California), Calgary (Canada), Basingstoke, (United Kingdom), and Shanghai (China).</p>\r\n<p>Financially Secure- Novatel Wireless is cash strong with no debt; founded in 1996, IPO in 2000.</p>\r\n<p>Compensation &amp; Benefits: Our successful candidate will be entitled to a compensation package commensurate with qualifications, experience and performance, plus a comprehensive benefits plan.</p>\r\n<p><strong>How to Apply:</strong> </p>\r\n<p>• Thank you for your interest on becoming part of our innovative, market leading wireless family. </p>\r\n<p>• Please select the apply to button at the top of this page. </p>\r\n<p>• Candidates that complete the pre-qualification questions receive special priority.</p>'),(1061,'<p><strong>Preferred Skills:</strong></p>\r\n<p> </p>'),(1062,'<p><strong>Job Description:</strong> </p>\r\n<p><strong>Internal Job Description:</strong> Principal Engineer/System Architect (Networking)</p>\r\n<p>• Leading the system architecture (software) of next generation mobile hotspot devices</p>\r\n<p>• Leading IP development and module designs working with a group of software developers or individuals </p>\r\n<p>• Driving LOE and technical requirement documents (TRD) for software components </p>\r\n<p>• Participate in code development/code review/ debugging/ testing/release processes</p>\r\n<p>• Tracking project progress, keeping work on track, meeting deadlines</p>\r\n<p>• Interacting with product marketing, external parties to make architectural decisions. </p>\r\n<p>• Reporting status/progress/issues to management on regular basis. </p>\r\n<p><strong>Required Experience and Knowledge: </strong></p>\r\n<p>• 12+ years experience as architect, designer and/or developer of networking products and system software </p>\r\n<p>• Technically strong in the areas such as networking protocols, power management, and system optimization</p>\r\n<p>• In-depth knowledge and hands on experience on embedded software development </p>\r\n<p>• Good knowledge on consumer products and user experience </p>\r\n<p>• Fluency in C programming language. Others such as C++, Java, Perl or scripting languages are plus. </p>\r\n<p>• Familiar with product certification process and requirements. </p>\r\n<p>Education:  MS in EE, Computer Science or similar fields. </p>\r\n<p><strong>Who is Novatel Wireless?</strong></p>\r\n<p>Novatel Wireless is a global leader in developing innovative wireless data devices and applications for markets worldwide using advanced wireless networks such as LTE, UMTS, HSDPA, GSM, GPRS, CDMA, and EV-DO. We are a publicly traded company headquartered in San Diego, California.</p>\r\n<p>Innovators- We are a global innovator in 3G &amp; 4G wireless mobility solutions</p>\r\n<p>• 1st to market with the Mifi- personal wireless hotspot</p>\r\n<p>• 1st to market with EV-DO Rev-A product line</p>\r\n<p>• 1st USB wireless broadband in North America</p>\r\n<p>• 1st 3G wireless broadband router in Europe</p>\r\n<p>• Exciting LTE M2M Wimax HSPA+ products</p>\r\n<p>Work/Life Balance- We hire passionate people and create great teams.</p>\r\n<p>Global- We have offices in San Diego (California), Calgary (Canada), Basingstoke, (United Kingdom), and Shanghai (China).</p>\r\n<p>Financially Secure- Novatel Wireless is cash strong with no debt; founded in 1996, IPO in 2000.</p>\r\n<p>Compensation &amp; Benefits: Our successful candidate will be entitled to a compensation package commensurate with qualifications, experience and performance, plus a comprehensive benefits plan.</p>\r\n<p><strong>How to Apply:</strong> </p>\r\n<p>• Thank you for your interest on becoming part of our innovative, market leading wireless family. </p>\r\n<p>• Please select the apply to button at the top of this page. </p>\r\n<p>• Candidates that complete the pre-qualification questions receive special priority.</p>'),(1088,'<p><a title=\"Where To Buy\" href=\"{CCM:CID_244}\">Where to Buy</a>   |   <a title=\"Contact Us\" href=\"{CCM:CID_174}\">Contact Us</a>    </p>'),(1089,'<h1>About Novatel Wireless</h1>\r\n<p>Novatel Wireless, Inc. is a leader in the design and development of intelligent wireless solutions based on 2G, 3G, and 4G technologies providing wireless connectivity.</p>'),(1097,'<h2>Contact Novatel Corporate Headquarters</h2>\r\n<p><strong>Novatel Wireless Inc</strong></p>\r\n<p style=\"padding-left: 30px;\"><strong>Address:</strong></p>\r\n<p style=\"padding-left: 30px;\">9645 Scranton Road<br />Suite #205<br />San Diego, California USA 92121</p>\r\n<p style=\"padding-left: 30px;\"><strong>Email:</strong> info@nvtl.com<br /><strong>Telephone</strong>: +1 858.812.3400 / Toll Free: +1 888.888.9231<br /><strong>Fax:</strong> +1 858.812.3402</p>'),(1099,'<h2>Calgary Office</h2>\r\n<p><strong>Address:</strong></p>\r\n<p>6715 8th Street N.E. Suite 200<br />Calgary, Alberta, Canada<br />T2E 7H7</p>\r\n<p><strong>Telephone:</strong> +1 403.295.4800 / Toll Free: +1 888.888.9231</p>\r\n<p><strong>Fax:</strong> +1 403.295.4801</p>'),(1103,'<h2>Novatel Corporate Headquarters</h2>\r\n<p><strong>Novatel Wireless Inc</strong></p>\r\n<p style=\"padding-left: 30px;\"><strong>Address:</strong></p>\r\n<p style=\"padding-left: 30px;\">9645 Scranton Road<br />Suite #205<br />San Diego, California USA 92121</p>\r\n<p style=\"padding-left: 30px;\"><strong>Email:</strong> info@nvtl.com<br /><strong>Telephone</strong>: +1 858.812.3400 / Toll Free: +1 888.888.9231<br /><strong>Fax:</strong> +1 858.812.3402</p>'),(1104,'<h2>Calgary Office</h2>\r\n<p style=\"padding-left: 30px;\"><strong>Address:</strong></p>\r\n<p style=\"padding-left: 30px;\">6715 8th Street N.E. Suite 200<br />Calgary, Alberta, Canada<br />T2E 7H7</p>\r\n<p style=\"padding-left: 30px;\"><strong>Telephone:</strong> +1 403.295.4800 / Toll Free: +1 888.888.9231</p>\r\n<p style=\"padding-left: 30px;\"><strong>Fax:</strong> +1 403.295.4801</p>'),(1105,'<h2>Europe, Middle East, Africa, Southern Asia, Australia and New Zealand Headquarters</h2>\r\n<p style=\"padd