 and 3G Low Power platforms deliver small size and industry-leading high performance, driving the essential capabilities, mobile connectivity and device intelligence needed for today\'s demanding design-in and OEM markets.</span></p>\r\n<p><span style=\"font-size: 11px;\">The Enabler III and HS 1000 platforms are part of Enfora\'s intelligent device offerings and feature superior performance in a small package with ultimate flexibility. Coupled with the robust N4A Communications &amp;#x0026; Management platform, devices can be provisioned, monitored and reconfigured remotely, most anywhere in the world. Driven by the services architecture, Enfora delivers flexible, modular architecture for development and deployment.</span></p>\r\n<p><span style=\"font-size: 11px;\">The architecture helps make it simple, but if you have a special design challenge or just want help getting past a small design issue, contact our design services team for assistance. No project is too small or too large. We have assisted many of today\'s global 1000 companies with innovative designs, engineering assistance and creative ways to connect you &amp;#x2014; Anywhere, Anytime.</span></p>\r\n<p><span style=\"font-size: 11px;\">With the architecture, custom branding, distinctive designs, and innovative ideas become reality.</span></p>\r\n<div> </div>'),(1158,'<h1><span style=\"font-size: 11px; background-color: #ffffff;\">OEM Mobile Computing</span></h1>\r\n<p><span style=\"font-size: 11px;\">The pace of change and technology advances in today\'s world is nothing short of astounding. To be and remain competitive — to survive — companies must constantly innovate, create, design, manufacture and deploy new and better products. The architecture gets you there more rapidly, securely and with connection reliability unsurpassed in the industry.</span></p>\r\n<p><span style=\"font-size: 11px;\"><br /></span></p>\r\n<p><span style=\"font-size: 11px;\">The Anywhere, Anytime experience is driving a profou