transmission, empowering today’s connected care network, delivering connected health — most Anywhere, Anytime. Intelligent end-point devices and embedded communications platforms ensure fast reliable connectivity throughout the global infrastructure, delivering the time and operational-sensitive data for life-critical healthcare decisions.</span></p>\r\n<p><span style=\"font-size: 11px;\"><img style=\"float: left; margin-left: 15px; margin-right: 15px;\" src=\"{CCM:FID_132}\" alt=\"NVTL_Solutions_teleheatlh.png\" width=\"258\" height=\"172\" />With simple Data-Pipe technology to high-speed backhaul embedded platforms, Enfora is empowering remote monitoring device manufacturers of all sizes with resilient, high-speed, reliable end-point, wireless connectivity solutions. Driven by the N4A Services Architecture, Enfora delivers a flexible, modular architecture through its innovative and award-winning Enabler III andEnabler HS 1000 embedded platforms – delivering high-performance wireless connectivity and rapid solutions deployment. </span></p>\r\n<p><span style=\"font-size: 11px;\">Mission-critical infrastructures can be efficiently managed and high-value assets can be located and leveraged using real-time location services. Enfora and its strategic partners deliver the data for better decision-making, improving performance in your connected devices — driving critical data for clinicians and patients. </span></p>\r\n<p><span style=\"font-size: 11px;\">Coupled with the robust N4A Communications and Management platform, devices can be provisioned, monitored and reconfigured remotely, most anywhere in the world. Connected Telehealth — Anywhere, Anytime. </span></p>'),(1178,'<h2>The Connected Home</h2>\r\n<p><span style=\"font-size: 11px;\">From security panels to securing personal assets, energy-saving and green initiatives to connected Personal Area Networks (PANs), Enfora delivers exceptional wireless connectivity with the industry’s leading high performance communications platforms. Enabling real-time data for security and applications including alarm panels, intelligent locks, home monitoring devices and the latest in energy-saving PAN devices and high-speed routers, Enfora’s Enabler III and Enabler HS 1000 series of modules, deliver.</span></p>\r\n<p><span style=\"font-size: 11px;\"><img style=\"float: left; margin-left: 15px; margin-right: 15px;\" src=\"{CCM:FID_137}\" alt=\"NVTL_Solutions_ConnectedHome.png\" width=\"258\" height=\"172\" />With simple integrated devices and a host of embedded platforms — Enfora is empowering the connected home with resilient, high-speed, scalable, and reliable end-point connectivity solutions. Driven by the N4A Services Architecture, Enfora delivers a flexible, modular architecture capable of interfacing with ZigBee, Bluetooth and other near field technologies for fast wireless connectivity and solutions deployment. </span></p>\r\n<p><span style=\"font-size: 11px;\">Home Automation systems have been transformed with the N4A family of intelligent devices, from the Enabler III and HS embedded platforms to the family of SA Telemetry devices purpose-built for the time-sensitive data needed in the security and home automation markets.</span></p>\r\n<p><span style=\"font-size: 11px;\">With intelligent backhaul communications through smart meters or residential gateways, information can be efficiently managed to effectively decrease energy usage. Enfora and its strategic partners deliver the data for better decision-making, improving performance safety and security for your treasured assets.</span></p>\r\n<p><span style=\"font-size: 11px;\">Coupled with the robust N4A Communications and Management platform, devices can be provisioned, monitored and reconfigured remotely, most anywhere in the world. The Connected Home — Empowered Anywhere, Anytime. </span></p>'),(1181,'<h2>Telemetry</h2>\r\n<p><span style=\"font-size: 11px;\">From the oil pipeline to the soft drink dispenser, today’s visionary companies rely on remote data communications to collect data from their remote assets, enhancing their bottom line by allowing their business to operate more efficiently through the management and utilization of critical, decision-based data. This certified, quad-band integrated IP-based platform is compact and economical, ensuring cost-effective connectivity in a small robust platform. </span></p>\r\n<p><span style=\"font-size: 11px;\">Designed with GSM/GPRS connectivity for global deployments, the SA family has been designed to enhance your visibility into remotely-located fixed assets. Similar to Enfora’s industry-leading portfolio of integrated Mobile Tracking products, the SA family connects the world’s leading companies to their fixed assets, Anywhere, Anytime. </span></p>\r\n<p><span style=\"font-size: 11px;\"><img style=\"float: left; margin-left: 15px; margin-right: 15px;\" src=\"{CCM:FID_133}\" alt=\"NVTL_Solutions_Telemetry.png\" width=\"258\" height=\"172\" />Fixed assets of various types can benefit greatly from this fully programmable platform, with voice communications, a wide operational environment and much more. the units are designed to be easily deployed and provisioned, supplying critical information from industrial automation applications, supply and cold chain environments, fixed asset deployments, and a host of applications where companies require connectivity to serially-connected and sensor-generated data. </span></p>\r\n<p><span style=\"font-size: 11px;\">The SA family is part of Enfora’s intelligent telemetry devices, featuring superior performance in a small package for ultimate flexibility. Coupled with the robust N4A Management and Communications Software platform, devices can be provisioned, monitored and reconfigured remotely, most anywhere in the world. Driven by the services architecture, Enfora delivers a flexible, modular architecture for fast wireless asset tracking, solutions development and deployment. Keeping you connected to your company’s fixed and mobile assets, Anywhere, Anytime.</span></p>\r\n<p><span style=\"font-size: 11px;\">Popular Use Cases for the Spider SA family:</span></p>\r\n<p><span style=\"font-size: 11px;\">Spider SA-G+ - the SA-G+ is a full-featured telemetry platform with serial and user-defined I/O ports designed to communicate with sensors and most any serial-based communications device.</span></p>'),(1182,'<h2>Telemetry</h2>\r\n<p><span style=\"font-size: 11px;\">From the oil pipeline to the soft drink dispenser, today’s visionary companies rely on remote data communications to collect data from their remote assets, enhancing their bottom line by allowing their business to operate more efficiently through the management and utilization of critical, decision-based data. This certified, quad-band integrated IP-based platform is compact and economical, ensuring cost-effective connectivity in a small robust platform. </span></p>\r\n<p><span style=\"font-size: 11px;\">Designed with GSM/GPRS connectivity for global deployments, the SA family has been designed to enhance your visibility into remotely-located fixed assets. Similar to Enfora’s industry-leading portfolio of integrated Mobile Tracking products, the SA family connects the world’s leading companies to their fixed assets, Anywhere, Anytime. </span></p>\r\n<p><span style=\"font-size: 11px;\"><img style=\"float: left; margin-left: 15px; margin-right: 15px;\" src=\"{CCM:FID_133}\" alt=\"NVTL_Solutions_Telemetry.png\" width=\"258\" height=\"172\" />Fixed assets of various types can benefit greatly from this fully programmable platform, with voice communications, a wide operational environment and much more. the units are designed to be easily deployed and provisioned, supplying critical information from industrial automation applications, supply and cold chain environments, fixed asset deployments, and a host of applications where companies require connectivity to serially-connected and sensor-generated data. </span></p>\r\n<p><span style=\"font-size: 11px;\">The SA family is part of Enfora’s intelligent telemetry devices, featuring superior performance in a small package for ultimate flexibility. Coupled with the robust N4A Management and Communications Software platform, devices can be provisioned, monitored and reconfigured remotely, most anywhere in the world. Driven by the services architecture, Enfora delivers a flexible, modular architecture for fast wireless asset tracking, solutions development and deployment. Keeping you connected to your company’s fixed and mobile assets, Anywhere, Anytime.</span></p>\r\n<h4><span style=\"font-size: 11px;\">Popular Use Cases for the Spider SA family:</span></h4>\r\n<p><span style=\"font-size: 11px;\">Spider SA-G+ - the SA-G+ is a full-featured telemetry platform with serial and user-defined I/O ports designed to communicate with sensors and most any serial-based communications device.</span></p>'),(1192,'<h1>Consumer Devices</h1>\r\n<p> </p>'),(1193,'<h3><a title=\"Consumer Devices\" href=\"{CCM:CID_175}\">Consumer Devices</a></h3>\r\n<p>The pace of change and technology advances in today\'s world is nothing short of astounding. To be and remain competitive — to survive — companies must constantly innovate, create, design, manufacture and deploy new and better products. The architecture gets you there more rapidly, securely and with connection reliability unsurpassed in the industry.</p>\r\n<hr />\r\n<h3><a title=\"Consumer Devices\" href=\"{CCM:CID_175}\">Consumer Devices</a></h3>\r\n<p>The pace of change and technology advances in today\'s world is nothing short of astounding. To be and remain competitive — to survive — companies must constantly innovate, create, design, manufacture and deploy new and better products. The architecture gets you there more rapidly, securely and with connection reliability unsurpassed in the industry.</p>\r\n<hr />\r\n<h3><a title=\"Consumer Devices\" href=\"{CCM:CID_175}\">Consumer Devices</a></h3>\r\n<p>