</a></p>'),(1245,'<p><strong>Legacy of Innovation</strong></p>\r\n<p>Fixed or mobile, a myriad of assets need to be monitored for regulatory compliance, security, national defense, operational efficiencies or just peace of mind. Whether you are monitoring a Hazmat shipment on a truck or railroad car, the location of a construction trailer, a shipping container, ATM machine, refrigeration unit, air conditioning compressor or any other powered valuable asset, the AT 4000 is the right solution.</p>\r\n<p>Designed for the intelligent monitoring of powered mobile and fixed assets the AT 4000 is easily installed and managed. The AT 4000 is provisioned through the N4A™ Communications &amp; Management platform and can be configured to optimize motion detection, location monitoring, reporting and geo-fence settings, all of which will help match battery life and service availability to the application.</p>\r\n<p> </p>'),(1247,'<p><img src=\"{CCM:FID_75}\" alt=\"pdf_icon.png\" width=\"13\" height=\"13\" /> <a href=\"{CCM:FID_DL_140}\">SA-G_WEB.pdf</a></p>'),(1249,'<p><img src=\"{CCM:FID_75}\" alt=\"pdf_icon.png\" width=\"13\" height=\"13\" /> <a href=\"{CCM:FID_DL_145}\">Mini_MT_WEB.pdf</a></p>'),(1250,'<h3><a title=\"Security\" href=\"{CCM:CID_217}\">Security</a></h3>\r\n<h5>Enfora delivers exceptional connectivity with the industry\'s leading high performance communications platforms. Enabling real-time data for security applications including alarm panels, intelligent locks, asset monitoring devices and the latest in high-speed video capture and transmission.</h5>\r\n<hr />\r\n<h3><a title=\"Telehealth/Medical\" href=\"{CCM:CID_218}\">Telehealth / Medical</a></h3>\r\n<h5>Connecting the latest in remote healthcare products and services: from the simple glucose meter with an embedded communications module to a blood pressure monitor and much more. Today’s healthcare delivery network demands reliable communications services; no matter the modality, no matter the location.</h5>\r\n<hr />\r\n<h3><a title=\"Connected Home\" href=\"{CCM:CID_240}\">Connected Home</a></h3>\r\n<h5>From the oil pipeline to the soft drink dispenser, today’s visionary companies rely on remote data communications to collect data from their remote assets, enhancing their bottom line by allowing their business to operate more efficiently through the management and utilization of critical, decision-based data. This certified, quad-band integrated IP-based platform is compact and economical, ensuring cost-effective connectivity in a small robust platform. </h5>\r\n<hr />\r\n<h3><a title=\"Telemetry\" href=\"{CCM:CID_241}\">Telemetry</a></h3>\r\n<h5>From the oil pipeline to the soft drink dispenser, today’s visionary companies rely on remote data communications to collect data from their remote assets, enhancing their bottom line by allowing their business to operate more efficiently through the management and utilization of critical, decision-based data. This certified, quad-band integrated IP-based platform is compact and economical, ensuring cost-effective connectivity in a small robust platform. </h5>\r\n<hr />\r\n<h5> </h5>'),(1251,'<h3><a title=\"Consumer Devices\" href=\"{CCM:CID_175}\">Consumer Devices</a></h3>\r\n<h5>Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur.</h5>\r\n<hr />\r\n<h3><a title=\"OEM Mobile Computing\" href=\"{CCM:CID_176}\">OEM Mobile Computing</a></h3>\r\n<h5>The pace of change and technology advances in today\'s world is nothing short of astounding. To be and remain competitive — to survive — companies must constantly innovate, create, design, manufacture and deploy new and better products. The architecture gets you there more rapidly, securely and with connection reliability unsurpassed in the industry.</h5>\r\n<hr />\r\n<h3><a title=\"Transportation\" href=\"{CCM:CID_177}\">Transportation</a></h3>\r\n<h5>Enfora pioneered resilient, high-speed, reliable end-point connectivity solutions for the transportation marketplace. Whether you\'re traveling the open road, meeting an on-time delivery or watching your child drive off to school, Enfora\'s innovation empowers you over the highway, on the rail and most anywhere, anytime in the supply chain.</h5>\r\n<hr />\r\n<h5> </h5>\r\n<h3><a title=\"Industrial Automation\" href=\"{CCM:CID_216}\">Industrial Automation</a></h3>\r\n<h5>Enfora pioneered resilient, high-speed, reliable end-point connectivity solutions for the transportation marketplace. Whether you\'re traveling the open road, meeting an on-time delivery or watching your child drive off to school, Enfora\'s innovation empowers you over the highway, on the rail and most anywhere, anytime in the supply chain.</h5>\r\n<hr />\r\n<p> </p>'),(1252,'<h3><a title=\"Security\" href=\"{CCM:CID_217}\">Security</a></h3>\r\n<h5>Enfora delivers exceptional connectivity with the industry\'s leading high performance communications platforms. Enabling real-time data for security applications including alarm panels, intelligent locks, asset monitoring devices and the latest in high-speed video capture and transmission.</h5>\r\n<hr />\r\n<h3><a title=\"Telehealth/Medical\" href=\"{CCM:CID_218}\">Telehealth / Medical</a></h3>\r\n<h5>Connecting the latest in remote healthcare products and services: from the simple glucose meter with an embedded communications module to a blood pressure monitor and much more. Today’s healthcare delivery network demands reliable communications services; no matter the modality, no matter the location.<br /> </h5>\r\n<hr />\r\n<h3><a title=\"Connected Home\" href=\"{CCM:CID_240}\">Connected Home</a></h3>\r\n<h5>From the oil pipeline to the soft drink dispenser, today’s visionary companies rely on remote data communications to co