ts</li>\r\n<li>Refrigeration Units</li>\r\n<li>Powered Assets</li>\r\n</ul>\r\n<div> </div>'),(1286,'<ul>\r\n<li>Wireless POS Terminal</li>\r\n<li>Safety &amp; Security</li>\r\n<li>Vending Machines</li>\r\n<li>Public Traffic  Services</li>\r\n<li>Gauge Monitoring (light, water, telephone)</li>\r\n<li>Remote Monitoring Automation and Control (RMAC)</li>\r\n<li>Industrial/SCADA</li>\r\n<li>Service/Maintenance (gas fields/chemical plants/water)</li>\r\n<li>Kiosks, Billboards (Public Service, other)</li>\r\n<li>Parking Meters</li>\r\n<li>Electricity Tower Monitoring</li>\r\n</ul>'),(1287,'<p class=\"t1\">With its compact design and low power consumption, the SA-G+ is an ideal device to connect remote assets requiring low data throughput to the cloud via advanced monitoring to the business enterprise.</p>'),(1289,'<ul>\r\n<li>Personal &amp; Remote Worker Tracking</li>\r\n<li>Emergency Response</li>\r\n<li>Child &amp; Teen Tracking</li>\r\n<li>Elderly Locator</li>\r\n<li>Mobile/Home Healthcare</li>\r\n</ul>\r\n<p> </p>'),(1291,'<p><img src=\"{CCM:FID_75}\" alt=\"pdf_icon.png\" width=\"13\" height=\"13\" /> <a href=\"{CCM:FID_DL_161}\">mifi_liberate_datasheet.pdf</a></p>'),(1294,'<p><img src=\"{CCM:FID_75}\" alt=\"pdf_icon.png\" width=\"13\" height=\"13\" /> <a href=\"{CCM:FID_DL_159}\">mifi_4620l_vzw_datasheet.pdf</a></p>'),(1296,'<p><img src=\"{CCM:FID_75}\" alt=\"pdf_icon.png\" width=\"13\" height=\"13\" /> <a href=\"{CCM:FID_DL_158}\">MiFi4510NVTLDatasheetRev2.pdf</a></p>'),(1301,'<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</p>'),(1302,'<h4>Cell Based Location (CBL)</h4>'),(1307,'<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</p>'),(1308,'<h4>Device Manager</h4>'),(1309,'<p style=\"margin: 0px 0px 10px; color: #555555; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 12px; line-height: 20px; background-color: #ffffff;\"><strong>A Scalable Solution</strong></p>'),(1310,'<p><span style=\"color: #555555; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 12px; line-height: 20px; background-color: #ffffff;\">The flexibility of our N4A™ software architecture makes it possible to integrate a broad range of existing solutions. The N4A™ CMS application has been architected to scale, functioning in environments varying from a single-server demo to those with carrier-grade requirements. The application may be scaled vertically and horizontally, depending on customer requirements. N4A™ CMS is designed for the multitenant requirements of resellers and company organizations.</span></p>'),(1311,'<p><strong style=\"color: #555555; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 12px; line-height: 20px; background-color: #ffffff;\">Exceptional Support</strong></p>'),(1312,'<p><span style=\"color: #555555; font-family: \'Open Sans\', Helvetica, Arial, sans-serif; font-size: 12px; line-height: 20px; background-color: #ffffff;\">Novatel Wireless has an exceptional customer support infrastructure, with Technical Account Managers (TAMs) and Field Applications Engineers (FAEs) around the globe available to deliver customer-driven support options both pre- and post-installation.</span></p>'),(1313,'<p class=\"HeadingProductname\"><strong>Highlights</strong></p>\r\n<p class=\"t1\">Novatel Wireless accelerates solution delivery by quickly building connectivity from a customer’s Internet Protocol (IP)-enabled remote assets to their existing enterprise applications. Removing the inherent complexities of wireless networks and their communications protocols, our N4A™ Communications and Management Software (CMS) enables database or web service-driven control and management of Enfora® remote devices. Using a standard web-based user interface, customers have a detailed mobile asset view, enabling proactive management as well as necessary system upgrades. Additionally, using the built-in device configuration and service management capabilities, N4A™ CMS effectively manages and applies device configurations across multiple device groups.</p>\r\n<p class=\"t1\">Available as an on-premise solution, N4A™ CMS is particularly well suited to customers who:</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-weight: normal; font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Need a functional application up and running quickly</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-weight: normal; font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Lack the man hours or expertise necessary to master device and session management</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-weight: normal; font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Want to capitalize on our experience with wireless devices and network operators</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-weight: normal; font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Require flexible integration options</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-weight: normal; font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Prefer to focus resources on their in-house application software development</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-weight: normal; font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Need a simple web service interface for programmatic interaction</p>\r\n<p> </p>'),(1314,'<p>A Scalable Solution</p>'),(1315,'<p>Exceptional Support</p>'),(1316,'<p>The flexibility of our N4A™ software architecture makes it possible to integrate a broad range of existing solutions. The N4A™ CMS application has been architected to scale, functioning in environments varying from a single-server demo to those with carrier-grade requirements. The application may be scaled vertically and horizontally, depending on customer requirements. N4A™ CMS is designed for the multitenant requirements of resellers and company organizations.</p>'),(1317,'<p>Novatel Wireless has an exceptional customer support infrastructure, with Technical Account Managers (TAMs) and Field Applications Engineers (FAEs) around the globe available to deliver customer-driven support options both pre- and post-installation.</p>'),(1318,'<p class=\"HeadingProductname\"><strong>Highlights</strong></p>\r\n<p class=\"t1\">Novatel Wireless accelerates solution delivery by quickly building connectivity from a customer’s Internet Protocol (IP)-enabled remote assets to their existing enterprise applications. Removing the inherent complexities of wireless networks and their communications protocols, our N4A™ Communications and Management Software (CMS) enables database or web service-driven control and management of Enfora® remote devices. Using a standard web-based user interface, customers have a detailed mobile asset view, enabling proactive management as well as necessary system upgrades. Additionally, using the built-in device configuration and service management capabilities, N4A™ CMS effectively manages and applies device configurations across multiple device groups.</p>\r\n<p class=\"t1\">Available as an on-premise solution, N4A™ CMS is particularly well suited to customers who:</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-weight: normal; font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Need a functional application up and running quickly</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-weight: normal; font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Lack the man hours or expertise necessary to master device and session management</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-weight: normal; font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Want to capitalize on our experience with wireless devices and network operators</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-weight: normal; font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Require flexible integration options</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-weight: normal; font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Prefer to focus resources on their in-house application software development</p>\r\n<p class=\"t1\" style=\"margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\">·<span style=\"font-weight: normal; font-size: 7pt; font-family: \'Times New Roman\';\">       </span></span><!--[endif]-->Need a simple web service interface for programmatic interaction </p>'),(1326,'<h4>Expedite® E346 PCI Express Mini Card</h4>'),(1327,'<h4>Expedite® E396 PCI Express Mini Card</h4>');
